INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawy', '', 'Warunki i zasady dostaw', 'warunki, dostawy, opóźnienia, pakowanie, wysyłka', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"pl\" xml:lang=\"pl\">Wysyłki i zwroty</span></h1><p></p>\n<h2 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"pl\" xml:lang=\"pl\">Informacje o wysyłce</span></h2><p></p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"pl\" xml:lang=\"pl\">Paczki wysyłane są zazwyczaj w ciągu 2 dni od otrzymania płatności. Wysyłane są za pośrednictwem UPS z opcją śledzenia przesyłki i dostarczenia bez potrzebny podpisu. Jeżeli wybrana zostanie opcja dostarczenia przesyłki przez UPS Extra, potrzebne będzie pokwitowanie odbioru. Naliczone zostaną r</span>ównież dodatkowe opłaty za przesyłkę, zatem prosimy o kontakt przed wybraniem tej metody dostawy. Niezależnie od metody dostarczenia, otrzymają Państwo link pozwalający na bieżąco śledzić stan przesyłki.</p><p></p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Opłata za przesyłkę obejmują wszystkie wymagane opłaty w tym podatek, koszt pakowania oraz wysyłki. Opłaty transportowe mogą różnić się w zależności od całkowitej wagi przesyłki. Zalecane jest zgrupowanie wszystkich artykułów w jednym zamówieniu. Artykuły zakupione jako osobne zamówienia nie mogą być grupowane, co powoduje naliczenie opłat wysyłki osobno dla każdego z nich. Ryzyko za ewentualne uszkodzenie paczki, ponosi klient, dlatego zalecane jest poinformowanie dostawce o ewentualnych delikatnych przedmiotach znajdujących się w przesyłce.</p><p></p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Wielkości pudełek dobrane zostaną adekwatnie do wielkości produktów i dobrze zabezpieczone.</p><p></p>', 'dostawy'),
(1, 2, 1, 'Dostawy', '', 'Warunki i zasady dostaw', 'warunki, dostawy, opóźnienia, pakowanie, wysyłka', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"pl\" xml:lang=\"pl\">Wysyłki i zwroty</span></h1>\n<h2 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"pl\" xml:lang=\"pl\">Informacje o wysyłce</span></h2>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"pl\" xml:lang=\"pl\">Paczki wysyłane są zazwyczaj w ciągu 2 dni od otrzymania płatności. Wysyłane są za pośrednictwem UPS z opcją śledzenia przesyłki i dostarczenia bez potrzebny podpisu. Jeżeli wybrana zostanie opcja dostarczenia przesyłki przez UPS Extra, potrzebne będzie pokwitowanie odbioru. Naliczone zostaną r</span><span lang=\"en-us\" xml:lang=\"en-us\">ównież dodatkowe opłaty za przesyłkę, zatem prosimy o kontakt przed wybraniem tej metody dostawy. Niezależnie od metody dostarczenia, otrzymają Państwo link pozwalający na bieżąco śledzić stan przesyłki.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"en-us\" xml:lang=\"en-us\">Opłata za przesyłkę obejmują wszystkie wymagane opłaty w tym podatek, koszt pakowania oraz wysyłki. Opłaty transportowe mogą różnić się w zależności od całkowitej wagi przesyłki. Zalecane jest zgrupowanie wszystkich artykułów w jednym zamówieniu. Artykuły zakupione jako osobne zamówienia nie mogą być grupowane, co powoduje naliczenie opłat wysyłki osobno dla każdego z nich. Ryzyko za ewentualne uszkodzenie paczki, ponosi klient, dlatego zalecane jest poinformowanie dostawce o ewentualnych delikatnych przedmiotach znajdujących się w przesyłce.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\"><span lang=\"en-us\" xml:lang=\"en-us\">Wielkości pudełek dobrane zostaną adekwatnie do wielkości produktów i dobrze zabezpieczone.</span></p>', 'dostawy'),
(2, 1, 1, 'Warunki Prawne', '', 'Warunki prawne', 'warunki, prawo, własność', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Warunki prawne</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Strona jest własnością firmy Dreamland™. Zakaz kopiowania strony pod groźbą złamania prawa.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Strona ta została stworzona za pomocą szablonu <a href=\"http://www.prestashop.com\">PrestaShop</a>™.</p>\n<div id=\"gtx-trans\">\n<div class=\"gtx-trans-icon\"></div>\n</div>', 'warunki-prawne'),
(2, 2, 1, 'Warunki Prawne', '', 'Warunki prawne', 'warunki, prawo, własność', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Warunki prawne</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Strona jest własnością firmy Dreamland™. Zakaz kopiowania strony pod groźbą złamania prawa.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Strona ta została stworzona za pomocą szablonu <a href=\"http://www.prestashop.com\">PrestaShop</a>™.</p>', 'warunki-prawne'),
(3, 1, 1, 'Zasady i warunki korzystania', '', 'Zasady i warunki korzystania', 'zasady, warunki, sprzedaż', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Zasady i warunki korzystania</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">1. Warunkiem rozpoczęcia korzystania ze Sklepu internetowego jest rejestracja w jego ramach.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">2. Firma AMED może pozbawić Klienta prawa do korzystania ze Sklepu Internetowego, jak również może ograniczyć jego dostęp do części lub całości zasobów Sklepu Internetowego, ze skutkiem natychmiastowym, w przypadku naruszenia przez Klienta Regulaminu, a w szczególności, gdy Klient:</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">a.) podał w trakcie rejestracji w sklepie internetowym dane niezgodne z prawdą, niedokładne lub nieaktualne, wprowadzające w błąd lub naruszające prawa osób trzecich,</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">b.) dopuścił się za pośrednictwem sklepu internetowego naruszenia dóbr osobistych osób trzecich, w szczególności dóbr osobistych innych klientów sklepu internetowego,</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">c.) dopuści się innych zachowań, które zostaną uznane przez Firmę AMED za zachowania niezgodne z obowiązującymi przepisami prawa lub ogólnymi zasadami korzystania z sieci Internet lub godzące w dobre imię Firmy AMED.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">3. Osoba, która została pozbawiona prawa do korzystania ze sklepu internetowego, nie może dokonać powtórnej rejestracji bez uprzedniej zgody Firmy AMED.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">4. W celu zapewnienia bezpieczeństwa przekazu komunikatów i danych w związku ze świadczonymi w ramach Witryny usługami, Sklep internetowy podejmuje środki techniczne i organizacyjne odpowiednie do stopnia zagrożenia bezpieczeństwa świadczonych usług, w szczególności środki służące zapobieganiu pozyskiwania i modyfikacji przez osoby nieuprawnione danych osobowych przesyłanych w Internecie.</p>', 'zasady-i-warunki-korzystania'),
(3, 2, 1, 'Zasady i warunki korzystania', '', 'Zasady i warunki korzystania', 'zasady, warunki, sprzedaż', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Zasady i warunki korzystania</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">1. Warunkiem rozpoczęcia korzystania ze Sklepu internetowego jest rejestracja w jego ramach.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">2. Firma AMED może pozbawić Klienta prawa do korzystania ze Sklepu Internetowego, jak również może ograniczyć jego dostęp do części lub całości zasobów Sklepu Internetowego, ze skutkiem natychmiastowym, w przypadku naruszenia przez Klienta Regulaminu, a w szczególności, gdy Klient:</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">a.) podał w trakcie rejestracji w sklepie internetowym dane niezgodne z prawdą, niedokładne lub nieaktualne, wprowadzające w błąd lub naruszające prawa osób trzecich,</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">b.) dopuścił się za pośrednictwem sklepu internetowego naruszenia dóbr osobistych osób trzecich, w szczególności dóbr osobistych innych klientów sklepu internetowego,</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">c.) dopuści się innych zachowań, które zostaną uznane przez Firmę AMED za zachowania niezgodne z obowiązującymi przepisami prawa lub ogólnymi zasadami korzystania z sieci Internet lub godzące w dobre imię Firmy AMED.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">3. Osoba, która została pozbawiona prawa do korzystania ze sklepu internetowego, nie może dokonać powtórnej rejestracji bez uprzedniej zgody Firmy AMED.</p>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">4. W celu zapewnienia bezpieczeństwa przekazu komunikatów i danych w związku ze świadczonymi w ramach Witryny usługami, Sklep internetowy podejmuje środki techniczne i organizacyjne odpo