(4, 1, 1, 'O nas', '', 'O nas', 'o nas, informacje', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">O nas</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Jesteśmy firma która chce dawać uśmiech każdemu kto marzył o pięknej zabawce. Nie ważne jest czy jesteś rodzicem chcącym sprawić prezent swojej pociesze czy może dorosłym spełniającym swoje marzenia z dzieciństwa. Nikogo tu nie oceniamy. Miłej zabawy :)</p>', 'o-nas'),
(4, 2, 1, 'O nas', '', 'O nas', 'o nas, informacje', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">O nas</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Jesteśmy firma która chce dawać uśmiech każdemu kto marzył o pięknej zabawce. Nie ważne jest czy jesteś rodzicem chcącym sprawić prezent swojej pociesze czy może dorosłym spełniającym swoje marzenia z dzieciństwa. Nikogo tu nie oceniamy. Miłej zabawy :)</p>', 'o-nas'),
(5, 1, 1, 'Zabezpieczenie płatności', '', 'Zabezpieczenie płatności przy zakupach na naszej stronie', 'ssl, visa, mastercard, paypal, zabezpieczenie płatności', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Zabezpieczenie płatności</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Nasze płatności są zabezpieczanie przez certyfikat SSL i przeprowadzanie ich tylko we współpracy ze sprawdzonymi firmami takimi jak Visa/Mastercard/Paypal.</p>', 'zabezpieczenie-platnosci'),
(5, 2, 1, 'Zabezpieczenie płatności', '', 'Zabezpieczenie płatności przy zakupach na naszej stronie', 'ssl, visa, mastercard, paypal, zabezpieczenie płatności', '<h1 class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Zabezpieczenie płatności</h1>\n<p class=\"MsoNormal\" style=\"margin-bottom:10pt;line-height:115%;\">Nasze płatności są zabezpieczanie przez certyfikat SSL i przeprowadzanie ich tylko we współpracy ze sprawdzonymi firmami takimi jak Visa/Mastercard/Paypal.<span lang=\"pl\" xml:lang=\"pl\"></span></p>', 'zabezpieczenie-platnosci'),
(6, 1, 1, 'Zwroty', '', 'Warunki dokonywania zwrotów', 'zwroty', '<h1>Warunki zwrotów</h1>\n<p>Zwrotów mogą Państwo dokonywać w czasie do 14b dni pojawienia się przesyłki w paczkomacie lub odebrania jej ze sklepu. Koszt zwrotów ponoszą Państwo sami. Zwrotów prosimy dokonywać na adres:</p>\n<p><em>ul. Jarzębinowa 14/8</em></p>\n<p><em>80-745 Płock</em></p>', 'zwroty'),
(6, 2, 1, 'Zwroty', '', 'Warunki dokonywania zwrotów', 'zwroty', '<h1>Warunki zwrotów</h1>\n<p>Zwrotów mogą Państwo dokonywać w czasie do 14b dni pojawienia się przesyłki w paczkomacie lub odebrania jej ze sklepu. Koszt zwrotów ponoszą Państwo sami. Zwrotów prosimy dokonywać na adres:</p>\n<p><em>ul. Jarzębinowa 14/8</em></p>\n<p><em>80-745 Płock</em></p>', 'zwroty');
