INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, 'Dzięki zestawowi do zabawy Klub Chelsea z przyczepą kempingową i lalką dzieci mogą w każdej chwili wyruszyć ku przygodzie - zestaw przekształca się w obozowisko, a dołączone elementy do zabawy, w tym szczeniaczek, inspirują wyobraźnię! Przymocuj przyczepę do samochodu, umieść lalkę Chelsea w fotelu kierowcy i popchnij auto, aby ruszyć w drogę! Jeśli chcesz pojeździć samym kabrioletem lub rozbić obóz, wystarczy odłączyć przyczepę. Odczep haczyk i otwórz ją, aby odsłonić przytulne wnętrze! Dzięki elementom do zabawy możesz stworzyć odpowiedni klimat do śpiewania piosenek i snucia opowieści przy ognisku - ustaw palenisko, wyjmij 2 kijki z piankami i łap za gitarę. Łóżko piętrowe z drabinką zapewnia spokojny sen nawet w drodze. Kuchnia ma pełne wyposażenie:  zlew, kuchenkę, lodówkę z otwieranymi drzwiami, w której można schować dwa kubki znajdujące się w zestawie, ręcznik do zawieszenia przy blacie oraz garnuszek ze specjalnym zaczepem do przymocowania na palniku kuchenki. Są też drzwiczki dla psów, aby szczeniaczek mógł z łatwością wchodzić i wychodzić! Podczas krótkich wycieczek autem otwierany bagażnik pomieści walizkę i inne potrzebne rzeczy. Wiek dziecka:  od 3 lat.', '', 'barbie-przyczepa-kempingowa-chelsea-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Przyczepa kempingowa Chelsea, zestaw z lalką i akcesoriami', '', '', '', ''),
(1, 1, 2, 'Dzięki zestawowi do zabawy Klub Chelsea z przyczepą kempingową i lalką dzieci mogą w każdej chwili wyruszyć ku przygodzie - zestaw przekształca się w obozowisko, a dołączone elementy do zabawy, w tym szczeniaczek, inspirują wyobraźnię! Przymocuj przyczepę do samochodu, umieść lalkę Chelsea w fotelu kierowcy i popchnij auto, aby ruszyć w drogę! Jeśli chcesz pojeździć samym kabrioletem lub rozbić obóz, wystarczy odłączyć przyczepę. Odczep haczyk i otwórz ją, aby odsłonić przytulne wnętrze! Dzięki elementom do zabawy możesz stworzyć odpowiedni klimat do śpiewania piosenek i snucia opowieści przy ognisku - ustaw palenisko, wyjmij 2 kijki z piankami i łap za gitarę. Łóżko piętrowe z drabinką zapewnia spokojny sen nawet w drodze. Kuchnia ma pełne wyposażenie:  zlew, kuchenkę, lodówkę z otwieranymi drzwiami, w której można schować dwa kubki znajdujące się w zestawie, ręcznik do zawieszenia przy blacie oraz garnuszek ze specjalnym zaczepem do przymocowania na palniku kuchenki. Są też drzwiczki dla psów, aby szczeniaczek mógł z łatwością wchodzić i wychodzić! Podczas krótkich wycieczek autem otwierany bagażnik pomieści walizkę i inne potrzebne rzeczy. Wiek dziecka:  od 3 lat.', '', 'barbie-przyczepa-kempingowa-chelsea-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Przyczepa kempingowa Chelsea, zestaw z lalką i akcesoriami', '', '', '', ''),
(2, 1, 1, 'Barbie Rower z koszykiem z kwiatami Przejedź się wprost do świata wyobraźni! Różowa rama, turkusowe błotniki i srebrne akcenty tworzą razem prześliczny jednoślad. Prawdziwe, działające pedały i obracające się koła pomogą ruszyć z miejsca w stronę wielkiej przygody. Posadź lalkę Barbie (sprzedawana oddzielnie) na siodełku ze specjalnym klipsem, który przytrzyma ją na rowerku. Ułóż jej stopy na pedałach, a ręce na kierownicy i popchnij, żeby zobaczyć, jak jedzie! Niebieski kask zapewni jej bezpieczeństwo. Ozdobą roweru jest przymocowany z przodu koszyk pełen różowych kwiatów! Można je wkładać i wyjmować dla lepszej zabawy. Wybierz się na krótką przejażdżkę lub ruszaj w stronę nowej przygody na Rowerze Barbie!  W zestawie rower dla lalki Barbie z koszykiem z kwiatami i kask.  Lalka sprzedawana oddzielnie.  Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-rower-zestaw-bez-lalki', '', '', '', 'Barbie, Rower, zestaw bez lalki', '', '', '', ''),
(2, 1, 2, 'Barbie Rower z koszykiem z kwiatami Przejedź się wprost do świata wyobraźni! Różowa rama, turkusowe błotniki i srebrne akcenty tworzą razem prześliczny jednoślad. Prawdziwe, działające pedały i obracające się koła pomogą ruszyć z miejsca w stronę wielkiej przygody. Posadź lalkę Barbie (sprzedawana oddzielnie) na siodełku ze specjalnym klipsem, który przytrzyma ją na rowerku. Ułóż jej stopy na pedałach, a ręce na kierownicy i popchnij, żeby zobaczyć, jak jedzie! Niebieski kask zapewni jej bezpieczeństwo. Ozdobą roweru jest przymocowany z przodu koszyk pełen różowych kwiatów! Można je wkładać i wyjmować dla lepszej zabawy. Wybierz się na krótką przejażdżkę lub ruszaj w stronę nowej przygody na Rowerze Barbie!  W zestawie rower dla lalki Barbie z koszykiem z kwiatami i kask.  Lalka sprzedawana oddzielnie.  Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-rower-zestaw-bez-lalki', '', '', '', 'Barbie, Rower, zestaw bez lalki', '', '', '', ''),
(3, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Gabriellę Icely. Jest ubrana \"w lód\" czyli na jasnoniebiesko od stóp do głów. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Gabriella ma oko do projektowania mody i uwielbia opracowywać tkaniny. Jej lodowaty niebieski wygląd jest świeży i piękny. Ubrana w dzianinowy sweter z golfem, metaliczną spódnicę z tęczowym paskiem i buty z wężowej skóry jest niezwykle stylowa. Jej drugi strój to holograficzna sukienka, kurtka ze skóry węża i wysokie szpilki z paskami. Zestaw zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-gabriella-icely-lalka-modowa', '', '', '', 'Rainbow High, Gabriella Icely, lalka modowa', '', '', '', ''),
