(4, 1, 1, 'Słodkie laleczki L.O.L. Surprise O.M.G. dostępne są teraz w wersji Mini! Każda mini laleczka jest dokładną repliką jej modnej, dorosłej siostry O.M.G.! Malutka L.O.L. jest wyposażona w charakterystyczne dla niej akcesorium, które dopełni jej fantastyczny wizerunek. Odkryj sama jaką postać skrywa Twoja kula. Może to być nawet Mini Lady Diva. Cała kolekcja liczy aż 18 słodkich postaci. Sama kula stanie się idealnym zestawem do zabawy. Każda Mini laleczka ma swój ulubiony pokój, w którym może spędzać wolny czas i przyjmować gości. Zbierz całą kolekcję L.O.L. Surprise O.M.G. Mini i zestaw z kolekcją regularnych laleczek O.M.G.! Uwaga! Produkt występuje w kilku wariantach! Wysyłka losowa, bez możliwości wyboru laleczki!', '', 'lol-surprise-omg-minis-laleczka-niespodzianka', '', '', '', 'L.O.L. Surprise, O.M.G. Minis, laleczka niespodzianka', '', '', '', ''),
