(5, 1, 1, 'Lalka Barbie Dreamtopia która inspiruje do opowiadania fantastycznych historyjek i zabawy w układanie fryzur dzięki bardzo długim, dwukolorowym włosom oraz akcesoriom do stylizacji! Rozczesz długie, kolorowe włosy Barbie, a potem wybierz dla niej fryzurę i wyruszcie wspólnie ku baśniowej przygodzie. Wśród akcesoriów do stylizacji są szczotka do włosów, 2 tiary, 2 spinki i 2 grzebyczki, dzięki którym możesz tworzyć niezliczone magiczne fryzury. Wiek dziecka:  od 3 roku życia', '', 'barbie-dreamtopia-dlugie-wlosy-lalka-ksiezniczka', '', '', '', 'Barbie, Dreamtopia, Długie włosy, lalka księżniczka', '', '', '', ''),
