(6, 1, 1, 'Zestaw Enchantimals z lalkami i rodzinką żółwików z kolekcji Podwodne Królestwo. Zestaw zawiera 3 lalki, 3 figurki zwierzątek, opakowanie masy do zabawy i 5 akcesoriów. Lalka Tinsley Turtle (15 cm) ma braciszka i siostrzyczkę (każda lalka po 10 cm). Rodzinkę Enchantimals dopełniają 3 urocze żółwiki morskie. Za pomocą masy do zabawy i foremek można budować zamki z piasku i inne kształty. 6 bohaterów ze świata Enchantimals zapewnia mnóstwo inspiracji do wymyślania własnych przygód! Wiek dziecka:  od 3 lat.', '', 'enchantimals-rodzina-tinsley-turle-zolwie-zestaw-z-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Rodzina Tinsley Turle - Żółwie, zestaw z lalkami i zwierzątkami', '', '', '', ''),
