(9, 1, 1, 'Kalendarz Adwentowy Cry Babies Magic Tears! Odkryj razem z Ruthie aż 24 niespodzianki na Święta Bożego Narodzenia, które nie spotkasz w żadnym innym zestawie! Kalendarz po otwarciu jest także trójwymiarową scenerią (część elementów można dogiąć dzięki zagięciom i wycięciom w tworzywie, takich jak choinka czy skrzynka pocztowa na listy). Stwórz nowe scenariusze zabawy w zimowym i świątecznym otoczeniu z laleczką Ruth, która płacze prawdziwymi łzami! W zestawie odkryjesz m.in.:  reniferka choinkę  narty sanki świąteczne akcesoria dla Ruthie i jej przyjaciół Niech Twoje dziecko zanurzy się w świat laleczek Cry Babies Magic Tears i poczuje Święta!', '', 'cry-babies-magic-tears-kalendarz-adwentowy', '', '', '', 'Cry Babies, Magic Tears, kalendarz adwentowy', '', '', '', ''),
(9, 1, 2, 'Kalendarz Adwentowy Cry Babies Magic Tears! Odkryj razem z Ruthie aż 24 niespodzianki na Święta Bożego Narodzenia, które nie spotkasz w żadnym innym zestawie! Kalendarz po otwarciu jest także trójwymiarową scenerią (część elementów można dogiąć dzięki zagięciom i wycięciom w tworzywie, takich jak choinka czy skrzynka pocztowa na listy). Stwórz nowe scenariusze zabawy w zimowym i świątecznym otoczeniu z laleczką Ruth, która płacze prawdziwymi łzami! W zestawie odkryjesz m.in.:  reniferka choinkę  narty sanki świąteczne akcesoria dla Ruthie i jej przyjaciół Niech Twoje dziecko zanurzy się w świat laleczek Cry Babies Magic Tears i poczuje Święta!', '', 'cry-babies-magic-tears-kalendarz-adwentowy', '', '', '', 'Cry Babies, Magic Tears, kalendarz adwentowy', '', '', '', ''),
(10, 1, 1, 'Pierwsza lalka dla małego dziecka jest mięciutka i miła w dotyku. Została zaprojektowana i wykonana ze szczególną starannością, ponieważ zabawki dla dzieci poniżej 1 roku życia muszą spełniać dodatkowe normy bezpieczeństwa. To lalka dla dziecka bez ograniczeń wiekowych.', '', 'smily-play-bambolina-moja-pierwsza-lalka', '', '', '', 'Smily Play, Bambolina, moja pierwsza lalka', '', '', '', ''),
(10, 1, 2, 'Pierwsza lalka dla małego dziecka jest mięciutka i miła w dotyku. Została zaprojektowana i wykonana ze szczególną starannością, ponieważ zabawki dla dzieci poniżej 1 roku życia muszą spełniać dodatkowe normy bezpieczeństwa. To lalka dla dziecka bez ograniczeń wiekowych.', '', 'smily-play-bambolina-moja-pierwsza-lalka', '', '', '', 'Smily Play, Bambolina, moja pierwsza lalka', '', '', '', ''),
(11, 1, 1, 'Urocza lalka z serii Disney Princess - Ariel! Księżniczka Ariel błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty. W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-ariel-lalka', '', '', '', 'Disney Princess, Księżniczka Ariel, lalka', '', '', '', ''),
(11, 1, 2, 'Urocza lalka z serii Disney Princess - Ariel! Księżniczka Ariel błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty. W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-ariel-lalka', '', '', '', 'Disney Princess, Księżniczka Ariel, lalka', '', '', '', ''),
(12, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Vanessa Nova z serii RockStar! Jest perkusistką zespołu, który podbił serca całego świata! Ma piękne, kolorowe włosy, które możesz układać i dopasowywać do stylizacji. Ma wspaniałe rysy twarzy, długie rzęsy. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. W zestawie znajdziesz dodatkowy strój oraz perkusję ze złotymi pałeczkami. Wybierz stylizację, podłącz sprzęt i pokażcie światu prawdziwe show! W zestawie lalka Vanessa Nova, dodatkowy strój dla laleczki, buty, dodatki takie jak czapka, kolczyki, perkusja, złote pałeczki do gry, wieszaki na ubrania, grzebień, stojak na lalkę. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz cały zespół:  wokal, gitara i perkusja! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-rockstar-vanessa-nova-lalka-modowa', '', '', '', 'Rainbow High, RockStar, Vanessa Nova, lalka modowa', '', '', '', ''),
(12, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Vanessa Nova z serii RockStar! Jest perkusistką zespołu, który podbił serca całego świata! Ma piękne, kolorowe włosy, które możesz układać i dopasowywać do stylizacji. Ma wspaniałe rysy twarzy, długie rzęsy. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. W zestawie znajdziesz dodatkowy strój oraz perkusję ze złotymi pałeczkami. Wybierz stylizację, podłącz sprzęt i pokażcie światu prawdziwe show! W zestawie lalka Vanessa Nova, dodatkowy strój dla laleczki, buty, dodatki takie jak czapka, kolczyki, perkusja, złote pałeczki do gry, wieszaki na ubrania, grzebień, stojak na lalkę. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz cały zespół:  wokal, gitara i perkusja! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-rockstar-vanessa-nova-lalka-modowa', '', '', '', 'Rainbow High, RockStar, Vanessa Nova, lalka modowa', '', '', '', ''),
(13, 1, 1, 'Rainbow High, Rainbow Vision, Tessa Park, lalka modowa Epicka bitwa muzyczna - Najlepsze Szkoły Artystyczne z całego świata zmierzą się w konkursie muzycznym - Rainbow Vision. Zawodnicy z całego świata zabłysną swoimi prawdziwymi kolorami w epickiej bitwie, aby wyłonić JEDNEGO ZWYCIĘZCĘ! Jeden zwycięzca - Shadow High chce powstrzymać Rainbow High przed kolejną wygraną. Nie są to jednak jedyne szkoły biorące udział w konkursie. Do walki staje również znany na całym świecie K-popowy zespół, Royal Three, który przyjechał tu, aby wygrać! Tessa - Tessa Park ma unikalny design i ubrana jest w odcienie fioletu i błękitu. Ma wspaniały, dopracowany styl, piękne fioletowo-niebieskie włosy upięte w wysoki kucyk i grzywkę. Ma długie prawdziwe rzęsy i szklane oczy. 2 stroje Mix &amp; Match - Tessa ubrana jest w spodnie z jedną krótszą nogawką, jedną podkolanówkę, crop top, pasek z klamrą, kurtkę i trampki. Jej druga stylizacja składa się z szarego półpłaszczyka zapiętego na sportowym crop topie, spodni i szpilek. Mikrofon - Posiada ona wszystkie niezbędne dla zespołu akcesoria oraz merch zespołu. Ma swój własny mikrofonowy, dzięki czemu może występować i śpiewać bez statywu. Band merch - W zestawie znajduje się oficjalny merch zespołu, w tym t-shirt, książeczka z tekstami piosenek i mini plakat zespołu. Zestaw zapewni dzieciom niekończącą się radość i pomysłową zabawę oraz będą mogły same walczyć na Rainbow Vision. Zaprezentuj lalkę na stojaku - Tessa jest w pełni ruchoma, jej ręce i nogi mogą zginać się w wielu efektownych pozach lub możesz zaprezentować ją na dołączonym stojaku dla lalki.', '', 'rainbow-high-rainbow-vision-tessa-park-lalka-modowa', '', '', '', 'Rainbow High, Rainbow Vision, Tessa Park, lalka modowa', '', '', '', ''),
(13, 1, 2, 'Rainbow High, Rainbow Vision, Tessa Park, lalka modowa Epicka bitwa muzyczna - Najlepsze Szkoły Artystyczne z całego świata zmierzą się w konkursie muzycznym - Rainbow Vision. Zawodnicy z całego świata zabłysną swoimi prawdziwymi kolorami w epickiej bitwie, aby wyłonić JEDNEGO ZWYCIĘZCĘ! Jeden zwycięzca - Shadow High chce powstrzymać Rainbow High przed kolejną wygraną. Nie są to jednak jedyne szkoły biorące udział w konkursie. Do walki staje również znany na całym świecie K-popowy zespół, Royal Three, który przyjechał tu, aby wygrać! Tessa - Tessa Park ma unikalny design i ubrana jest w odcienie fioletu i błękitu. Ma wspaniały, dopracowany styl, piękne fioletowo-niebieskie włosy upięte w wysoki kucyk i grzywkę. Ma długie prawdziwe rzęsy i szklane oczy. 2 stroje Mix &amp; Match - Tessa ubrana jest w spodnie z jedną krótszą nogawką, jedną podkolanówkę, crop top, pasek z klamrą, kurtkę i trampki. Jej druga stylizacja składa się z szarego półpłaszczyka zapiętego na sportowym crop topie, spodni i szpilek. Mikrofon - Posiada ona wszystkie niezbędne dla zespołu akcesoria oraz merch zespołu. Ma swój własny mikrofonowy, dzięki czemu może występować i śpiewać bez statywu. Band merch - W zestawie znajduje się oficjalny merch zespołu, w tym t-shirt, książeczka z tekstami piosenek i mini plakat zespołu. Zestaw zapewni dzieciom niekończącą się radość i pomysłową zabawę oraz będą mogły same walczyć na Rainbow Vision. Zaprezentuj lalkę na stojaku - Tessa jest w pełni ruchoma, jej ręce i nogi mogą zginać się w wielu efektownych pozach lub możesz zaprezentować ją na dołączonym stojaku dla lalki.', '', 'rainbow-high-rainbow-vision-tessa-park-lalka-modowa', '', '', '', 'Rainbow High, Rainbow Vision, Tessa Park, lalka modowa', '', '', '', ''),
(14, 1, 1, 'Lalka Helena to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Lalę marki Smiki można przebierać, karmić i przytulać. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Cechy zabawki:  Lalka z miękkim tułowiem, ubrana w śliczne, różowe ubranko i czapeczkę. Do lalki dołączone są akcesoria:  smoczek, buteleczka dla lalki oraz bajecznie kolorowa pozytywka-motyl. Pozytywka po uruchomieniu gra melodie i świeci delikatnym światłem. Informacje podstawowe:  Wymiary:  około 40 cm. Wiek:  od 3 lat. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-helena-lalka-interaktywna-z-akcesoriami-i-pozytywka-40-cm', '', '', '', 'Smiki, Helena, lalka interaktywna z akcesoriami i pozytywką, 40 cm', '', '', '', ''),
(14, 1, 2, 'Lalka Helena to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Lalę marki Smiki można przebierać, karmić i przytulać. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Cechy zabawki:  Lalka z miękkim tułowiem, ubrana w śliczne, różowe ubranko i czapeczkę. Do lalki dołączone są akcesoria:  smoczek, buteleczka dla lalki oraz bajecznie kolorowa pozytywka-motyl. Pozytywka po uruchomieniu gra melodie i świeci delikatnym światłem. Informacje podstawowe:  Wymiary:  około 40 cm. Wiek:  od 3 lat. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-helena-lalka-interaktywna-z-akcesoriami-i-pozytywka-40-cm', '', '', '', 'Smiki, Helena, lalka interaktywna z akcesoriami i pozytywką, 40 cm', '', '', '', ''),
(15, 1, 1, 'Ruszaj ku kempingowej przygodzie z lalkami Skipper i Stacie (sprzedawane oddzielnie) inspirowanymi hitowym serialem Barbie \"It Takes Two - My dwie\". W zestawie z lalką Skipper są króliczek i akcesoria kempingowe, takie jak \"ognisko\", kolba kukurydzy, kubki i garnek. Lalka nosi kolorowe stroje biwakowe, a w zestawie są naklejki, których można używać do personalizacji akcesoriów dla lalek! Dzięki licznym akcesoriom i możliwościom opowiadania historii ten zestaw do zabawy Barbie to wspaniały prezent dla dzieci w wieku od 3 do 7 lat, zwłaszcza dla tych, które uwielbiają wypoczynek na świeżym powietrzu.', '', 'barbie-kemping-skipper-i-zwierzatko-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kemping, Skipper i zwierzątko, zestaw z lalką i akcesoriami', '', '', '', ''),
(15, 1, 2, 'Ruszaj ku kempingowej przygodzie z lalkami Skipper i Stacie (sprzedawane oddzielnie) inspirowanymi hitowym serialem Barbie \"It Takes Two - My dwie\". W zestawie z lalką Skipper są króliczek i akcesoria kempingowe, takie jak \"ognisko\", kolba kukurydzy, kubki i garnek. Lalka nosi kolorowe stroje biwakowe, a w zestawie są naklejki, których można używać do personalizacji akcesoriów dla lalek! Dzięki licznym akcesoriom i możliwościom opowiadania historii ten zestaw do zabawy Barbie to wspaniały prezent dla dzieci w wieku od 3 do 7 lat, zwłaszcza dla tych, które uwielbiają wypoczynek na świeżym powietrzu.', '', 'barbie-kemping-skipper-i-zwierzatko-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kemping, Skipper i zwierzątko, zestaw z lalką i akcesoriami', '', '', '', ''),
(16, 1, 1, 'Wanienka z funkcją pompki wodnej.  Kolor transparentny turkusowy.  Dla lalek o wysokości 30-43 cm.', '', 'simba-new-born-baby-wanienka-dla-lalek-32-cm', '', '', '', 'Simba, New Born Baby, wanienka dla lalek, 32 cm', '', '', '', ''),
