(17, 1, 1, 'Przeżyj ponownie magiczną chwilę, w której Elsa zostaje Królową Lodu! Unieś rękę Elsy i zobacz, jak jej sukienka koronacyjna znika, a na jej miejsce pojawia się kreacja mroźnej królowej. Kiedy zechcesz powtórzyć przemianę, możesz to zrobić - wystarczy, że pociągniesz suknię koronacyjną z tyłu i zresetujesz przemianę. Powtarzalna zabawa, która nigdy się nie kończy, zapewnia dzieciom stałą rozrywkę. W zestawie znajduje się również tiara oraz peleryna - załóż Elsie akcesoria, aby dopełnić jej wygląd. Wiek dziecka:  od 3 lat', '', 'kraina-lodu-elsa-krolewska-przemiana-lalka', '', '', '', 'Kraina Lodu, Elsa, Królewska przemiana, lalka', '', '', '', ''),
(17, 1, 2, 'Przeżyj ponownie magiczną chwilę, w której Elsa zostaje Królową Lodu! Unieś rękę Elsy i zobacz, jak jej sukienka koronacyjna znika, a na jej miejsce pojawia się kreacja mroźnej królowej. Kiedy zechcesz powtórzyć przemianę, możesz to zrobić - wystarczy, że pociągniesz suknię koronacyjną z tyłu i zresetujesz przemianę. Powtarzalna zabawa, która nigdy się nie kończy, zapewnia dzieciom stałą rozrywkę. W zestawie znajduje się również tiara oraz peleryna - załóż Elsie akcesoria, aby dopełnić jej wygląd. Wiek dziecka:  od 3 lat', '', 'kraina-lodu-elsa-krolewska-przemiana-lalka', '', '', '', 'Kraina Lodu, Elsa, Królewska przemiana, lalka', '', '', '', ''),
(18, 1, 1, 'Klasyczna lalka Anna dla dzieci w wieku od 3 lat Dzieci mogą odtwarzać swoje ulubione sceny z filmów Kraina Lodu dzięki klasycznej lalce Elsie. W zestawie znajdują się zdejmowane stroje inspirowane drugą częścią hitowego filmu. Lalkę można ustawiać w różnych pozach, by odgrywanie znanych i tworzenie nowych scen stało się jeszcze wspanialszą zabawą! Lalka ma 5 punktów artykulacji.', '', 'kraina-lodu-forever-anna-w-stroju-podroznym-lalka', '', '', '', 'Kraina Lodu Forever, Anna w stroju podróżnym, lalka', '', '', '', ''),
(18, 1, 2, 'Klasyczna lalka Anna dla dzieci w wieku od 3 lat Dzieci mogą odtwarzać swoje ulubione sceny z filmów Kraina Lodu dzięki klasycznej lalce Elsie. W zestawie znajdują się zdejmowane stroje inspirowane drugą częścią hitowego filmu. Lalkę można ustawiać w różnych pozach, by odgrywanie znanych i tworzenie nowych scen stało się jeszcze wspanialszą zabawą! Lalka ma 5 punktów artykulacji.', '', 'kraina-lodu-forever-anna-w-stroju-podroznym-lalka', '', '', '', 'Kraina Lodu Forever, Anna w stroju podróżnym, lalka', '', '', '', ''),
(19, 1, 1, 'Przygody z czarodziejskiego świata czekają na Ciebie razem z zestawem małych laleczek Rona i Ginny Weasley Magical Minis. Ten zestaw zabawek ze świata Harry\'ego Pottera zawiera dwie 3-calowe lalki oraz o Parszywka, szczura Ron\'a i Arnolda, puszka pigmejskego Ginny. Zarówno laleczka Rona, jak i Ginny jest bardzo szczegółowa, co ożywia ukochane postaci. Obydwoje są ubrani w mundurki Hogwartu i trzymają różdżki, dzięki czemu możesz poruszać ich rękoma, odgrywać ich przygody i udawać, że rzucają zaklęcia. Parszywek i Arnold są dodatkową atrakcją. Parszywek trzyma ogon w zabawnej pozie, a Arnolda można przyczepić do ramienia Ginny. Zestaw Małych Lalek Magical Minis to doskonały sposób, aby pobudzić wyobraźnię i chęć do zabawy. Przemierzaj sale zamku Hogwart (sprzedawanego osobno) z Ronem i Ginny. Zbierz wszystkie zestawy, lalki i lokacje (sprzedawane osobno), aby stworzyć własny czarodziejski świat. Lalki kolekcjonerskie Magical Minis ze świata Harry\'ego Pottera i zestawy to wspaniałe podarunku dla dzieci od 5 roku życia. Twórz własne, magiczne historie, dzięki zestawowi Małych Lalek Rona i Ginny Weasley.', '', 'wizarding-world-harry-potter-ron-i-giny-zestaw-dwoch-lalek-3', '', '', '', 'Wizarding World, Harry Potter, Ron i Giny, zestaw dwóch lalek 3\"', '', '', '', ''),
(19, 1, 2, 'Przygody z czarodziejskiego świata czekają na Ciebie razem z zestawem małych laleczek Rona i Ginny Weasley Magical Minis. Ten zestaw zabawek ze świata Harry\'ego Pottera zawiera dwie 3-calowe lalki oraz o Parszywka, szczura Ron\'a i Arnolda, puszka pigmejskego Ginny. Zarówno laleczka Rona, jak i Ginny jest bardzo szczegółowa, co ożywia ukochane postaci. Obydwoje są ubrani w mundurki Hogwartu i trzymają różdżki, dzięki czemu możesz poruszać ich rękoma, odgrywać ich przygody i udawać, że rzucają zaklęcia. Parszywek i Arnold są dodatkową atrakcją. Parszywek trzyma ogon w zabawnej pozie, a Arnolda można przyczepić do ramienia Ginny. Zestaw Małych Lalek Magical Minis to doskonały sposób, aby pobudzić wyobraźnię i chęć do zabawy. Przemierzaj sale zamku Hogwart (sprzedawanego osobno) z Ronem i Ginny. Zbierz wszystkie zestawy, lalki i lokacje (sprzedawane osobno), aby stworzyć własny czarodziejski świat. Lalki kolekcjonerskie Magical Minis ze świata Harry\'ego Pottera i zestawy to wspaniałe podarunku dla dzieci od 5 roku życia. Twórz własne, magiczne historie, dzięki zestawowi Małych Lalek Rona i Ginny Weasley.', '', 'wizarding-world-harry-potter-ron-i-giny-zestaw-dwoch-lalek-3', '', '', '', 'Wizarding World, Harry Potter, Ron i Giny, zestaw dwóch lalek 3\"', '', '', '', ''),
(20, 1, 1, 'Wybierz się na Targ króliczków Enchantimals. W tym zestawie z ponad 35 elementami są lalka Becker Bunny 15 cm, króliczek Lop, 3 stoiska i mnóstwo akcesoriów. Możesz ustawić stoiska z produktami spożywczymi, kwiatami i przekąskami, a potem wymyślać wciąż nowe opowieści. Pomóż króliczkowym przyjaciołom wypełnić półki bananami, marchewkami, kwiatami, deserami i innymi przysmakami.\\ „Waż” na wadze, „podliczaj” na kasie, a potem zapakuj koszyk świeżutkimi towarami. Doskonały prezent dla dzieci od 4 roku życia.', '', 'enchantimals-targ-kroliczkow-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Targ króliczków, zestaw z lalką i akcesoriami', '', '', '', ''),
(20, 1, 2, 'Wybierz się na Targ króliczków Enchantimals. W tym zestawie z ponad 35 elementami są lalka Becker Bunny 15 cm, króliczek Lop, 3 stoiska i mnóstwo akcesoriów. Możesz ustawić stoiska z produktami spożywczymi, kwiatami i przekąskami, a potem wymyślać wciąż nowe opowieści. Pomóż króliczkowym przyjaciołom wypełnić półki bananami, marchewkami, kwiatami, deserami i innymi przysmakami.\\ „Waż” na wadze, „podliczaj” na kasie, a potem zapakuj koszyk świeżutkimi towarami. Doskonały prezent dla dzieci od 4 roku życia.', '', 'enchantimals-targ-kroliczkow-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Targ króliczków, zestaw z lalką i akcesoriami', '', '', '', ''),
(21, 1, 1, 'Lalki Ken Fashionistas są na czasie z najnowszą modą i indywidualnymi stylizacjami. Ken Fashionistas oczarowuje różnorodnością strojów i modnych butów. Kolorowy typ podkreśla smukłą sylwetkę. Spodnie mają fantastyczny, modny krój. Buty są dobrze dobrane do stylu. Lalki nie stoją samodzielnie. Kolory i elementy dekoracyjne mogą się różnić od przedstawionych na opakowaniu. Wiek dziecka:  od 3 lat.', '', 'barbie-fashionistas-stylowy-ken-bluza-w-kolorowe-paski-lalka', '', '', '', 'Barbie Fashionistas, Stylowy Ken, bluza w kolorowe paski, lalka', '', '', '', ''),
(21, 1, 2, 'Lalki Ken Fashionistas są na czasie z najnowszą modą i indywidualnymi stylizacjami. Ken Fashionistas oczarowuje różnorodnością strojów i modnych butów. Kolorowy typ podkreśla smukłą sylwetkę. Spodnie mają fantastyczny, modny krój. Buty są dobrze dobrane do stylu. Lalki nie stoją samodzielnie. Kolory i elementy dekoracyjne mogą się różnić od przedstawionych na opakowaniu. Wiek dziecka:  od 3 lat.', '', 'barbie-fashionistas-stylowy-ken-bluza-w-kolorowe-paski-lalka', '', '', '', 'Barbie Fashionistas, Stylowy Ken, bluza w kolorowe paski, lalka', '', '', '', ''),
(22, 1, 1, 'Śliczna, duża lalka typu bobas z miękkim tułowiem, z czapeczką. Śpiewa piosenki:  \"Pieski małe dwa\", \"Jesteśmy jagódki\", \"My jesteśmy krasnoludki\" oraz mówi, wita się, prosi żeby ją przytulić i ukołysać do snu, zachęca do zabawy, pyta o obiadek. Towar dostępny w dwóch wersjach (biały lub różowy śpioszek), wysyłany losowo Lalka przeznaczona dla dzieci powyżej 18 miesiąca życia. Zawiera baterie typu CR2032.', '', 'swede-dorotka-lalka-spiewajaca-i-mowiaca-po-polsku', '', '', '', 'Swede, Dorotka, lalka śpiewająca i mówiąca po polsku', '', '', '', ''),
(22, 1, 2, 'Śliczna, duża lalka typu bobas z miękkim tułowiem, z czapeczką. Śpiewa piosenki:  \"Pieski małe dwa\", \"Jesteśmy jagódki\", \"My jesteśmy krasnoludki\" oraz mówi, wita się, prosi żeby ją przytulić i ukołysać do snu, zachęca do zabawy, pyta o obiadek. Towar dostępny w dwóch wersjach (biały lub różowy śpioszek), wysyłany losowo Lalka przeznaczona dla dzieci powyżej 18 miesiąca życia. Zawiera baterie typu CR2032.', '', 'swede-dorotka-lalka-spiewajaca-i-mowiaca-po-polsku', '', '', '', 'Swede, Dorotka, lalka śpiewająca i mówiąca po polsku', '', '', '', ''),
(23, 1, 1, 'Ruszaj ku kempingowej przygodzie z lalką Daisy inspirowaną hitowym serialem Barbie \"It Takes Two - My dwie\". Ubierz lalkę Daisy i jej pieska w kamizelki ratunkowe i posadź w kajaku - jest w nim specjalne miejsce dla szczeniaka. Wiosło ma uchwyty, aby lalka mogła łatwiej trzymać je w rękach, a kajak specjalny zaczep na kamerę, która dokumentuje całą wyprawę. Dzięki butelce wody lalka Daisy może utrzymać odpowiedni poziom nawodnienia. Daisy jest gotowa na cały dzień przygód ubrana w strój biwakowy, a dodatkowo wyposażona w saszetkę i stylowe okulary przeciwsłoneczne. Dzięki tak wielu możliwościom opowiadania historii ta lalka i zestaw do zabawy Barbie \"It Takes Two - My dwie\" inspiruje dzieci w wieku od 3 do 7 lat do wymyślania niezliczonych przygód na świeżym powietrzu. Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-kemping-daisy-zestaw-z-lalka-kajakiem-i-akcesoriami', '', '', '', 'Barbie, Kemping Daisy, zestaw z lalką, kajakiem i akcesoriami', '', '', '', ''),
(23, 1, 2, 'Ruszaj ku kempingowej przygodzie z lalką Daisy inspirowaną hitowym serialem Barbie \"It Takes Two - My dwie\". Ubierz lalkę Daisy i jej pieska w kamizelki ratunkowe i posadź w kajaku - jest w nim specjalne miejsce dla szczeniaka. Wiosło ma uchwyty, aby lalka mogła łatwiej trzymać je w rękach, a kajak specjalny zaczep na kamerę, która dokumentuje całą wyprawę. Dzięki butelce wody lalka Daisy może utrzymać odpowiedni poziom nawodnienia. Daisy jest gotowa na cały dzień przygód ubrana w strój biwakowy, a dodatkowo wyposażona w saszetkę i stylowe okulary przeciwsłoneczne. Dzięki tak wielu możliwościom opowiadania historii ta lalka i zestaw do zabawy Barbie \"It Takes Two - My dwie\" inspiruje dzieci w wieku od 3 do 7 lat do wymyślania niezliczonych przygód na świeżym powietrzu. Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-kemping-daisy-zestaw-z-lalka-kajakiem-i-akcesoriami', '', '', '', 'Barbie, Kemping Daisy, zestaw z lalką, kajakiem i akcesoriami', '', '', '', ''),
(24, 1, 1, 'Na fali, w toni oceanu, głęboko pod wodą… Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają odkrywać nowe miejsca i nawiązywać nowe przyjaźnie! Te syrenki mają wyjątkowe ogony wypełnione wodą i brokatem. Mają też nową, fantastyczną funkcję — zmieniają kolor! Ogon zmienia kolor po zanurzeniu w wodzie! Te syrenki mają również wyjątkowe płetwy i przyjemne w dotyku ubrania! Charakterystyka produktów:  Lalki syrenki do przebierania z miłą w dotyku odzieżą, akcesoriami i nowym ogonem, który zmienia kolor 3 nowe postacie i powrót 2 ulubionych postaci Nowy kształt płetwy Ogon jest wypełniony wodą i brokatem dla zapewnienia hipnotyzującego efektu Ogon zmienia kolor po zanurzeniu w wodzie Unikalny, formowany, ozdobny ogon ma przeguby w talii i przy płetwie Przepiękne szklane oczy Długie, kolorowe włosy, które można czesać Zdejmowana kurtka i top Torebka i biżuteria Stojak na lalkę', '', 'mermaze-mermaidz-theme-doll-gwen-lalka-modowa-zmieniajaca-kolor', '', '', '', 'Mermaze Mermaidz, Theme Doll, Gwen, lalka modowa zmieniająca kolor', '', '', '', ''),
(24, 1, 2, 'Na fali, w toni oceanu, głęboko pod wodą… Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają odkrywać nowe miejsca i nawiązywać nowe przyjaźnie! Te syrenki mają wyjątkowe ogony wypełnione wodą i brokatem. Mają też nową, fantastyczną funkcję — zmieniają kolor! Ogon zmienia kolor po zanurzeniu w wodzie! Te syrenki mają również wyjątkowe płetwy i przyjemne w dotyku ubrania! Charakterystyka produktów:  Lalki syrenki do przebierania z miłą w dotyku odzieżą, akcesoriami i nowym ogonem, który zmienia kolor 3 nowe postacie i powrót 2 ulubionych postaci Nowy kształt płetwy Ogon jest wypełniony wodą i brokatem dla zapewnienia hipnotyzującego efektu Ogon zmienia kolor po zanurzeniu w wodzie Unikalny, formowany, ozdobny ogon ma przeguby w talii i przy płetwie Przepiękne szklane oczy Długie, kolorowe włosy, które można czesać Zdejmowana kurtka i top Torebka i biżuteria Stojak na lalkę', '', 'mermaze-mermaidz-theme-doll-gwen-lalka-modowa-zmieniajaca-kolor', '', '', '', 'Mermaze Mermaidz, Theme Doll, Gwen, lalka modowa zmieniająca kolor', '', '', '', ''),
(25, 1, 1, 'Poczuj moc wolności z Królową Anną i rozpocznij zabawę! Lalka ma uformowany gorset oraz nosi zdejmowaną spódnicę inspirowaną filmową królewską kreacją. 5 ruchomych elementów - ustaw lalkę tak, jak tylko chcesz, i odgrywaj niesamowite filmowe sceny oraz wymyślaj własne, niepowtarzalne historie. Wiek dziecka:  od 3 lat.', '', 'kraina-lodu-krolowa-anna-lalka', '', '', '', 'Kraina Lodu, Królowa Anna, lalka', '', '', '', ''),
(25, 1, 2, 'Poczuj moc wolności z Królową Anną i rozpocznij zabawę! Lalka ma uformowany gorset oraz nosi zdejmowaną spódnicę inspirowaną filmową królewską kreacją. 5 ruchomych elementów - ustaw lalkę tak, jak tylko chcesz, i odgrywaj niesamowite filmowe sceny oraz wymyślaj własne, niepowtarzalne historie. Wiek dziecka:  od 3 lat.', '', 'kraina-lodu-krolowa-anna-lalka', '', '', '', 'Kraina Lodu, Królowa Anna, lalka', '', '', '', ''),
(26, 1, 1, 'Alya Cesaire to niepozorna dziewczyna, która po otrzymaniu od Biedronki Miraculum Lisa postanawia wspomóc herosów w walce i wstępuje w ich szeregi przyjmując pseudonim Rudej Kitki. Jest lojalna i zawsze pomoże potrzebującym wyrwać się z opresji. Dołącz do niej i jej przyjaciół - wspólnymi siłami pokonajcie największego złoczyńcę – Władcę Ciem i ochrońcie Paryż przed szerzącą się przestępczością.  Niech figurka Rudej Kitki dołączy do twojej kolekcji zabawek. Dzięki niewielkim rozmiarom możesz w łatwy sposób przetransportować ja w dowolne miejsce i bawić się wspólnie z przyjaciółmi. Figurka została wykonana z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. W zestawie znajduje się peleryna z kapturem oraz inne akcesoria, które dodatkowo urozmaicą zabawę. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-ruda-kitka-figurka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot:  Ruda Kitka, figurka', '', '', '', ''),
(26, 1, 2, 'Alya Cesaire to niepozorna dziewczyna, która po otrzymaniu od Biedronki Miraculum Lisa postanawia wspomóc herosów w walce i wstępuje w ich szeregi przyjmując pseudonim Rudej Kitki. Jest lojalna i zawsze pomoże potrzebującym wyrwać się z opresji. Dołącz do niej i jej przyjaciół - wspólnymi siłami pokonajcie największego złoczyńcę – Władcę Ciem i ochrońcie Paryż przed szerzącą się przestępczością.  Niech figurka Rudej Kitki dołączy do twojej kolekcji zabawek. Dzięki niewielkim rozmiarom możesz w łatwy sposób przetransportować ja w dowolne miejsce i bawić się wspólnie z przyjaciółmi. Figurka została wykonana z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. W zestawie znajduje się peleryna z kapturem oraz inne akcesoria, które dodatkowo urozmaicą zabawę. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-ruda-kitka-figurka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot:  Ruda Kitka, figurka', '', '', '', ''),
(27, 1, 1, 'Lalka Barbie Totally Hair z motywem gwiazdek ma swój własny przebojowy styl i fryzurę, inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, metaliczną kamizelkę, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Lalka Barbie o standardowej sylwetce ma zaczesaną na bok grzywkę, inspirowaną swoim pierwowzorem, a do tego piękne fioletowe i niebieskie pasemka. Ma na sobie sukienkę z nadrukiem w gwiazdki i bufiastymi rękawami. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-gwiazdki-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Gwiazdki, lalka z akcesoriami', '', '', '', ''),
(27, 1, 2, 'Lalka Barbie Totally Hair z motywem gwiazdek ma swój własny przebojowy styl i fryzurę, inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, metaliczną kamizelkę, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Lalka Barbie o standardowej sylwetce ma zaczesaną na bok grzywkę, inspirowaną swoim pierwowzorem, a do tego piękne fioletowe i niebieskie pasemka. Ma na sobie sukienkę z nadrukiem w gwiazdki i bufiastymi rękawami. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-gwiazdki-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Gwiazdki, lalka z akcesoriami', '', '', '', ''),
(28, 1, 1, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie i podążania za marzeniami. Dzięki różnym odcieniom skóry, sylwetkom, stylom, kolorom oczu, fryzurom, typom i barwom włosów te zabawki odzwierciedlają różnorodność świata. Ken na wózku inwalidzkim jest gotowy na nowe przygody. Rampa ułatwia mu poruszanie się po Idealnym domku dla lalek Barbie (sprzedawany oddzielnie, zależnie od dostępności). Ken jest ubrany w białą koszulkę z niebiesko-żółtym wzorem, czarne szorty, białe buciki i srebrzyste okulary przeciwsłoneczne. Lalki Fashionistas dają dzieciom nieskończone możliwości opowiadania historyjek, wyrażania siebie oraz odkrywania, że moda to wyśmienita zabawa dla każdego Informacje dodatkowe:  W zestawie jest 1 lalka w ubranku oraz akcesoria. Zestawy sprzedawane oddzielnie, zależnie od dostępności. Lalka Ken nie stoi samodzielnie. Płaskie buciki pasują do lalek z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-ken-na-wozku-lalka-z-akcesoriami', '', '', '', 'Barbie, Ken na wózku, lalka z akcesoriami', '', '', '', ''),
(28, 1, 2, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie i podążania za marzeniami. Dzięki różnym odcieniom skóry, sylwetkom, stylom, kolorom oczu, fryzurom, typom i barwom włosów te zabawki odzwierciedlają różnorodność świata. Ken na wózku inwalidzkim jest gotowy na nowe przygody. Rampa ułatwia mu poruszanie się po Idealnym domku dla lalek Barbie (sprzedawany oddzielnie, zależnie od dostępności). Ken jest ubrany w białą koszulkę z niebiesko-żółtym wzorem, czarne szorty, białe buciki i srebrzyste okulary przeciwsłoneczne. Lalki Fashionistas dają dzieciom nieskończone możliwości opowiadania historyjek, wyrażania siebie oraz odkrywania, że moda to wyśmienita zabawa dla każdego Informacje dodatkowe:  W zestawie jest 1 lalka w ubranku oraz akcesoria. Zestawy sprzedawane oddzielnie, zależnie od dostępności. Lalka Ken nie stoi samodzielnie. Płaskie buciki pasują do lalek z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-ken-na-wozku-lalka-z-akcesoriami', '', '', '', 'Barbie, Ken na wózku, lalka z akcesoriami', '', '', '', ''),
(29, 1, 1, 'W naszej manufakturze wierzymy, że zabawa jest najlepszą nauką. Dlatego też z wielką miłością tworzymy kultowe lalki Llorens, w 100, ręcznie wykonane, o niepowtarzalnych wzorach. Stosowane przez nas tkaniny pochodzą od renomowanych marek odzieży dziecięcej. Wszystkie lalki Llorens są zgodne z europejskimi przepisami dotyczącymi bezpieczeństwa dzieci, co gwarantuje, że Twoje dzieci będą się bawić w możliwie najbezpieczniejszy sposób.  Lalka płacząca Aitana mierzy 33 cm wzrostu. Buzia, rączki oraz nóżki wykonane są z delikatnego, przyjemnego w dotyku winylu, zaś brzuszek jest miękki, co czyni, iż lalka jest idealna do przytulania. Posiada blond włosy związane w dwa małe kucyki zwieńczone na końcach różowymi gumkami z puchatymi pomponami w kolorze różowo-białym. Uroku fryzurze dodaje delikatna blond grzywka. Niebieskie oczka, malutki nosek, uszka, małe usteczka i pyzate policzki to cechy tej lali. Nigdy nie rozstaje się ze swoim ukochanym smoczkiem, gdy ktoś chce go zabrać, zapłacze i zawoła \"Mama\", \"Pappa\", uspokaja się po włożeniu smoczka do buzi.  Aitana ubrana jest w zwiewną sukienkę w łososiowym kolorze, której uroku dodają aplikacje w postaci białych motylków. Dopełnienie stylizacji tworzą krótkie, różowe spodenki, ciepła różowy płaszczyk z kołnierzykiem oraz skarpetki. Lalka została zapakowana w ozdobny karton, więc bez zbędnych dodatkowych opakowań, może być wręczona jako prezent. Jest to wspaniała zabawka dla dzieci w każdym wieku. Kochamy hiszpańskie lalki Llorens!', '', 'llorens-aitana-lalka-placzaca-33-cm', '', '', '', 'Llorens, Aitana, lalka płacząca, 33 cm', '', '', '', '');
