(30, 1, 1, 'Steffi z koniem w stroju dżokejki Steffi ubrana jest w profesjonalny strój dżokejki:  w biało-różowa bluzkę i ciemne bryczesy. Całość stroju uzupełnia różowy kask i długie oficerki. Lalka ma zginane w łokciach ręce i zginane w kolanach nogi - dzięki czemu można posadzić ją na koniu w pozycji jeździeckiej. Konik ma bardzo długą grzywę, doskonałą do rozczesywania i pielęgnowania. Na swym grzbiecie ma różowe siodło oraz lejce. Wysokość lalki:  29 cm, wysokość konia:  27 cm. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'steffi-w-stroju-dzokejki-z-koniem-lalka-29-cm', '', '', '', 'Steffi w stroju dżokejki z koniem, lalka, 29 cm', '', '', '', ''),
(30, 1, 2, 'Steffi z koniem w stroju dżokejki Steffi ubrana jest w profesjonalny strój dżokejki:  w biało-różowa bluzkę i ciemne bryczesy. Całość stroju uzupełnia różowy kask i długie oficerki. Lalka ma zginane w łokciach ręce i zginane w kolanach nogi - dzięki czemu można posadzić ją na koniu w pozycji jeździeckiej. Konik ma bardzo długą grzywę, doskonałą do rozczesywania i pielęgnowania. Na swym grzbiecie ma różowe siodło oraz lejce. Wysokość lalki:  29 cm, wysokość konia:  27 cm. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'steffi-w-stroju-dzokejki-z-koniem-lalka-29-cm', '', '', '', 'Steffi w stroju dżokejki z koniem, lalka, 29 cm', '', '', '', ''),
(31, 1, 1, 'Do szczęśliwej rodziny należą Steffi w ciąży (bobasa można wyjąć i włożyć z powrotem do brzuszka lalki), Kevin i Evi. Rodzice z niecierpliwością oczekują nowego potomka, a Evi siostrzyczkę lub braciszka. Wszyscy właśnie wybierają się na wspólny spacer, ponieważ pogoda zapowiada się wspaniale. Uwielbiają oni spędzać ze sobą wolne chwile. W skład zestawu wchodzą:  lalka Steffi ubrana w różową sukienkę i wysokie szpilki Kevin, ubrany niebieski T-shirt w paski i jasne spodnie lalka Evi, która ma różową spódniczkę i żółtą bluzkę liczne akcesoria (np. wózek spacerówka, aparat, kubek, portfele, kluczyki, karty płatnicze)', '', 'steffi-rodzina-lalek', '', '', '', 'Steffi Rodzina lalek', '', '', '', ''),
(31, 1, 2, 'Do szczęśliwej rodziny należą Steffi w ciąży (bobasa można wyjąć i włożyć z powrotem do brzuszka lalki), Kevin i Evi. Rodzice z niecierpliwością oczekują nowego potomka, a Evi siostrzyczkę lub braciszka. Wszyscy właśnie wybierają się na wspólny spacer, ponieważ pogoda zapowiada się wspaniale. Uwielbiają oni spędzać ze sobą wolne chwile. W skład zestawu wchodzą:  lalka Steffi ubrana w różową sukienkę i wysokie szpilki Kevin, ubrany niebieski T-shirt w paski i jasne spodnie lalka Evi, która ma różową spódniczkę i żółtą bluzkę liczne akcesoria (np. wózek spacerówka, aparat, kubek, portfele, kluczyki, karty płatnicze)', '', 'steffi-rodzina-lalek', '', '', '', 'Steffi Rodzina lalek', '', '', '', ''),
(32, 1, 1, 'Plac zabaw przyjaciół Enchantimals Miejskie przygody jest pełen dynamicznej zabawy. W zestawie (30 cm) są 2 lalki (15 cm / 10 cm), 2 zwierzątka i ponad 10 akcesoriów. Znajdziesz tu 4 obszary zabawy z ruchomymi elementami, takimi jak huśtawka, tyrolka oraz obracające się karuzela i koło sterowe. Jest tu też siatka do wspinaczki, minizjeżdżalnia dla zwierzątek i wieża obserwacyjna z teleskopem. Wymyślaj wesołe historyjki na placu zabaw z lalką Sabine Squirrel (15 cm), jej młodszą siostrą Senecą Squirrel (10 cm) oraz ich zwierzęcymi przyjaciółmi. 4 bohaterów ze świata Enchantimals zapewnia mnóstwo inspiracji do wymyślania własnych przygód! Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, który zachęca do zabawy z wyobraźnią.', '', 'enchantimals-plac-zabaw-przyjaciol-zestaw-z-lalkami', '', '', '', 'Enchantimals, Plac zabaw przyjaciół, zestaw z lalkami', '', '', '', ''),
