(35, 1, 1, 'Przedstawiamy ultramodne lalki Barbie Extra Fancy gotowe na WIELKIE wyjście w olśniewających kreacjach! Lalki Barbie Extra Fancy wyglądają olśniewająco dzięki pięknym strojom z luksusowymi detalami i akcesoriami oraz uroczym zwierzęcym towarzyszom. Ta lalka Barbie ma oryginalną fryzurę - bardzo długie włosy są pokarbowane i częściowo upięte na górze w koczki bantu. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się wystrzałowa sukienka z tęczowym nadrukiem w misie i błyszczącymi zielonymi detalami oraz półprzezroczysta peleryna z nadrukiem w misie. Niebieskie buciki na obcasie, różowe skarpetki, metaliczne miniokulary przeciwsłoneczne, fioletowe rękawiczki, oryginalna torebka i mnóstwo biżuterii inspirują do wyrażania swojego stylu i kreatywnej zabawy. Dołączony miś też jest niezwykle modny - ma urocza minkę i własne akcesorium. Lalki Barbie Extra Fancy to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-fancy-lalka-w-stroju-w-misie', '', '', '', 'Barbie, Extra Fancy, lalka w stroju w misie', '', '', '', ''),
