(44, 1, 2, 'Tweens idą na bal przebierańców! Tematyka zachęca do odgrywania ról Charakterystyka produktów:  1 modowa lalka, przegubowa i łatwa do ustawienia w róznych pozycjach 20 niespodzianek, efektowny strój, buty, akcesoria, stojak na lalkę i nie tylko! W tej serii znajdziesz 4 nowe postaci do zebrania, w tym:  Curious Sir:  #584131 Royal Heartbreaker:  #584124 Misschievious:  #584117 Miss Hops:  #584100', '', 'lol-surprise-tweens-masquerade-royal-heartbreaker-lalka-modowa', '', '', '', 'L.O.L. Surprise, Tweens, Masquerade, Royal Heartbreaker, lalka modowa', '', '', '', ''),
(45, 1, 1, '<p>Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka tej animowanej bajki, podaruj mu wyjątkowy prezent – lalkę przedstawiającą filmową Biedronkę. Od teraz Twoje dziecko będzie mogło się bawić w odgrywanie scenek, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Lalka została wykonana z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Dzięki ruchomym elementom, Twoje dziecko może ożywić ulubioną postać oraz ponownie przeżywać ratowanie Paryża. Postać jest odwzorowana z dużą dbałością o najmniejsze szczegóły i posiada wiele charakterystycznych cech superbohaterki. Lalka ma błyszczące, granatowe włosy spięte w kucyki, czerwony strój w czarne kropki, kolczyki oraz maskę, która pomaga Marinette zachować anonimowość. W zestawie znajduje się również jojo! Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.</p>', '', 'miraculum-biedronka-i-czarny-kot-biedronka-figurka', '', '', '', 'Miraculum:  Biedronka i Czarny Kot, Biedronka, figurka', '', '', '', ''),
(45, 1, 2, '<p>Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka tej animowanej bajki, podaruj mu wyjątkowy prezent – lalkę przedstawiającą filmową Biedronkę. Od teraz Twoje dziecko będzie mogło się bawić w odgrywanie scenek, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Lalka ma 26 cm wysokości i została wykonana z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Dzięki ruchomym elementom, Twoje dziecko może ożywić ulubioną postać oraz ponownie przeżywać ratowanie Paryża. Postać jest odwzorowana z dużą dbałością o najmniejsze szczegóły i posiada wiele charakterystycznych cech superbohaterki. Lalka ma błyszczące, granatowe włosy spięte w kucyki, czerwony strój w czarne kropki, kolczyki oraz maskę, która pomaga Marinette zachować anonimowość. W zestawie znajduje się również jojo! Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.</p>', '', 'miraculum-biedronka-i-czarny-kot-biedronka-figurka', '', '', '', 'Miraculum:  Biedronka i Czarny Kot, Biedronka, figurka', '', '', '', ''),
(46, 1, 1, 'Daj się zainspirować do zabawy w opiekę, stylizację i przyjaźń z tym zestawem z lalką Barbie, dwoma konikami i mnóstwem akcesoriów. Zestaw do zabawy Barbie Koniki Stylizacja i opieka obejmuje ogrodzenie z poidłem, prysznicem i stanowiskiem do pielęgnowania koni. Wyszczotkuj grzywy obu koników, a potem użyj zimnej wody, aby odkryć kolorowe pasemka Gdy chcesz wrócić do poprzedniego koloru, wykorzystaj ciepłą wodę - tę transformację możesz powtarzać tyle razy, ile chcesz. Przystrój grzywy doczepianymi pasemkami lub kwiatową koroną, a potem użyj specjalnego przyrządu do stylizacji, aby ozdobić grzywę konia lub włosy lalki uroczymi motylkowymi spinkami. Gdy skończysz stylizację, pomóż Barbie \"karmić\" konie \"marchewkami\" - aby ułatwić to zadanie, koniki mają ruchome głowy. Po przekąsce możesz też zgiąć nogi lalki w kolanach i posadzić ją w siodle, aby pogalopować ku przygodzie. Z lalką Barbie, dwoma konikami i ponad 20 akcesoriami tematycznymi masz nieograniczone możliwości opowiadania historyjek Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-koniki-stylizacja-i-opieka-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Koniki, Stylizacja i opieka, zestaw z lalką i akcesoriami', '', '', '', ''),
