(48, 1, 1, 'Najlepsze z najlepszych szkół artystycznych z całego świata biorą udział w elitarnym wydarzeniu. Setki kandydatów pokażą swój prawdziwy talent! 3 nowe lalki do przebierania z nowym motywem Piękna, w pełni przegubowa lalka do przebierania Długie włosy do czesania plus akcesoria do włosów i grzebień W zestawie:  lalka Sabrina 2 stroje stylistki akcesoria modowe (kolczyki, buty…) akcesoria pasujące do motywu stojak na lalkę', '', 'rainbow-vision-rainbow-high-sabrina-st-cloud-lalka-modowa', '', '', '', 'Rainbow Vision, Rainbow High, Sabrina St. Cloud, lalka modowa', '', '', '', ''),
(48, 1, 2, 'Najlepsze z najlepszych szkół artystycznych z całego świata biorą udział w elitarnym wydarzeniu. Setki kandydatów pokażą swój prawdziwy talent! 3 nowe lalki do przebierania z nowym motywem Piękna, w pełni przegubowa lalka do przebierania Długie włosy do czesania plus akcesoria do włosów i grzebień W zestawie:  lalka Sabrina 2 stroje stylistki akcesoria modowe (kolczyki, buty…) akcesoria pasujące do motywu stojak na lalkę', '', 'rainbow-vision-rainbow-high-sabrina-st-cloud-lalka-modowa', '', '', '', 'Rainbow Vision, Rainbow High, Sabrina St. Cloud, lalka modowa', '', '', '', ''),
(49, 1, 1, 'Zalety produktu:  rozwijanie wyobraźni dziecka. Lalka z akcesoriami od Mega Creative to bez wątpienia świetny prezent dla Twojej pociechy. Zapewni jej wspaniałe chwile podczas zabawy.. Zawartość zestawu:  lalka, piesek. Produkt przeznaczony dla dzieci w wieku:  3. Wymiary produktu - lalka (cm):  5 x 11 x 3. Wymiary opakowania (cm):  8 x 15 x 4. Waga produktu bez opakowania (kg):  0,05. Waga produktu w opakowaniu (kg):  0,06 kg. Nie wymaga zasilania bateriami.', '', 'mega-creative-lalka-z-akcesoriami', '', '', '', 'Mega Creative, lalka z akcesoriami', '', '', '', ''),
(49, 1, 2, 'Zalety produktu:  rozwijanie wyobraźni dziecka. Lalka z akcesoriami od Mega Creative to bez wątpienia świetny prezent dla Twojej pociechy. Zapewni jej wspaniałe chwile podczas zabawy.. Zawartość zestawu:  lalka, piesek. Produkt przeznaczony dla dzieci w wieku:  3. Wymiary produktu - lalka (cm):  5 x 11 x 3. Wymiary opakowania (cm):  8 x 15 x 4. Waga produktu bez opakowania (kg):  0,05. Waga produktu w opakowaniu (kg):  0,06 kg. Nie wymaga zasilania bateriami.', '', 'mega-creative-lalka-z-akcesoriami', '', '', '', 'Mega Creative, lalka z akcesoriami', '', '', '', ''),
(50, 1, 1, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach.  Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka posiada kubek na kawę oraz torebkę w kształcie kawałka tortu. Barbie ubrana jest oryginalny strój ze wzorem w panterkę. Towarzyszy jej piesek. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-17', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 17', '', '', '', ''),
(50, 1, 2, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach.  Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka posiada kubek na kawę oraz torebkę w kształcie kawałka tortu. Barbie ubrana jest oryginalny strój ze wzorem w panterkę. Towarzyszy jej piesek. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-17', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 17', '', '', '', ''),
(51, 1, 1, 'Lalka Agusia w wanience.  Wykąp swojego bobasa, a potem załóż mu pieluszkę.  Do zestawu dołączone jest mydełko, krem, kaczuszka, pieluszka i smoczek butelka.  Lalka wykonana z wysokiej jakości materiałów.  Wiek 3+, wymiary wanienki 30x37x8,5 cm, wysokość lalki 25 cm.', '', 'dromader-agusia-lalka-w-wanience-25-cm', '', '', '', 'Dromader, Agusia, lalka w wanience, 25 cm', '', '', '', ''),
(51, 1, 2, 'Lalka Agusia w wanience.  Wykąp swojego bobasa, a potem załóż mu pieluszkę.  Do zestawu dołączone jest mydełko, krem, kaczuszka, pieluszka i smoczek butelka.  Lalka wykonana z wysokiej jakości materiałów.  Wiek 3+, wymiary wanienki 30x37x8,5 cm, wysokość lalki 25 cm.', '', 'dromader-agusia-lalka-w-wanience-25-cm', '', '', '', 'Dromader, Agusia, lalka w wanience, 25 cm', '', '', '', ''),
(52, 1, 1, 'Na fali, w toni oceanu, głęboko pod wodą... Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają muzykę, modę, sport, gry i wiele innych rzeczy! Każda postać Mermaze ma inną pasję wyrażoną przez jej własny styl. Każda ma zmieniający kolor, rzeźbiony ogon z detalami i kolorowe włosy. Syreni ogon pełni także funkcję stojaka! Baw się nimi w wodzie i na lądzie! Zestaw zawiera lalkę Orra, 4 brokatowe żele do włosów, 5 spinek do włosów i pędzelek, dzięki którym stworzysz wiele pięknych fryzur na długich, falujących i kolorowych  włosach. Możesz również upodobnić się do syreny, użyć brokatowego żelu na swoich włosach, zmyć go i użyć ponownie. Syrena Orra ma również piękne błyszczące oczy i prawdziwe, długie rzęsy. Błyszczy się i mieni w cieniu, budząc ciekawość i zainteresowanie. Jest wręcz hipnotyzująca i tworzy własny rytm fal. Aby zmienić kolor ogona, polej lalkę lodowatą wodą lub zanurz ją w pojemniku z wodą. Zestaw idealnie sprawdzi się do zabawy w wodzie i poza nią! Uwaga:  włosy lalki mogą wyglądać inaczej po zanurzeniu w wodzie. Charakterystyka produktów:  5 lalek modowych syrenek z wymiennymi topami. Idealne do zabawy w basenie lub wannie! Cały ogon zmienia kolor po zanurzeniu w wodzie. Unikalne, rzeźbione, dekoracyjne ogony zginają się w pasie i na płetwie. Ogon pełni także funkcję stojaka, więc lalka naprawdę stoi! Przepiękne szklane oczy. Długie, kolorowe włosy, które można czesać. Torebka. Dla dzieci w wieku 4+', '', 'mermaze-mermaidz-syrenka-orra-lalka-modowa-zmieniajaca-kolor', '', '', '', 'Mermaze Mermaidz, Syrenka Orra, lalka modowa, zmieniająca kolor', '', '', '', ''),
(52, 1, 2, 'Na fali, w toni oceanu, głęboko pod wodą... Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają muzykę, modę, sport, gry i wiele innych rzeczy! Każda postać Mermaze ma inną pasję wyrażoną przez jej własny styl. Każda ma zmieniający kolor, rzeźbiony ogon z detalami i kolorowe włosy. Syreni ogon pełni także funkcję stojaka! Baw się nimi w wodzie i na lądzie! Zestaw zawiera lalkę Orra, 4 brokatowe żele do włosów, 5 spinek do włosów i pędzelek, dzięki którym stworzysz wiele pięknych fryzur na długich, falujących i kolorowych  włosach. Możesz również upodobnić się do syreny, użyć brokatowego żelu na swoich włosach, zmyć go i użyć ponownie. Syrena Orra ma również piękne błyszczące oczy i prawdziwe, długie rzęsy. Błyszczy się i mieni w cieniu, budząc ciekawość i zainteresowanie. Jest wręcz hipnotyzująca i tworzy własny rytm fal. Aby zmienić kolor ogona, polej lalkę lodowatą wodą lub zanurz ją w pojemniku z wodą. Zestaw idealnie sprawdzi się do zabawy w wodzie i poza nią! Uwaga:  włosy lalki mogą wyglądać inaczej po zanurzeniu w wodzie. Charakterystyka produktów:  5 lalek modowych syrenek z wymiennymi topami. Idealne do zabawy w basenie lub wannie! Cały ogon zmienia kolor po zanurzeniu w wodzie. Unikalne, rzeźbione, dekoracyjne ogony zginają się w pasie i na płetwie. Ogon pełni także funkcję stojaka, więc lalka naprawdę stoi! Przepiękne szklane oczy. Długie, kolorowe włosy, które można czesać. Torebka. Dla dzieci w wieku 4+', '', 'mermaze-mermaidz-syrenka-orra-lalka-modowa-zmieniajaca-kolor', '', '', '', 'Mermaze Mermaidz, Syrenka Orra, lalka modowa, zmieniająca kolor', '', '', '', ''),
(53, 1, 1, 'Wyprodukowana w Hiszpanii realistyczna lalka bobas mierząca 36 cm marki Llorens jest wyjątkową zabawką dla każdego dziecka. Bobasek jest ubrany w ażurowy rampers w serduszka i czapeczkę. Rampers jest zapinany na plecach na rzep, co ułatwia przebieranie bobasa. Do zestawu dołączono różowy śpiworek z kapturem i króliczymi uszami. Materiałowy brzuszek lalki wypełniono miękką wyściółką, po naciśnięciu go lalka zacznie płakać. Tę słodką buzię pokocha każde dziecko. Bobasek ma urocze niebieskie oczy, dlugie rzęsy i śliczny, mały nosek. Oczy są otwarte na stałe, nie zamykają się. Rączki i nóżki są ruchome, dzięki czemu w łatwy sposób możemy układać lalkę jak tylko chcemy. Załączony smoczek pełni funkcję dekoracyjną. Lalka została zapakowana w ozdobny karton.', '', 'llorens-lalka-placzaca-bobas-36-cm', '', '', '', 'Llorens, lalka płacząca, bobas, 36 cm', '', '', '', ''),
