(54, 1, 2, 'Miraculous:  Biedronka i Czarny Kot, Vesperia, lalka', '', 'miraculous-biedronka-i-czarny-kot-vesperia-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Vesperia, lalka', '', '', '', ''),
(55, 1, 1, 'Seria Miss Minis to niesamowita nowość uwielbianej marki Llorens. Ta słodka mała dziewczynka o imieniu Miss Dana Star ma 26 cm i niezwykle modne ubranko. Dana czaruje swoimi czarnymi oczkami, piegowatymi policzkami z rumieńcem i bujną fryzurą z kokardkami. Laleczka jest ubrana w różową sukienkę z kokardką, białe buciki z kokardami i białą kurtkę z futerka. Do zestawu dołączony jest lizak oraz torebka. Lalka jest wykonana z miękkiego winylu i ma ruchome ręce, nogi oraz głowę. Lalki Miss Minis to świetne przyjaciółki, które są gotowe na różnego rodzaju wycieczki. Lalka została zapakowana w ozdobny karton.', '', 'llorens-miss-miniss-melena-lalka-brunetka-26-cm', '', '', '', 'Llorens, Miss Miniss, Melena, lalka, brunetka, 26 cm', '', '', '', ''),
(55, 1, 2, 'Seria Miss Minis to niesamowita nowość uwielbianej marki Llorens. Ta słodka mała dziewczynka o imieniu Miss Dana Star ma 26 cm i niezwykle modne ubranko. Dana czaruje swoimi czarnymi oczkami, piegowatymi policzkami z rumieńcem i bujną fryzurą z kokardkami. Laleczka jest ubrana w różową sukienkę z kokardką, białe buciki z kokardami i białą kurtkę z futerka. Do zestawu dołączony jest lizak oraz torebka. Lalka jest wykonana z miękkiego winylu i ma ruchome ręce, nogi oraz głowę. Lalki Miss Minis to świetne przyjaciółki, które są gotowe na różnego rodzaju wycieczki. Lalka została zapakowana w ozdobny karton.', '', 'llorens-miss-miniss-melena-lalka-brunetka-26-cm', '', '', '', 'Llorens, Miss Miniss, Melena, lalka, brunetka, 26 cm', '', '', '', ''),
(56, 1, 1, 'Lalki Barbie Extra prezentują unikalny i odważny styl w modnych strojach o wyrazistych kolorach. Każda lalka Barbie ma własną wyjątkową stylizację. W każdym zestawie znajduje się także inna figurka zwierzątka - wszystkie wyglądają bardzo uroczo i modnie. Linia Barbie Extra umożliwia dzieciom wyrażanie siebie poprzez eksperymentowanie ze stylem i ekscytującą zabawę w stylizację lalek, które można ustawiać w różnych pozach. Te lalki są gotowe na modową przygodę z brokatem, żelkami, emotkami i niesamowitymi fryzurami - robią wrażenie, gdziekolwiek się pojawią. Lalki nie stoją samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-extra-moda-lalka-ze-zwierzatkiem-nr-13', '', '', '', 'Barbie, Extra Moda, lalka ze zwierzątkiem nr 13', '', '', '', ''),
(56, 1, 2, 'Lalki Barbie Extra prezentują unikalny i odważny styl w modnych strojach o wyrazistych kolorach. Każda lalka Barbie ma własną wyjątkową stylizację. W każdym zestawie znajduje się także inna figurka zwierzątka - wszystkie wyglądają bardzo uroczo i modnie. Linia Barbie Extra umożliwia dzieciom wyrażanie siebie poprzez eksperymentowanie ze stylem i ekscytującą zabawę w stylizację lalek, które można ustawiać w różnych pozach. Te lalki są gotowe na modową przygodę z brokatem, żelkami, emotkami i niesamowitymi fryzurami - robią wrażenie, gdziekolwiek się pojawią. Lalki nie stoją samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-extra-moda-lalka-ze-zwierzatkiem-nr-13', '', '', '', 'Barbie, Extra Moda, lalka ze zwierzątkiem nr 13', '', '', '', ''),
(57, 1, 1, 'Na fali, w toni oceanu, głęboko pod wodą… Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają odkrywać nowe miejsca i nawiązywać nowe przyjaźnie! Te syrenki mają wyjątkowe ogony wypełnione wodą i brokatem. Mają też nową, fantastyczną funkcję — zmieniają kolor! Ogon zmienia kolor po zanurzeniu w wodzie! Te syrenki mają również wyjątkowe płetwy i przyjemne w dotyku ubrania! Charakterystyka produktów:  Lalki syrenki do przebierania z miłą w dotyku odzieżą, akcesoriami i nowym ogonem, który zmienia kolor 3 nowe postacie i powrót 2 ulubionych postaci Nowy kształt płetwy Ogon jest wypełniony wodą i brokatem dla zapewnienia hipnotyzującego efektu Ogon zmienia kolor po zanurzeniu w wodzie Unikalny, formowany, ozdobny ogon ma przeguby w talii i przy płetwie Przepiękne szklane oczy Długie, kolorowe włosy, które można czesać Zdejmowana kurtka i top Torebka i biżuteria Stojak na lalkę', '', 'mermaze-mermaidz-theme-doll-crystabella-lalka-modowa-zmieniajaca-kolor', '', '', '', 'Mermaze Mermaidz, Theme Doll, Crystabella, lalka modowa zmieniająca kolor', '', '', '', ''),
(57, 1, 2, 'Na fali, w toni oceanu, głęboko pod wodą… Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają odkrywać nowe miejsca i nawiązywać nowe przyjaźnie! Te syrenki mają wyjątkowe ogony wypełnione wodą i brokatem. Mają też nową, fantastyczną funkcję — zmieniają kolor! Ogon zmienia kolor po zanurzeniu w wodzie! Te syrenki mają również wyjątkowe płetwy i przyjemne w dotyku ubrania! Charakterystyka produktów:  Lalki syrenki do przebierania z miłą w dotyku odzieżą, akcesoriami i nowym ogonem, który zmienia kolor 3 nowe postacie i powrót 2 ulubionych postaci Nowy kształt płetwy Ogon jest wypełniony wodą i brokatem dla zapewnienia hipnotyzującego efektu Ogon zmienia kolor po zanurzeniu w wodzie Unikalny, formowany, ozdobny ogon ma przeguby w talii i przy płetwie Przepiękne szklane oczy Długie, kolorowe włosy, które można czesać Zdejmowana kurtka i top Torebka i biżuteria Stojak na lalkę', '', 'mermaze-mermaidz-theme-doll-crystabella-lalka-modowa-zmieniajaca-kolor', '', '', '', 'Mermaze Mermaidz, Theme Doll, Crystabella, lalka modowa zmieniająca kolor', '', '', '', ''),
(58, 1, 1, 'Steffi przygotowuje śniadanie. Zestaw zawiera 14 akcesoriów do przygotowania i jedzenia porannego posiłku, między innymi toster z funkcją Try-me. Wysokość:  29 cm. Wiek:  3l+.', '', 'steffi-love-sniadanie-lalka-z-akcesoriami-29-cm', '', '', '', 'Steffi Love, Śniadanie, lalka z akcesoriami, 29 cm', '', '', '', ''),
(58, 1, 2, 'Steffi przygotowuje śniadanie. Zestaw zawiera 14 akcesoriów do przygotowania i jedzenia porannego posiłku, między innymi toster z funkcją Try-me. Wysokość:  29 cm. Wiek:  3l+.', '', 'steffi-love-sniadanie-lalka-z-akcesoriami-29-cm', '', '', '', 'Steffi Love, Śniadanie, lalka z akcesoriami, 29 cm', '', '', '', ''),
(59, 1, 1, 'Seria Miss Minis to niesamowita nowość uwielbianej marki Llorens. Ta słodka mała dziewczynka o imieniu Miss Lilly Queen ma 26 cm i niezwykle modne ubranko. Lilly czaruje swoimi czarnymi oczkami, piegowatymi policzkami z rumieńcem i słodkimi kiteczkami z kokardkami. Laleczka jest ubrana w białą sukienkę w gwiazdki, różowy sweterek z kokardką i białe buty z kokardkami. Do zestawu dołączony jest lizak. Lalka jest wykonana z miękkiego winylu i ma ruchome ręce, nogi oraz głowę. Lalki Miss Minis to świetne przyjaciółki, które są gotowe na różnego rodzaju wycieczki. Lalka została zapakowana w ozdobny karton.', '', 'llorens-miss-miniss-lalka-blondynka-26-cm', '', '', '', 'Llorens, Miss Miniss, lalka, blondynka, 26 cm', '', '', '', ''),
(59, 1, 2, 'Seria Miss Minis to niesamowita nowość uwielbianej marki Llorens. Ta słodka mała dziewczynka o imieniu Miss Lilly Queen ma 26 cm i niezwykle modne ubranko. Lilly czaruje swoimi czarnymi oczkami, piegowatymi policzkami z rumieńcem i słodkimi kiteczkami z kokardkami. Laleczka jest ubrana w białą sukienkę w gwiazdki, różowy sweterek z kokardką i białe buty z kokardkami. Do zestawu dołączony jest lizak. Lalka jest wykonana z miękkiego winylu i ma ruchome ręce, nogi oraz głowę. Lalki Miss Minis to świetne przyjaciółki, które są gotowe na różnego rodzaju wycieczki. Lalka została zapakowana w ozdobny karton.', '', 'llorens-miss-miniss-lalka-blondynka-26-cm', '', '', '', 'Llorens, Miss Miniss, lalka, blondynka, 26 cm', '', '', '', ''),
(60, 1, 1, 'Lalka 29 cm w modnej stylizacji (sukienka z cekinami).   Dziewczyna ma na twarzy wyraźnie zaznaczony makijaż.   Dostępne są również kolczyki i inne akcesoria.   Długie, różowe włosy są rozpuszczone.   Laleczka jest przegubowa.   Zabawkę zapakowano w pudełko, które automatycznie przyciąga uwagę dziewczynek.  Produkt występuje w różnych wariantach.   Wymiary opakowania:  16x5x31,5 cm.  Wiek:  3+. Uwaga:  produkt wysyłany losowo!', '', 'bigtoys-lalka-w-sukni-balowej-cekiny-zestaw-z-akcesoriami', '', '', '', 'BigToys, lalka w sukni balowej, cekiny, zestaw z akcesoriami', '', '', '', ''),
(60, 1, 2, 'Lalka 29 cm w modnej stylizacji (sukienka z cekinami).   Dziewczyna ma na twarzy wyraźnie zaznaczony makijaż.   Dostępne są również kolczyki i inne akcesoria.   Długie, różowe włosy są rozpuszczone.   Laleczka jest przegubowa.   Zabawkę zapakowano w pudełko, które automatycznie przyciąga uwagę dziewczynek.  Produkt występuje w różnych wariantach.   Wymiary opakowania:  16x5x31,5 cm.  Wiek:  3+. Uwaga:  produkt wysyłany losowo!', '', 'bigtoys-lalka-w-sukni-balowej-cekiny-zestaw-z-akcesoriami', '', '', '', 'BigToys, lalka w sukni balowej, cekiny, zestaw z akcesoriami', '', '', '', ''),
(61, 1, 1, 'Lalka z akcesoriami od Mega Creative to bez wątpienia świetny prezent dla Twojej pociechy. Oprócz zapewnienia jej wspaniałych chwil podczas zabawy, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę!  W zestawie znajduje się:    lalka w ubranku,   torebka,   szczotka do włosów,   butelka,   karta zdrowia,   szczypce,   nożyczki,   pęseta,   termometr.     Lalka posiada efekty dźwiękowe.  Wymiar lalki 35 cm.', '', 'mega-creative-lalka-bobas-z-akcesoriami-35-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 35 cm', '', '', '', ''),
(61, 1, 2, 'Lalka z akcesoriami od Mega Creative to bez wątpienia świetny prezent dla Twojej pociechy. Oprócz zapewnienia jej wspaniałych chwil podczas zabawy, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę!  W zestawie znajduje się:    lalka w ubranku,   torebka,   szczotka do włosów,   butelka,   karta zdrowia,   szczypce,   nożyczki,   pęseta,   termometr.     Lalka posiada efekty dźwiękowe.  Wymiar lalki 35 cm.', '', 'mega-creative-lalka-bobas-z-akcesoriami-35-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 35 cm', '', '', '', ''),
(62, 1, 1, 'Zestaw Enchantimals z lalkami rodzinką wyderek z kolekcji Podwodne Królestwo. Zestaw zawiera 3 lalki, 3 figurki zwierzątek, opakowanie masy do zabawy i 5 akcesoriów. Lalka Ottavia Otter (15 cm) ma dwie małe siostrzyczki (każda lalka po 10 cm), aby można było odgrywać rodzinną więź. Rodzinkę Enchantimals dopełniają 3 urocze wyderki. Za pomocą masy do zabawy i foremek można budować zamki z piasku i inne kształty. 6 bohaterów ze świata Enchantimals zapewnia mnóstwo inspiracji do wymyślania własnych przygód! Wiek dziecka:  od 3 lat.', '', 'enchantimals-rodzina-ottavia-otter-wydry-zestaw-z-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Rodzina Ottavia Otter - Wydry, zestaw z lalkami i zwierzątkami', '', '', '', ''),
(62, 1, 2, 'Zestaw Enchantimals z lalkami rodzinką wyderek z kolekcji Podwodne Królestwo. Zestaw zawiera 3 lalki, 3 figurki zwierzątek, opakowanie masy do zabawy i 5 akcesoriów. Lalka Ottavia Otter (15 cm) ma dwie małe siostrzyczki (każda lalka po 10 cm), aby można było odgrywać rodzinną więź. Rodzinkę Enchantimals dopełniają 3 urocze wyderki. Za pomocą masy do zabawy i foremek można budować zamki z piasku i inne kształty. 6 bohaterów ze świata Enchantimals zapewnia mnóstwo inspiracji do wymyślania własnych przygód! Wiek dziecka:  od 3 lat.', '', 'enchantimals-rodzina-ottavia-otter-wydry-zestaw-z-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Rodzina Ottavia Otter - Wydry, zestaw z lalkami i zwierzątkami', '', '', '', ''),
(63, 1, 1, 'Dzieci od najmłodszych lat powinny się uczyć odpowiedzialności i troski o drugą osobę. Lalka Bobas Mega Creative sprawi, że Twoja pociecha zaopiekuje się nią w najlepszy możliwy sposób! W zestawie znajduje się:  lalka oraz akcesoria:  toaleta, chusteczki papierowe, grzebień oraz 2 płyny do kąpieli. Lalka pije, sika oraz wydaje dźwięki. Posiada kręcone włosy. Zestaw wykonany z plastiku, gumy, materiału oraz sztucznego włosia. Przeznaczony dla dzieci w wieku:  3+. Wymaga zasilania bateriami 2 x AALR06- nie załączono do zestawu. Lalka:  25 cm. Wymiary opakowania (dł. x wys. x gł.) cm:  36x29x15.', '', 'mega-creative-lalka-bobas-z-akcesoriami-25-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 25 cm', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(63, 1, 2, 'Dzieci od najmłodszych lat powinny się uczyć odpowiedzialności i troski o drugą osobę. Lalka Bobas Mega Creative sprawi, że Twoja pociecha zaopiekuje się nią w najlepszy możliwy sposób! W zestawie znajduje się:  lalka oraz akcesoria:  toaleta, chusteczki papierowe, grzebień oraz 2 płyny do kąpieli. Lalka pije, sika oraz wydaje dźwięki. Posiada kręcone włosy. Zestaw wykonany z plastiku, gumy, materiału oraz sztucznego włosia. Przeznaczony dla dzieci w wieku:  3+. Wymaga zasilania bateriami 2 x AALR06- nie załączono do zestawu. Lalka:  25 cm. Wymiary opakowania (dł. x wys. x gł.) cm:  36x29x15.', '', 'mega-creative-lalka-bobas-z-akcesoriami-25-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 25 cm', '', '', '', ''),
(64, 1, 1, '<p>Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka animowanej bajki, podaruj mu wyjątkowy prezent – niesamowity zestaw zawierający aż 4 lalki superbohaterów: Królową Pszczół Biedronkę Czarnego Kota Rudą Kitkę Od teraz Twoje dziecko będzie mogło się bawić w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Lalki zostały wykonane z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Dzięki ruchomym elementom, Twoje dziecko może ożywić ulubioną postać z serialu „Miraculum: Biedronka i Czarny Kot” oraz ponownie przeżywać ratowanie Paryża. Lalki mają aż 15 ruchomych punktów, w tym zginające się ręce i nogi! Zostały wykonane z najwyższej jakości materiałów i dbałością o najdrobniejsze szczegóły. Doskonale odwzorowują bohaterów popularnego serialu. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.</p>', '', 'miraculum-biedronka-i-czarny-kot-krolowa-pszczol-biedronka-czarny-kot-ruda-kitka-figurki-4-szt', '', '', '', 'Miraculum:  Biedronka i Czarny Kot, Królowa Pszczół, Biedronka, Czarny Kot, Ruda Kitka, figurki, 4 szt.', '', '', '', ''),
(64, 1, 2, '<p>Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka animowanej bajki, podaruj mu wyjątkowy prezent – niesamowity zestaw zawierający aż 4 lalki superbohaterów: Królową Pszczół Biedronkę Czarnego Kota Rudą Kitkę Od teraz Twoje dziecko będzie mogło się bawić w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Lalki zostały wykonane z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Dzięki ruchomym elementom, Twoje dziecko może ożywić ulubioną postać z serialu „Miraculum: Biedronka i Czarny Kot” oraz ponownie przeżywać ratowanie Paryża. Lalki mają około 26 cm wysokości i aż 15 ruchomych punktów, w tym zginające się ręce i nogi! Zostały wykonane z najwyższej jakości materiałów i dbałością o najdrobniejsze szczegóły. Doskonale odwzorowują bohaterów popularnego serialu. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.</p>', '', 'miraculum-biedronka-i-czarny-kot-krolowa-pszczol-biedronka-czarny-kot-ruda-kitka-figurki-4-szt', '', '', '', 'Miraculum:  Biedronka i Czarny Kot, Królowa Pszczół, Biedronka, Czarny Kot, Ruda Kitka, figurki, 4 szt.', '', '', '', ''),
(65, 1, 1, 'Baby Born laleczka Angel jest taka malutka, a idealna do tulenia. Miękka laleczka Baby Born nadaje się dla dzieci już od urodzenia. Ma idealny rozmiar dla malutkich rączek. Wykonano ją z przyjemnej, welurowej tkaniny, a na jej miękkim brzuszku znajduje się śliczna aplikacja. Dodatki takie jak zawieszka do łóżeczka czy wewnętrzna grzechotka idealnie nadają się do zabawy i poznawania świata. Laleczka posiada małe skrzydełka I zawieszkę. Zabawka dla dzieci bez ograniczeń wiekowych.', '', 'baby-born-laleczka-angel-18-cm-z-zawieszka', '', '', '', 'Baby Born, laleczka Angel, 18 cm, z zawieszką', '', '', '', ''),
(65, 1, 2, 'Baby Born laleczka Angel jest taka malutka, a idealna do tulenia. Miękka laleczka Baby Born nadaje się dla dzieci już od urodzenia. Ma idealny rozmiar dla malutkich rączek. Wykonano ją z przyjemnej, welurowej tkaniny, a na jej miękkim brzuszku znajduje się śliczna aplikacja. Dodatki takie jak zawieszka do łóżeczka czy wewnętrzna grzechotka idealnie nadają się do zabawy i poznawania świata. Laleczka posiada małe skrzydełka I zawieszkę. Zabawka dla dzieci bez ograniczeń wiekowych.', '', 'baby-born-laleczka-angel-18-cm-z-zawieszka', '', '', '', 'Baby Born, laleczka Angel, 18 cm, z zawieszką', '', '', '', ''),
(66, 1, 1, 'Naucz się prowadzić farmę z zestawem do zabawy Barbie Farma radosnych kurek. Zawsze gotowa, by pomóc kurom w składaniu jajek, lalka Barbie (brunetka, 29 cm) jest ubrana w sukienkę ze wzorem w kurczaki oraz niebieskie kalosze. Zestaw do zabawy ma niesamowitą funkcję - użyj masy, aby przygotować jajka, z których \"wyklują\" się pisklęta. Pomagaj kurkom \"składać jajka\", które toczą się po rampie do odpowiedniego pojemnika. Zestaw pozwala też \"siać trawę\" za pomocą zielonej masy, aby zapewnić pożywienie cielaczkowi i króliczkowi. Zestaw zawiera 2 kolory masy, formę, łopatę, wiadro, jabłkowe przysmaki, podajnik na paszę, cielątko, króliczka, 2 kurki i 6 kurczaczków. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Doskonały prezent dla dzieci od 4 roku życia, zwłaszcza tych pasjonujących się zwierzętami i opieką nad innymi!', '', 'barbie-farma-radosnych-kurek-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Farma radosnych kurek, zestaw z lalką i akcesoriami', '', '', '', ''),
(66, 1, 2, 'Naucz się prowadzić farmę z zestawem do zabawy Barbie Farma radosnych kurek. Zawsze gotowa, by pomóc kurom w składaniu jajek, lalka Barbie (brunetka, 29 cm) jest ubrana w sukienkę ze wzorem w kurczaki oraz niebieskie kalosze. Zestaw do zabawy ma niesamowitą funkcję - użyj masy, aby przygotować jajka, z których \"wyklują\" się pisklęta. Pomagaj kurkom \"składać jajka\", które toczą się po rampie do odpowiedniego pojemnika. Zestaw pozwala też \"siać trawę\" za pomocą zielonej masy, aby zapewnić pożywienie cielaczkowi i króliczkowi. Zestaw zawiera 2 kolory masy, formę, łopatę, wiadro, jabłkowe przysmaki, podajnik na paszę, cielątko, króliczka, 2 kurki i 6 kurczaczków. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Doskonały prezent dla dzieci od 4 roku życia, zwłaszcza tych pasjonujących się zwierzętami i opieką nad innymi!', '', 'barbie-farma-radosnych-kurek-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Farma radosnych kurek, zestaw z lalką i akcesoriami', '', '', '', ''),
(67, 1, 1, 'Lalka Księżniczka Roszpunka z serii Disney Princess Księżniczka Roszpunka błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty! W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-roszpunka-lalka', '', '', '', 'Disney Princess, Księżniczka Roszpunka, lalka', '', '', '', ''),
(67, 1, 2, 'Lalka Księżniczka Roszpunka z serii Disney Princess Księżniczka Roszpunka błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty! W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-roszpunka-lalka', '', '', '', 'Disney Princess, Księżniczka Roszpunka, lalka', '', '', '', ''),
(68, 1, 1, 'Lalka płacząca bobas ma 37 cm i została wyprodukowana w Hiszpanii przez manufakturę Llorens. Jest to zabawka dla dzieci w każdym wieku. Lalka bobas wygląda jak prawdziwe dziecko w wieku niemowlęcym. Dzięki swojemu realistycznemu wyglądowi uczy empatii i odpowiedzialności. Gdy naciśniemy lalkę na materiałowy brzuszek będzie płakać i wołać \"mama, papa\". Dziewczynka została ubrana w biało-różowe body oraz opaskę z pomponami. Do zestawu dołączono pasujący do stylizacji lalki kocyk, którym można owinąć lalkę jak rożek. Załączony smoczek służy do ozdoby. Lalka została zapakowana w ozdobny prezentowy karton.', '', 'llorens-lalka-placzaca-bobas-rozowy-rozek', '', '', '', 'Llorens, lalka płacząca, bobas, różowy rożek', '', '', '', ''),
(68, 1, 2, 'Lalka płacząca bobas ma 37 cm i została wyprodukowana w Hiszpanii przez manufakturę Llorens. Jest to zabawka dla dzieci w każdym wieku. Lalka bobas wygląda jak prawdziwe dziecko w wieku niemowlęcym. Dzięki swojemu realistycznemu wyglądowi uczy empatii i odpowiedzialności. Gdy naciśniemy lalkę na materiałowy brzuszek będzie płakać i wołać \"mama, papa\". Dziewczynka została ubrana w biało-różowe body oraz opaskę z pomponami. Do zestawu dołączono pasujący do stylizacji lalki kocyk, którym można owinąć lalkę jak rożek. Załączony smoczek służy do ozdoby. Lalka została zapakowana w ozdobny prezentowy karton.', '', 'llorens-lalka-placzaca-bobas-rozowy-rozek', '', '', '', 'Llorens, lalka płacząca, bobas, różowy rożek', '', '', '', ''),
(69, 1, 1, 'Dzieci mogą pomóc lalce Chelsea ruszyć na ratunek w wozie strażackim z obracającymi się kółkami, który inspiruje do nieskończonych opowieści.  Możesz od razu ruszyć do akcji z drabiną i wężem strażackim, a potem rozłożyć zestaw, aby odkryć dodatkowe elementy, takie jak umywalka, stanowisko pierwszej pomocy, łóżko piętrowe i nie tylko. Lalka Chelsea (15 cm) ma na sobie uroczy strój strażacki ze zdejmowaną spódniczką, kaskiem i bucikami. Wraz ze szczeniaczkiem jest gotowa do akcji. Spersonalizuj wóz strażacki za pomocą arkusza naklejek i baw się w strażaków dzięki 15 akcesoriom.  Zestaw można łatwo złożyć i schować w nim lalkę oraz akcesoria, aby zabrać je, gdziekolwiek chcesz.  Wspaniały prezent dla dzieci od 3 roku życia.', '', 'barbie-woz-strazacki-chelsea-zestaw-z-lalka', '', '', '', 'Barbie, Wóz strażacki Chelsea, zestaw z lalką', '', '', '', ''),
