(71, 1, 1, 'Lalka bobas Nahia ma 45 cm i została wyprodukowana przez hiszpańską markę Llorens. Jest to wspaniała zabawka dla dzieci w każdym wieku. Jej ruchome rączki zapewniają dziecku rozmaitą zabawę. Całe ciało Nahii zostało wykonane z przyjemnego w dotyku winylu, dzięki czemu lalkę można kąpać zanurzając ją w wodzie do poziomu szyi. Dla Nahi przygotowano stylizację składającą się z różowego sweterka, spodenek, skarpetek i czapeczki. Do zestawu dołączono ozdobny smoczek. Lalka została zapakowana w ozdobny karton.', '', 'llorens-nahia-lalka-bobas-45-cm', '', '', '', 'Llorens, Nahia, lalka - bobas, 45 cm', '', '', '', ''),
(71, 1, 2, 'Lalka bobas Nahia ma 45 cm i została wyprodukowana przez hiszpańską markę Llorens. Jest to wspaniała zabawka dla dzieci w każdym wieku. Jej ruchome rączki zapewniają dziecku rozmaitą zabawę. Całe ciało Nahii zostało wykonane z przyjemnego w dotyku winylu, dzięki czemu lalkę można kąpać zanurzając ją w wodzie do poziomu szyi. Dla Nahi przygotowano stylizację składającą się z różowego sweterka, spodenek, skarpetek i czapeczki. Do zestawu dołączono ozdobny smoczek. Lalka została zapakowana w ozdobny karton.', '', 'llorens-nahia-lalka-bobas-45-cm', '', '', '', 'Llorens, Nahia, lalka - bobas, 45 cm', '', '', '', ''),
(72, 1, 1, 'Najlepsze z najlepszych szkół artystycznych z całego świata biorą udział w elitarnym wydarzeniu. Setki kandydatów pokażą swój prawdziwy talent! 3 nowe lalki do przebierania z nowym motywem muzycznym. Lalki ze szkoły Shadow High - zespół Neon Shadow Piękna, w pełni przegubowa lalka do przebierania Długie włosy do czesania plus akcesoria do włosów i grzebień W zestawie:  lalka Mara Pinkett 2 stroje stylistki w zestawie akcesoria modowe (kolczyki, kapelusz / opaska na głowę, buty…) akcesoria pasujące do motywu stojak na lalkę Zbierz wszystkie 3:  Uma Van Hoose, Harley Limestone', '', 'rainbow-high-vision-shadow-high-mara-pinkett-lalka-modowa', '', '', '', 'Rainbow High, Vision Shadow High, Mara Pinkett, lalka modowa', '', '', '', ''),
(72, 1, 2, 'Najlepsze z najlepszych szkół artystycznych z całego świata biorą udział w elitarnym wydarzeniu. Setki kandydatów pokażą swój prawdziwy talent! 3 nowe lalki do przebierania z nowym motywem muzycznym. Lalki ze szkoły Shadow High - zespół Neon Shadow Piękna, w pełni przegubowa lalka do przebierania Długie włosy do czesania plus akcesoria do włosów i grzebień W zestawie:  lalka Mara Pinkett 2 stroje stylistki w zestawie akcesoria modowe (kolczyki, kapelusz / opaska na głowę, buty…) akcesoria pasujące do motywu stojak na lalkę Zbierz wszystkie 3:  Uma Van Hoose, Harley Limestone', '', 'rainbow-high-vision-shadow-high-mara-pinkett-lalka-modowa', '', '', '', 'Rainbow High, Vision Shadow High, Mara Pinkett, lalka modowa', '', '', '', ''),
(73, 1, 1, 'Zalety produktu:  rozwija wyobraźnię dziecka poprzez różne scenariusze zabawy, lalka ma ruchome ręce i nogi. Lalka Mega Creative to niezbędna zabawka w kolekcji każdej młodej damy. Bez wątpienia czas spędzony z nią będzie czystą przyjemnością Baw się ze mną, będziesz szczęśliwsza piękna. Zawartość zestawu:  Lalka w ubranku. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Wymiary produktu (cm):  15 x 30 x 7. Wymiar opakowania (cm):  22 x 35 x 9. Waga produktu bez opakowania (kg):  0,23 kg. Waga produktu w opakowaniu (kg):  0,51 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  18m+.', '', 'mega-creative-lalka-30-cm', '', '', '', 'Mega Creative, lalka, 30 cm', '', '', '', ''),
(73, 1, 2, 'Zalety produktu:  rozwija wyobraźnię dziecka poprzez różne scenariusze zabawy, lalka ma ruchome ręce i nogi. Lalka Mega Creative to niezbędna zabawka w kolekcji każdej młodej damy. Bez wątpienia czas spędzony z nią będzie czystą przyjemnością Baw się ze mną, będziesz szczęśliwsza piękna. Zawartość zestawu:  Lalka w ubranku. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Wymiary produktu (cm):  15 x 30 x 7. Wymiar opakowania (cm):  22 x 35 x 9. Waga produktu bez opakowania (kg):  0,23 kg. Waga produktu w opakowaniu (kg):  0,51 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  18m+.', '', 'mega-creative-lalka-30-cm', '', '', '', 'Mega Creative, lalka, 30 cm', '', '', '', ''),
(74, 1, 1, 'Evi w kaloszach i ślicznej sukience - ogrodniczce na szelkach w kształcie uszu króliczka. Towarzyszy jej słodki króliczek. Ma do dyspozycji 12 akcesoriów ogrodniczych. Wysokość lalki:  12 cm. Wiek:  3l+.', '', 'evi-love-ogrodniczka-lalka-12-cm', '', '', '', 'Evi Love, Ogrodniczka, lalka, 12 cm', '', '', '', ''),
(74, 1, 2, 'Evi w kaloszach i ślicznej sukience - ogrodniczce na szelkach w kształcie uszu króliczka. Towarzyszy jej słodki króliczek. Ma do dyspozycji 12 akcesoriów ogrodniczych. Wysokość lalki:  12 cm. Wiek:  3l+.', '', 'evi-love-ogrodniczka-lalka-12-cm', '', '', '', 'Evi Love, Ogrodniczka, lalka, 12 cm', '', '', '', ''),
(75, 1, 1, 'Zestaw lekarza z lalką jest dla wszystkich dzieci, które zawsze chciały bawić się w lekarza. Urocza lalka (33 cm) gaworzy, śmieje się lub płacze słodkimi dźwiękami dziecka, gdy naciskasz na jej brzuszek (w sumie:  24 dźwięki dziecka). Ma na sobie uroczy kombinezon z aplikacjami i pasujący kapelusz z kokarda. Jej miękkie ciało sprawia, ze jest idealna do tulenia i przytulania. Zestaw zawiera stetoskop, strzykawkę, termometr do gorączki w uchu i butelkę do wspaniałych zabaw w odgrywanie ról, takich jak słuchanie bicia serca, mierzenie temperatury czy karmienie lalki. Ze względu na poręczny rozmiar lalka jest idealnym towarzyszem podróży. Wymiary lalki:  33 x 8,5 x 8,5 cm.', '', 'bayer-design-lalka-doktor-33-cm-zestaw-z-akcesoriami', '', '', '', 'Bayer Design, lalka doktor, 33 cm, zestaw z akcesoriami', '', '', '', ''),
(75, 1, 2, 'Zestaw lekarza z lalką jest dla wszystkich dzieci, które zawsze chciały bawić się w lekarza. Urocza lalka (33 cm) gaworzy, śmieje się lub płacze słodkimi dźwiękami dziecka, gdy naciskasz na jej brzuszek (w sumie:  24 dźwięki dziecka). Ma na sobie uroczy kombinezon z aplikacjami i pasujący kapelusz z kokarda. Jej miękkie ciało sprawia, ze jest idealna do tulenia i przytulania. Zestaw zawiera stetoskop, strzykawkę, termometr do gorączki w uchu i butelkę do wspaniałych zabaw w odgrywanie ról, takich jak słuchanie bicia serca, mierzenie temperatury czy karmienie lalki. Ze względu na poręczny rozmiar lalka jest idealnym towarzyszem podróży. Wymiary lalki:  33 x 8,5 x 8,5 cm.', '', 'bayer-design-lalka-doktor-33-cm-zestaw-z-akcesoriami', '', '', '', 'Bayer Design, lalka doktor, 33 cm, zestaw z akcesoriami', '', '', '', ''),
(76, 1, 1, 'W naszej manufakturze wierzymy, że zabawa jest najlepszą nauką. Dlatego też z wielką miłością tworzymy kultowe lalki Llorens, w 100 % ręcznie wykonane, o niepowtarzalnych wzorach. Stosowane przez nas tkaniny pochodzą od renomowanych marek odzieży dziecięcej. Wszystkie lalki Llorens są zgodne z europejskimi przepisami dotyczącymi bezpieczeństwa dzieci, co gwarantuje, że Twoje dzieci będą się bawić w możliwie najbezpieczniejszy sposób.  Lalka płacząca Cuquita mierzy 30 cm. Jej rączki, nóżki oraz głowa są wykonane z miękkiego w dotyku winylu, zaś brzuszek jest materiałowy. Po naciśnięciu brzuszka lalka zacznie płakać i wołać mama / papa. Cuquita ma śliczną, delikatną buzię i duże, niebieskie oczęta. Lalka jest ubrana w pajacyk ze słodkim nadrukiem lwa oraz różową czapeczkę. Lalka została zapakowana w ozdobny karton, więc bez zbędnych dodatkowych opakowań, może być wręczona jako prezent.  Zasilanie:  Bateria LR44 (w zestawie) Wymagania wiekowe:  od 3 lat', '', 'llorens-cuquita-bobas-placzacy-lalka-30-cm', '', '', '', 'Llorens, Cuquita, bobas płaczący, lalka, 30 cm', '', '', '', ''),
(76, 1, 2, 'W naszej manufakturze wierzymy, że zabawa jest najlepszą nauką. Dlatego też z wielką miłością tworzymy kultowe lalki Llorens, w 100 % ręcznie wykonane, o niepowtarzalnych wzorach. Stosowane przez nas tkaniny pochodzą od renomowanych marek odzieży dziecięcej. Wszystkie lalki Llorens są zgodne z europejskimi przepisami dotyczącymi bezpieczeństwa dzieci, co gwarantuje, że Twoje dzieci będą się bawić w możliwie najbezpieczniejszy sposób.  Lalka płacząca Cuquita mierzy 30 cm. Jej rączki, nóżki oraz głowa są wykonane z miękkiego w dotyku winylu, zaś brzuszek jest materiałowy. Po naciśnięciu brzuszka lalka zacznie płakać i wołać mama / papa. Cuquita ma śliczną, delikatną buzię i duże, niebieskie oczęta. Lalka jest ubrana w pajacyk ze słodkim nadrukiem lwa oraz różową czapeczkę. Lalka została zapakowana w ozdobny karton, więc bez zbędnych dodatkowych opakowań, może być wręczona jako prezent.  Zasilanie:  Bateria LR44 (w zestawie) Wymagania wiekowe:  od 3 lat', '', 'llorens-cuquita-bobas-placzacy-lalka-30-cm', '', '', '', 'Llorens, Cuquita, bobas płaczący, lalka, 30 cm', '', '', '', ''),
(77, 1, 1, 'Dzięki temu zestawowi do zabawy Enchantimals Miejski domek z kawiarenką możesz bawić się w wielkim stylu! Zestaw o wysokości 70 cm ma 6 obszarów zabawy i ponad 15 akcesoriów, zapewniając mnóstwo możliwości wymyślania magicznych opowieści. Znajdziesz tu też lalkę Palmer Pomeranian (15 cm) i jej pieska Pommy. Odkryj 3 poziomy zabawy:  kawiarenkę z patio, salon z kuchnią, sypialnię oraz \"basen\" na dachu. W domku są też balkon, schody przeciwpożarowe i otwierane drzwi (z klapką dla pieska Pommy). Wśród akcesoriów są łóżko, kanapa, lodówka, \"napoje\", \"desery\" i nie tylko, więc masz wszystko, czego potrzebujesz, aby wraz z przyjaciółmi Enchantimals wygodnie mieszkać i bawić się w mieście. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, który zachęca do zabawy z wyobraźnią.', '', 'enchantimals-miejski-domek-z-kawiarenka-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Miejski domek z kawiarenką, zestaw z lalką i akcesoriami', '', '', '', ''),
