(79, 1, 1, 'Lalka O.M.G. Sports Court Cutie jest modową lalką ubraną w sportowym stylu. Zestaw zawiera odjazdowy pakiet akcesoriów, które pozwalają stylizować piękność o ciemnym kręconych włosach. Court Cutie jest najwyższej klasy tenisistką, która wygrywa każdy międzyszkolny mecz. Dziewczyna ma jednak ambitniejsze plany - chciałaby zadebiutować na zawodach krajowych. Ślicznotka ma swoją szczęśliwą rakietę tenisową, którą zabiera na codzienne treningi ze swoim instruktorem. Let\'s go serve &amp; volley! Zostaniesz partnerką Court Cutie? Czy można zachować styl, uprawiając sport? Tylko spójrzcie na Court Cutie! Ubrana w biało-różowy strój do tenisa i czapkę z daszkiem chroniącą przed słońcem wygląda jak gwiazda z okładki magazynu sportowego. Ta millennial girl ma turkusową opalizującą kurteczkę, by okryć się podczas przerwy w meczu. Na co dzień nosi buty na grubej podeszwie. Zawartość zestawu:  lalka OMG stojak dla lalki modne ubranie sportowe kurtka para butów szczotka do włosów rakieta do tenisa para kolczyków frotka czapka z daszkiem torebka na ramię magazyn dla lalki plakat dla lalki oraz wiele innych niespodzianek! Specyfikacja:  Lalka ma ruchome ręce, nogi oraz głowę Wysokość lalki:  23 cm Wymiary opakowania:  30x25,5x7 cm Waga:  0,45 kg Wiek:  4+', '', 'lol-surprise-omg-sports-doll-court-cutie-lalka-modowa', '', '', '', 'L.O.L. Surprise, OMG Sports Doll, Court Cutie, lalka modowa', '', '', '', ''),
