(80, 1, 1, 'Chelsea i jej przyjaciele zachęcają najmłodszych do odkrywania świata. Ta urocza lalka Chelsea ma w zestawie wózek inwalidzki z realistycznymi detalami i obracającymi się kółkami. Rampa zapewnia łatwy dostęp i realistyczną zabawę, a arkusz naklejek pozwala dzieciom spersonalizować wózek i rampę. Lalka Chelsea ma na sobie koszulkę ze szczeniaczkiem (wbudowaną) i zdejmowaną spódniczkę z uroczym nadrukiem, a do tego modne białe buciki i okulary przeciwsłoneczne w kształcie serduszek. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Chelsea są doskonałym prezentem dla dzieci od 3 roku życia. Dzieci mogą zebrać je wszystkie, aby znaleźć jeszcze więcej inspiracji do różnorodnych opowieści.', '', 'barbie-color-reveal-neon-tie-dye-lalka-chelsea-1-szt', '', '', '', 'Barbie, Color Reveal, Neon Tie-Dye, lalka Chelsea, 1 szt.', '', '', '', ''),
