(82, 1, 1, 'Mała marzycielka ze śpiącymi oczami ma własną butelkę. Słodkie maleństwo marzy o tym, by pewnego dnia zostać księżniczką. Dlatego jej ubranko wygląda jak królewska szata. Oczywiście potrzebuje też tiulowej spódniczki, a ulubiona owca Baby Annabell jest nadrukowana na stroju królowej. Wykonane w stylu easy fit, ubranko można łatwo zakładać i zdejmować nawet najmniejszą dłonią. Urocza ozdoba chroni głowę małego marzyciela. Kiedy kładziesz 36-centymetrową lalkę na plecach, zamyka śpiące oczy. Jej miękkie, wypchane body jest idealne na wiele godzin przytulania i zabawy. Posiada też butelkę do karmienia. Markowa lalka Baby Annabell. Mała wersja dla początkujących (36 cm) ma miękki korpus lalki. W stylu easy fit. Ze śpiącymi oczami. Delikatnie zachęca dzieci od pierwszego roku życia do zabawy i dostarcza początkowych bodźców do rozwijania poczucia empatii i odpowiedzialności.', '', 'baby-annabell-little-sweet-annabell-lalka-36-cm', '', '', '', 'Baby Annabell, Little Sweet Annabell, lalka, 36 cm', '', '', '', ''),
