(83, 1, 1, 'Sprawdź się w projektowaniu wraz z lalką Barbie Projektantką wnętrz! Lalka jest gotowa do pracy ubrana w różową sukienkę i baleriny oraz żakiet w pepitkę. Lalka Barbie Projektantka wnętrz ma protezę nogi, a wśród akcesoriów są \"tablet\" i karta z projektem. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Doskonały prezent dla dzieci od 3 lat, zwłaszcza tych pasjonujących się kreatywnością, kolorami i projektowaniem.', '', 'barbie-kariera-projektantka-wnetrz-lalka-z-akcesoriami', '', '', '', 'Barbie, Kariera, Projektantka wnętrz, lalka z akcesoriami', '', '', '', ''),
