(84, 1, 1, 'Wyrusz z ulubioną lalką Barbie w w fascynującą podróż. Ten inspirowany serialem \"Barbie Dreamhouse Adventures\" zestaw zawiera wszystkie akcesoria niezbędne podczas wyprawy. Nie zapomnij zabrać ze sobą także pieska. W zestawie:  lalka Barbie w modnym stroju i butach, szczeniaczek, walizka, plecak, naklejki, 10 akcesoriów podróżnych, Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Zabawka dla dzieci w wieku od 3 lat.', '', 'barbie-barbie-w-podrozy-lalka-z-akcesoriami-i-naklejkami', '', '', '', 'Barbie, Barbie w podróży, lalka z akcesoriami i naklejkami', '', '', '', ''),
(84, 1, 2, 'Wyrusz z ulubioną lalką Barbie w w fascynującą podróż. Ten inspirowany serialem \"Barbie Dreamhouse Adventures\" zestaw zawiera wszystkie akcesoria niezbędne podczas wyprawy. Nie zapomnij zabrać ze sobą także pieska. W zestawie:  lalka Barbie w modnym stroju i butach, szczeniaczek, walizka, plecak, naklejki, 10 akcesoriów podróżnych, Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Zabawka dla dzieci w wieku od 3 lat.', '', 'barbie-barbie-w-podrozy-lalka-z-akcesoriami-i-naklejkami', '', '', '', 'Barbie, Barbie w podróży, lalka z akcesoriami i naklejkami', '', '', '', ''),
(85, 1, 1, 'Ruszaj ku kempingowej przygodzie z lalkami Barbie inspirowanymi hitowym serialem Barbie \"It Takes Two My dwie. Ken jest ubrany w swój kempingowy strój:  niebiesko-białą kraciastą koszulę \"na guziki\", dżinsy z przetarciami i białe buciki sportowe. Wśród wyjątkowych akcesoriów są okulary przeciwsłoneczne, lornetka, mapa, \"przekąska\", butelka \"wody\" i otwierana lodówka turystyczna. Zbierz też inne lalki i zabawki Barbie, by bawić się całą paczką przyjaciół! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Dzieci od 3 roku życia pokochają odgrywanie ulubionych scen i wymyślanie własnych przygód z lalką Barbie i jej przyjaciółmi inspirowanymi bajką Barbie \"It Takes Two My dwie\".', '', 'barbie-kemping-kena-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kemping Kena, zestaw z lalką i akcesoriami', '', '', '', ''),
