(86, 1, 1, 'Interaktywna lalka z firmy Simba - New Born Baby W skład zestawu wchodzą:  akcesoria lekarskie, pieluszka, smoczek, nocnik, buteleczka. Lalka bobas ubrana jest w różowo biały kombinezon z krótkimi rękawkami i nogawkami ozdobiony wzorem i falbanka. Na główce laleczki jest dopasowana czapeczka. Lalkę można kąpać, ma ruchome nóżki, rączki i głowę. wielkość lalki:  38 cm', '', 'simba-new-born-baby-doktor-interaktywna-lalka-z-akcesoriami', '', '', '', 'Simba, New Born Baby, Doktor, interaktywna lalka z akcesoriami', '', '', '', ''),
(86, 1, 2, 'Interaktywna lalka z firmy Simba - New Born Baby W skład zestawu wchodzą:  akcesoria lekarskie, pieluszka, smoczek, nocnik, buteleczka. Lalka bobas ubrana jest w różowo biały kombinezon z krótkimi rękawkami i nogawkami ozdobiony wzorem i falbanka. Na główce laleczki jest dopasowana czapeczka. Lalkę można kąpać, ma ruchome nóżki, rączki i głowę. wielkość lalki:  38 cm', '', 'simba-new-born-baby-doktor-interaktywna-lalka-z-akcesoriami', '', '', '', 'Simba, New Born Baby, Doktor, interaktywna lalka z akcesoriami', '', '', '', ''),
(87, 1, 1, 'Smily Play, lalka Julka 32 cm w pudełku prezentowym odgrywanie ról 2+ Lalka Julka lubi, kiedy się nią opiekujesz i zabierasz ze sobą na spacery. Miękka lalka jest ubrana w czapkę, kombinezon z różnych faktur materiałów. Lalka, po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Podczas zabawy lalkami, zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju dziecka. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Lalki to nierozłączny element dzieciństwa. Zachęcają do aktywnej oraz kreatywnej zabawy, dają również możliwość stworzenia własnego świata. Dzięki nim uczymy się opiekuńczości oraz wrażliwości. Z lalką dziecku łatwiej jest wkroczyć w świat radości, strachu, euforii i smutku. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 32 cm Specyfikacja:   Wiek:  24m+  Wymiary produktu:  szer. 17 cm., wys. 33 cm., gł. 9,5 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-julka-lalka-32-cm', '', '', '', 'Smily Play, Julka, lalka, 32 cm', '', '', '', ''),
(87, 1, 2, 'Smily Play, lalka Julka 32 cm w pudełku prezentowym odgrywanie ról 2+ Lalka Julka lubi, kiedy się nią opiekujesz i zabierasz ze sobą na spacery. Miękka lalka jest ubrana w czapkę, kombinezon z różnych faktur materiałów. Lalka, po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Podczas zabawy lalkami, zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju dziecka. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Lalki to nierozłączny element dzieciństwa. Zachęcają do aktywnej oraz kreatywnej zabawy, dają również możliwość stworzenia własnego świata. Dzięki nim uczymy się opiekuńczości oraz wrażliwości. Z lalką dziecku łatwiej jest wkroczyć w świat radości, strachu, euforii i smutku. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 32 cm Specyfikacja:   Wiek:  24m+  Wymiary produktu:  szer. 17 cm., wys. 33 cm., gł. 9,5 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-julka-lalka-32-cm', '', '', '', 'Smily Play, Julka, lalka, 32 cm', '', '', '', ''),
(88, 1, 1, 'Lalka Stefii z kotkiem.  Lalka ubrana jest w strój z motywem kota z akcesoriami do opieki nad kotem.  Zaopiekuj się kotem.  Wymiary opakowania:  33 x 16 x 5 cm.  Wiek:  3+.', '', 'steffi-z-kotkiem-lalka-z-figurka-i-akcesoriami', '', '', '', 'Steffi z kotkiem, lalka z figurką i akcesoriami', '', '', '', ''),
(88, 1, 2, 'Lalka Stefii z kotkiem.  Lalka ubrana jest w strój z motywem kota z akcesoriami do opieki nad kotem.  Zaopiekuj się kotem.  Wymiary opakowania:  33 x 16 x 5 cm.  Wiek:  3+.', '', 'steffi-z-kotkiem-lalka-z-figurka-i-akcesoriami', '', '', '', 'Steffi z kotkiem, lalka z figurką i akcesoriami', '', '', '', ''),
(89, 1, 1, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka. Lalka Bobas 41 cm od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę Lalka występuje w dwóch wersjach kolorystycznych:  fioletowo szarym, różowo niebieskim. Zawartość zestawu:  lalka bobas w czapeczce lub w opasce, butelka na mleko, torba na pieluchy, kaftanik, śliniak, maskotka dla bobasa. Produkt wykonany z tworzywa sztucznego oraz materiału. Wymiary produktu dł. (cm):  41 cm. Wymiary opakowania (cm):  32 x 35 x 12. Waga produktu bez opakowania (kg):  0,38 kg. Waga produktu w opakowaniu (kg):  0,57 kg. Nie wymaga zasilania bateriami. Przeznaczony dla dzieci w wieku:  3+.', '', 'mega-creative-lalka-bobas-z-akcesoriami-41-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 41 cm', '', '', '', ''),
(89, 1, 2, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka. Lalka Bobas 41 cm od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę Lalka występuje w dwóch wersjach kolorystycznych:  fioletowo szarym, różowo niebieskim. Zawartość zestawu:  lalka bobas w czapeczce lub w opasce, butelka na mleko, torba na pieluchy, kaftanik, śliniak, maskotka dla bobasa. Produkt wykonany z tworzywa sztucznego oraz materiału. Wymiary produktu dł. (cm):  41 cm. Wymiary opakowania (cm):  32 x 35 x 12. Waga produktu bez opakowania (kg):  0,38 kg. Waga produktu w opakowaniu (kg):  0,57 kg. Nie wymaga zasilania bateriami. Przeznaczony dla dzieci w wieku:  3+.', '', 'mega-creative-lalka-bobas-z-akcesoriami-41-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 41 cm', '', '', '', ''),
(90, 1, 1, 'Lalka Steffi Tęczowa Moda została stworzona przez bardzo cenioną i popularną firmę Simba, która od lat projektuje zabawki dla dzieci, dbając o ich wysoką jakość. Pochodzi ona z serii lalek Steffi Love uwielbianej przez dziewczynki. Steffi ma niebieskie oczy i długie blond włosy. Ubrana jest w piękną kolorową sukienkę w paski w kolorach tęczy. Do zestawu dołączono także:  3 pary butów na obcasie (w kolorze pomarańczowym, zielonym i różowym); 3 torebki, które Steffi może trzymać w dłoni (w kolorze niebieskim, czerwonym i żółtym); różowe okulary.  Zestaw z pewnością przypadnie do gustu każdej dziewczynce uwielbiającej lalki. Dzięki załączonym akcesoriom dziewczynki będą mogły tworzyć własne stylizacje dla Steffi. zabawka od 3. roku życia wysokość lalki:  29 cm w zestawie:  lalka, 3 pary butów na obcasie, 3 torebki oraz różowe okulary wymiary opakowania:  32,5x12x5 cm', '', 'steffi-teczowa-moda-lalka-z-akcesoriami', '', '', '', 'Steffi, Tęczowa Moda, lalka z akcesoriami', '', '', '', ''),
