(91, 1, 1, 'Lalka pluszowa z magnetycznym smoczkiem. Ubranko zdejmowane. Lalka jest bardzo miła w dotyku, miękka, ma widoczne palce i pępek. Wymiary:  38 cm (wysokość).', '', 'manhattan-toy-bobas-w-sukience-w-paski-lalka-ze-smoczkiem', '', '', '', 'Manhattan Toy, bobas w sukience w paski, lalka ze smoczkiem', '', '', '', ''),
(91, 1, 2, 'Lalka pluszowa z magnetycznym smoczkiem. Ubranko zdejmowane. Lalka jest bardzo miła w dotyku, miękka, ma widoczne palce i pępek. Wymiary:  38 cm (wysokość).', '', 'manhattan-toy-bobas-w-sukience-w-paski-lalka-ze-smoczkiem', '', '', '', 'Manhattan Toy, bobas w sukience w paski, lalka ze smoczkiem', '', '', '', ''),
(92, 1, 1, 'Evi robi swoje pierwsze gofry ze swoją nową gofrownicą. Pyszne gofry w kształcie serduszek można jeść na okrągło! W zestawie znajduje się:  gofrownica miska do robienia ciasta trzepaczka do ubijania jajek łyżka do nalewania ciasta łopatka do wyjmowania gofrów wałek talerzyk 6 szt. akcesoriów kuchennych 2 gofry Cechy:  Wymiary opakowania:  4,5x10x16 cm. Wysokość lalki:  12 cm. Wiek:  3+.', '', 'simba-lalka-evi-piecze-gofry', '', '', '', 'Simba, Lalka Evi piecze gofry', '', '', '', ''),
(92, 1, 2, 'Evi robi swoje pierwsze gofry ze swoją nową gofrownicą. Pyszne gofry w kształcie serduszek można jeść na okrągło! W zestawie znajduje się:  gofrownica miska do robienia ciasta trzepaczka do ubijania jajek łyżka do nalewania ciasta łopatka do wyjmowania gofrów wałek talerzyk 6 szt. akcesoriów kuchennych 2 gofry Cechy:  Wymiary opakowania:  4,5x10x16 cm. Wysokość lalki:  12 cm. Wiek:  3+.', '', 'simba-lalka-evi-piecze-gofry', '', '', '', 'Simba, Lalka Evi piecze gofry', '', '', '', ''),
(93, 1, 1, 'Zanurz się w świecie przygód z lalką Barbie \"Malibu\" Roberts inspirowaną bajką \"Barbie Mermaid Power Moc syrenek\"! Na magiczny wygląd syrenki lalki Barbie składają się bardzo długie niebieskie włosy i piękny ogon z efektem ombre, wspaniałymi akcentami i łuskami. Lalka ma także 2 wymienne płetwy, 2 tiary wysadzane \"klejnotami\", 2 naszyjniki i szczotkę do włosów, dlatego dzieci mogą tworzyć niesamowite stylizacje na każdą przygodę. Uroczy mały konik morski inspiruje do wspaniałych opowieści o przyjaźni. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Mermaid Power Moc syrenek dla dzieci od 3 roku życia inspirują do odtwarzania ulubionych filmowych momentów lub tworzenia własnych opowieści!', '', 'barbie-syrenka-malibu-lalka-filmowa', '', '', '', 'Barbie, Syrenka Malibu, lalka filmowa', '', '', '', ''),
(93, 1, 2, 'Zanurz się w świecie przygód z lalką Barbie \"Malibu\" Roberts inspirowaną bajką \"Barbie Mermaid Power Moc syrenek\"! Na magiczny wygląd syrenki lalki Barbie składają się bardzo długie niebieskie włosy i piękny ogon z efektem ombre, wspaniałymi akcentami i łuskami. Lalka ma także 2 wymienne płetwy, 2 tiary wysadzane \"klejnotami\", 2 naszyjniki i szczotkę do włosów, dlatego dzieci mogą tworzyć niesamowite stylizacje na każdą przygodę. Uroczy mały konik morski inspiruje do wspaniałych opowieści o przyjaźni. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Mermaid Power Moc syrenek dla dzieci od 3 roku życia inspirują do odtwarzania ulubionych filmowych momentów lub tworzenia własnych opowieści!', '', 'barbie-syrenka-malibu-lalka-filmowa', '', '', '', 'Barbie, Syrenka Malibu, lalka filmowa', '', '', '', ''),
(94, 1, 1, 'Maluchy w domu spędzą dzień bawiąc się z Nią i będą się świetnie bawić.  To lalka o miękkim ciele i miękkich w dotyku winylowych kończynach.  Wydziela delikatny aromat wanilii.  Jej ubrania i dodatki w odcieniach różu i bieli szyte są wyłącznie z wysokiej jakości materiałów.  Zawiera smoczek i wielofunkcyjną torbę do przechowywania wszystkich akcesoriów Twojego dziecka.  Zabawa lalkami jest bardzo korzystna dla najmłodszych, ponieważ pobudza uczucia, język, odpowiedzialność, a przede wszystkim wyobraźnię.', '', 'munecas-arias-nia-elegance-placzaca-lalka-bobas-rozowa-33-cm', '', '', '', 'Munecas Arias, Nia Elegance, płacząca lalka bobas, różowa, 33 cm', '', '', '', ''),
(94, 1, 2, 'Maluchy w domu spędzą dzień bawiąc się z Nią i będą się świetnie bawić.  To lalka o miękkim ciele i miękkich w dotyku winylowych kończynach.  Wydziela delikatny aromat wanilii.  Jej ubrania i dodatki w odcieniach różu i bieli szyte są wyłącznie z wysokiej jakości materiałów.  Zawiera smoczek i wielofunkcyjną torbę do przechowywania wszystkich akcesoriów Twojego dziecka.  Zabawa lalkami jest bardzo korzystna dla najmłodszych, ponieważ pobudza uczucia, język, odpowiedzialność, a przede wszystkim wyobraźnię.', '', 'munecas-arias-nia-elegance-placzaca-lalka-bobas-rozowa-33-cm', '', '', '', 'Munecas Arias, Nia Elegance, płacząca lalka bobas, różowa, 33 cm', '', '', '', ''),
(95, 1, 1, 'Lalka Julka to idealna towarzyszka spacerów dla małej opiekunki. Włóż ją do wózka, zabierz na spacer, zaproś na herbatkę. Przytul i baw się razem ze swoim bobaskiem. Lalka i jej ubrania wykonane są z wysokiej jakości materiałów. Dobrze dopracowane detale. Dziewczynka, która zaopiekuje się bobaskiem nauczy się:  Opiekować inną osobą Tworzyć i pielęgnować więzi Razem z Julką dziecko nauczy się angielskiego, ponad 60 słów angielskich i polskich Zaśpiewa trzy piosenki i wysłucha dwóch bajeczek:  Złotowłosa i 3 misie, Czerwony Kapturek Lalka ma 32 cm wysokości.  Wymiary:  32x18x8,5 cm. Wiek:  2+.', '', 'smily-play-julka-lalka-interaktywna-32-cm', '', '', '', 'Smily Play, Julka, lalka interaktywna, 32 cm', '', '', '', ''),
(95, 1, 2, 'Lalka Julka to idealna towarzyszka spacerów dla małej opiekunki. Włóż ją do wózka, zabierz na spacer, zaproś na herbatkę. Przytul i baw się razem ze swoim bobaskiem. Lalka i jej ubrania wykonane są z wysokiej jakości materiałów. Dobrze dopracowane detale. Dziewczynka, która zaopiekuje się bobaskiem nauczy się:  Opiekować inną osobą Tworzyć i pielęgnować więzi Razem z Julką dziecko nauczy się angielskiego, ponad 60 słów angielskich i polskich Zaśpiewa trzy piosenki i wysłucha dwóch bajeczek:  Złotowłosa i 3 misie, Czerwony Kapturek Lalka ma 32 cm wysokości.  Wymiary:  32x18x8,5 cm. Wiek:  2+.', '', 'smily-play-julka-lalka-interaktywna-32-cm', '', '', '', 'Smily Play, Julka, lalka interaktywna, 32 cm', '', '', '', '');
