(97, 1, 1, 'Baw się i wciel w rolę niani z zestawem Barbie Skipper z linii Klub Opiekunek Ten zestaw do zabawy Skipper Klub Opiekunek zawiera lalkę nianię, lalkę bobaska i spacerówkę, która podskakuje w górę i w dół podczas popychania Zainspiruj się do realistycznej zabawy, korzystając z akcesoriów, takich jak kocyk dla malucha, grzechotka, butelka i miś „przytulanka”. Lalka niania ma na sobie sukienkę na ramiączkach, a stylizację dopełniają buciki. Dzieci od 3 roku życia pokochają zabawę w nianię i troszczenie się o innych dzięki temu inspirującemu zestawowi do zabawy w opiekę i opowiadanie historii. Lalki nie stoją samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-opiekunka-skipper-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Opiekunka Skipper, zestaw z lalką i akcesoriami', '', '', '', ''),
(97, 1, 2, 'Baw się i wciel w rolę niani z zestawem Barbie Skipper z linii Klub Opiekunek Ten zestaw do zabawy Skipper Klub Opiekunek zawiera lalkę nianię, lalkę bobaska i spacerówkę, która podskakuje w górę i w dół podczas popychania Zainspiruj się do realistycznej zabawy, korzystając z akcesoriów, takich jak kocyk dla malucha, grzechotka, butelka i miś „przytulanka”. Lalka niania ma na sobie sukienkę na ramiączkach, a stylizację dopełniają buciki. Dzieci od 3 roku życia pokochają zabawę w nianię i troszczenie się o innych dzięki temu inspirującemu zestawowi do zabawy w opiekę i opowiadanie historii. Lalki nie stoją samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-opiekunka-skipper-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Opiekunka Skipper, zestaw z lalką i akcesoriami', '', '', '', ''),
(98, 1, 1, 'Laleczka Evi ubrana w tradycyjny strój z Ameryki Południowej, skąd pochodzi jej urocza podopieczna z gatunku wielbłądowatych. Laleczka propaguje zyskujący na popularności alpaca treking, czyli spacer z alpaką prowadzoną na smyczy w tempie narzuconym przez zwierzątko. Wysokość lalki:  12 cm', '', 'simba-evi-alpaca-lalka-12-cm', '', '', '', 'Simba, Evi, Alpaca, lalka, 12 cm', '', '', '', ''),
(98, 1, 2, 'Laleczka Evi ubrana w tradycyjny strój z Ameryki Południowej, skąd pochodzi jej urocza podopieczna z gatunku wielbłądowatych. Laleczka propaguje zyskujący na popularności alpaca treking, czyli spacer z alpaką prowadzoną na smyczy w tempie narzuconym przez zwierzątko. Wysokość lalki:  12 cm', '', 'simba-evi-alpaca-lalka-12-cm', '', '', '', 'Simba, Evi, Alpaca, lalka, 12 cm', '', '', '', ''),
(99, 1, 1, 'Zestawy Barbie Color Reveal Barbie z lalką z serii Słońce i deszcz dostarczą dzieciom mnóstwo radości podczas odkrywania aż 7 niespodzianek! Zabawa zaczyna się już przy otwieraniu opakowania:  otwórz tubkę i wyjmij lalkę Barbie® pokrytą farbką Color Reveal™ z nadrukiem chmurek oraz 4 torebki-niespodzianki z ukrytą zawartością. Wypełnij tubkę ciepłą wodą, włóż lalkę do środka i poruszaj nią – woda zmieni kolor na jasnoniebieski, dając magiczny efekt! Wyjmij lalkę, by sprawdzić, jak wygląda – każda lalka Barbie® ma długie pastelowe włosy z błyszczącymi pasemkami i gorset ozdobiony kropelkami deszczu lub kwiatami. Otwórz 4 torebki-niespodzianki, w których znajdziesz winylowy płaszcz przeciwdeszczowy w pastelowym odcieniu, winylowy kapelusz lub opaskę do włosów, parę kaloszy i szczotkę do włosów. Po zabawie przechowuj je w tubce. Użyj zimnej lub ciepłej wody, aby zmienić kolor ust i cienia do powiek Barbie® – tę niesamowitą transformację można powtarzać wiele razy! Znajdź też rzadką lalkę Barbie Color Reveal z serii Słońce i deszcz z brzoskwiniowymi włosami i zwierzątkiem Color Reveal. Zbierz wszystkie lalki, aby dowolnie wymieniać akcesoria i poszerzać możliwości zabawy. Doskonały prezent dla dzieci od 3 roku życia. UWAGA:  Wysyłka losowa.', '', 'barbie-color-reveal-kolorowa-niespodzianka-seria-slonce-i-deszcz-lalka-i-akcesoria-1-szt', '', '', '', 'Barbie, Color Reveal, Kolorowa niespodzianka, seria Słońce i deszcz, lalka i akcesoria, 1 szt.', '', '', '', ''),
