(100, 1, 1, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka, bobas posiada efekty dźwiękowe:  po naciśnięciu brzuszka lalka płacze, śmieje się i mówi Tata, lalka zamyka i otwiera oczy. Lalka Bobas od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zawartość zestawu:  lalka Bobas, nocnik, pieluszka, butelka, opakowanie chusteczek, śliniak i sukienka. Całość wykonana z plastiku, materiału oraz sztucznego włosia. Wymiary produktu dł. (cm):  lalka 35 cm. Wymiary opakowania (cm):  38 x 35 x 10. Waga produktu bez opakowania (kg):  0,24 kg. Waga produktu w opakowaniu (kg):  0,62 kg. Wymaga zasilania bateriami 3 x AG13-załączono do zestawu. Produkt przeznaczony dla dzieci w wieku:  3.', '', 'mega-creative-lalka-bobas-z-akcesoriami-35-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 35 cm', '', '', '', ''),
