(102, 1, 1, 'Otwórz nowe L.O.L. Surprise! O.M.G. lalki modowe z 20 niespodziankami. Lalki wspaniale się prezentują. mają piękne włosy i własny, olśniewający styl. Są starszymi siostrami ulubionych postaci L.O.L. Surprise! Doświadczenie podczas rozpakowywania jest całkowicie niepowtarzalne. Seria 6 – przeciwieństwa! Zbierz oba! Laleczka ma kilka punktów artykulacji co pomoże w łatwym przebieraniu, zajmowaniu odpowiednich póz, a także w tworzeniu najbardziej wymyślnych ewolucji.  Zestaw zawiera:  modną lalkę L.O.L. Surprise O.M.G. efektowny strój, buty, akcesoria zawodowe, stojak na lalkę i nie tylko! W zestawie znajdziesz aż 20 niespodzianek! Odpakuj sama wszystkie! Opakowanie stanie się idealnym zestawem do zabawy. Laleczka będzie mogła przechowywać później swoją garderobę w wygodnym opakowaniu z okienkiem.', '', 'lol-surprise-omg-melrose-lalka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Melrose, lalka modowa', '', '', '', ''),
