(104, 1, 1, 'Oto seria kolekcjonerskich lalek - bohaterów sagi Harry Potter! Mali czarodzieje oraz ich nauczyciele - zbierz je wszystkie! W zestawie:  lalka Ginny Weasley ubranko i płaszcz różdżka Cechy lalki:  niezwykła dbałość o szczegóły wygląd postaci jak w filmie wiele punktów artykulacji (przy ramionach, dłoniach, nogach i szyi) dla jeszcze lepszej zabawy ok 25 cm wysokości Wiek dziecka:  od 6 lat.', '', 'harry-potter-ginny-weasley-lalka-z-rozdzka', '', '', '', 'Harry Potter, Ginny Weasley, lalka z różdżką', '', '', '', ''),
(104, 1, 2, 'Oto seria kolekcjonerskich lalek - bohaterów sagi Harry Potter! Mali czarodzieje oraz ich nauczyciele - zbierz je wszystkie! W zestawie:  lalka Ginny Weasley ubranko i płaszcz różdżka Cechy lalki:  niezwykła dbałość o szczegóły wygląd postaci jak w filmie wiele punktów artykulacji (przy ramionach, dłoniach, nogach i szyi) dla jeszcze lepszej zabawy ok 25 cm wysokości Wiek dziecka:  od 6 lat.', '', 'harry-potter-ginny-weasley-lalka-z-rozdzka', '', '', '', 'Harry Potter, Ginny Weasley, lalka z różdżką', '', '', '', ''),
(105, 1, 1, 'Lalka 26 cm z pełnym winylowym ciałem i dopasowanymi ubraniami oraz kocem w różowo-białym kolorze. Zawiera dodatkową sukienkę, czapkę i smoczek. Winylowe ciało o lekkim zapachu wanilii. Jej ubrania, kocyk i dodatki w kolorze różowo-białym wykonane są z wysokiej jakości materiałów. Zawiera smoczek, koc, czapkę i dodatkową sukienkę.', '', 'munecas-arias-trousseau-lalka-26-cm', '', '', '', 'Munecas Arias, Trousseau, lalka, 26 cm', '', '', '', ''),
(105, 1, 2, 'Lalka 26 cm z pełnym winylowym ciałem i dopasowanymi ubraniami oraz kocem w różowo-białym kolorze. Zawiera dodatkową sukienkę, czapkę i smoczek. Winylowe ciało o lekkim zapachu wanilii. Jej ubrania, kocyk i dodatki w kolorze różowo-białym wykonane są z wysokiej jakości materiałów. Zawiera smoczek, koc, czapkę i dodatkową sukienkę.', '', 'munecas-arias-trousseau-lalka-26-cm', '', '', '', 'Munecas Arias, Trousseau, lalka, 26 cm', '', '', '', ''),
(106, 1, 1, 'Rainbow High, Rainbow Vision, Tiara Song, lalka modowa Epicka bitwa muzyczna - Najlepsze Szkoły Artystyczne z całego świata zmierzą się w konkursie muzycznym - Rainbow Vision. Zawodnicy z całego świata zabłysną swoimi prawdziwymi kolorami w epickiej bitwie, aby wyłonić JEDNEGO ZWYCIĘZCĘ! Jeden zwycięzca - Shadow High chce powstrzymać Rainbow High przed kolejną wygraną. Nie są to jednak jedyne szkoły biorące udział w konkursie. Do walki staje również znany na całym świecie K-popowy zespół, Royal Three, który przyjechał tu, aby wygrać! Tiara - Tiara Song ma unikalny design i ubrana jest w odcienie fioletu i lilii. Ma wspaniały, dopracowany styl, piękne bardzo długie fioletowo-liliowe włosy, długie prawdziwe rzęsy i szklane oczy 2 stroje Mix &amp; Match - Tiara ubrana jest w gorset i spódnicę wysadzaną kryształkami i krótką kurteczkę z brokatowymi nitkami, buty oraz akcesoria. Jej druga stylizacja składa się ze spódnicy, body, stylowej pół-marynarki i obcasów w paski Mikrofon - Posiada ona wszystkie niezbędne dla zespołu akcesoria oraz merch zespołu. Ma swój własny mikrofon, dzięki czemu może występować i śpiewać bez statyw Band Merch - W zestawie znajduje się oficjalny merch zespołu, w tym t-shirt, książeczka z tekstami piosenek i mini plakat zespołu. Zestaw zapewni dzieciom niekończącą się radość i pomysłową zabawę oraz będą mogły same walczyć na Rainbow Vision', '', 'rainbow-high-rainbow-vision-tiara-song-lalka-modowa', '', '', '', 'Rainbow High, Rainbow Vision, Tiara Song, lalka modowa', '', '', '', ''),
(106, 1, 2, 'Rainbow High, Rainbow Vision, Tiara Song, lalka modowa Epicka bitwa muzyczna - Najlepsze Szkoły Artystyczne z całego świata zmierzą się w konkursie muzycznym - Rainbow Vision. Zawodnicy z całego świata zabłysną swoimi prawdziwymi kolorami w epickiej bitwie, aby wyłonić JEDNEGO ZWYCIĘZCĘ! Jeden zwycięzca - Shadow High chce powstrzymać Rainbow High przed kolejną wygraną. Nie są to jednak jedyne szkoły biorące udział w konkursie. Do walki staje również znany na całym świecie K-popowy zespół, Royal Three, który przyjechał tu, aby wygrać! Tiara - Tiara Song ma unikalny design i ubrana jest w odcienie fioletu i lilii. Ma wspaniały, dopracowany styl, piękne bardzo długie fioletowo-liliowe włosy, długie prawdziwe rzęsy i szklane oczy 2 stroje Mix &amp; Match - Tiara ubrana jest w gorset i spódnicę wysadzaną kryształkami i krótką kurteczkę z brokatowymi nitkami, buty oraz akcesoria. Jej druga stylizacja składa się ze spódnicy, body, stylowej pół-marynarki i obcasów w paski Mikrofon - Posiada ona wszystkie niezbędne dla zespołu akcesoria oraz merch zespołu. Ma swój własny mikrofon, dzięki czemu może występować i śpiewać bez statyw Band Merch - W zestawie znajduje się oficjalny merch zespołu, w tym t-shirt, książeczka z tekstami piosenek i mini plakat zespołu. Zestaw zapewni dzieciom niekończącą się radość i pomysłową zabawę oraz będą mogły same walczyć na Rainbow Vision', '', 'rainbow-high-rainbow-vision-tiara-song-lalka-modowa', '', '', '', 'Rainbow High, Rainbow Vision, Tiara Song, lalka modowa', '', '', '', ''),
(107, 1, 1, 'Lalka z garderobą i akcesoriami. Stwórz własny styl i ubierz lalkę jak chcesz! Znudziła Ci się stylizacja? Zmień ją i baw się dalej. Lalka ma piękne blond włosy które możesz czesać i stylizować. Wybierz jeden ze strojów, dobierz buty, torebkę i ułóż włosy. Piękna różowa zamykana garderoba w której zmieścisz wszystkie elementy zestawu. Możesz powiesić ubrania na wieszakach i utrzymać w szafie porządek. Po skończonej zabawie garderobę można zamknąć drzwiczki i dzięki rączce zabrać wszędzie ze sobą. W zestawie znajdują się:  lalka w gotowej stylizacji, 8 różowych wieszaków, 7 strojów, 6 par butów, 3 torebki, 2 pary okularów, lusterko i grzebyk, naklejki i akcesoria. Wysokość lalki:  29cm Wymiary garderoby (złożonej):  33 x 38 x 9 cm Wymiary garderoby (rozłożona):  65,5 x 38 x 9 cm Wymiary opakowania:  40 x 47 x 12 cm Wiek:  3+', '', 'gazelo-lalka-z-akcesoriami-garderoba', '', '', '', 'Gazelo, lalka z akcesoriami, garderoba', '', '', '', ''),
