(108, 1, 1, 'Ten zestaw Barbie Extra Deluxe z lalką i ubrankami pozwala wyznaczać trendy dzięki ponad 15 modnym elementom, które można dowolnie łączyć, by stworzyć ponad 30 niezwykłych stylizacji. Ubranka podkreślają niezwykły styl Barbie:  różowy futerkowy płaszcz, dwukolorowa kwiecista sukienka, winylowa spódniczka, czarne spodnie i 3 bluzki:  1 z nadrukiem w kropki, 1 z falbankami i 1 z kokardką. Wśród modnych akcesoriów są torebka w kształcie szminki, pasek z logo Barbie, okulary przeciwsłoneczne, opaska do włosów z \"perełkami\", 2 pary bucików i biżuteria. Lalka Barbie z punktami zgięcia ma długie, różowe włosy, które zostały pokarbowane i częściowo upięte na górze. Piesek też jest niezwykle modny - ma kokardkę z \"perełkami\", obrożę i uroczą minkę. W zestawie:  lalka Barbie (29 cm) w sukience, bucikach i z dodatkami, 1 figurka zwierzątka, 1 torebka, 1 para bucików, 1 spódniczka, 3 bluzki, 1 płaszcz, 1 para spodni, 1 opaska na głowę, 1 naszyjnik, 1 para okularów przeciwsłonecznych. Wiek dziecka:  od 3 lat.', '', 'barbie-extra-lalka-deluxe-z-akcesoriami', '', '', '', 'Barbie Extra, lalka deluxe z akcesoriami', '', '', '', ''),
(108, 1, 2, 'Ten zestaw Barbie Extra Deluxe z lalką i ubrankami pozwala wyznaczać trendy dzięki ponad 15 modnym elementom, które można dowolnie łączyć, by stworzyć ponad 30 niezwykłych stylizacji. Ubranka podkreślają niezwykły styl Barbie:  różowy futerkowy płaszcz, dwukolorowa kwiecista sukienka, winylowa spódniczka, czarne spodnie i 3 bluzki:  1 z nadrukiem w kropki, 1 z falbankami i 1 z kokardką. Wśród modnych akcesoriów są torebka w kształcie szminki, pasek z logo Barbie, okulary przeciwsłoneczne, opaska do włosów z \"perełkami\", 2 pary bucików i biżuteria. Lalka Barbie z punktami zgięcia ma długie, różowe włosy, które zostały pokarbowane i częściowo upięte na górze. Piesek też jest niezwykle modny - ma kokardkę z \"perełkami\", obrożę i uroczą minkę. W zestawie:  lalka Barbie (29 cm) w sukience, bucikach i z dodatkami, 1 figurka zwierzątka, 1 torebka, 1 para bucików, 1 spódniczka, 3 bluzki, 1 płaszcz, 1 para spodni, 1 opaska na głowę, 1 naszyjnik, 1 para okularów przeciwsłonecznych. Wiek dziecka:  od 3 lat.', '', 'barbie-extra-lalka-deluxe-z-akcesoriami', '', '', '', 'Barbie Extra, lalka deluxe z akcesoriami', '', '', '', ''),
(109, 1, 1, 'Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka animowanej bajki, podaruj mu wyjątkowy prezent - lalkę przedstawiającą Alix Kubdel jako superbohaterkę o imieniu Królix! Alix Kubdel to uczennica szkoły Collège Françoise Dupont. Jest chłopczycą - ma krótkie, czerwone włosy, które sterczą na wszystkie strony. Ma złote kolczyki zarówno w nosie, jak i w uszach. Nosi też czarne gogle. Alix jest pewna siebie, odważna i uwielbia wyzwania, ale bywa również uparta i lekkomyślna. Jest też emocjonalna i często mówi to, co myśli, jednak po czasie uświadamia sobie własne błędy. Nie lubi integrować się z klasą. Z pomocą Fluff – Kwami królika, które zwane jest również Kwami ewolucji - może zmienić się w superbohaterkę, Królix. Fluff, Rusz wskazówki! Lalka ma 26 cm i aż 15 ruchomych punktów, w tym zginające się ręce i nogi! Do lalki dołączone są także akcesoria:  figurka Fluff - Kwami królika - oraz opaska z białymi króliczymi uszami. Lalka jest ubrana w charakterystyczny niebiesko-biało-czarny kostium, a jej twarz zakrywa niebiesko-biała maska z czarnymi elementami. Ma też białe botki, które można zdejmować. Odtwórz wszystkie niesamowite sceny akcji z serialu! Zbierz całą kolekcję Miraculowych lalek! Wiek:  4+', '', 'miraculous-biedronka-i-czarny-kot-krolix-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Królix, lalka', '', '', '', ''),
