(110, 1, 1, 'Lalka bobas z dźwiękiem. Mówi i śpiewa po polsku. Ma duże, urocze oczy z długimi rzęsami. Bobas ubrany jest w białą bluzeczkę z długim rękawkiem, tiulową spódniczkę oraz różowe spodenki. Na głowie śliczna koronkowa czapeczka z kwiatkiem. Dołączony jest również biały smoczek. Główka, rączki i nóżki bobaska wykonane zostały z przyjemnego w dotyku tworzywa, zaś tułów posiada miękkie wypełnienie. Lalka w prezentowym pudełku Zabawka wymaga użycia baterii:  3 x LR44-1,5V (dołączone). Przed użyciem należy wyciągnąć zawleczkę. Wymiary opakowania:  54x31cm Wielkość Lalki:  40 cm Wiek:  3+', '', 'adar-lalka-bobas-zabawka-z-dzwiekiem', '', '', '', 'Adar, lalka, bobas, zabawka z dźwiękiem', '', '', '', ''),
(110, 1, 2, 'Lalka bobas z dźwiękiem. Mówi i śpiewa po polsku. Ma duże, urocze oczy z długimi rzęsami. Bobas ubrany jest w białą bluzeczkę z długim rękawkiem, tiulową spódniczkę oraz różowe spodenki. Na głowie śliczna koronkowa czapeczka z kwiatkiem. Dołączony jest również biały smoczek. Główka, rączki i nóżki bobaska wykonane zostały z przyjemnego w dotyku tworzywa, zaś tułów posiada miękkie wypełnienie. Lalka w prezentowym pudełku Zabawka wymaga użycia baterii:  3 x LR44-1,5V (dołączone). Przed użyciem należy wyciągnąć zawleczkę. Wymiary opakowania:  54x31cm Wielkość Lalki:  40 cm Wiek:  3+', '', 'adar-lalka-bobas-zabawka-z-dzwiekiem', '', '', '', 'Adar, lalka, bobas, zabawka z dźwiękiem', '', '', '', ''),
(111, 1, 1, 'Ta słodka lalka będzie idealną towarzyszką przygód! Nosidełko jest bardzo lekkie i wygodne, dzięki czemu zawsze możesz je nosić przy sobie. Jest to niemowlę o miękkim ciele i winylowych kończynach, które są miękkie w dotyku o lekkim zapachu wanilii. Jej ubranka i nosidełko w odcieniach różu i bieli wykonane są z wysokiej jakości materiałów. Poza tym będzie potrzebowała dużo przytulania, bo jeśli ściśniesz jego brzuszek, będzie płakała. Zawiera smoczek i nosidełko jako akcesoria.', '', 'munecas-arias-erea-placzaca-lalka-z-kolyska-33-cm', '', '', '', 'Munecas Arias, Erea, płacząca lalka z kołyską, 33 cm', '', '', '', ''),
(111, 1, 2, 'Ta słodka lalka będzie idealną towarzyszką przygód! Nosidełko jest bardzo lekkie i wygodne, dzięki czemu zawsze możesz je nosić przy sobie. Jest to niemowlę o miękkim ciele i winylowych kończynach, które są miękkie w dotyku o lekkim zapachu wanilii. Jej ubranka i nosidełko w odcieniach różu i bieli wykonane są z wysokiej jakości materiałów. Poza tym będzie potrzebowała dużo przytulania, bo jeśli ściśniesz jego brzuszek, będzie płakała. Zawiera smoczek i nosidełko jako akcesoria.', '', 'munecas-arias-erea-placzaca-lalka-z-kolyska-33-cm', '', '', '', 'Munecas Arias, Erea, płacząca lalka z kołyską, 33 cm', '', '', '', ''),
(112, 1, 1, 'Bobasy Cry Babies powracają w nowej odsłonie! Teraz mają nowy wygląd! Po raz pierwszy mają na sobie urocze, zdejmowane ubranka! Wyróżniają je prawdziwe, kolorowe włosy i śliczne, kryształowe oczka. Lalki są lżejsze i mają bardziej miękką twarzyczkę. Bobasy płaczą prawdziwymi łzami, wydając przy tym autentyczne odgłosy płaczącego malucha. Przytul je i daj im smoczek, a od razu się uspokoją! Aby laleczka zaczęła płakać:  wystarczy wlać wodę do specjalnego pojemnika umieszczonego z tyłu jej głowy i nacisnąć przycisk znajdujący się poniżej włączyć laleczkę i wyciągnąć smoczek z jej ust. Bobas ubrany jest w śliczne, spersonalizowane ubranko biedronki (kurteczka, spodenki, buciki). Wymagane baterie 2xAAA w zestawie. Wiek dziecka:  powyżej 18. miesiąca życia', '', 'tm-toys-cry-babies-dressy-lady-lalka-interaktywna-bobas', '', '', '', 'TM Toys, Cry Babies, Dressy Lady, lalka interaktywna bobas', '', '', '', ''),
(112, 1, 2, 'Bobasy Cry Babies powracają w nowej odsłonie! Teraz mają nowy wygląd! Po raz pierwszy mają na sobie urocze, zdejmowane ubranka! Wyróżniają je prawdziwe, kolorowe włosy i śliczne, kryształowe oczka. Lalki są lżejsze i mają bardziej miękką twarzyczkę. Bobasy płaczą prawdziwymi łzami, wydając przy tym autentyczne odgłosy płaczącego malucha. Przytul je i daj im smoczek, a od razu się uspokoją! Aby laleczka zaczęła płakać:  wystarczy wlać wodę do specjalnego pojemnika umieszczonego z tyłu jej głowy i nacisnąć przycisk znajdujący się poniżej włączyć laleczkę i wyciągnąć smoczek z jej ust. Bobas ubrany jest w śliczne, spersonalizowane ubranko biedronki (kurteczka, spodenki, buciki). Wymagane baterie 2xAAA w zestawie. Wiek dziecka:  powyżej 18. miesiąca życia', '', 'tm-toys-cry-babies-dressy-lady-lalka-interaktywna-bobas', '', '', '', 'TM Toys, Cry Babies, Dressy Lady, lalka interaktywna bobas', '', '', '', ''),
(113, 1, 1, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-181', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 181', '', '', '', ''),
(113, 1, 2, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-181', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 181', '', '', '', ''),
(114, 1, 1, 'Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka animowanej bajki, podaruj mu wyjątkowy prezent – lalkę przedstawiającą Królową Pszczół! Od teraz będzie mogło się bawić w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Lalka została wykonana z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Dzięki ruchomym elementom, Twoje dziecko może ożywić ulubioną postać z serialu Miraculum:  Biedronka i Czarny Kot oraz ponownie przeżywać ratowanie Paryża. Lalka Królowa Pszczół ma 26 cm i jest wyposażona w znaną z serialu broń w postaci ula oraz Kwami, które dodatkowo urozmaicą zabawę. Strój i buty Królowej Pszczół można zdejmować. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-krolowa-pszczol-lalka-26-cm', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Królowa Pszczół, lalka, 26 cm', '', '', '', ''),
