(115, 1, 1, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach. Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka Barbie ma oryginalną fryzurę z bardzo długimi blond włosami, ozdobioną warkoczykiem i serduszkami. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się kolorowa góra z kwiatowym nadrukiem, dopasowane do niej dżinsowe szorty z falbanką, przezroczyste ponczo i białe buciki do kostki. Akcesoria obejmują torebkę w kształcie koszyka piknikowego, kwiatowe okulary przeciwsłoneczne w stylu retro oraz mnóstwo odważnej biżuterii, która inspiruje do wyrażania siebie i zabawy w opowiadanie historii. Króliczek też jest niesamowicie stylowy - ma zdejmowany kapelusik, złocistą biżuterię i uroczą minkę. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-12', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 12', '', '', '', ''),
(115, 1, 2, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach. Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka Barbie ma oryginalną fryzurę z bardzo długimi blond włosami, ozdobioną warkoczykiem i serduszkami. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się kolorowa góra z kwiatowym nadrukiem, dopasowane do niej dżinsowe szorty z falbanką, przezroczyste ponczo i białe buciki do kostki. Akcesoria obejmują torebkę w kształcie koszyka piknikowego, kwiatowe okulary przeciwsłoneczne w stylu retro oraz mnóstwo odważnej biżuterii, która inspiruje do wyrażania siebie i zabawy w opowiadanie historii. Króliczek też jest niesamowicie stylowy - ma zdejmowany kapelusik, złocistą biżuterię i uroczą minkę. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-12', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 12', '', '', '', ''),
(116, 1, 1, 'Lalka dzidziuś Sasha belgijskiej marki Lilliputiens jest idealna do tulenia, usypiania, uspokajania, zabierania na spacer czy zabawy w dom. Lalka jest duża – ma aż 36 cm wzrostu, a do tego perfekcyjnie wykończona, z dbałością o każdy szczegół i bezpieczna dla dziecka:  oczy i buzia lalki są wyszywane, u rąk i nóg ma paluszki, na brzuszku pępuszek, a na głowie zabawnie zmierzwione dłuższe ciemne włoski. Lalkę można sadzać i przebierać. Ma zdejmowany rampers w botaniczny wzór z ukrytym między liśćmi Lemurem Georgem, pieluszkę i zawieszkę ze smoczkiem, który – dzięki magnesowi – można umieścić przy jej ustach. Zabawka pozwala dziecku ogrywać role i oswajać codzienność, pomaga także w rozwoju empatii. Idealnie nadaje się na prezent. Myć wyłącznie powierzchniowo. Szczegóły:  wiek rekomendowany:  2 lata + materiał:  poliester wymiary produktu:  11 x 29 x 36 cm bezpieczeństwo i jakość:  EN71, CE, ASTM, ISO 9001 Lilliputiens to belgijska marka, założona w 1995 roku przez dwójkę pasjonatów rodzimych produktów dla dzieci. Zespół kreatywny marki tworzą głównie mamy, które potrafią znajdować najlepsze odpowiedzi na potrzeby dzieci i najlepiej wiedzą czego maluchy oczekują od zabawek na kolejnych etapach swojego rozwoju. To dlatego produkty Lilliputiens nigdy nie są tylko tym, czym się na początku wydają. Każdy z nich ma ukryte funkcje, zaskakuje, rozbudza ciekawość i zachęca do nowych odkryć. Produkowane na bazie tkanin, miękkie, cudownie kolorowe i budzące pozytywne emocje zabawki wyróżniają się wyjątkową jakością i fascynującą kreatywnością. Ideą marki jest, poprzez niezwykłe zabawki, oferowanie pomocy rodzicom w wychowywaniu twórczego i otwartego pokolenia. Jeśli szukasz stymulujących, pięknych i całkowicie bezpiecznych zabawek, z cudownymi detalami, które zachwycą nie tylko dzieci, ale nawet Ciebie, odkryj Lilliputiens! Lilliputiens - A world full of little wonders.', '', 'lilliputiens-dzidzius-sasha-duza-lalka-36-cm', '', '', '', 'Lilliputiens, dzidziuś Sasha, duża lalka, 36 cm', '', '', '', ''),
