 duża lalka, 36 cm', '', '', '', ''),
(117, 1, 1, 'Lalka Kevin w nowoczesnym, stylowym stroju. Wiek dziecka:  od 3 lat. UWAGA! Dwa warianty - towar wysyłany losowo.', '', 'simba-kevin-w-letnim-stroju-lalka', '', '', '', 'Simba, Kevin w letnim stroju, lalka', '', '', '', ''),
(117, 1, 2, 'Lalka Kevin w nowoczesnym, stylowym stroju. Wiek dziecka:  od 3 lat. UWAGA! Dwa warianty - towar wysyłany losowo.', '', 'simba-kevin-w-letnim-stroju-lalka', '', '', '', 'Simba, Kevin w letnim stroju, lalka', '', '', '', ''),
(118, 1, 1, 'Lalka Natalia chodząca Po klaśnięciu dwa razy w dłonie lalka chodzi, śpiewa, mówi po polsku Ma zamykające się oczy', '', 'artyk-natalia-lalka-chodzaca-40-cm', '', '', '', 'Artyk, Natalia, lalka chodząca, 40 cm', '', '', '', ''),
(118, 1, 2, 'Lalka Natalia chodząca Po klaśnięciu dwa razy w dłonie lalka chodzi, śpiewa, mówi po polsku Ma zamykające się oczy', '', 'artyk-natalia-lalka-chodzaca-40-cm', '', '', '', 'Artyk, Natalia, lalka chodząca, 40 cm', '', '', '', ''),
(119, 1, 1, 'Przenieś się do bajkowego świata Miraculous, gdzie nad bezpieczeństwem ludzkości czuwa zgrany duet super bohaterów – Biedronka i Czarny Kot. Ich zadaniem jest ochrona Paryża przed czarnym charakterem – Władcą Ciem oraz walka z przestępczością na terenie miasta. Zarówno Biedronka jak i Czarny Kot są w posiadaniu Miraculum, które dają im ogromną moc, odwagę i szybkość.  Jeśli twoje dziecko marzy, aby do jego kolekcji zabawek dołączyli ulubieni bohaterowie serialu animowanego ze znanego dziecięcego kanału telewizyjnego to podaruj mu lalki, które wywołają uśmiech na jego twarzy. Zabawki wiernie odwzorowują bajkowe postacie, są wykonane z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Niech twoja pociecha weźmie w dłonie figurki głównych bohaterów i wykona gest przybicia piąstki, który zwieńczy pomyślnie wykonaną misję. Zabawki dedykowane są dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-zestaw-lalek', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, zestaw lalek', '', '', '', ''),
(119, 1, 2, 'Przenieś się do bajkowego świata Miraculous, gdzie nad bezpieczeństwem ludzkości czuwa zgrany duet super bohaterów – Biedronka i Czarny Kot. Ich zadaniem jest ochrona Paryża przed czarnym charakterem – Władcą Ciem oraz walka z przestępczością na terenie miasta. Zarówno Biedronka jak i Czarny Kot są w posiadaniu Miraculum, które dają im ogromną moc, odwagę i szybkość.  Jeśli twoje dziecko marzy, aby do jego kolekcji zabawek dołączyli ulubieni bohaterowie serialu animowanego ze znanego dziecięcego kanału telewizyjnego to podaruj mu lalki, które wywołają uśmiech na jego twarzy. Zabawki wiernie odwzorowują bajkowe postacie, są wykonane z wysokiej jakości materiałów z dbałością o najdrobniejsze szczegóły. Niech twoja pociecha weźmie w dłonie figurki głównych bohaterów i wykona gest przybicia piąstki, który zwieńczy pomyślnie wykonaną misję. Zabawki dedykowane są dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-zestaw-lalek', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, zestaw lalek', '', '', '', ''),
(120, 1, 1, 'Lalka dzidziuś Lena belgijskiej marki Lilliputiens jest idealna do tulenia, usypiania, uspokajania, zabierania na spacer czy zabawy w dom. Laleczkę można przebierać, zabawiać, karmić i układać do snu. Jest perfekcyjnie wykończona, z dbałością o każdy szczegół i w pełni bezpieczna dla dziecka. Ma zdejmowaną brzoskwiniową sukienkę z wzorem w drzewka i różową pieluszkę. Oczy i buzia lalki są wyszywane, a miękkie jasne włoski z weluru uczesane w dwa zabawne sznurkowe koczki. W zestawie znajduje się dwustronna miękka gondola z daszkiem, łańcuchem z naszywkami oraz rączkami do przenoszenia, dwustronny kocyk-przewijak, mini komforter-jednorożec oraz pluszowa butelka mleka z magnesem, który pozwala przykładać ją do buzi laleczki, imitując karmienie. Idealnie nadaje się na prezent. Można prać w pralce w temperaturze do 30°C w delikatnym cyklu. Szczegóły:  wiek rekomendowany:  12 m+ materiał:  poliester, bawełna wymiary produktu:  19 x 27 x 20 cm bezpieczeństwo i jakość:  EN71, CE, ASTM, ISO 9001 Lilliputiens to belgijska marka, założona w 1995 roku przez dwójkę pasjonatów rodzimych produktów dla dzieci. Zespół kreatywny marki tworzą głównie mamy, które potrafią znajdować najlepsze odpowiedzi na potrzeby dzieci i najlepiej wiedzą czego maluchy oczekują od zabawek na kolejnych etapach swojego rozwoju. To dlatego produkty Lilliputiens nigdy nie są tylko tym, czym się na początku wydają. Każdy z nich ma ukryte funkcje, zaskakuje, rozbudza ciekawość i zachęca do nowych odkryć. Produkowane na bazie tkanin, miękkie, cudownie kolorowe i budzące pozytywne emocje zabawki wyróżniają się wyjątkową jakością i fascynującą kreatywnością. Ideą marki jest, poprzez niezwykłe zabawki, oferowanie pomocy rodzicom w wychowywaniu twórczego i otwartego pokolenia. Jeśli szukasz stymulujących, pięknych i całkowicie bezpiecznych zabawek, z cudownymi detalami, które zachwycą nie tylko dzieci, ale nawet Ciebie, odkryj Lilliputiens! Lilliputiens - A world full of little wonders.', '', 'lilliputiens-lena-lalka-dzidzius-w-gondoli-z-komforterem-i-butelka-mleka', '', '', '', 'Lilliputiens, Lena, lalka dzidziuś w gondoli z komforterem i butelką mleka', '', '', '', '');
