putiens-lena-lalka-dzidzius-w-gondoli-z-komforterem-i-butelka-mleka', '', '', '', 'Lilliputiens, Lena, lalka dzidziuś w gondoli z komforterem i butelką mleka', '', '', '', ''),
(121, 1, 1, 'Lalka siostrzyczka jednorożca o wysokości 43 cm. W zestawie 12 akcesoriów: butelka, szczotka do włosów, 4 spinki do włosów, 2 gumki do włosów, 2 bransoletki, para skrzydełek, 1 opaska na głowę.  Lala wygląda bardzo realistycznie, posiada 6 funkcji działających bez baterii. Wiek:  4+.', '', 'baby-born-lalka-siostrzyczka-jednorozca-43-cm', '', '', '', 'Baby Born, lalka siostrzyczka jednorożca, 43 cm', '', '', '', ''),
(121, 1, 2, 'Lalka siostrzyczka jednorożca o wysokości 43 cm. W zestawie 12 akcesoriów: butelka, szczotka do włosów, 4 spinki do włosów, 2 gumki do włosów, 2 bransoletki, para skrzydełek, 1 opaska na głowę.  Lala wygląda bardzo realistycznie, posiada 6 funkcji działających bez baterii. Wiek:  4+.', '', 'baby-born-lalka-siostrzyczka-jednorozca-43-cm', '', '', '', 'Baby Born, lalka siostrzyczka jednorożca, 43 cm', '', '', '', ''),
(122, 1, 1, 'Lalka bobas Sofia ma 45 cm i została wyprodukowana przez hiszpańską markę Llorens. Jest to wspaniała zabawka dla dzieci w każdym wieku. Sofia posiada ruchome rączki i nóżki dzięki czemu zabawa z nią jest bardzo urozmaicona. Jej ciałko wykonano z przyjemnego w dotyku winylu, dzięki czemu można ją kąpać zanurzając w wodzie do poziomu szyi. Przygotowana dla niej stylizacja składa się z różowego sweterka, spodenek, czapki i skarpetek. Do zestawu dołączono ozdobny smoczek. Lalka została zapakowana w ozdobny karton.', '', 'llorens-sofia-lalka-bobas-45-cm', '', '', '', 'Llorens, Sofia, lalka - bobas, 45 cm', '', '', '', ''),
(122, 1, 2, 'Lalka bobas Sofia ma 45 cm i została wyprodukowana przez hiszpańską markę Llorens. Jest to wspaniała zabawka dla dzieci w każdym wieku. Sofia posiada ruchome rączki i nóżki dzięki czemu zabawa z nią jest bardzo urozmaicona. Jej ciałko wykonano z przyjemnego w dotyku winylu, dzięki czemu można ją kąpać zanurzając w wodzie do poziomu szyi. Przygotowana dla niej stylizacja składa się z różowego sweterka, spodenek, czapki i skarpetek. Do zestawu dołączono ozdobny smoczek. Lalka została zapakowana w ozdobny karton.', '', 'llorens-sofia-lalka-bobas-45-cm', '', '', '', 'Llorens, Sofia, lalka - bobas, 45 cm', '', '', '', ''),
(123, 1, 1, 'L.O.L. Surprise O.M.G. Sports wkraczają do akcji! Modne, odważne, zwariowane. Dziewczyny kochają aktywność fizyczną, dlatego nawet poza salą fitness, czy boiskiem uwielbiają nosić ubrania w sportowej stylizacji! Od wyjść z koleżankami do kawiarni, czy na zakupy po spotkanie w bibliotece, z pewnością znajdą nowe modowe trendy, poznając przy tym nowych przyjaciół! Czy wy też oszaleliście na ich punkcie? O tak, LOL Surprise O.M.G. nie pozwolą nikomu przejść obojętnie. Mają wspaniałe stroje i akcesoria modowe, a ich absolutnie przepięknie wystylizowane fryzury i makijaże, zachwycają kolorystyką i oryginalnością. Czy jesteście gotowe na taką dawkę niespodzianek z LOL Surprise O.M.G.? L.O.L. Surprise O.M.G. to zabawa w odkrywanie z lalką typu „fashion”. Opakowanie skonstruowano tak, by dziewczynki na każdym etapie rozpakowywania kolejnych niespodzianek czuły dreszczyk emocji, otwierając aż 20 różnych elementów zestawu. Kolorowe pudełko doskonale koresponduje z tematyką serii. Wśród niespodzianek znajdują się akcesoria do stylizowania lalki, od odjazdowych ubrań, po oryginalne dodatki. Całość pozwala na stworzenie wyjątkowej stylizacji. Bo przecież lalki L.O.L. Surprise O.M.G. właśnie takie są – wyjątkowe i oryginalne! Zbierz wszystkie modne lalki LOL Surprise OMG Sports i przygotuj się na odkrywanie świata LOL Surprise! Cechy produktu:  Lalka O.M.G. Sports Dolls Odpakuj ponad 20 niespodzianek, w tym wiele akcesoriów sportowych i modowych, szczotkę do włosów i stojak na lalkę. Nowe pudełko z okienkiem Akcesoria z motywem sportowym Specyfikacja:  Wysokość lalki:  ok. 27 cm Wymiary opakowania:  31x25,5x7,5 cm Wiek:  3+', '', 'lol-surprise-omg-sports-doll-kicks-babe-lalka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Sports Doll, Kicks Babe, lalka modowa', '', '', '', ''),
