(125, 1, 1, 'Smily Play, lalka julka 39 cm w pudełku prezentowym odgrywanie ról 2+ Lalka Julka lubi, kiedy się nią opiekujesz i zabierasz ze sobą na spacery. Miękka lalka jest ubrana w czapkę, szalik, kombinezon z prążkowanymi spodniami oraz niebieską pikowaną kurteczkę obszytą prążkowanym materiałem w kolorze spodni. Lalka, po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Podczas zabawy lalkami, zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju dziecka. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Lalki to nierozłączny element dzieciństwa. Zachęcają do aktywnej oraz kreatywnej zabawy, dają również możliwość stworzenia własnego świata. Dzięki nim uczymy się opiekuńczości oraz wrażliwości. Z lalką dziecku łatwiej jest wkroczyć w świat radości, strachu, euforii i smutku. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 39 cm Specyfikacja:   Wiek:  24m+  Wymiary produktu:  szer. 20,5 cm., wys. 41 cm., gł. 11 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-julka-lalka-39-cm', '', '', '', 'Smily Play, Julka, lalka, 39 cm', '', '', '', ''),
