(129, 1, 1, 'InfluHeroes to całkowita nowość na polskim rynku zabawek. Ta wyjątkowa linia produktów została przygotowana we współpracy z topowymi influencerami:  Martyną Zabawą, Pawłem Malinowskim i Miss Agą, których średnia ilość wyświetleń na kanale YouTube łącznie wynosi ponad 18 milionów miesięcznie! Polska kolekcja InfluHeroes to część międzynarodowego projektu, angażującego najbardziej znanych influencerów z kategorii zabawek. Martyna Zabawa, Paweł Malinowski i Miss Aga są pierwszymi polskimi YouTuberami zaproszonymi do udziału w tak wyjątkowym projekcie. InfluHeroes to nowatorskie produkty, wykonane z niezwykłą dbałością o najdrobniejsze szczegóły, sygnowane przez znanych i lubianych influencerów młodego pokolenia, które z pewnością ucieszą wielu subskrybentów YouTube. Ta wyjątkowa lalka inspirowana jest wyglądem znanej i lubianej influencerki Miss Agi. Została wykonana z najwyższej jakości materiałów, z dbałością o najdrobniejsze szczegóły. Dopracowany styl, idealnie odwzorowane detale twarzy i charakterystyczna fryzura z pewnością zachwycą wszystkich fanów Miss Agi. Drugi komplet akcesoriów i ubrań na zmianę zapewni każdemu dziecku doskonałą zabawę, pozwoli wykreować oryginalną stylóweczkę i przeniesie je w magiczny świat mediów społecznościowych i Internetu.  Wysokość:  23 cm  Ruchome ręce i nogi  Stylowe akcesoria i ubrania na zmianę w zestawie  Wiek:  4+', '', 'influheroes-miss-aga-lalka-zestaw-z-akcesoriami', '', '', '', 'InfluHeroes, Miss Aga, lalka, zestaw z akcesoriami', '', '', '', ''),
