(132, 1, 1, 'Przedstawiamy ultramodne lalki Barbie Extra Fancy gotowe na WIELKIE wyjście w olśniewających kreacjach! Lalki Barbie Extra Fancy wyglądają olśniewająco dzięki pięknym strojom z luksusowymi detalami i akcesoriami oraz uroczym zwierzęcym towarzyszom. Ta lalka Barbie ma niezwykłą oryginalną fryzurę - bardzo długie blond włosy z grzywką i różowymi akcentami zostały upięte w wysoką kitkę. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się różowa suknia z błyszczącej sztucznej skóry premium z krótszym przodem i dłuższym tyłem ozdobiona dużymi kokardkami oraz rajstopy w serduszka. Różowe buciki na obcasie, perełkowe okulary przeciwsłoneczne, lustrzana torebka oraz mnóstwo biżuterii inspirują do wyrażania swojego stylu i kreatywnej zabawy. Jej piesek też jest niezwykle modny - ma piękny różowy kolor, kokardki i uroczą minkę. Lalki Barbie Extra Fancy to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-fancy-lalka-w-rozowym-stroju', '', '', '', 'Barbie, Extra Fancy, lalka w różowym stroju', '', '', '', ''),
