(133, 1, 1, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Wracają w nowym rozmiarze rozmiarze 11,5 cala (ok. 29 cm)! Siostry dają czadu cały dzień. Jesteśmy stylowymi diwami i maszerujemy w rytmie naszego własnego DJ-a. Jesteśmy mega. Wyróżniamy się z tłumu i same ustalamy zasady, które zaskoczą świat. W opakowaniu czeka aż 15 niespodzianek, efektowny strój, buty, akcesoria, stojak na lalkę i nie tylko! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Lady Diva akcesoria stojak na lalkę Zbierz całą kolekcję:  Fierce Royal Bee, Neonlicious, Swag', '', 'lol-surprise-o-m-g-fierce-lady-diva-lalka-modowa', '', '', '', 'L.O.L. Surprise, O. M. G. Fierce Lady Diva, lalka modowa', '', '', '', ''),
(133, 1, 2, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Wracają w nowym rozmiarze rozmiarze 11,5 cala (ok. 29 cm)! Siostry dają czadu cały dzień. Jesteśmy stylowymi diwami i maszerujemy w rytmie naszego własnego DJ-a. Jesteśmy mega. Wyróżniamy się z tłumu i same ustalamy zasady, które zaskoczą świat. W opakowaniu czeka aż 15 niespodzianek, efektowny strój, buty, akcesoria, stojak na lalkę i nie tylko! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Lady Diva akcesoria stojak na lalkę Zbierz całą kolekcję:  Fierce Royal Bee, Neonlicious, Swag', '', 'lol-surprise-o-m-g-fierce-lady-diva-lalka-modowa', '', '', '', 'L.O.L. Surprise, O. M. G. Fierce Lady Diva, lalka modowa', '', '', '', ''),
(134, 1, 1, 'Smily Play, Julka, sensoryczna lalka kucharz z akcesoriami do gotowania w pudełku prezentowym odgrywanie ról Lalka Kucharz lubi gotować, a ponadto jest ubrana w fartuszek, czapkę kucharską. W zestawie znajdują się akcesoria związane z zawodem. Zabawa w kucharza to znakomita okazja do nauki zasad zdrowego odżywiania. Lalka po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Zabawa w gotowanie, to znakomita okazja do nauki zasad zdrowego odżywiania, a używanie akcesoriów rozwija małą motorykę oraz usprawnia precyzję ruchów. Podczas zabawy zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Podczas zabawy lalką dziecko rozwija w sobie opiekuńczość i wrażliwość. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 35 cm Skład zestawu:   Miękka lalka  Widelec  Łyżka  Nóż  Patelnia  Garnek z przykrywką Specyfikacja:   Wiek:  36m+  Wymiary produktu:  szer. 28 cm., wys. 14,5 cm., gł. 24 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-kucharz-z-akcesoriami-do-gotowania-lalka-35-cm', '', '', '', 'Smily Play, kucharz z akcesoriami do gotowania, lalka, 35 cm', '', '', '', ''),
