(136, 1, 1, 'Oto przystojny blond Ken z delikatnym zarostem! Ken prezentuje się wyśmienicie w czarnej stylizacji. Kontrastowe białe buty dodają szyku! Ken posiada delikatny zarost oraz modną fryzurę. Lalka posiada wiele punktów artykulacji dla jeszcze lepszej zabawy. Lalka nie stoi samodzielnie. Wiek dziecka:  od 3 lat.', '', 'barbie-looks-blond-ken-z-zarostem-lalka', '', '', '', 'Barbie Looks, blond Ken z zarostem, lalka', '', '', '', ''),
