(137, 1, 1, 'Valeria mierząca 28 cm to dzieło hiszpańskiej marki Llorens, która dokłada wszelkich starań, by ich zabawki były wyjątkowe. Ta lalka to spełnienie marzeń każdej małej dziewczynki. Valeria jest ubrana w sukienkę z łączych materiałów, kurtkę z futerkowym kapturem i buty z kokardkami. Lalka ma blond włosy z grzywką, spięte w kok. Ta słodka buzia zachwyci każdego. Valeria ma niebieskie oczęta, pełne usta i mały nosek. Lalka jest wykonana z miękkiego winylu, a jej nóżki i rączki są ruchome, dzięki czemu możemy ją układać jak tylko chcemy. Lalka została zapakowana w ozdobny karton.', '', 'llorens-valeria-europejka-lalka-28-cm', '', '', '', 'Llorens, Valeria, Europejka, lalka, 28 cm', '', '', '', ''),
(137, 1, 2, 'Valeria mierząca 28 cm to dzieło hiszpańskiej marki Llorens, która dokłada wszelkich starań, by ich zabawki były wyjątkowe. Ta lalka to spełnienie marzeń każdej małej dziewczynki. Valeria jest ubrana w sukienkę z łączych materiałów, kurtkę z futerkowym kapturem i buty z kokardkami. Lalka ma blond włosy z grzywką, spięte w kok. Ta słodka buzia zachwyci każdego. Valeria ma niebieskie oczęta, pełne usta i mały nosek. Lalka jest wykonana z miękkiego winylu, a jej nóżki i rączki są ruchome, dzięki czemu możemy ją układać jak tylko chcemy. Lalka została zapakowana w ozdobny karton.', '', 'llorens-valeria-europejka-lalka-28-cm', '', '', '', 'Llorens, Valeria, Europejka, lalka, 28 cm', '', '', '', ''),
(138, 1, 1, 'Lalka Bambolina Smily Play przypomina prawdziwego bobasa. Pije i siusia jak małe dziecko więc trzeba się nią opiekować. Lalki, to najstarsze znane światu zabawki. Zaletą lalek jest to, że można się nimi wszędzie bawić. Cechy lalki:  Oczka lali zamykają się i otwierają. Ma dołączone akcesoria:  butelkę i stetoskop Lala ma realistyczny wygląd Pije i robi siusiu Zabawa lalką pobudza wyobraźnię i kreatywnoś, rozwija wrażliwość i opiekuńczość Wysokość:  33 cm Przeznaczona dla dzieci w wieku:  3+.', '', 'smily-play-bambolina-lalka-doktor-33-cm', '', '', '', 'Smily Play, Bambolina, Lalka doktor, 33 cm', '', '', '', ''),
(138, 1, 2, 'Lalka Bambolina Smily Play przypomina prawdziwego bobasa. Pije i siusia jak małe dziecko więc trzeba się nią opiekować. Lalki, to najstarsze znane światu zabawki. Zaletą lalek jest to, że można się nimi wszędzie bawić. Cechy lalki:  Oczka lali zamykają się i otwierają. Ma dołączone akcesoria:  butelkę i stetoskop Lala ma realistyczny wygląd Pije i robi siusiu Zabawa lalką pobudza wyobraźnię i kreatywnoś, rozwija wrażliwość i opiekuńczość Wysokość:  33 cm Przeznaczona dla dzieci w wieku:  3+.', '', 'smily-play-bambolina-lalka-doktor-33-cm', '', '', '', 'Smily Play, Bambolina, Lalka doktor, 33 cm', '', '', '', ''),
(139, 1, 1, 'Odtwarzaj swoje ulubione sceny z Harry\'ego Pottera dzięki zestawowi upominkowemu Luny Lovegood od Wizarding World! Dzięki dwóm różnym strojom i pięciu akcesoriom w zestawie ta 8-calowa lalka Luny Lovegood jest idealna do zabawy w tworzenie historii. To pozycja obowiązkowa dla fanów Harry\'ego Pottera. Urocze detale twarzy, miękkie, długie falowane włosy oraz pięć punktów zgięcia ożywiają ukochaną, ekscentryczną postać ze świata Harry\'ego Pottera. Luna jest gotowa na niekończące się czarujące przygody z dwoma strojami do wyboru! Może mieć na sobie różowo-fioletową bluzkę i fioletowe spodnie, znane z filmu o Księciu Półkrwi albo może być ubrana w mundurek Hogwartu sweter i spódnicę Ravenclaw. Umieść flagę Gryffindoru w dłoni Luny i załóż jej czapkę lwa, aby odtworzyć kultową scenę Quidditcha! Umieść różdżkę w dłoni Luny i ustaw ją, aby odtworzyć moment, w którym rzuca zaklęcie i wyczarowuje Patronusa w postaci królika (figurka w zestawie)! Ta 8-calowa lalka Luny Lovegood inspiruje wyobraźnię poprzez zabawę. Aby uzyskać jeszcze więcej sposobów na rozbudowanie czarodziejskiego świata, zbierz pozostałe 8-calowe zabawki ze świata Harry\'ego Pottera do swojej kolekcji (sprzedawane osobno)! Zestaw upominkowy Lony Lovegood oraz 8-calowe lalki ze świata Harry\'ego Pottera to świetne prezenty dla dziewczynek. Poczuj magię świata Harry\'ego Pottera dzięki zestawowi upominkowego Luny Lovegood od Wizarding World. Akcesoria w zestawie:  Lalka Luna Lovegood 2 stroje Para butów 5 akcesoriów Arkusz naklejek', '', 'wizarding-world-luna-lalka-8', '', '', '', 'Wizarding World, Luna, lalka 8\"', '', '', '', ''),
(139, 1, 2, 'Odtwarzaj swoje ulubione sceny z Harry\'ego Pottera dzięki zestawowi upominkowemu Luny Lovegood od Wizarding World! Dzięki dwóm różnym strojom i pięciu akcesoriom w zestawie ta 8-calowa lalka Luny Lovegood jest idealna do zabawy w tworzenie historii. To pozycja obowiązkowa dla fanów Harry\'ego Pottera. Urocze detale twarzy, miękkie, długie falowane włosy oraz pięć punktów zgięcia ożywiają ukochaną, ekscentryczną postać ze świata Harry\'ego Pottera. Luna jest gotowa na niekończące się czarujące przygody z dwoma strojami do wyboru! Może mieć na sobie różowo-fioletową bluzkę i fioletowe spodnie, znane z filmu o Księciu Półkrwi albo może być ubrana w mundurek Hogwartu sweter i spódnicę Ravenclaw. Umieść flagę Gryffindoru w dłoni Luny i załóż jej czapkę lwa, aby odtworzyć kultową scenę Quidditcha! Umieść różdżkę w dłoni Luny i ustaw ją, aby odtworzyć moment, w którym rzuca zaklęcie i wyczarowuje Patronusa w postaci królika (figurka w zestawie)! Ta 8-calowa lalka Luny Lovegood inspiruje wyobraźnię poprzez zabawę. Aby uzyskać jeszcze więcej sposobów na rozbudowanie czarodziejskiego świata, zbierz pozostałe 8-calowe zabawki ze świata Harry\'ego Pottera do swojej kolekcji (sprzedawane osobno)! Zestaw upominkowy Lony Lovegood oraz 8-calowe lalki ze świata Harry\'ego Pottera to świetne prezenty dla dziewczynek. Poczuj magię świata Harry\'ego Pottera dzięki zestawowi upominkowego Luny Lovegood od Wizarding World. Akcesoria w zestawie:  Lalka Luna Lovegood 2 stroje Para butów 5 akcesoriów Arkusz naklejek', '', 'wizarding-world-luna-lalka-8', '', '', '', 'Wizarding World, Luna, lalka 8\"', '', '', '', ''),
(140, 1, 1, 'Lalka w sukience z długim brązowym warkoczem. Posiada zginane ręce w łokciach oraz nadgarstkach. Występuje w 6 wzorach i kolorach. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Wielkość lalki:  29 cm. Zabawka przeznaczona dla dzieci w wieku:  3+ Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-lalka-29-cm', '', '', '', 'Mega Creative, lalka, 29 cm', '', '', '', ''),
(140, 1, 2, 'Lalka w sukience z długim brązowym warkoczem. Posiada zginane ręce w łokciach oraz nadgarstkach. Występuje w 6 wzorach i kolorach. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Wielkość lalki:  29 cm. Zabawka przeznaczona dla dzieci w wieku:  3+ Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-lalka-29-cm', '', '', '', 'Mega Creative, lalka, 29 cm', '', '', '', ''),
(141, 1, 1, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-sowa-sniezna-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka sowa śnieżna, 1 szt.', '', '', '', ''),
(141, 1, 2, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-sowa-sniezna-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka sowa śnieżna, 1 szt.', '', '', '', ''),
(142, 1, 1, 'Ten wyjątkowy, lśniący, 40-centymetrowy kabriolet Barbie w kolorze chromowanego różu ma dwa siedzenia i logo Barbie na masce oraz drzwiach. Sportowe koła, wysoka jakość i starannie wykonane detale wnętrza dodają mu realizmu, przenosząc dziecko do świata zabawy i fantazji.  Stylowy pilot zdalnego sterowania o częstotliwości 2,4 GHz gwarantuje bezawaryjne użytkowanie samochodu, a w dodatku ma kształt kierownicy, co zapewnia lepszą kontrolę i zabawę. Ten zdalnie sterowany samochód Barbie osiąga prędkość nawet 8 km/h! Zapewnia nieskończone możliwości świetnej zabawy i doskonale pasuje do innych zestawów z lalką Barbie, Kenem i akcesoriami. Można łączyć go z innymi zabawkami z tej kolekcji, aby wymyślać niesamowite, nowe historie. To idealny prezent dla każdej małej księżniczki! Zdalne sterowanie - pilot zdalnego sterowania ma kształt kierownicy, co zapewnia lepszą kontrolę i zabawę.  Prędkość - do 8 km/h.  Doskonały styl i świetna zabawa - wysoka jakość wykonania, dbałość o każdy detal, olśniewający różowy kolor i logo Barbie na masce oraz drzwiach zachwycą każdą małą księżniczkę! Autentyczny design Mattel.  Idealny prezent dla dziewczynki na każdą okazję.', '', 'barbie-kabriolet-pojazd-zdalnie-sterowany-rozowy', '', '', '', 'Barbie, kabriolet, pojazd zdalnie sterowany, różowy', '', '', '', ''),
