(145, 1, 1, 'Lalka bobas z dźwiękiem od firmy ADAR to zestaw dla najmłodszych dzieci, które uwielbiają wcielać się w role opiekunów. lala to uroczy bobasek, przypomina prawdziwe niemowlę ma śliczne, niebieskie oczy z długimi rzęsami ubrana jest w kaftanik, różowe śpioszki i różowe buciki na głowie ma różową czapeczkę w zestawie różowy smoczek po naciśnięciu na brzuszek lala mówi i śpiewa po polsku główka, rączki i nóżki bobaska wykonane zostały z przyjemnego w dotyku tworzywa, zaś tułów posiada miękkie wypełnienie. lalka w worku wielkość lalki:  35cm Zabawka wymaga użycia baterii: 3 x LR44-1,5V (dołączone). Przed użyciem należy wyciągnąć zawleczkę. Wymiary opakowania:  50x28,5c Wiek:  3+', '', 'adar-lalka-bobas-zabawka-z-dzwiekiem', '', '', '', 'Adar, lalka, bobas, zabawka z dźwiękiem', '', '', '', ''),
