(147, 1, 1, 'Rozpakowywanie lalek Barbie Cutie Reveal to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego króliczka. Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi dekoracjami na twarzy. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  błyszczącą spódniczkę, parę modnych bucików, gąbkę-grzebień, opaskę na głowę z króliczymi uszami i małego króliczka Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego polaru z nadrukiem tęczy. Dodatkowo głowa kostiumu zmienia się w legowisko dla króliczka. To jeszcze nie koniec niespodzianek - użyj zimnej wody, aby odsłonić inspirowany zwierzątkiem makijaż na buzi lalki Barbie oraz „zamykać i otwierać” oczy króliczka. Użyj ciepłej wody, aby wrócić do pierwotnego wyglądu. Tę magiczną transformację możesz powtarzać bez końca Wiek:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-krolik-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka królik z akcesoriami', '', '', '', ''),
