(148, 1, 1, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Wracają w nowym rozmiarze rozmiarze 11,5 cala (ok. 29 cm)! Siostry dają czadu cały dzień. Jesteśmy stylowymi diwami i maszerujemy w rytmie naszego własnego DJ-a. Jesteśmy mega. Wyróżniamy się z tłumu i same ustalamy zasady, które zaskoczą świat. W opakowaniu czeka aż 15 niespodzianek, efektowny strój, buty, akcesoria, stojak na lalkę i nie tylko! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Fierce Swag akcesoria stojak na lalkę Zbierz całą kolekcję:  Fierce Royal Bee, Neonlicious, Lady Diva', '', 'lol-surprise-o-m-g-fierce-swag-lalka-modowa', '', '', '', 'L.O.L. Surprise, O. M. G. Fierce Swag, lalka modowa', '', '', '', '');
