(150, 1, 2, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka. Lalka Bobas od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zawartość zestawu:  lalka Bobas. Wymiary produktu dł. (cm):  lalka - 28 cm. Wymiary opakowania (cm):  15 x 31 x 9. Waga produktu bez opakowania (kg):  0,25 kg. Waga produktu w opakowaniu (kg):  0,34 kg. Nie wymaga zasilania bateriami. Produkt przeznaczony dla dzieci w wieku:  18m+.', '', 'mega-creative-lalka-bobas', '', '', '', 'Mega Creative, lalka bobas', '', '', '', ''),
(151, 1, 1, 'Rainbow High Fashion Studio Ainsley Stwórz ponad 300 modnych, tęczowych stylizacji z Rainbow High Fashion Studio! Zawiera ekskluzywną lalkę Ainsley z wymiennymi tęczowymi strojami i akcesoriami! Luksusowy wieszak na ubrania na kółkach, wieszaki i przezroczysta skrzynka na buty ze złotymi detalami. Wyeksponuj i przechowuj wszystkie jej stylizacje! Zawiera lalkę do przebierania Ainsley Stwórz ponad 300 stylizacji dzięki ponad 35 strojom, w tym 10 ubraniom, 4 parom butów, wieszakom, spinkom i grzebieniowi Luksusowy złoty stojak na ubrania na kółkach 4 przezroczyste pudełka na kultowe buty Rainbow High Stojak na lalkę Wysokość lalki:  28 cm', '', 'rainbow-high-ainsley-lalka-modowa', '', '', '', 'Rainbow High, Ainsley, lalka modowa', '', '', '', ''),
