(155, 1, 1, 'Otwórz nowe L.O.L. Surprise! O.M.G. lalki modowe z 20 niespodziankami. Lalki wspaniale się prezentują. mają piękne włosy i własny, olśniewający styl. Są starszymi siostrami ulubionych postaci L.O.L. Surprise! Doświadczenie podczas rozpakowywania jest całkowicie niepowtarzalne. Seria 6 – przeciwieństwa! Zbierz oba! Laleczka ma kilka punktów artykulacji co pomoże w łatwym przebieraniu, zajmowaniu odpowiednich póz, a także w tworzeniu najbardziej wymyślnych ewolucji.  Zestaw zawiera:  modną lalkę L.O.L. Surprise O.M.G. efektowny strój, buty, akcesoria zawodowe, stojak na lalkę i nie tylko! W zestawie znajdziesz aż 20 niespodzianek! Odpakuj sama wszystkie! Opakowanie stanie się idealnym zestawem do zabawy. Laleczka będzie mogła przechowywać później swoją garderobę w wygodnym opakowaniu z okienkiem.', '', 'lol-surprise-omg-sketches-lalka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Sketches, lalka modowa', '', '', '', ''),
(155, 1, 2, 'Otwórz nowe L.O.L. Surprise! O.M.G. lalki modowe z 20 niespodziankami. Lalki wspaniale się prezentują. mają piękne włosy i własny, olśniewający styl. Są starszymi siostrami ulubionych postaci L.O.L. Surprise! Doświadczenie podczas rozpakowywania jest całkowicie niepowtarzalne. Seria 6 – przeciwieństwa! Zbierz oba! Laleczka ma kilka punktów artykulacji co pomoże w łatwym przebieraniu, zajmowaniu odpowiednich póz, a także w tworzeniu najbardziej wymyślnych ewolucji.  Zestaw zawiera:  modną lalkę L.O.L. Surprise O.M.G. efektowny strój, buty, akcesoria zawodowe, stojak na lalkę i nie tylko! W zestawie znajdziesz aż 20 niespodzianek! Odpakuj sama wszystkie! Opakowanie stanie się idealnym zestawem do zabawy. Laleczka będzie mogła przechowywać później swoją garderobę w wygodnym opakowaniu z okienkiem.', '', 'lol-surprise-omg-sketches-lalka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Sketches, lalka modowa', '', '', '', ''),
(156, 1, 1, 'Zestaw bez lalki Barbie! Garderoba Barbie inspiruje dzieci do tworzenia wciąż nowych stylizacji i niezliczonych historii!  Garderoba Barbie ma po otwarciu ponad 60 cm szerokości i zawiera ponad 15 miejsc do przechowywania, wysuwaną przestrzeń tworzącą drugi poziom, zsyp z koszem na pranie, duże lustro, biurko oraz ponad 35 elementów modowych (ubranka i akcesoria) do stworzenia ponad 400 stylizacji! W zestawie znajduje się 5 stylizacji - błyszcząca różowa sukienka na jedno ramię, urocza kwiecista sukienka, modny komplet z koszulką i spódniczką, strój ratowniczki z szortami i koszulką na ramiączkach oraz strój pielęgniarki składający się z koszulki i spodni. Szafa ma ukrytą, wysuwaną przestrzeń tworzącą drugi poziom, dodatkowe miejsca do przechowywania oraz zsyp z koszem na pranie, do którego możesz wrzucać ubranka. Po wybraniu stroju ustaw lalkę Barbie (nie znajduje się w zestawie) na podstawce, aby dokończyć stylizację i zobaczyć w dużym lustrze, jak modnie wygląda. Akcesoria obejmują między innymi 5 par bucików, biżuterię, daszek, torebkę, laptopa, otoskop i gwizdek. Możesz posadzić lalkę Barbie (nie znajduje się w zestawie) na krześle przy biurku z komputerem, aby odgrywać jeszcze więcej historyjek. Powieś ubranka lalki na 10 wieszakach oraz skorzystaj z dodatkowego miejsca do przechowywania w postaci półek i kosza na ubranka. Po skończonej zabawie zamknij szafę, którą za pomocą wygodnego uchwytu możesz przenosić, gdziekolwiek chcesz. Twórz własne modne historie z lalką Barbie (nie znajduje się w zestawie) i jej garderobą. To doskonały prezent dla dzieci w wieku od 3 lat, zwłaszcza tych, które kochają przebieranki!', '', 'barbie-garderoba-zestaw-akcesoriow-bez-lalki', '', '', '', 'Barbie, Garderoba, zestaw akcesoriów bez lalki', '', '', '', ''),
