(158, 1, 1, 'Przeżyj jeszcze raz niesamowity występ z lalką Barbie Brooklyn ubraną w strój znany z filmu „Barbie:  Big City, Big Dreams:  Wielkie miasto, wielkie marzenia”. Unieś rekę lalki i przyłóż mikrofon do ust Barbie, aby aktywować muzykę oraz światełka na sukience. Podnoś i opuszczaj rękę lalki, aby powtarzać niezwykły moment i cieszyć się porywającymi melodiami. Dzieci w wieku od 3 lat mogą dołączyć lalkę Barbie Malibu, aby stworzyć magiczny muzyczny duet i odgrywać niezwykłe przygody. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-big-city-big-dreams-brooklyn-muzyczna-lalka', '', '', '', 'Barbie, Big City, Big Dreams, Brooklyn, muzyczna lalka', '', '', '', ''),
(158, 1, 2, 'Przeżyj jeszcze raz niesamowity występ z lalką Barbie Brooklyn ubraną w strój znany z filmu „Barbie:  Big City, Big Dreams:  Wielkie miasto, wielkie marzenia”. Unieś rekę lalki i przyłóż mikrofon do ust Barbie, aby aktywować muzykę oraz światełka na sukience. Podnoś i opuszczaj rękę lalki, aby powtarzać niezwykły moment i cieszyć się porywającymi melodiami. Dzieci w wieku od 3 lat mogą dołączyć lalkę Barbie Malibu, aby stworzyć magiczny muzyczny duet i odgrywać niezwykłe przygody. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-big-city-big-dreams-brooklyn-muzyczna-lalka', '', '', '', 'Barbie, Big City, Big Dreams, Brooklyn, muzyczna lalka', '', '', '', ''),
