(159, 1, 2, 'Artyk Zabawki, lalka, bobas, 48 cm', '', 'artyk-zabawki-lalka-bobas-48-cm', '', '', '', 'Artyk Zabawki, lalka, bobas, 48 cm', '', '', '', ''),
(160, 1, 1, 'Lalka Barbie Totally Hair z motywem serduszek ma swój własny przebojowy styl i fryzurę, inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, metaliczną bluzkę, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Ta lalka Barbie drobniejszą sylwetkę niż standardowa, a do tego włosy w połowie czarne, a w połowie w barwach różu, niebieskiego i żółtego. Jest ubrana w kolorową sukienkę bez rękawów z nadrukiem w serduszka. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-serca-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Serca, lalka z akcesoriami', '', '', '', ''),
(160, 1, 2, 'Lalka Barbie Totally Hair z motywem serduszek ma swój własny przebojowy styl i fryzurę, inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, metaliczną bluzkę, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Ta lalka Barbie drobniejszą sylwetkę niż standardowa, a do tego włosy w połowie czarne, a w połowie w barwach różu, niebieskiego i żółtego. Jest ubrana w kolorową sukienkę bez rękawów z nadrukiem w serduszka. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-serca-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Serca, lalka z akcesoriami', '', '', '', ''),
(161, 1, 1, ', Julka, sensoryczna lalka z akcesoriami lekarz w pudełku prezentowym odgrywanie ról Lalka Julka lubi, kiedy się nią opiekujesz, badasz i leczysz. Lalka jest ubrana w czapkę i kombinezon z baskinką. Do badania ma odpowiednie akcesoria, które może schować w torbie z uchwytami w kształcie serc. Lalka po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Zabawa w leczenie, to znakomita okazja do nauki zasad zdrowego życia, dbania o siebie innych, a używanie akcesoriów rozwija małą motorykę oraz usprawnia precyzję ruchów. Podczas zabawy zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Podczas zabawy lalką dziecko rozwija w sobie opiekuńczość i wrażliwość. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 35 cm Skład zestawu:   Miękka lalka  Torebka  Stetoskop  Bezpieczne lusterko  Szpatułka  Termometr Specyfikacja:   Wiek:  36m+  Wymiary produktu:  szer. 28 cm., wys. 14,5 cm., gł. 24 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-doktor-sensoryczna-lalka-z-akcesoriami-35-cm', '', '', '', 'Smily Play, Doktor, sensoryczna lalka z akcesoriami, 35 cm', '', '', '', ''),
