(162, 1, 1, 'Lalkę New Born Baby - chłopca można karmić, poić, dawać smoczek, zmieniać pieluszkę i sadzać na nocniczek. Lalka potrafi pić i robić siusiu. Zabawka przeznaczona dla dzieci w wieku:  3+ Wysokość lalki:  43 cm. W zestawie znajdują się:  lalka butelki smoczek  miseczka łyżka widelczyk nocniczek pieluszka', '', 'simba-new-born-baby-lalka-chlopiec-43-cm', '', '', '', 'Simba, New Born Baby, lalka chłopiec, 43 cm', '', '', '', ''),
