(163, 1, 1, 'Przygotuj się na pokaz mody z zupełnie nową lalką LOL Surprise! OMG Winter Fashion Show, Fashion Edition Dolls:  Missy Frost &amp; LaRose. Jeszcze bardziej modne i wystrzałowe niż kiedykolwiek wcześniej! Odpakuj limitowane edycje stylów i akcesoriów. I przygotuj się na sesję zdjęciową! Charakterystyka produktów:  2 nowe postacie:  Missy Frost (#584315) LaRose (#584322) 320 looków z kolekcji Mix &amp; Match! Ponad 16 niespodzianek! Moda, która Cię zmienia! Zbierz wszystkie 4 lalki OMG Winter Fashion Show i przygotuj się światła reflektorów!', '', 'lol-surprise-omg-fashion-show-style-edition-missy-frost-laleczka-modowa', '', '', '', 'L.O.L. Surprise, OMG Fashion Show Style Edition, Missy Frost, laleczka modowa', '', '', '', ''),
