(164, 1, 1, 'Twórz niekończące się przygody z czarodziejskiego świata z 8-calową lalką Cho Chang! Śliczne detale twarzy, miękkie, długie kręcone włosy i pięć punktów zgięcia ożywiają tę ukochaną postać ze świata Harry\'ego Pottera. Cho ma na sobie mundurek Howartu, sweter Ravenclaw, spódniczkę z tiulu, a także zdejmowalne buty oraz różdżkę, które wzbogacą tworzone przez Ciebie historie. Ustaw Cho w dowolny sposób, odtwarzając ulubione sceny albo wymyślając całkowicie nowe! Poruszaj jej ramionami i udawaj, że rzuca kultowe zaklęcia takie jak Episkey! 8-calowe lalki ze świata Harry\'ego Pottera to doskonały sposób, aby zainspirować czarodziejską wyobraźnię poprzez zabawę. Dodaj wszystkie 8-calowe lalki do kolekcji (każda sprzedawana osobno) i stwórz własny magiczny świat. Te zabawki to doskonały prezent dla dziewczynek w wieku 5 lat i starszych. Obowiązkowy element kolekcji każdego fana. Weź do domu 8-calową lalkę Cho Chang i szykuj się na czarodziejskie przygody!', '', 'wizarding-world-harry-potter-cho-lalka-8', '', '', '', 'Wizarding World, Harry Potter, Cho, lalka 8\"', '', '', '', ''),
(164, 1, 2, 'Twórz niekończące się przygody z czarodziejskiego świata z 8-calową lalką Cho Chang! Śliczne detale twarzy, miękkie, długie kręcone włosy i pięć punktów zgięcia ożywiają tę ukochaną postać ze świata Harry\'ego Pottera. Cho ma na sobie mundurek Howartu, sweter Ravenclaw, spódniczkę z tiulu, a także zdejmowalne buty oraz różdżkę, które wzbogacą tworzone przez Ciebie historie. Ustaw Cho w dowolny sposób, odtwarzając ulubione sceny albo wymyślając całkowicie nowe! Poruszaj jej ramionami i udawaj, że rzuca kultowe zaklęcia takie jak Episkey! 8-calowe lalki ze świata Harry\'ego Pottera to doskonały sposób, aby zainspirować czarodziejską wyobraźnię poprzez zabawę. Dodaj wszystkie 8-calowe lalki do kolekcji (każda sprzedawana osobno) i stwórz własny magiczny świat. Te zabawki to doskonały prezent dla dziewczynek w wieku 5 lat i starszych. Obowiązkowy element kolekcji każdego fana. Weź do domu 8-calową lalkę Cho Chang i szykuj się na czarodziejskie przygody!', '', 'wizarding-world-harry-potter-cho-lalka-8', '', '', '', 'Wizarding World, Harry Potter, Cho, lalka 8\"', '', '', '', ''),
(165, 1, 1, '<b>Steffi Love Steffi i Evi na spacerze z psem</b>  Steffi i Evi na spacerze z dalmatyńczykiem. Evi ma hulajnogę.  SPÓJNOŚĆ ZESTAWU:  lalki posiadają sukienki z kwiatowymi akcentami spójnymi z tematyką zestawu. Dołączona jest hulajnoga dla Evi, co pozwoli na zabawę w spacery po parku.  DLA MIŁOŚNICZEK ZWIERZĄT:  zestaw zawiera dwa dalmatyńczyki, które lalki mogą prowadzić na smyczy; jest to dobrze dopasowany prezent dla dziewczynek, które uwielbiają pieski.   LALKA Z TRADYCJĄ:  Steffi Love ma ponad 30-letnią historię i oferuje pierwszorzędną estetykę wykonania i bogaty asortyment, lalka docenia wolny czas spędzony ze swoją małą siostrą Evi.   RÓŻNORODNOŚĆ ZESTAWÓW TEMATYCZNYCH:  w bogatym asortymencie Steffi LOVE znajdziesz zestawy, które pozwolą wcielić się w codzienne role:  spacery z psem, konie, zestawy lekarskie, wycieczki rowerowe.   ROZWIJAJĄ UMIEJĘTNOŚCI SPOŁECZNE:  dzieci mają nieograniczone możliwości zanurzania się w nowych rolach i odgrywania ich, dzięki czemu rozwijają umiejętności społeczne oraz wzbogacają wyobraźnię.   WIELE MOŻLIWOŚCI ZABAWY:  lalka Steffi ma 29cm, a Evi 12cm, trafiony prezent dla dzieci od 3 lat.  Steffi Love zapewnia szereg opcji zabawy, a przeróżne stylizacje i warianty zestawów umożliwiają dopasowanie ich do zainteresowań dziewczynek, wymarzonych profesji oraz tego, w jaki sposób lubią spędzać czas. Zestawy Steffi Love wspierają rozwój emocjonalny dzieci, pomagają kształtować emocje oraz rozwijają w maluszkach poczucie odpowiedzialności i troski. Dodatkowe informacje:  Nr katalogowy:  105733605  Marka:  Steffi Love Seria:  Pozostałe Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Nie Baterie w zestawie:  Nie Zasilanie:  Nie dotyczy Wysokość:  29 cm Akcesoria w zestawie:   Pozostałe parametry:  Wymiary opakowania:  5 x 20 x 32,5 cm', '', 'steffi-love-i-evi-lalki-na-spacerze-z-psem', '', '', '', 'Steffi Love i Evi, lalki na spacerze z psem', '', '', '', ''),
