(166, 1, 1, 'Lalka Steffi w ciąży - zestaw do zabawy. lalka Steffi z ciążowym brzuszkiem i w wygodnych ubrankach noworodek akcesoria dla dzidziusia:  buteleczka do karmienia, smoczek, talerzyk ze sztućcami, grzechotka, kaczuszka do kąpieli, mydełko. Kolory mogą się różnić. Uwaga:  małe elementy! Wiek dziecka:  od 3 lat.', '', 'steffi-lalka-w-ciazy-zestaw-z-bobasem-i-akcesoriami', '', '', '', 'Steffi, lalka w ciąży, zestaw z bobasem i akcesoriami', '', '', '', ''),
