(167, 1, 1, 'Lalka Bobas siusiający 30cm (piżamka z jednorożcem). W zestawie znajduje się pieluszka, łyżka, buteleczka, smoczek, nocnik, talerzyk w kształcie króliczka. Zabawka pozwala na zmianę pieluszki dzidziusiowi, podanie mu smoczka, napojenie go, nakarmienie i ułożenie na nocniku. Dodatki posiadają wytłoczenia, które urealniają produkt. Laleczka jest ubrana w uroczą piżamkę. Na jej głowie znajduje się czapeczka. Bobas zamyka oczy po położeniu go. Wszystko zapakowano w pudełko z okienkiem. Ciekawym dodatkiem jest specjalna karta, na której możemy napisać imię, wzrost, wagę i datę urodzenia. Dodatkowe informacje:  Marka:  Natalia Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Zasilanie:  Bateria Wysokość:  30 cm Akcesoria w zestawie: Lalka 30 cm Smoczek Butelka Pieluszka Łyżeczka Miseczka Nocnik Karta Urodzenia  Pozostałe parametry:  Wymiary opakowania:  26.5 x 29.5 x 14.5 cm', '', 'artyk-edufun-lalka-bobas-siusiajacy-30-cm', '', '', '', 'Artyk, Edu&Fun, lalka, bobas siusiający, 30 cm', '', '', '', ''),
