(170, 1, 1, 'Mała dziewczynka Baby Born wciąż nie chce spać. Przecież jest jeszcze tak widno. Mamusia i tatuś znają pewną sztuczkę:  wystarczy obrócić smoczek w buzi lali, żeby zamknęły się jej śliczne oczęta – i już jest ciemno. Gdy przekręcasz smoczek, oczka lalki zamykają się lub otwierają, bez względu na to w jakiej jest pozycji. Jej oczka są takie śpiące:  jeśli położysz ją na plecach bez smoczka, oczka zamkną się same. Niektóre czynności tak bardzo ją bawią. Uwielbia spać, kocha jeść i oczywiście nie może doczekać się kąpieli. Chętnie pije wodę z butelki. Siusia w pieluchę albo do nocnika. Płacze prawdziwymi łzami. Nie tylko pije wodę. Baby Born potrafi jeść owsiankę. A potem to już tylko czas na kupkę. Ma ruchome rączki, nóżki i główkę. Łatwo jest ją rozebrać, a potem ubrać w te wszystkie modne ciuszki. Ciało bobaska jest takie miękkie i przyjemne w dotyku.  Podstawowy zestaw zawiera 10 dodatków współgrających z funkcjami zabawki, do kompletu różowe body i czapeczka. Baby Born Magic:  10 funkcji - niekończąca się zabawa. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Smoczek pasuje do wszystkich lalek Baby Born w rozmiarze 43 cm. Funkcja śpiących oczek sterowanych obrotem smoczka działa tylko w serii Baby Born Magic. Zabawka nie wymaga baterii. Zawartość zestawu:  lalka Baby Born Magic Girl 43 cm z body i czapeczką, 1 nocnik, 1 pieluszka, 1 talerzyk z łyżką, 1 porcja owsianki, 1 butelka, 1 magiczny smoczek, 1 akt urodzenia,', '', 'baby-born-magiczna-dziewczynka-lalka-interaktywna-43-cm', '', '', '', 'Baby Born, Magiczna Dziewczynka, lalka interaktywna, 43 cm', '', '', '', ''),
