(171, 1, 1, '<b>Steffi Love Kevin w letnim stroju, 2 rodzaje</b>  Kevin ubrany w letnią koszulkę i jeansy. Dodane okulary słoneczne. Wersja:  blondyn i brunet.  <b>Produkt wysyłany losowo, brak możliwości wyboru konkretnego modelu. Cena dotyczy 1szt.</b>', '', 'simba-steffi-love-kevin-w-letnim-stroju-lalka-1-szt', '', '', '', 'Simba, Steffi Love, Kevin w letnim stroju, lalka, 1 szt.', '', '', '', ''),
(171, 1, 2, '<b>Steffi Love Kevin w letnim stroju, 2 rodzaje</b>  Kevin ubrany w letnią koszulkę i jeansy. Dodane okulary słoneczne. Wersja:  blondyn i brunet.  <b>Produkt wysyłany losowo, brak możliwości wyboru konkretnego modelu. Cena dotyczy 1szt.</b>', '', 'simba-steffi-love-kevin-w-letnim-stroju-lalka-1-szt', '', '', '', 'Simba, Steffi Love, Kevin w letnim stroju, lalka, 1 szt.', '', '', '', ''),
(172, 1, 1, 'W naszej manufakturze wierzymy, że zabawa jest najlepszą nauką. Dlatego też z wielką miłością tworzymy kultowe lalki Llorens, w 100, ręcznie wykonane, o niepowtarzalnych wzorach. Stosowane przez nas tkaniny pochodzą od renomowanych marek odzieży dziecięcej. Wszystkie lalki Llorens są zgodne z europejskimi przepisami dotyczącymi bezpieczeństwa dzieci, co gwarantuje, że Twoje dzieci będą się bawić w możliwie najbezpieczniejszy sposób.  Lalka płacząca Roberta mierzy 33 cm wzrostu. Buzia, rączki oraz nóżki wykonane są z delikatnego, przyjemnego w dotyku winylu, zaś brzuszek jest miękki, co czyni, iż lalka jest idealna do przytulania. Niebieskie oczka, malutki nosek, uszka, małe usteczka i pyzate policzki to cechy tej lali. Nigdy nie rozstaje się ze swoim ukochanym smoczkiem, gdy ktoś chce go zabrać, zapłacze i zawoła \"\"Mama\"\", \"\"Pappa\"\", uspokaja się po włożeniu smoczka do buzi.  Lalka posiada blond grzywkę i włosy związane w dwa kucyki, zwieńczone atłasowymi wstążkami w kolorze łososiowym. Roberta ubrana jest w białą, nakrapianą sukienkę z motywem koników na biegunach, ozdobioną atłasową kokardką; bluzę z kapturem w kolorze łososiowo-białym, krótkie spodenki oraz ciepłe skarpetki pasujące do kompletu. Lalka została zapakowana w ozdobny karton, więc bez zbędnych dodatkowych opakowań, może być wręczona jako prezent. Jest to wspaniała zabawka dla dzieci w każdym wieku. Kochamy hiszpańskie lalki Llorens! Dodatkowe informacje:   Marka:  Inne Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Zasilanie:  Bateria LR44 Wysokość:  33 cm Akcesoria w zestawie: Smoczek, Biała, nakrapiana sukienka z motywem koników na biegunach, ozdobiona atłasową kokardką, Bluza z kapturem w kolorze łososiowo-białym,  Krótkie spodenki, Ciepłe skarpetki pasujące do kompletu.  Pozostałe parametry: Wymiary opakowania:  21x38x10 cm', '', 'llorens-roberta-lalka-bobas-placzaca-33-cm', '', '', '', 'Llorens, Roberta, lalka bobas, płacząca, 33 cm', '', '', '', ''),
