,
(173, 1, 1, 'Baby Born Nocny Przyjaciel - mała laleczka bobas dla dzieci już od pierwszych dni życia. wykonana z delikatnej, puszystej welurowej tkaniny głowa z bezpiecznej, miękkiej gumy na brzuszku ma zamontowane świecące na wrzosowo serduszko po naciśnięciu serduszka uruchamiana jest spokojna melodia lalka ubrana w różowe śpiochy i czapeczkę w trójkąty wymiary lalki:  30 cm zasilanie:  2xAAA (w zestawie baterie testowe)', '', 'baby-born-mala-laleczka-nightfriends-30-cm', '', '', '', 'Baby Born, mała laleczka Nightfriends, 30 cm', '', '', '', ''),
(173, 1, 2, 'Baby Born Nocny Przyjaciel - mała laleczka bobas dla dzieci już od pierwszych dni życia. wykonana z delikatnej, puszystej welurowej tkaniny głowa z bezpiecznej, miękkiej gumy na brzuszku ma zamontowane świecące na wrzosowo serduszko po naciśnięciu serduszka uruchamiana jest spokojna melodia lalka ubrana w różowe śpiochy i czapeczkę w trójkąty wymiary lalki:  30 cm zasilanie:  2xAAA (w zestawie baterie testowe)', '', 'baby-born-mala-laleczka-nightfriends-30-cm', '', '', '', 'Baby Born, mała laleczka Nightfriends, 30 cm', '', '', '', ''),
(174, 1, 1, 'Lalka niemowlak 30 cm w niebiesko-żółtym body w serca i czapeczce.  Do zestawu dołączono butelkę, pudełeczko z chusteczką, pieluszkę, miseczkę, widelczyk i łyżeczkę.  Lalka bobas z dźwiękiem, umie mówić.  Lalka wykonana z wysokiej jakości materiałów.  Zabawka wymaga użycia baterii 3xLR44 (dołączono).  Wiek 3+  Zestaw w ładnym, prezentowym opakowaniu o wymiarach 32x12x29 cm.', '', 'dromader-agusia-bobas-lalka-interaktywna-mowi-akcesoria-30-cm', '', '', '', 'Dromader, Agusia, bobas, lalka interaktywna, mówi, akcesoria, 30 cm', '', '', '', ''),
(174, 1, 2, 'Lalka niemowlak 30 cm w niebiesko-żółtym body w serca i czapeczce.  Do zestawu dołączono butelkę, pudełeczko z chusteczką, pieluszkę, miseczkę, widelczyk i łyżeczkę.  Lalka bobas z dźwiękiem, umie mówić.  Lalka wykonana z wysokiej jakości materiałów.  Zabawka wymaga użycia baterii 3xLR44 (dołączono).  Wiek 3+  Zestaw w ładnym, prezentowym opakowaniu o wymiarach 32x12x29 cm.', '', 'dromader-agusia-bobas-lalka-interaktywna-mowi-akcesoria-30-cm', '', '', '', 'Dromader, Agusia, bobas, lalka interaktywna, mówi, akcesoria, 30 cm', '', '', '', ''),
(175, 1, 1, 'Zapraszamy na lunch! Czas na wyśmienitą zabawę z Foodtruckiem Barbie! Jeśli uwielbiasz przygotowywanie pysznych posiłków i obsługę klientów, możesz zostać właścicielem własnego foodtrucka! Pojazd ma ponad 45 cm długości i jest ozdobiony kolorowymi grafikami związanymi z jedzeniem. Otwórz go, aby odsłonić miejsca do przygotowywania i podawania jedzenia:  kuchenkę z grillem, stanowisko z koktajlami, ladę i szafki. W zestawie jest również ponad 30 akcesoriów tematycznych, w tym stojąca tablica z menu, przybory kuchenne, tacki, kubki, frytkownica, blender do koktajli, produkty \"spożywcze\", krzesełko dla klienta i więcej. Niektóre z akcesoriów mają zaczepy, aby lalka (sprzedawana oddzielnie) mogła je trzymać w dłoni - dzięki temu zabawa jest bardziej realistyczna. Barbie może \"przygotowywać\" wyborne przysmaki, takie jak \"sałatka\", \"burger\", \"frytki\" i nie tylko! Kiedy klient wybierze, na co ma ochotę, Barbie \"podliczy\" cenę na kasie.  W zestawie nie znajduje się lalka - należy dokupić ją osobno. Wiek dziecka:  powyżej 3 lat.', '', 'barbie-foodtruck-zestaw-do-zabawy-bez-lalki', '', '', '', 'Barbie, Foodtruck, zestaw do zabawy bez lalki', '', '', '', '');
