(175, 1, 2, 'Zapraszamy na lunch! Czas na wyśmienitą zabawę z Foodtruckiem Barbie! Jeśli uwielbiasz przygotowywanie pysznych posiłków i obsługę klientów, możesz zostać właścicielem własnego foodtrucka! Pojazd ma ponad 45 cm długości i jest ozdobiony kolorowymi grafikami związanymi z jedzeniem. Otwórz go, aby odsłonić miejsca do przygotowywania i podawania jedzenia:  kuchenkę z grillem, stanowisko z koktajlami, ladę i szafki. W zestawie jest również ponad 30 akcesoriów tematycznych, w tym stojąca tablica z menu, przybory kuchenne, tacki, kubki, frytkownica, blender do koktajli, produkty \"spożywcze\", krzesełko dla klienta i więcej. Niektóre z akcesoriów mają zaczepy, aby lalka (sprzedawana oddzielnie) mogła je trzymać w dłoni - dzięki temu zabawa jest bardziej realistyczna. Barbie może \"przygotowywać\" wyborne przysmaki, takie jak \"sałatka\", \"burger\", \"frytki\" i nie tylko! Kiedy klient wybierze, na co ma ochotę, Barbie \"podliczy\" cenę na kasie.  W zestawie nie znajduje się lalka - należy dokupić ją osobno. Wiek dziecka:  powyżej 3 lat.', '', 'barbie-foodtruck-zestaw-do-zabawy-bez-lalki', '', '', '', 'Barbie, Foodtruck, zestaw do zabawy bez lalki', '', '', '', ''),
(176, 1, 1, 'Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka tej animowanej bajki, podaruj mu wyjątkowy prezent - lalkę przedstawiającą Adriena! Dzięki niej będzie mogło bawić się w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię, tworząc zupełnie nowe historie.<br /><br />Lalki i akcesoria przedstawiające Biedronkę i jej przyjaciół z serialu „Miraculum:  Biedronka i Czarny Kot” pozwalają stworzyć niezwykły świat wyobraźni, w którym dzieci mogą być odważne, silne i niesamowite! Lalka Adriena została starannie wykonana z wysokiej jakości materiałów, z dbałością o najdrobniejsze szczegóły. Plagg, wysuwaj pazury!!! Zestaw zawiera lalkę przedstawiającą Adriena oraz strój superbohatera - Czarnego Kota, potrzebny do transformacji Adriena! Lalka ma 26 cm i 13 ruchomych punktów, w tym zginające się ręce i nogi! W zestawie znajdziesz też kompletny strój Czarnego Kota, który pomoże w transformacji Adriena, w tym czarne buty i zdejmowaną maskę. Wiek:  4+', '', 'miraculous-biedronka-i-czarny-kot-adrien-lalka-i-stroj-czarnego-kota', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Adrien, lalka i strój Czarnego Kota', '', '', '', ''),
(176, 1, 2, 'Witaj w uniwersum Miraculum! Jeżeli Twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego Kota i z utęsknieniem wyczekuje emisji kolejnego odcinka tej animowanej bajki, podaruj mu wyjątkowy prezent - lalkę przedstawiającą Adriena! Dzięki niej będzie mogło bawić się w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię, tworząc zupełnie nowe historie.<br /><br />Lalki i akcesoria przedstawiające Biedronkę i jej przyjaciół z serialu „Miraculum:  Biedronka i Czarny Kot” pozwalają stworzyć niezwykły świat wyobraźni, w którym dzieci mogą być odważne, silne i niesamowite! Lalka Adriena została starannie wykonana z wysokiej jakości materiałów, z dbałością o najdrobniejsze szczegóły. Plagg, wysuwaj pazury!!! Zestaw zawiera lalkę przedstawiającą Adriena oraz strój superbohatera - Czarnego Kota, potrzebny do transformacji Adriena! Lalka ma 26 cm i 13 ruchomych punktów, w tym zginające się ręce i nogi! W zestawie znajdziesz też kompletny strój Czarnego Kota, który pomoże w transformacji Adriena, w tym czarne buty i zdejmowaną maskę. Wiek:  4+', '', 'miraculous-biedronka-i-czarny-kot-adrien-lalka-i-stroj-czarnego-kota', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Adrien, lalka i strój Czarnego Kota', '', '', '', ''),
(177, 1, 1, 'Barbie celebruje różnorodność z kolekcją wyjątkowych lalek, które zachęcają dzieci do odgrywania różnych przygód oraz inspirują do spełniania marzeń. Dzięki różnym odcieniom skóry, kolorom oczu i włosów, fryzurom, typom włosów, sylwetkom oraz ubrankom lalki Barbie z linii Fashionistas odzwierciedlają różnorodność świata, dając dzieciom nieskończone możliwości opowiadania historyjek i wyrażania siebie. Lalka Barbie na wózku inwalidzkim z obracającymi się kółkami i hamulcem ręcznym jest gotowa na nowe przygody i odkrycia. Kółka wózka naprawdę się obracają - wystarczy lekko go popchnąć, aby zaczął się ruszać, lub ustawić hamulec, aby stał w miejscu. Lalka Barbie ma wiele punktów zgięcia, dzięki czemu może wygodnie siedzieć i poruszać się na wózku. Biała koszulka w kolorowe paski z wyciętymi ramionami oraz lekko sprane dżinsy to niezwykle modne połączenie, a stylizację dopełnia para srebrzystych okularów przeciwsłonecznych, żółty zegarek i białe buciki sportowe. W zestawie znajduje się też rampa, dzięki której lalka Barbie może łatwo wjechać do Idealnego domku Barbie Dreamhouse i z niego wyjechać (domek sprzedawany oddzielnie, zależnie od dostępności). Zestaw obejmuje lalkę Barbie Fashionistas w ubranku i z akcesoriami, wózek inwalidzki i rampę. Informacje dodatkowe:  Lalka nie stoi i nie porusza się na wózku samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-lalka-na-wozku-blondynka', '', '', '', 'Barbie, Fashionistas, Lalka na wózku, blondynka', '', '', '', ''),
(177, 1, 2, 'Barbie celebruje różnorodność z kolekcją wyjątkowych lalek, które zachęcają dzieci do odgrywania różnych przygód oraz inspirują do spełniania marzeń. Dzięki różnym odcieniom skóry, kolorom oczu i włosów, fryzurom, typom włosów, sylwetkom oraz ubrankom lalki Barbie z linii Fashionistas odzwierciedlają różnorodność świata, dając dzieciom nieskończone możliwości opowiadania historyjek i wyrażania siebie. Lalka Barbie na wózku inwalidzkim z obracającymi się kółkami i hamulcem ręcznym jest gotowa na nowe przygody i odkrycia. Kółka wózka naprawdę się obracają - wystarczy lekko go popchnąć, aby zaczął się ruszać, lub ustawić hamulec, aby stał w miejscu. Lalka Barbie ma wiele punktów zgięcia, dzięki czemu może wygodnie siedzieć i poruszać się na wózku. Biała koszulka w kolorowe paski z wyciętymi ramionami oraz lekko sprane dżinsy to niezwykle modne połączenie, a stylizację dopełnia para srebrzystych okularów przeciwsłonecznych, żółty zegarek i białe buciki sportowe. W zestawie znajduje się też rampa, dzięki której lalka Barbie może łatwo wjechać do Idealnego domku Barbie Dreamhouse i z niego wyjechać (domek sprzedawany oddzielnie, zależnie od dostępności). Zestaw obejmuje lalkę Barbie Fashionistas w ubranku i z akcesoriami, wózek inwalidzki i rampę. Informacje dodatkowe:  Lalka nie stoi i nie porusza się na wózku samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-lalka-na-wozku-blondynka', '', '', '', 'Barbie, Fashionistas, Lalka na wózku, blondynka', '', '', '', ''),
(178, 1, 1, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Neonlicious to stylistka, która kocha modę i metamorfozy. Uwielbia stylizować wszystkich w swoim szalonym stylu, który jest jej znakiem rozpoznawczym. Jest starszą siostrą L.O.L. Surprise Neon QT. Jak wszystkie laleczki, L.O.L. Surprise O.M.G mają oszałamiające rysy twarzy, piękne włosy. Mają kilka punktów artykulacji co pozwala na ustawianie laleczek w przeróżnych pozach, a także ułatwiają przebieranie lalek. W opakowaniu czeka aż 11 niespodzianek do odkrycia! Sprawdź sama co kryje Twoja Neonlicious! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Neonlicious,  ubrania,  buty,  akcesoria,  szczotka do włosów,  stojak na lalkę Zbierz całą kolekcję Series 1:  Swag, Royal B, Lady Diva oraz Neonlicious.', '', 'lol-surprise-omg-neonlicious-laleczka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Neonlicious, laleczka modowa', '', '', '', ''),
