(180, 1, 1, 'Miękka lalka robiąca siusiu. W zestawie z akcesoriami - 7 elementów. Wymiar:  38 cm. Wiek:  od 3 lat.', '', 'simba-new-born-baby-lalka-bobas-z-akcesoriami-38-cm', '', '', '', 'Simba, New Born Baby, lalka bobas z akcesoriami, 38 cm', '', '', '', ''),
