(181, 1, 1, 'Oto Enchantimals - grupa uroczych dziewczynek związanych ze swoimi ukochanymi zwierzątkami wyjątkową przyjaźnią. Lalce Tarla Tabby (15 cm) towarzyszy jej kotek Cuddler - są nierozłączni i nawet wyglądają podobnie! Aby wzbogacić zabawę, Tarla Tabby (15 cm) ma na sobie zdejmowaną spódniczkę i buciki. Tarla Tabby i Cuddler mają podobne detale, takie jak pomarańczowe włosy, co zachęca do wymyślania niezwykłych historyjek. Dzieci pokochają wyjątkową więź łączącą bohaterów ze świata Enchantimals! Doskonały prezent dla dzieci od 4 roku życia.', '', 'enchantimals-tarla-orange-cat-cuddler-zestaw-z-lalka-i-figurka', '', '', '', 'Enchantimals, Tarla Orange Cat & Cuddler, zestaw z lalką i figurką', '', '', '', ''),
(181, 1, 2, 'Oto Enchantimals - grupa uroczych dziewczynek związanych ze swoimi ukochanymi zwierzątkami wyjątkową przyjaźnią. Lalce Tarla Tabby (15 cm) towarzyszy jej kotek Cuddler - są nierozłączni i nawet wyglądają podobnie! Aby wzbogacić zabawę, Tarla Tabby (15 cm) ma na sobie zdejmowaną spódniczkę i buciki. Tarla Tabby i Cuddler mają podobne detale, takie jak pomarańczowe włosy, co zachęca do wymyślania niezwykłych historyjek. Dzieci pokochają wyjątkową więź łączącą bohaterów ze świata Enchantimals! Doskonały prezent dla dzieci od 4 roku życia.', '', 'enchantimals-tarla-orange-cat-cuddler-zestaw-z-lalka-i-figurka', '', '', '', 'Enchantimals, Tarla Orange Cat & Cuddler, zestaw z lalką i figurką', '', '', '', ''),
(182, 1, 1, 'Lalka Barbie Totally Hair z motywem motylków ma swój własny przebojowy styl i fryzurę inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, metaliczną bluzkę, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Lalka Barbie o standardowej sylwetce ma motyw motylków oraz różowe i turkusowe pasemka w karbowanych włosach zebranych częściowo w koczek. Ma na sobie prostą dopasowaną sukienkę z nadrukiem w motylki. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-motylki-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Motylki, lalka z akcesoriami', '', '', '', ''),
(182, 1, 2, 'Lalka Barbie Totally Hair z motywem motylków ma swój własny przebojowy styl i fryzurę inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, metaliczną bluzkę, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Lalka Barbie o standardowej sylwetce ma motyw motylków oraz różowe i turkusowe pasemka w karbowanych włosach zebranych częściowo w koczek. Ma na sobie prostą dopasowaną sukienkę z nadrukiem w motylki. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-motylki-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Motylki, lalka z akcesoriami', '', '', '', ''),
(183, 1, 1, 'Odkryj radość z opiekowania się zwierzątkami i prowadzenia kliniki weterynaryjnej z zestawem Barbie Chelsea Weterynarz. Ubrana w uroczy biały fartuch i sukienkę lalka Chelsea jest gotowa przyjmować pacjentów. Może badać ich na stole za pomocą stetoskopu i sprawdzać, ile ważą, na specjalnej ruchomej wadze. Odgrywaj pełne troski opowieści dzięki 4 figurkom zwierzątek:  2 pieskom, 1 kotkowi i 1 ptaszkowi z ruchomą huśtawką. Wśród 18 akcesoriów znajdziesz też legowisko dla zwierzątek, przyrządy medyczne, podkładkę, kołnierz, butelkę z \"pompką\", butelkę z \"lekarstwem\", transporter dla zwierzaka, miski, psie przysmaki i arkusz bandaży. Wkrocz do świata kreatywnej zabawy i wyjątkowych opowieści z zestawem do zabawy Barbie Chelsea Weterynarz. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Doskonały prezent dla dzieci od 3 lat, zwłaszcza tych pasjonujących się zwierzętami, opieką i pracą weterynarza!', '', 'barbie-weterynarz-zestaw-z-lalka-chelsea', '', '', '', 'Barbie, Weterynarz, zestaw z lalką Chelsea', '', '', '', ''),
(183, 1, 2, 'Odkryj radość z opiekowania się zwierzątkami i prowadzenia kliniki weterynaryjnej z zestawem Barbie Chelsea Weterynarz. Ubrana w uroczy biały fartuch i sukienkę lalka Chelsea jest gotowa przyjmować pacjentów. Może badać ich na stole za pomocą stetoskopu i sprawdzać, ile ważą, na specjalnej ruchomej wadze. Odgrywaj pełne troski opowieści dzięki 4 figurkom zwierzątek:  2 pieskom, 1 kotkowi i 1 ptaszkowi z ruchomą huśtawką. Wśród 18 akcesoriów znajdziesz też legowisko dla zwierzątek, przyrządy medyczne, podkładkę, kołnierz, butelkę z \"pompką\", butelkę z \"lekarstwem\", transporter dla zwierzaka, miski, psie przysmaki i arkusz bandaży. Wkrocz do świata kreatywnej zabawy i wyjątkowych opowieści z zestawem do zabawy Barbie Chelsea Weterynarz. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Doskonały prezent dla dzieci od 3 lat, zwłaszcza tych pasjonujących się zwierzętami, opieką i pracą weterynarza!', '', 'barbie-weterynarz-zestaw-z-lalka-chelsea', '', '', '', 'Barbie, Weterynarz, zestaw z lalką Chelsea', '', '', '', ''),
(184, 1, 1, 'Lalka Ken Pan młody inspiruje do opowiadania fantastycznych historyjek o bajkowym weselu! Mali marzyciele mogą zorganizować baśniowe wesele z lalką Ken w pięknym garniturze. Ken jest gotowy na swój wielki dzień, ubrany w piękny satynowy garnitur, koszulę, muszkę i brązowe eleganckie buty. Wśród tematycznych akcesoriów są \"tort weselny\", bukiet kwiatów, zegarek, okulary przeciwsłoneczne i pudełko na obrączki. Dzięki wyjątkowej stylizacji i akcesoriom lalka Ken Pan młody inspiruje dzieci w wieku od 3 do 7 lat do wymyślania własnych niezwykłych opowieści. Miłośnicy baśni mogą zebrać też inne lalki, zabawki i akcesoria Barbie, aby zabawa była jeszcze bardziej magiczna. Wiek dziecka:  od 3 lat.', '', 'barbie-ken-pan-mlody-lalka-z-akcesoriami', '', '', '', 'Barbie, Ken Pan Młody, lalka z akcesoriami', '', '', '', ''),
(184, 1, 2, 'Lalka Ken Pan młody inspiruje do opowiadania fantastycznych historyjek o bajkowym weselu! Mali marzyciele mogą zorganizować baśniowe wesele z lalką Ken w pięknym garniturze. Ken jest gotowy na swój wielki dzień, ubrany w piękny satynowy garnitur, koszulę, muszkę i brązowe eleganckie buty. Wśród tematycznych akcesoriów są \"tort weselny\", bukiet kwiatów, zegarek, okulary przeciwsłoneczne i pudełko na obrączki. Dzięki wyjątkowej stylizacji i akcesoriom lalka Ken Pan młody inspiruje dzieci w wieku od 3 do 7 lat do wymyślania własnych niezwykłych opowieści. Miłośnicy baśni mogą zebrać też inne lalki, zabawki i akcesoria Barbie, aby zabawa była jeszcze bardziej magiczna. Wiek dziecka:  od 3 lat.', '', 'barbie-ken-pan-mlody-lalka-z-akcesoriami', '', '', '', 'Barbie, Ken Pan Młody, lalka z akcesoriami', '', '', '', ''),
(185, 1, 1, 'Barbie Cutie Reveal - oto Twoja ulubiona lalka w uroczym zwierzęcym przebraniu! Odkrywaj niespodzianki i baw się w najlepsze! Zabawa rozpoczyna się od rozpakowania. W środku znajdziesz lalkę, mięciutkie pluszowe zwierzątko oraz 10 niespodzianek. Lalka posiada punkty artykulacji dla jeszcze lepszej zabawy. Ubrana jest uroczy kostium. Kolorowe włosy oraz ładne detale urozmaicają zabawę. Wśród niespodzianek znajdziesz:  spódniczkę, buciki, grzebień, opaskę i zwierzątko! Kostium lalki jest dwustronny. Głowa kostiumu zamienia się w miejsce do spania dla zwierzątka. Funkcja zmiany koloru - użyj zimnej wody, by dokonać zmiany wyglądu Barbie i jej przyjaciela! Ciepła woda odwraca ten efekt. Można powtarzać w nieskończoność! Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i zdobienia mogą się różnić. Niespodzianki w tubie są losowe. Wiek dziecka:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-piesek-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka piesek z akcesoriami', '', '', '', ''),
(185, 1, 2, 'Barbie Cutie Reveal - oto Twoja ulubiona lalka w uroczym zwierzęcym przebraniu! Odkrywaj niespodzianki i baw się w najlepsze! Zabawa rozpoczyna się od rozpakowania. W środku znajdziesz lalkę, mięciutkie pluszowe zwierzątko oraz 10 niespodzianek. Lalka posiada punkty artykulacji dla jeszcze lepszej zabawy. Ubrana jest uroczy kostium. Kolorowe włosy oraz ładne detale urozmaicają zabawę. Wśród niespodzianek znajdziesz:  spódniczkę, buciki, grzebień, opaskę i zwierzątko! Kostium lalki jest dwustronny. Głowa kostiumu zamienia się w miejsce do spania dla zwierzątka. Funkcja zmiany koloru - użyj zimnej wody, by dokonać zmiany wyglądu Barbie i jej przyjaciela! Ciepła woda odwraca ten efekt. Można powtarzać w nieskończoność! Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i zdobienia mogą się różnić. Niespodzianki w tubie są losowe. Wiek dziecka:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-piesek-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka piesek z akcesoriami', '', '', '', ''),
(186, 1, 1, 'Lalka bobas uwielbia pluskać się z dziećmi i ma funkcję zmiany koloru. Lalka ma wodoodporny korpus i można ją w pełni kąpać. Dzięki temu idealnie nadaje się do zabawy i zabierania ze sobą pod prysznic i do wanny. Na ustach lalki wciąż pozostaje miazga marchwi, którą dzieci muszą zmyć. Lalkę można czyścić ciepłą wodą (od 31 stopni celsjusza). Aby lalka była miła i ciepła po kąpieli i można ją było wycierać do sucha, w zestawie znajduje się również ręcznik kąpielowy z kapturem. Dopełnieniem zestawu jest gąbka do mycia w kształcie serca.', '', 'simba-new-born-baby-brudny-bobasek-30-cm', '', '', '', 'Simba, New Born Baby, brudny bobasek, 30 cm', '', '', '', ''),
(186, 1, 2, 'Lalka bobas uwielbia pluskać się z dziećmi i ma funkcję zmiany koloru. Lalka ma wodoodporny korpus i można ją w pełni kąpać. Dzięki temu idealnie nadaje się do zabawy i zabierania ze sobą pod prysznic i do wanny. Na ustach lalki wciąż pozostaje miazga marchwi, którą dzieci muszą zmyć. Lalkę można czyścić ciepłą wodą (od 31 stopni celsjusza). Aby lalka była miła i ciepła po kąpieli i można ją było wycierać do sucha, w zestawie znajduje się również ręcznik kąpielowy z kapturem. Dopełnieniem zestawu jest gąbka do mycia w kształcie serca.', '', 'simba-new-born-baby-brudny-bobasek-30-cm', '', '', '', 'Simba, New Born Baby, brudny bobasek, 30 cm', '', '', '', ''),
(187, 1, 1, 'My Garden Baby Raczkujący Bobasek-Motylek  Ta lalka My Garden Baby (ok. 30 cm) uwielbia chichotać i raczkować. Dotknij jej skrzydełek, aby zaczęła się ruszać i wydawać 20 dziecięcych odgłosów - czekają Cię całe godziny interaktywnej zabawy. Lalka uroczo chichocze i gaworzy, a podczas raczkowania porusza skrzydełkami! W zestawie jest też biedronka na kółkach, aby lalka My Garden Baby mogła za nią podążać. Urocze skrzydełka, motylkowa ozdoba na głowie i słodki zapach jaśminu sprawiają, że zajmowanie się tym maluszkiem to sama przyjemność. Unieś się w świat zabawy z Raczkującym Bobaskiem-Motylkiem! Kolory i elementy dekoracyjne mogą się różnić. Wiek:  od 2 lat', '', 'my-garden-baby-raczkujacy-bobasek-motylek-lalka-rozowa', '', '', '', 'My Garden Baby, Raczkujący Bobasek-Motylek, lalka, różowa', '', '', '', ''),
(187, 1, 2, 'My Garden Baby Raczkujący Bobasek-Motylek  Ta lalka My Garden Baby (ok. 30 cm) uwielbia chichotać i raczkować. Dotknij jej skrzydełek, aby zaczęła się ruszać i wydawać 20 dziecięcych odgłosów - czekają Cię całe godziny interaktywnej zabawy. Lalka uroczo chichocze i gaworzy, a podczas raczkowania porusza skrzydełkami! W zestawie jest też biedronka na kółkach, aby lalka My Garden Baby mogła za nią podążać. Urocze skrzydełka, motylkowa ozdoba na głowie i słodki zapach jaśminu sprawiają, że zajmowanie się tym maluszkiem to sama przyjemność. Unieś się w świat zabawy z Raczkującym Bobaskiem-Motylkiem! Kolory i elementy dekoracyjne mogą się różnić. Wiek:  od 2 lat', '', 'my-garden-baby-raczkujacy-bobasek-motylek-lalka-rozowa', '', '', '', 'My Garden Baby, Raczkujący Bobasek-Motylek, lalka, różowa', '', '', '', ''),
(188, 1, 1, 'Baw się w modnym stylu z Kalendarzem adwentowym Barbie, w którym znajdziesz lalkę Barbie 30 cm i 24 niespodzianki do tworzenia różnych stylizacji. Dzieci pokochają odkrywanie aż 24 modowych niespodzianek - po jednej każdego dnia aż do świąt. W każdej przegródce jest 1 ubranko lub modne akcesorium. Pierwszego dnia dzieci odpakowują wyjątkowy prezent - lalkę Barbie, a przez następne 24 dni odkrywają codziennie nową niespodziankę. Opakowanie ma modny motyw i może służyć za ozdobę podczas zabawy. Informacje dodatkowe:  Kolory i elementy dekoracyjne mogą się różnić. Lalka nie stoi samodzielnie. Doskonały prezent świąteczny dla dzieci w wieku od 3 do 7 lat.', '', 'barbie-kalendarz-adwentowy-styl-i-szyk-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kalendarz adwentowy, Styl i szyk, zestaw z lalką i akcesoriami', '', '', '', ''),
(188, 1, 2, 'Baw się w modnym stylu z Kalendarzem adwentowym Barbie, w którym znajdziesz lalkę Barbie 30 cm i 24 niespodzianki do tworzenia różnych stylizacji. Dzieci pokochają odkrywanie aż 24 modowych niespodzianek - po jednej każdego dnia aż do świąt. W każdej przegródce jest 1 ubranko lub modne akcesorium. Pierwszego dnia dzieci odpakowują wyjątkowy prezent - lalkę Barbie, a przez następne 24 dni odkrywają codziennie nową niespodziankę. Opakowanie ma modny motyw i może służyć za ozdobę podczas zabawy. Informacje dodatkowe:  Kolory i elementy dekoracyjne mogą się różnić. Lalka nie stoi samodzielnie. Doskonały prezent świąteczny dla dzieci w wieku od 3 do 7 lat.', '', 'barbie-kalendarz-adwentowy-styl-i-szyk-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kalendarz adwentowy, Styl i szyk, zestaw z lalką i akcesoriami', '', '', '', ''),
(189, 1, 1, 'Lalka niemowlak 30 cm w niebiesko-żółtym body z krótkim rękawkiem i opaską na główce.  Do zestawu dołączono butelkę, smoczek, pieluszkę, miseczkę, widelczyk i łyżeczkę.  Lalka bobas z dźwiękiem, umie mówić.  Lalka wykonana z wysokiej jakości materiałów.  Zabawka wymaga użycia baterii 3xLR44 (dołączono).  Wiek 3+  Zestaw w ładnym, prezentowym opakowaniu o wymiarach 32x12x29 cm.', '', 'dromader-agusia-bobas-lalka-interaktywna-mowi-akcesoria-30-cm', '', '', '', 'Dromader, Agusia, bobas, lalka interaktywna, mówi, akcesoria, 30 cm', '', '', '', ''),
