(190, 1, 1, 'Lalka Barbie, tym razem w najmodniejszej odsłonie. Lalka ubrana jest w modną sukienkę w kultowe wzory, a na nogach ma białe sportowe buty na koturnie. Każda z lalek ma rozpuszczone proste włosy, które można dowolnie upinać.', '', 'pro-kids-barbie-lalka-podstawowa', '', '', '', 'Pro Kids, Barbie, lalka podstawowa', '', '', '', ''),
(190, 1, 2, 'Lalka Barbie, tym razem w najmodniejszej odsłonie. Lalka ubrana jest w modną sukienkę w kultowe wzory, a na nogach ma białe sportowe buty na koturnie. Każda z lalek ma rozpuszczone proste włosy, które można dowolnie upinać.', '', 'pro-kids-barbie-lalka-podstawowa', '', '', '', 'Pro Kids, Barbie, lalka podstawowa', '', '', '', ''),
(191, 1, 1, 'Barbie Cutie Reveal - oto Twoja ulubiona lalka w uroczym zwierzęcym przebraniu! Odkrywaj niespodzianki i baw się w najlepsze! Zabawa rozpoczyna się od rozpakowania. W środku znajdziesz lalkę, mięciutkie pluszowe zwierzątko oraz 10 niespodzianek. Lalka posiada punkty artykulacji dla jeszcze lepszej zabawy. Ubrana jest uroczy kostium. Kolorowe włosy oraz ładne detale urozmaicają zabawę. Wśród niespodzianek znajdziesz:  spódniczkę, buciki, grzebień, opaskę i zwierzątko! Kostium lalki jest dwustronny. Głowa kostiumu zamienia się w miejsce do spania dla zwierzątka. Funkcja zmiany koloru - użyj zimnej wody, by dokonać zmiany wyglądu Barbie i jej przyjaciela! Ciepła woda odwraca ten efekt. Można powtarzać w nieskończoność! Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i zdobienia mogą się różnić. Niespodzianki w tubie są losowe. Wiek dziecka:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-panda-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka panda z akcesoriami', '', '', '', ''),
(191, 1, 2, 'Barbie Cutie Reveal - oto Twoja ulubiona lalka w uroczym zwierzęcym przebraniu! Odkrywaj niespodzianki i baw się w najlepsze! Zabawa rozpoczyna się od rozpakowania. W środku znajdziesz lalkę, mięciutkie pluszowe zwierzątko oraz 10 niespodzianek. Lalka posiada punkty artykulacji dla jeszcze lepszej zabawy. Ubrana jest uroczy kostium. Kolorowe włosy oraz ładne detale urozmaicają zabawę. Wśród niespodzianek znajdziesz:  spódniczkę, buciki, grzebień, opaskę i zwierzątko! Kostium lalki jest dwustronny. Głowa kostiumu zamienia się w miejsce do spania dla zwierzątka. Funkcja zmiany koloru - użyj zimnej wody, by dokonać zmiany wyglądu Barbie i jej przyjaciela! Ciepła woda odwraca ten efekt. Można powtarzać w nieskończoność! Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i zdobienia mogą się różnić. Niespodzianki w tubie są losowe. Wiek dziecka:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-panda-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka panda z akcesoriami', '', '', '', ''),
(192, 1, 1, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-177', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 177', '', '', '', ''),
(192, 1, 2, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-177', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 177', '', '', '', ''),
(193, 1, 1, 'lalka wykonana z materiałów najwyższej jakości wysokość lalki:  38 cm zamykane oczka akcesoria:  nocnik, butelka i smoczek wiek dziecka:  powyżej 18 miesiąca życia', '', 'dolls-world-lalka-bobas-baby-olivia-38-cm', '', '', '', 'Dolls World, lalka bobas Baby Olivia, 38 cm', '', '', '', ''),
