(194, 1, 1, 'Oto Enchantimals - grupa uroczych dziewczynek związanych ze swoimi ukochanymi zwierzątkami wyjątkową przyjaźnią. Lalce Hadley Husky (15 cm) towarzyszy jej piesek Sledder - są nierozłączni i nawet wyglądają podobnie! Aby wzbogacić zabawę, Hadley Husky (15 cm) ma na sobie zdejmowaną spódniczkę, okulary i buciki. Hadley Husky i Sledder mają podobne detale, takie jak okulary z kwiatowym motywem, co zachęca do wymyślania niezwykłych historyjek. Dzieci pokochają wyjątkową więź łączącą bohaterów ze świata Enchantimals! Doskonały prezent dla dzieci od 4 roku życia.', '', 'enchantimals-hadley-husky-sledder-zestaw-z-lalka-i-figurka', '', '', '', 'Enchantimals, Hadley Husky & Sledder, zestaw z lalką i figurką', '', '', '', ''),
(194, 1, 2, 'Oto Enchantimals - grupa uroczych dziewczynek związanych ze swoimi ukochanymi zwierzątkami wyjątkową przyjaźnią. Lalce Hadley Husky (15 cm) towarzyszy jej piesek Sledder - są nierozłączni i nawet wyglądają podobnie! Aby wzbogacić zabawę, Hadley Husky (15 cm) ma na sobie zdejmowaną spódniczkę, okulary i buciki. Hadley Husky i Sledder mają podobne detale, takie jak okulary z kwiatowym motywem, co zachęca do wymyślania niezwykłych historyjek. Dzieci pokochają wyjątkową więź łączącą bohaterów ze świata Enchantimals! Doskonały prezent dla dzieci od 4 roku życia.', '', 'enchantimals-hadley-husky-sledder-zestaw-z-lalka-i-figurka', '', '', '', 'Enchantimals, Hadley Husky & Sledder, zestaw z lalką i figurką', '', '', '', ''),
(195, 1, 1, 'Uroczy bobasek New Born Baby pije i siusia do nocniczka, który wydaje dźwięki. Laleczkę można karmić widelczykiem lub łyżeczką oraz poić buteleczką. Bobaska można kąpać, a kiedy położysz go do snu, zamknie oczka i pójdzie spać. Bobasek jest z wykonany z nieprzemakalnego materiału aby można było go kąpać. New Born jest mięciutka, tak aby można było ją przytulać. Zabawka przeznaczona dla dzieci w wieku:  3+. W zestawie:  lalka o wysokości 38cm, która siusia, butelka do karmienia, miseczka ze sztućcami, nocnik z efektami dźwiękowymi, pieluszka i piżamka.', '', 'bobasek-newborn-lalka-38-cm', '', '', '', 'Bobasek Newborn, lalka, 38 cm', '', '', '', ''),
(195, 1, 2, 'Uroczy bobasek New Born Baby pije i siusia do nocniczka, który wydaje dźwięki. Laleczkę można karmić widelczykiem lub łyżeczką oraz poić buteleczką. Bobaska można kąpać, a kiedy położysz go do snu, zamknie oczka i pójdzie spać. Bobasek jest z wykonany z nieprzemakalnego materiału aby można było go kąpać. New Born jest mięciutka, tak aby można było ją przytulać. Zabawka przeznaczona dla dzieci w wieku:  3+. W zestawie:  lalka o wysokości 38cm, która siusia, butelka do karmienia, miseczka ze sztućcami, nocnik z efektami dźwiękowymi, pieluszka i piżamka.', '', 'bobasek-newborn-lalka-38-cm', '', '', '', 'Bobasek Newborn, lalka, 38 cm', '', '', '', ''),
(196, 1, 1, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach. Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka Barbie ma oryginalną fryzurę i wyjątkowy strój. Towarzyszy jej piesek w wesołych okularach na głowie. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-18', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 18', '', '', '', ''),
(196, 1, 2, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach. Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka Barbie ma oryginalną fryzurę i wyjątkowy strój. Towarzyszy jej piesek w wesołych okularach na głowie. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-18', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 18', '', '', '', ''),
(197, 1, 1, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Lady Diva to prawdziwa gwiazdą popu, która jest pewna siebie i stara, się aby każda chwila spędzona ze swoją ekipą była niesamowita. Uwielbia pomagać swoim przyjaciołom, przekazując dobrą energię, a więc daj jej mikrofon, włącz reflektory i przygotuj się do tańca! Lady Divajest starszą siostrą L.O.L. Surprise Diva. Jak wszystkie laleczki, L.O.L. Surprise O.M.G mają oszałamiające rysy twarzy, piękne włosy. Mają kilka punktów artykulacji co pozwala na ustawianie laleczek w przeróżnych pozach, a także ułatwiają przebieranie lalek. W opakowaniu czeka aż 11 niespodzianek do odkrycia! Sprawdź sama co kryje Twoja Lady Diva! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Lady Diva,  ubrania,  buty,  akcesoria,  szczotka do włosów,  stojak na lalkę Zbierz całą kolekcję Series 1:  Swag, Royal B, Lady Diva oraz Neonlicious.', '', 'lol-surprise-omg-lady-diva-laleczka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Lady Diva, laleczka modowa', '', '', '', ''),
