(198, 1, 2, '<b>Lalka Natalia śpiewająca modnisia 36 cm</b>  Śpiewa 2 piosenki:  Witaj, jestem Natalia oraz Kocham Cię, Mamusiu  Mówi 4 frazy:  Przytul mnie bardzo mocno, Pójdziemy na spacer, Bardzo lubię śpiewać oraz To świetna zabawa  Dodatkowe informacje:  Nr katalogowy:  121654              Marka:  Natalia Seria:  Pozostałe Wymagania wiekowe:  od 24 miesięcy Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Tak Zasilanie:  Baterie Wysokość:  36 cm Wymiary opakowania:  39,5 x 19 x 10 cm', '', 'artyk-natalia-spiewajaca-modnisia-lalka-36-cm', '', '', '', 'Artyk, Natalia, śpiewająca modnisia, lalka, 36 cm', '', '', '', ''),
(199, 1, 1, 'Młoda, zwinna i odważna Marinette jest gotowa stawić czoło Władcy Ciem. Zawsze chętnie rusza z pomocą, aby chronić swoje ukochane miasto, rodzinę i przyjaciół przed złoczyńcami. Miraculum z kwami Tikki umożliwia jej przemianę w Biedronkę. Pod postacią super bohaterki Marinette staje się silniejsza i zyskuje większą pewność siebie. Posiada specjalną umiejętność „Szczęśliwy traf” - może tworzyć przedmioty, które wykorzysta podczas walki ze złem. Zestaw Miraculous Sekret superbohatera zawiera lalkę przedstawiającą główną postać z animowanej bajki – Marinette w klasycznym stroju. Ma na sobie białą bluzkę, szarą marynarkę, różowe spodnie i różowe buty. W zaledwie kilka chwil twoje dziecko może przemienić Marinette w super bohaterkę – Biedronkę przebierając ją w czerwony kostium w czarne kropki, czerwone obuwie i umieszczając na jej twarzy maskę.', '', 'miraculous-biedronka-i-czarny-kot-lalka-marinette-i-stroj-biedronki', '', '', '', 'Miraculous:  Biedronka i Czarny Kot:  lalka Marinette i strój Biedronki', '', '', '', ''),
(199, 1, 2, 'Młoda, zwinna i odważna Marinette jest gotowa stawić czoło Władcy Ciem. Zawsze chętnie rusza z pomocą, aby chronić swoje ukochane miasto, rodzinę i przyjaciół przed złoczyńcami. Miraculum z kwami Tikki umożliwia jej przemianę w Biedronkę. Pod postacią super bohaterki Marinette staje się silniejsza i zyskuje większą pewność siebie. Posiada specjalną umiejętność „Szczęśliwy traf” - może tworzyć przedmioty, które wykorzysta podczas walki ze złem. Zestaw Miraculous Sekret superbohatera zawiera lalkę przedstawiającą główną postać z animowanej bajki – Marinette w klasycznym stroju. Ma na sobie białą bluzkę, szarą marynarkę, różowe spodnie i różowe buty. W zaledwie kilka chwil twoje dziecko może przemienić Marinette w super bohaterkę – Biedronkę przebierając ją w czerwony kostium w czarne kropki, czerwone obuwie i umieszczając na jej twarzy maskę.', '', 'miraculous-biedronka-i-czarny-kot-lalka-marinette-i-stroj-biedronki', '', '', '', 'Miraculous:  Biedronka i Czarny Kot:  lalka Marinette i strój Biedronki', '', '', '', ''),
(200, 1, 1, 'Oto lalka Barbie Dreamtopia Syrenka Tęczowa Przemiana - z nią zanurzysz się w kolorowym, bajkowym świecie! Funkcja zmiany koloru pobudza wyobraźnię dziewczynek i zachęca do jeszcze lepszej zabawy. Lalka ma we włosach tiarę, a do tego wielobarwny ogon i top z akcentami inspirowanymi morzem. Czas na magiczną zmianę kolorów - zanurz lalkę syrenkę Barbie w ciepłej wodzie i obserwuj, jak jej włosy, top i ogon natychmiast zmieniają kolory, ukazując całą tęczę pięknych pastelowych barw! Zanurz Barbie syrenkę w lodowatej wodzie, a kolory wrócą do pierwotnej wersji. Kolorową transformację możesz powtarzać bez końca! Informacje dodatkowe:  Lalka nie stoi i nie pływa samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-teczowa-przemiana-lalka-syrenka', '', '', '', 'Barbie, Tęczowa przemiana, lalka syrenka', '', '', '', ''),
(200, 1, 2, 'Oto lalka Barbie Dreamtopia Syrenka Tęczowa Przemiana - z nią zanurzysz się w kolorowym, bajkowym świecie! Funkcja zmiany koloru pobudza wyobraźnię dziewczynek i zachęca do jeszcze lepszej zabawy. Lalka ma we włosach tiarę, a do tego wielobarwny ogon i top z akcentami inspirowanymi morzem. Czas na magiczną zmianę kolorów - zanurz lalkę syrenkę Barbie w ciepłej wodzie i obserwuj, jak jej włosy, top i ogon natychmiast zmieniają kolory, ukazując całą tęczę pięknych pastelowych barw! Zanurz Barbie syrenkę w lodowatej wodzie, a kolory wrócą do pierwotnej wersji. Kolorową transformację możesz powtarzać bez końca! Informacje dodatkowe:  Lalka nie stoi i nie pływa samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-teczowa-przemiana-lalka-syrenka', '', '', '', 'Barbie, Tęczowa przemiana, lalka syrenka', '', '', '', ''),
(201, 1, 1, 'Lalka w nosidełku Wzory wysyłane są losowo.', '', 'trifox-lalka-w-nosidelku', '', '', '', 'Trifox, lalka w nosidełku', '', '', '', ''),
(201, 1, 2, 'Lalka w nosidełku Wzory wysyłane są losowo.', '', 'trifox-lalka-w-nosidelku', '', '', '', 'Trifox, lalka w nosidełku', '', '', '', ''),
(202, 1, 1, 'Wpadnij do Salonu piękności pudelków Enchantimals i zobacz niezwykłą metamorfozę piesków. W tym 15-elementowym zestawie są lalka (15 cm), 2 figurki piesków, stanowisko do kąpieli (16,5 cm) i akcesoria spa. Aby aktywować zmianę koloru, użyj zimnej wody i odkryj kolorowe dekoracje na głowie piesków! Tę magiczną transformację możesz powtarzać bez końca! Dzięki takim elementom jak stanowisko kąpielowe, \"suszarka\", butelka \"szamponu\" i nie tylko ten zestaw zawiera wszystko, aby lalka Perris Poodle (15 cm) mogła kąpać, pielęgnować i stylizować jej dwa pieski. Dzieci pokochają wyjątkową więź, jaka łączy te postacie Enchantimals. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zachęca do zabawy z wyobraźnią.', '', 'enchantimals-salon-pieknosci-pudelkow-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Salon piękności pudelków, zestaw z lalką i akcesoriami', '', '', '', ''),
(202, 1, 2, 'Wpadnij do Salonu piękności pudelków Enchantimals i zobacz niezwykłą metamorfozę piesków. W tym 15-elementowym zestawie są lalka (15 cm), 2 figurki piesków, stanowisko do kąpieli (16,5 cm) i akcesoria spa. Aby aktywować zmianę koloru, użyj zimnej wody i odkryj kolorowe dekoracje na głowie piesków! Tę magiczną transformację możesz powtarzać bez końca! Dzięki takim elementom jak stanowisko kąpielowe, \"suszarka\", butelka \"szamponu\" i nie tylko ten zestaw zawiera wszystko, aby lalka Perris Poodle (15 cm) mogła kąpać, pielęgnować i stylizować jej dwa pieski. Dzieci pokochają wyjątkową więź, jaka łączy te postacie Enchantimals. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zachęca do zabawy z wyobraźnią.', '', 'enchantimals-salon-pieknosci-pudelkow-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Salon piękności pudelków, zestaw z lalką i akcesoriami', '', '', '', ''),
(203, 1, 1, 'Braciszek posiada 6 funkcji działających bez konieczności użycia baterii. W zestawie 4 akcesoria.<br /><br />Braciszek jest nie tylko najlepszym bratem na świecie, ale też najlepszym przyjacielem na świecie. Na pasiastej koszulce ma napis Cool friends czyli najlepsi przyjaciele. Łobuziak łączy koszulkę ze schodzonymi dżinsami i niebieskimi trampkami. Czyż nie wygląda uroczo z tymi zmierzwionymi włosami opadającymi na skronie spod czapki? Tak naprawdę, to dość często rozczesuje czuprynę grzebieniem.<br />Braciszek jest super wysportowany. Dzięki elastycznym kolanom może samodzielnie stać. Marzy o karierze profesjonalnego skatera. Na treningi zawsze zabiera ze sobą sportowy bidon. Dzięki niemu może ugasić pragnienie. Gdy jakiś trik się nie uda, albo dojdzie do bolesnego upadku, Braciszek uroni łezkę. Oczywiście płacze tylko wtedy, gdy dziewczyny nie patrzą. Po treningu musi się odświeżyć, więc wskakuje do wanienki BABY born. Wszak jazda na deskorolce to prawdziwy wysiłek. Naśladuje 6 funkcji życiowych dostarczając mnóstwo zabawy. Pasują na nią wszystkie ubranka BABY born. Zabawa zestawami BABY born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Zabawka nie wymaga baterii. Dodatkowe informacje:  Wymagania wiekowe:  od 3 lat Wysokość:  43 cm Akcesoria w zestawie:  Butelka Grzebień 1 bransoletka przyjaźni dla dziecka i dla lalki.', '', 'baby-born-lalka-braciszek-43-cm', '', '', '', 'Baby Born, lalka braciszek, 43 cm', '', '', '', ''),
(203, 1, 2, 'Braciszek posiada 6 funkcji działających bez konieczności użycia baterii. W zestawie 4 akcesoria.<br /><br />Braciszek jest nie tylko najlepszym bratem na świecie, ale też najlepszym przyjacielem na świecie. Na pasiastej koszulce ma napis Cool friends czyli najlepsi przyjaciele. Łobuziak łączy koszulkę ze schodzonymi dżinsami i niebieskimi trampkami. Czyż nie wygląda uroczo z tymi zmierzwionymi włosami opadającymi na skronie spod czapki? Tak naprawdę, to dość często rozczesuje czuprynę grzebieniem.<br />Braciszek jest super wysportowany. Dzięki elastycznym kolanom może samodzielnie stać. Marzy o karierze profesjonalnego skatera. Na treningi zawsze zabiera ze sobą sportowy bidon. Dzięki niemu może ugasić pragnienie. Gdy jakiś trik się nie uda, albo dojdzie do bolesnego upadku, Braciszek uroni łezkę. Oczywiście płacze tylko wtedy, gdy dziewczyny nie patrzą. Po treningu musi się odświeżyć, więc wskakuje do wanienki BABY born. Wszak jazda na deskorolce to prawdziwy wysiłek. Naśladuje 6 funkcji życiowych dostarczając mnóstwo zabawy. Pasują na nią wszystkie ubranka BABY born. Zabawa zestawami BABY born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Zabawka nie wymaga baterii. Dodatkowe informacje:  Wymagania wiekowe:  od 3 lat Wysokość:  43 cm Akcesoria w zestawie:  Butelka Grzebień 1 bransoletka przyjaźni dla dziecka i dla lalki.', '', 'baby-born-lalka-braciszek-43-cm', '', '', '', 'Baby Born, lalka braciszek, 43 cm', '', '', '', ''),
(204, 1, 1, 'Lalka - mały bobas, który wydaje dźwięki. Ma wielkość 32 cm. Ubrany jest w piżamkę i czapeczkę. Lalka posiada dobrze wyszczególnione niebieskie źrenice. Ma bardzo dobrze odwzorowane palce, stópki, buzie i ciało do rzeczywistego wyglądu. Dodatkowo dołączono nosidełko z poduszką oraz butelkę. Z takim zestawem dziecko nauczy się opieki oraz troski nad drugą osobą. Opakowanie posiada rączkę. Wymiary opakowania:  37,5x32x10 cm', '', 'bigtoys-lalka-bobas-z-butelka-i-nosidelkiem-33-cm', '', '', '', 'BigToys, lalka bobas, z butelką i nosidełkiem, 33 cm', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(204, 1, 2, 'Lalka - mały bobas, który wydaje dźwięki. Ma wielkość 32 cm. Ubrany jest w piżamkę i czapeczkę. Lalka posiada dobrze wyszczególnione niebieskie źrenice. Ma bardzo dobrze odwzorowane palce, stópki, buzie i ciało do rzeczywistego wyglądu. Dodatkowo dołączono nosidełko z poduszką oraz butelkę. Z takim zestawem dziecko nauczy się opieki oraz troski nad drugą osobą. Opakowanie posiada rączkę. Wymiary opakowania:  37,5x32x10 cm', '', 'bigtoys-lalka-bobas-z-butelka-i-nosidelkiem-33-cm', '', '', '', 'BigToys, lalka bobas, z butelką i nosidełkiem, 33 cm', '', '', '', ''),
(205, 1, 1, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-179', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 179', '', '', '', ''),
(205, 1, 2, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-179', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 179', '', '', '', ''),
(206, 1, 1, 'Dzień dobry! To będzie taki fajny dzień! Mała Annabell ze swoim miękkim materiałowym ciałem jest zdecydowanie porannym ptaszkiem. Gdy tylko wstanie słońce, jest gotowa do zabawy. Oczywiście najpierw potrzebuje śniadania. Po wypiciu z butelki uwielbia się bawić i przytulać. Kiedy dziewczynka ma dość zabawy i leży na plecach, zamyka niebieskie oczy. Jeśli nie, będzie obserwować wszystko, co dzieje się uważnie, aż do zachodu słońca. Wieczorne niebo ma ten sam kolor, co romper Małej Annabell. Dzięki tak cudownie miękkiemu body w pastelowej moreli i pasującej czapce maluch nie musi się przebrać w piżamę. Wykonany w stylu łatwego dopasowania romper można łatwo założyć i zdjąć nawet najmniejszą ręką.', '', 'little-baby-annabell-lalka-36-cm', '', '', '', 'Little Baby Annabell, lalka, 36 cm', '', '', '', ''),
(206, 1, 2, 'Dzień dobry! To będzie taki fajny dzień! Mała Annabell ze swoim miękkim materiałowym ciałem jest zdecydowanie porannym ptaszkiem. Gdy tylko wstanie słońce, jest gotowa do zabawy. Oczywiście najpierw potrzebuje śniadania. Po wypiciu z butelki uwielbia się bawić i przytulać. Kiedy dziewczynka ma dość zabawy i leży na plecach, zamyka niebieskie oczy. Jeśli nie, będzie obserwować wszystko, co dzieje się uważnie, aż do zachodu słońca. Wieczorne niebo ma ten sam kolor, co romper Małej Annabell. Dzięki tak cudownie miękkiemu body w pastelowej moreli i pasującej czapce maluch nie musi się przebrać w piżamę. Wykonany w stylu łatwego dopasowania romper można łatwo założyć i zdjąć nawet najmniejszą ręką.', '', 'little-baby-annabell-lalka-36-cm', '', '', '', 'Little Baby Annabell, lalka, 36 cm', '', '', '', ''),
(207, 1, 1, 'Niezależnie od tego, czy ceremonia odbędzie się na zamku w baśniowym królestwie, czy w rodzinnym gronie na leśnej polance, śluby są wspaniałe! Dziewczynki mogą bawić się w swoje ulubione „na zawsze razem” z tą zachwycającą lalką Barbie Panna Młoda. Barbie w wyjątkowym stroju na tę wyjątkową okazję jest gotowa pewnym krokiem wejść na nową drogę życia. Klasyczna suknia ślubna bez ramiączek, z obszernym dołem, urozmaicona modnymi akcentami kolorystycznymi oraz mieniącymi się zdobieniami (obowiązkowo różowymi!) sprawia, że Barbie jest wspaniałą nowoczesną panną młodą! Załóż pannie młodej zachwycający naszyjnik i opaskę z welonem, aby ruszyła przez tłum ślubnych gości wprost do wyobraźni dziewczynek. Po sakramentalnym „tak” rzuć pięknym różowym bukiecikiem dopasowanym do dłoni lalki w stronę jej najlepszych przyjaciółek (sprzedawane oddzielnie). Następnie podziwiaj jej przepiękną obrączkę i rusz w stronę cudownego baśniowego zachodu słońca. Dziewczynki pokochają zabawę w odtwarzanie niezapomnianych ślubów i wymyślanie własnych baśniowych przygód. Lalka nie stoi samodzielnie. W zestawie:    lalka Barbie w sukni ślubnej z dodatkami, które obejmują welon (przyczepiony do opaski),  naszyjnik,  buciki i bukiecik do ręki.', '', 'barbie-panna-mloda-lalka', '', '', '', 'Barbie, Panna Młoda, lalka', '', '', '', ''),
(207, 1, 2, 'Niezależnie od tego, czy ceremonia odbędzie się na zamku w baśniowym królestwie, czy w rodzinnym gronie na leśnej polance, śluby są wspaniałe! Dziewczynki mogą bawić się w swoje ulubione „na zawsze razem” z tą zachwycającą lalką Barbie Panna Młoda. Barbie w wyjątkowym stroju na tę wyjątkową okazję jest gotowa pewnym krokiem wejść na nową drogę życia. Klasyczna suknia ślubna bez ramiączek, z obszernym dołem, urozmaicona modnymi akcentami kolorystycznymi oraz mieniącymi się zdobieniami (obowiązkowo różowymi!) sprawia, że Barbie jest wspaniałą nowoczesną panną młodą! Załóż pannie młodej zachwycający naszyjnik i opaskę z welonem, aby ruszyła przez tłum ślubnych gości wprost do wyobraźni dziewczynek. Po sakramentalnym „tak” rzuć pięknym różowym bukiecikiem dopasowanym do dłoni lalki w stronę jej najlepszych przyjaciółek (sprzedawane oddzielnie). Następnie podziwiaj jej przepiękną obrączkę i rusz w stronę cudownego baśniowego zachodu słońca. Dziewczynki pokochają zabawę w odtwarzanie niezapomnianych ślubów i wymyślanie własnych baśniowych przygód. Lalka nie stoi samodzielnie. W zestawie:    lalka Barbie w sukni ślubnej z dodatkami, które obejmują welon (przyczepiony do opaski),  naszyjnik,  buciki i bukiecik do ręki.', '', 'barbie-panna-mloda-lalka', '', '', '', 'Barbie, Panna Młoda, lalka', '', '', '', ''),
(208, 1, 1, 'Konik Mega Creative zabierze Cię w fantazyjny świat bajek. Połączenie Konika z bogatą wyobraźnią dziecięcą przeobrazi się w wielogodzinne zabawy Koń posiada bujna grzywę oraz długi ogon, grzywę i ogon można czesać. Zawartość zestawu:  konik, grzebyk do czesania konika. Konik występuje w czterech kolorach:  czarnym - kara, gniadym kasztanowym, białym, siwym. Wysyłka losowa. Wymiary produktu dł. x wys. x gł. cm:  17x17x5, Wymiary opakowania 17x17x5 dł. x wys. gł. cm:  Waga produktu bez opakowania kg:  0,07 kg, Waga produktu w opakowaniu kg:  1,11 kg, nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3', '', 'mega-creative-konik-akcesoria', '', '', '', 'Mega Creative, konik, akcesoria', '', '', '', ''),
(208, 1, 2, 'Konik Mega Creative zabierze Cię w fantazyjny świat bajek. Połączenie Konika z bogatą wyobraźnią dziecięcą przeobrazi się w wielogodzinne zabawy Koń posiada bujna grzywę oraz długi ogon, grzywę i ogon można czesać. Zawartość zestawu:  konik, grzebyk do czesania konika. Konik występuje w czterech kolorach:  czarnym - kara, gniadym kasztanowym, białym, siwym. Wysyłka losowa. Wymiary produktu dł. x wys. x gł. cm:  17x17x5, Wymiary opakowania 17x17x5 dł. x wys. gł. cm:  Waga produktu bez opakowania kg:  0,07 kg, Waga produktu w opakowaniu kg:  1,11 kg, nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3', '', 'mega-creative-konik-akcesoria', '', '', '', 'Mega Creative, konik, akcesoria', '', '', '', ''),
(209, 1, 1, 'Pomóż lalce Haydie Horse opiekować się zwierzątkami w żłobku na farmie Enchantimals. Będzie wesoło! Zestaw ze żłobkiem (25 cm) zawiera lalkę Haydie Horse (15 cm), 4 figurki zwierząt, stolik, łóżeczko, koszyk, gniazdo i mniejsze akcesoria. Układaj figurki zwierząt do snu w koszyku-kołysce lub łóżeczku z obrotową karuzelą. Karm lub przewijaj swoich zwierzęcych przyjaciół na stole, który można wykorzystywać także jako wysokie krzesełko . Dzieci mogą opiekować się zwierzętami - pomogą w tym mniejsze akcesoria, takie jak śliniaczek, pieluszka lub butelka. W zestawie znajdziesz nawet gniazdo z jajkiem, z którego może wykluć się pisklę! Pięć postaci ze świata Enchantimals dostarcza mnóstwa inspiracji do wymyślania własnych przygód! Wspaniały prezent dla dzieci powyżej 3 roku życia!', '', 'enchantimals-zlobek-na-farmie-zestaw-z-lalka-zwierzatkami-i-akcesoriami', '', '', '', 'Enchantimals, Żłobek na farmie, zestaw z lalką, zwierzątkami i akcesoriami', '', '', '', ''),
(209, 1, 2, 'Pomóż lalce Haydie Horse opiekować się zwierzątkami w żłobku na farmie Enchantimals. Będzie wesoło! Zestaw ze żłobkiem (25 cm) zawiera lalkę Haydie Horse (15 cm), 4 figurki zwierząt, stolik, łóżeczko, koszyk, gniazdo i mniejsze akcesoria. Układaj figurki zwierząt do snu w koszyku-kołysce lub łóżeczku z obrotową karuzelą. Karm lub przewijaj swoich zwierzęcych przyjaciół na stole, który można wykorzystywać także jako wysokie krzesełko . Dzieci mogą opiekować się zwierzętami - pomogą w tym mniejsze akcesoria, takie jak śliniaczek, pieluszka lub butelka. W zestawie znajdziesz nawet gniazdo z jajkiem, z którego może wykluć się pisklę! Pięć postaci ze świata Enchantimals dostarcza mnóstwa inspiracji do wymyślania własnych przygód! Wspaniały prezent dla dzieci powyżej 3 roku życia!', '', 'enchantimals-zlobek-na-farmie-zestaw-z-lalka-zwierzatkami-i-akcesoriami', '', '', '', 'Enchantimals, Żłobek na farmie, zestaw z lalką, zwierzątkami i akcesoriami', '', '', '', ''),
(210, 1, 1, 'Lalka Julka to idealna towarzyszka spacerów dla małej opiekunki. Włóż ją do wózka, zabierz na spacer, zaproś na herbatkę. Przytul i baw się razem ze swoim bobaskiem. Lalka i jej ubrania wykonane są z wysokiej jakości materiałów. Dobrze dopracowane detale. Dziewczynka, która zaopiekuje się bobaskiem nauczy się:  Opiekować inną osobą Tworzyć i pielęgnować więzi Razem z Julką dziecko nauczy się angielskiego, ponad 60 słów angielskich i polskich Zaśpiewa trzy piosenki i wysłucha dwóch bajeczek:  Złotowłosa i 3 misie, Czerwony Kapturek Lalka ma 32 cm wysokości.  Wymiar:  32x18x8,5 cm. Wiek:  2+.', '', 'smily-play-julka-lalka-interaktywna-32-cm', '', '', '', 'Smily Play, Julka, lalka interaktywna, 32 cm', '', '', '', ''),
(210, 1, 2, 'Lalka Julka to idealna towarzyszka spacerów dla małej opiekunki. Włóż ją do wózka, zabierz na spacer, zaproś na herbatkę. Przytul i baw się razem ze swoim bobaskiem. Lalka i jej ubrania wykonane są z wysokiej jakości materiałów. Dobrze dopracowane detale. Dziewczynka, która zaopiekuje się bobaskiem nauczy się:  Opiekować inną osobą Tworzyć i pielęgnować więzi Razem z Julką dziecko nauczy się angielskiego, ponad 60 słów angielskich i polskich Zaśpiewa trzy piosenki i wysłucha dwóch bajeczek:  Złotowłosa i 3 misie, Czerwony Kapturek Lalka ma 32 cm wysokości.  Wymiar:  32x18x8,5 cm. Wiek:  2+.', '', 'smily-play-julka-lalka-interaktywna-32-cm', '', '', '', 'Smily Play, Julka, lalka interaktywna, 32 cm', '', '', '', ''),
(211, 1, 1, 'Pomknij ku przygodzie z lalkami Enchantimals Przejażdżka po mieście. W tym zestawie z ponad 15 elementami są lalki Danessa Deer, Felicity Fox, Hardie Hamster, Bashy Bunny i Crizia Corgi (15 cm) oraz ich zwierzęcy przyjaciele. Każda lalka ma parę wrotek lub deskorolkę z obracającymi się kółkami - wystarczy ją popchnąć, aby pojechać ku przygodzie. Aby zabawa była jeszcze większa, lalki mają na sobie zdejmowane ubranko i akcesoria, takie jak spódniczki, buciki, ochraniacze na kolana i kaski. Dzieci pokochają przeżywanie miejskich przygód z tymi uroczymi przyjaciółmi Enchantimals. Ten zestaw to doskonały prezent dla dzieci od 4 roku życia zawierający gotową kolekcję Enchantimals.', '', 'enchantimals-przejazdzka-po-miescie-zestaw-z-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Przejażdżka po mieście, zestaw z lalkami i zwierzątkami', '', '', '', ''),
(211, 1, 2, 'Pomknij ku przygodzie z lalkami Enchantimals Przejażdżka po mieście. W tym zestawie z ponad 15 elementami są lalki Danessa Deer, Felicity Fox, Hardie Hamster, Bashy Bunny i Crizia Corgi (15 cm) oraz ich zwierzęcy przyjaciele. Każda lalka ma parę wrotek lub deskorolkę z obracającymi się kółkami - wystarczy ją popchnąć, aby pojechać ku przygodzie. Aby zabawa była jeszcze większa, lalki mają na sobie zdejmowane ubranko i akcesoria, takie jak spódniczki, buciki, ochraniacze na kolana i kaski. Dzieci pokochają przeżywanie miejskich przygód z tymi uroczymi przyjaciółmi Enchantimals. Ten zestaw to doskonały prezent dla dzieci od 4 roku życia zawierający gotową kolekcję Enchantimals.', '', 'enchantimals-przejazdzka-po-miescie-zestaw-z-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Przejażdżka po mieście, zestaw z lalkami i zwierzątkami', '', '', '', ''),
(212, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Poznaj młodsze wersje swoich sześciu ulubionych oryginalnych lalek Rainbow High Fashion! Ruby, Poppy, Sunny, Jade, Skyler i Violet. Każda z nich ma swoją własną historię o tym, jak odnalazły swoją twórczą pasję, zanim stały się uczennicami Rainbow High. Każda jest tak samo piękna, stylowa i kolorowa. Rainbow High Junior High to urocze laleczki, które mają piękne, młode rysy twarzy. Ich kolorowe i długie włosy nadają każdej z nich unikatowego charakteru, ale także są idealne do układania fantazyjnych fryzur. W zestawie znajdziesz akcesoria do włosów oraz grzebień. Dzięki kilku punktom artykulacji mogą z łatwością zmieniać pozy i dostosowywać się do Twojej wizji. Bardzo łatwo można je przebrać więc możesz dopasować każdą laleczkę do Twojej stylizacji. Laleczki Junior High nie mogą obejść się bez plecaka, który pomieści wszystkie potrzebne w szkole modowej artykuły. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High Junior High:  Ruby Anderson, Poppy Rowan, Sunny Madison, Jade Hunter, Skyler Bradshaw, Violet Willow (sprzedawane oddzielnie)! Wysokość lalki:  ok. 22 cm.', '', 'rainbow-high-junior-high-sunny-madison-lalka-modowa', '', '', '', 'Rainbow High, Junior High, Sunny Madison, lalka modowa', '', '', '', ''),
