(215, 1, 1, 'Lalka Agusia mini w wanience.  Wykąp swojego bobasa, a potem owiń go kocykiem.  Lalka wykonana z wysokiej jakości materiałów.  Do zestawu dołączona butelka.  Wiek 3+, wymiary wanienki 13x21x7 cm, wysokość:  lalki 17 cm.  Kocyk w różnych kolorach. Uwaga! Produkt wielowariantowy, produkt wysyłany losowo.', '', 'dromader-agusia-lalka-w-wanience-17-cm-1-szt', '', '', '', 'Dromader, Agusia, lalka w wanience, 17 cm, 1 szt.', '', '', '', ''),
