(216, 1, 1, 'Zestaw małego stylisty, wykonany z plastiku, doskonale odzwierciedlają prawdziwe akcesoria fryzjerskie. Suszarka posiada elementy dźwiękowe i świetlne. Produkt umieszczony na blistrze. \nZestaw zasilany bateriami:  1x1,5V LR6 (brak w zestawie).\n Zestaw zawiera:  1x suszarkę, 1x grzebień,\n Wymiary opakowania:  28x19,5x6cm,\n wiek:  3+.', '', 'gazelo-akcesoria-dla-lalek-suszarka-grzebien', '', '', '', 'Gazelo, akcesoria dla lalek, suszarka, grzebień', '', '', '', ''),
(216, 1, 2, 'Zestaw małego stylisty, wykonany z plastiku, doskonale odzwierciedlają prawdziwe akcesoria fryzjerskie. Suszarka posiada elementy dźwiękowe i świetlne. Produkt umieszczony na blistrze. \nZestaw zasilany bateriami:  1x1,5V LR6 (brak w zestawie).\n Zestaw zawiera:  1x suszarkę, 1x grzebień,\n Wymiary opakowania:  28x19,5x6cm,\n wiek:  3+.', '', 'gazelo-akcesoria-dla-lalek-suszarka-grzebien', '', '', '', 'Gazelo, akcesoria dla lalek, suszarka, grzebień', '', '', '', ''),
(217, 1, 1, 'Kalendarz adwentowy Barbie Dreamtopia zachwyci dzieci 25 upominkami, które mogą stopniowo odkrywać w oczekiwaniu na święta Pierwszego dnia dzieci wyjmują lalkę Barbie, a przez następne 24 dni otwierają po jednym nowym okienku. Mogą odkryć ubranko, akcesorium lub element do zabawy Wśród ubranek są 2 spódniczki, para skrzydełek i ogon syrenki, aby młodzi marzyciele mogli przebierać Barbie za księżniczkę, syrenkę lub wróżkę. Wśród uroczych akcesoriów są kolorowe buciki, tiary, naszyjniki, różdżka i szczotka do włosów - wszystkie z fantastycznymi detalami. Możesz je dowolnie łączyć, aby tworzyć nowe stylizacje. Dodatkowe niespodzianki, w tym 4 zwierzątka - piesek, miś, mały smok i jednorożec - inspirują do opowiadania własnych historyjek. Dzięki magicznej zabawie na 24 dni pełne niespodzianek ten Kalendarz adwentowy Barbie Dreamtopia to doskonały prezent dla dzieci od 3 roku życia Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-kalendarz-adwentowy-barbie-dreamtopia-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kalendarz adwentowy Barbie Dreamtopia, zestaw z lalką i akcesoriami', '', '', '', ''),
