(218, 1, 1, 'Lalka Julka to idealna towarzyszka spacerów dla małej opiekunki. Włóż ją do wózka, zabierz na spacer, zaproś na herbatkę. Przytul i baw się razem ze swoim bobaskiem. Lalka i jej ubrania wykonane są z wysokiej jakości materiałów. Dobrze dopracowane detale. Dziewczynka, która zaopiekuje się bobaskiem nauczy się:  Opiekować inną osobą Tworzyć i pielęgnować więzi Razem z Julką dziecko nauczy się angielskiego, ponad 60 słow angielskich i polskich Zaśpiewa trzy piosenki i wysłucha dwóch bajeczek:  Złotowłosa i 3 misie, Czerwony Kapturek Lalka ma 32 cm wysokości.  Wymiary:  32x18x8,5 cm. Wiek:  2+.', '', 'smily-play-julka-lalka-interaktywna-32-cm', '', '', '', 'Smily Play, Julka, lalka interaktywna, 32 cm', '', '', '', ''),
(218, 1, 2, 'Lalka Julka to idealna towarzyszka spacerów dla małej opiekunki. Włóż ją do wózka, zabierz na spacer, zaproś na herbatkę. Przytul i baw się razem ze swoim bobaskiem. Lalka i jej ubrania wykonane są z wysokiej jakości materiałów. Dobrze dopracowane detale. Dziewczynka, która zaopiekuje się bobaskiem nauczy się:  Opiekować inną osobą Tworzyć i pielęgnować więzi Razem z Julką dziecko nauczy się angielskiego, ponad 60 słow angielskich i polskich Zaśpiewa trzy piosenki i wysłucha dwóch bajeczek:  Złotowłosa i 3 misie, Czerwony Kapturek Lalka ma 32 cm wysokości.  Wymiary:  32x18x8,5 cm. Wiek:  2+.', '', 'smily-play-julka-lalka-interaktywna-32-cm', '', '', '', 'Smily Play, Julka, lalka interaktywna, 32 cm', '', '', '', ''),
(219, 1, 1, 'Kolorowa szafa dla lalek kryje w sobie wiele niespodzianek. Posiada w swoim wyposażeniu:  lustro, wieszaki, sukienki, buty i torebki. Podane wymiary są wymiarami szafy.', '', 'swede-szafa-z-ubraniami-dla-lalek', '', '', '', 'Swede, szafa z ubraniami dla lalek', '', '', '', ''),
(219, 1, 2, 'Kolorowa szafa dla lalek kryje w sobie wiele niespodzianek. Posiada w swoim wyposażeniu:  lustro, wieszaki, sukienki, buty i torebki. Podane wymiary są wymiarami szafy.', '', 'swede-szafa-z-ubraniami-dla-lalek', '', '', '', 'Swede, szafa z ubraniami dla lalek', '', '', '', ''),
(220, 1, 1, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Swag to prawdziwa artystka. Sama pisze teksty do swoich piosenek. Jest ma świetną osobowość, dzięki której jest kochana przez wszystkich. Lubi pokazywać inny punkt widzenia w swoich piosenkach. Jest starszą stostroą supergwiazdy L.O.L. Surprisww MC Swag. Jak wszystkie laleczki, L.O.L. Surprise O.M.G mają oszałamiające rysy twarzy, piękne włosy, a do tego wspaniały streetwearowy styl. Mają kilka punktów artykulacji co pozwala na ustawianie laleczek w przeróżnych pozach, a także ułatwiają przebieranie lalek. W opakowaniu czeka aż 11 niespodzianek do odkrycia! Sprawdź sama co kryje Twoja Swag! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Swag,  ubrania,  buty,  akcesoria,  szczotka do włosów,  stojak na lalkę Zbierz całą kolekcję Series 1:  Swag, Royal B, Lady Diva oraz Neonlicious.', '', 'lol-surprise-omg-swag-laleczka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Swag, laleczka modowa', '', '', '', ''),
(220, 1, 2, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Swag to prawdziwa artystka. Sama pisze teksty do swoich piosenek. Jest ma świetną osobowość, dzięki której jest kochana przez wszystkich. Lubi pokazywać inny punkt widzenia w swoich piosenkach. Jest starszą stostroą supergwiazdy L.O.L. Surprisww MC Swag. Jak wszystkie laleczki, L.O.L. Surprise O.M.G mają oszałamiające rysy twarzy, piękne włosy, a do tego wspaniały streetwearowy styl. Mają kilka punktów artykulacji co pozwala na ustawianie laleczek w przeróżnych pozach, a także ułatwiają przebieranie lalek. W opakowaniu czeka aż 11 niespodzianek do odkrycia! Sprawdź sama co kryje Twoja Swag! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Swag,  ubrania,  buty,  akcesoria,  szczotka do włosów,  stojak na lalkę Zbierz całą kolekcję Series 1:  Swag, Royal B, Lady Diva oraz Neonlicious.', '', 'lol-surprise-omg-swag-laleczka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Swag, laleczka modowa', '', '', '', ''),
(221, 1, 1, 'Dołącz do Harry\'ego Pottera, ucząc się robienia eliksirów w klasie eliksirów Wizarding World.  Dzięki wyjątkowej 3-calowej lalce Harry\'ego Pottera i trzem tematycznym akcesoriom młode czarownice, czarodzieje i mugole mogą odtwarzać ulubione sceny z Harry\'ego Pottera. Dzięki podręcznikowi tworzenia mikstur Księcia Półkrwi, Harry może warzyć eliksiry, w tym gwarantujący szczęście Felix Felicis. Ustaw swoją figurkę Magical Minis i podpal płomienie pod kociołkiem, przesuwając Herry\'ego nad miejscem aktywacji. Języki ognia unoszą się, a kociołek magicznie otwiera! Wzbogać swoją opowieść pokazując eliksir Felix Felicis na blacie ruchomego biurka! Ten zestaw to doskonały sposób pobudzenia wyobraźni poprzez ekscytującą zabawę. Połącz go z zamkiem Hogwart Magical Minis (sprzedawany oddzielnie) i rozszerz o klasę zaklęć oraz zestaw opieki nad magicznymi zwierzętami (zestawy z lalkami są sprzedawane osobno). Zbierz wszystkie Lalki Magical Minis i zestawy do zabawy, aby stworzyć swój własny świat czarodziejów (każdy sprzedawany osobno). Zabawki Magical Minis to idealne prezenty dla dzieci i fanów Harry\'ego Pottera. Poczuj magię dzięki klasie zaklęć!', '', 'wizarding-world-harry-potter-eliksiry-zestaw-z-figurka', '', '', '', 'Wizarding World, Harry Potter, Eliksiry, zestaw z figurką', '', '', '', ''),
(221, 1, 2, 'Dołącz do Harry\'ego Pottera, ucząc się robienia eliksirów w klasie eliksirów Wizarding World.  Dzięki wyjątkowej 3-calowej lalce Harry\'ego Pottera i trzem tematycznym akcesoriom młode czarownice, czarodzieje i mugole mogą odtwarzać ulubione sceny z Harry\'ego Pottera. Dzięki podręcznikowi tworzenia mikstur Księcia Półkrwi, Harry może warzyć eliksiry, w tym gwarantujący szczęście Felix Felicis. Ustaw swoją figurkę Magical Minis i podpal płomienie pod kociołkiem, przesuwając Herry\'ego nad miejscem aktywacji. Języki ognia unoszą się, a kociołek magicznie otwiera! Wzbogać swoją opowieść pokazując eliksir Felix Felicis na blacie ruchomego biurka! Ten zestaw to doskonały sposób pobudzenia wyobraźni poprzez ekscytującą zabawę. Połącz go z zamkiem Hogwart Magical Minis (sprzedawany oddzielnie) i rozszerz o klasę zaklęć oraz zestaw opieki nad magicznymi zwierzętami (zestawy z lalkami są sprzedawane osobno). Zbierz wszystkie Lalki Magical Minis i zestawy do zabawy, aby stworzyć swój własny świat czarodziejów (każdy sprzedawany osobno). Zabawki Magical Minis to idealne prezenty dla dzieci i fanów Harry\'ego Pottera. Poczuj magię dzięki klasie zaklęć!', '', 'wizarding-world-harry-potter-eliksiry-zestaw-z-figurka', '', '', '', 'Wizarding World, Harry Potter, Eliksiry, zestaw z figurką', '', '', '', ''),
(222, 1, 1, 'Barbie Color Reveal Neon Tie-Dye to wyjątkowy prezent dla dziecka. Zestaw z lalką, który zachwyci każdą dziewczynkę! W opakowaniu znajduje się duża lalka niespodzianka oraz moc akcesoriów! Aby dowiedzieć się, jak wygląda lalka, należy użyć wody i tuby z zestawu. W zestawie znajdziesz ponadto akcesoria niespodzianki ukryte w torebkach. Używaj na zmianę ciepłej i zimnej wody, by odkryć dodatkowe elementy ozdobne! Ubieraj lalkę, dopasowuj akcesoria, baw się każdego dnia! Kolory i zdobienia mogą się różnić. Lalka nie stoi samodzielnie. Idealny prezent dla dziewczynki w wieku od 3 lat.', '', 'barbie-color-reveal-neon-tie-dye-lalka-1-szt', '', '', '', 'Barbie, Color Reveal, Neon Tie-Dye, lalka, 1 szt.', '', '', '', ''),
(222, 1, 2, 'Barbie Color Reveal Neon Tie-Dye to wyjątkowy prezent dla dziecka. Zestaw z lalką, który zachwyci każdą dziewczynkę! W opakowaniu znajduje się duża lalka niespodzianka oraz moc akcesoriów! Aby dowiedzieć się, jak wygląda lalka, należy użyć wody i tuby z zestawu. W zestawie znajdziesz ponadto akcesoria niespodzianki ukryte w torebkach. Używaj na zmianę ciepłej i zimnej wody, by odkryć dodatkowe elementy ozdobne! Ubieraj lalkę, dopasowuj akcesoria, baw się każdego dnia! Kolory i zdobienia mogą się różnić. Lalka nie stoi samodzielnie. Idealny prezent dla dziewczynki w wieku od 3 lat.', '', 'barbie-color-reveal-neon-tie-dye-lalka-1-szt', '', '', '', 'Barbie, Color Reveal, Neon Tie-Dye, lalka, 1 szt.', '', '', '', ''),
(223, 1, 1, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach.  Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka posiada torebkę, okulary oraz biżuterię. Barbie ubrana jest w modny strój w jasnych odcieniach. Towarzyszy jej piesek. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-16', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 16', '', '', '', ''),
(223, 1, 2, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach.  Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Lalka posiada torebkę, okulary oraz biżuterię. Barbie ubrana jest w modny strój w jasnych odcieniach. Towarzyszy jej piesek. Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-16', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 16', '', '', '', ''),
(224, 1, 1, 'Zestaw z akcesoriami do opieki nad niemowlaczkiem zainteresuje każdą dziewczynkę, która lubi zabawy w rodzinę. Laleczka Evi jako opiekunka niemowlaka ma do dyspozycji:  komodę z przewijakiem wanienkę nocnik grzechotki buteleczki talerz i sztućce Wielkość laleczki:  12 cm.', '', 'evi-love-lalka-opiekunka-niemowlaka', '', '', '', 'Evi Love, lalka opiekunka niemowlaka', '', '', '', ''),
(224, 1, 2, 'Zestaw z akcesoriami do opieki nad niemowlaczkiem zainteresuje każdą dziewczynkę, która lubi zabawy w rodzinę. Laleczka Evi jako opiekunka niemowlaka ma do dyspozycji:  komodę z przewijakiem wanienkę nocnik grzechotki buteleczki talerz i sztućce Wielkość laleczki:  12 cm.', '', 'evi-love-lalka-opiekunka-niemowlaka', '', '', '', 'Evi Love, lalka opiekunka niemowlaka', '', '', '', ''),
(225, 1, 1, 'Magnetyczna moda Maggie to zestaw do kreatywnej zabawy od firmy Quercetti. Nowa odsłona produktu i wiele nowych magnetycznych sukienek, które można ze sobą łączyć, aby stworzyć idealny strój. Zestaw zawiera:   29 magnetycznych elementów, które można ze sobą dowolnie łączyć, by tworzyć olśniewające kreacje,  magnetyczną lalkę Maggie. Wszystkie zestawy z „Magnetic Fashion” są kompatybilne. Bawiąc się z Anią i Laurą można łączyć ze sobą różne style i wymyślać za każdym razem nowe stylizacje. Wymiary:  30x29,5x6,5 cm. Wiek:  5+.', '', 'quercetti-magnetyczna-moda-maggie-zestaw-kreatywny', '', '', '', 'Quercetti, Magnetyczna moda, Maggie, zestaw kreatywny', '', '', '', ''),
(225, 1, 2, 'Magnetyczna moda Maggie to zestaw do kreatywnej zabawy od firmy Quercetti. Nowa odsłona produktu i wiele nowych magnetycznych sukienek, które można ze sobą łączyć, aby stworzyć idealny strój. Zestaw zawiera:   29 magnetycznych elementów, które można ze sobą dowolnie łączyć, by tworzyć olśniewające kreacje,  magnetyczną lalkę Maggie. Wszystkie zestawy z „Magnetic Fashion” są kompatybilne. Bawiąc się z Anią i Laurą można łączyć ze sobą różne style i wymyślać za każdym razem nowe stylizacje. Wymiary:  30x29,5x6,5 cm. Wiek:  5+.', '', 'quercetti-magnetyczna-moda-maggie-zestaw-kreatywny', '', '', '', 'Quercetti, Magnetyczna moda, Maggie, zestaw kreatywny', '', '', '', ''),
(226, 1, 1, 'Na fali, w toni oceanu, głęboko pod wodą… Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają zmieniać swój wygląd! Słodka czy słona? Osobowość - i styl - tej zupełnie nowej syrenki zmienia się w zależności od pływów morskich! Twórz wiele różnych, niepowtarzalnych stylów, zmieniając ogony, stroje i fryzury! Ogon pełni także funkcję stojaka. Baw się nią w wodzie i na lądzie! Charakterystyka produktów:  Lalka syrenka do przebierania z wymiennymi elementami. Różna estetyka:  słona i słodka. Wymieniaj obrania, ogony i płetwy, aby tworzyć nowe style. Rozpuść lalce włosy, aby nadać jej zupełnie nowy wygląd. Kolor makijażu zmienia się w kontakcie z wodą. 2 niepowtarzalne, formowane ozdobne ogony z wymiennymi płetwami. Przepiękne szklane oczy. Długie, kolorowe włosy, które można czesać. W zestawie:  1 lalka z 2 fryzurami w jednej, 2 ogony, 2 płetwy, 2 kurtki, 1 top, 1 sukienka, 2 torebki, biżuteria, 3 wieszaki i półka na ubrania', '', 'mermaze-mermaidz-syrenka-lalka-modowa-zmieniajaca-kolor-teal', '', '', '', 'Mermaze Mermaidz, Syrenka, lalka modowa zmieniająca kolor, teal', '', '', '', ''),
(226, 1, 2, 'Na fali, w toni oceanu, głęboko pod wodą… Płyń za bajecznymi płetwami Mermaze, aby odkryć coś niesamowitego! Czy wiesz, że syreny są takie jak my? Uwielbiają zmieniać swój wygląd! Słodka czy słona? Osobowość - i styl - tej zupełnie nowej syrenki zmienia się w zależności od pływów morskich! Twórz wiele różnych, niepowtarzalnych stylów, zmieniając ogony, stroje i fryzury! Ogon pełni także funkcję stojaka. Baw się nią w wodzie i na lądzie! Charakterystyka produktów:  Lalka syrenka do przebierania z wymiennymi elementami. Różna estetyka:  słona i słodka. Wymieniaj obrania, ogony i płetwy, aby tworzyć nowe style. Rozpuść lalce włosy, aby nadać jej zupełnie nowy wygląd. Kolor makijażu zmienia się w kontakcie z wodą. 2 niepowtarzalne, formowane ozdobne ogony z wymiennymi płetwami. Przepiękne szklane oczy. Długie, kolorowe włosy, które można czesać. W zestawie:  1 lalka z 2 fryzurami w jednej, 2 ogony, 2 płetwy, 2 kurtki, 1 top, 1 sukienka, 2 torebki, biżuteria, 3 wieszaki i półka na ubrania', '', 'mermaze-mermaidz-syrenka-lalka-modowa-zmieniajaca-kolor-teal', '', '', '', 'Mermaze Mermaidz, Syrenka, lalka modowa zmieniająca kolor, teal', '', '', '', ''),
(227, 1, 1, 'Lalka Annabell ma miękkie ciało i realistyczne funkcje. Rano po przebudzeniu lubi pić wodę z butelki. Porusza ustami podczas ssania z butelki i naprawdę słychać, jak cieszy się śniadaniem. Kiedy kończy pić, wydaje beknięcie i jest gotowa do zabawy. Annabell śmieje się z wesoło kiedy bujasz ją na kolanie. Jest też bardzo wrażliwa i radośnie chichocze, gdy łaskoczesz ją po brzuchu. Nawet najbardziej wesołe dziecko-lalka może czasami być w złym humorze. Dlatego Annabell szlocha i płacze prawdziwymi łzami. Ale jest wiele sposobów, aby ją ponownie uspokoić. Jednym z jej ulubionych jest smoczek, który głośno ssie widocznymi ruchami ust. Kiedy nadejdzie pora snu, można ją ukołysać do snu. To sprawia, że ziewa, zamyka śpiące oczy i zasypia, oddychając głęboko. Dodatkowe informacje:  Nr katalogowy:  706299-116721 Marka:  Baby Annabell Seria:  Pozostałe Wymagania wiekowe:  od 3 lat Wysokość:  43 cm', '', 'baby-annabell-lalka-43-cm', '', '', '', 'Baby Annabell, lalka, 43 cm', '', '', '', ''),
(227, 1, 2, 'Lalka Annabell ma miękkie ciało i realistyczne funkcje. Rano po przebudzeniu lubi pić wodę z butelki. Porusza ustami podczas ssania z butelki i naprawdę słychać, jak cieszy się śniadaniem. Kiedy kończy pić, wydaje beknięcie i jest gotowa do zabawy. Annabell śmieje się z wesoło kiedy bujasz ją na kolanie. Jest też bardzo wrażliwa i radośnie chichocze, gdy łaskoczesz ją po brzuchu. Nawet najbardziej wesołe dziecko-lalka może czasami być w złym humorze. Dlatego Annabell szlocha i płacze prawdziwymi łzami. Ale jest wiele sposobów, aby ją ponownie uspokoić. Jednym z jej ulubionych jest smoczek, który głośno ssie widocznymi ruchami ust. Kiedy nadejdzie pora snu, można ją ukołysać do snu. To sprawia, że ziewa, zamyka śpiące oczy i zasypia, oddychając głęboko. Dodatkowe informacje:  Nr katalogowy:  706299-116721 Marka:  Baby Annabell Seria:  Pozostałe Wymagania wiekowe:  od 3 lat Wysokość:  43 cm', '', 'baby-annabell-lalka-43-cm', '', '', '', 'Baby Annabell, lalka, 43 cm', '', '', '', ''),
(228, 1, 1, 'Lalka Evi z akcesoriami.  Lalka w stroju safari z 2 figurkami małpek , plecakiem i lornetką.  Wyrusz na poszukiwanie przygody.  Wymiary opakowania:  16,5 x 12 x 4,5 cm.  Wiek:  3+.', '', 'evi-z-malpkami-lalka-z-akcesoriami', '', '', '', 'Evi z małpkami, lalka z akcesoriami', '', '', '', ''),
(228, 1, 2, 'Lalka Evi z akcesoriami.  Lalka w stroju safari z 2 figurkami małpek , plecakiem i lornetką.  Wyrusz na poszukiwanie przygody.  Wymiary opakowania:  16,5 x 12 x 4,5 cm.  Wiek:  3+.', '', 'evi-z-malpkami-lalka-z-akcesoriami', '', '', '', 'Evi z małpkami, lalka z akcesoriami', '', '', '', ''),
(229, 1, 1, 'Alya Cesaire to najlepsza przyjaciółka Marinette, wspólnie uczęszczają do tej samej klasy w jednej z paryskich szkół. Główna super bohaterka animowanej bajki podarowała jej Miraculum Lisa, dzięki któremu może przemienić się w Rudą Kitkę i wspomóc ją w walce. Po przemianie nie zmienia swojego charakteru. Jest lojalna i chętnie pomaga wyrwać się z opresji osobom w potrzebie.  Figurka przedstawiająca Rudą Kitkę przeniesie twoje dziecko do uniwersum Miraculous. Zabawka wiernie odwzorowuje serialową postać. Super bohaterka ma rude włosy, które zdobi opaska z uszami lisa. Na twarzy nosi maskę, a jej ciało pokrywa pomarańczowo-biały kombinezon. Zestaw zawiera również naszyjnik z Miraculum Lisa połączony z Kwami o imieniu Trixx – pomarańczową zawieszkę przypominającą lisi ogon. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-ruda-kitka-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Ruda Kitka, lalka', '', '', '', ''),
(229, 1, 2, 'Alya Cesaire to najlepsza przyjaciółka Marinette, wspólnie uczęszczają do tej samej klasy w jednej z paryskich szkół. Główna super bohaterka animowanej bajki podarowała jej Miraculum Lisa, dzięki któremu może przemienić się w Rudą Kitkę i wspomóc ją w walce. Po przemianie nie zmienia swojego charakteru. Jest lojalna i chętnie pomaga wyrwać się z opresji osobom w potrzebie.  Figurka przedstawiająca Rudą Kitkę przeniesie twoje dziecko do uniwersum Miraculous. Zabawka wiernie odwzorowuje serialową postać. Super bohaterka ma rude włosy, które zdobi opaska z uszami lisa. Na twarzy nosi maskę, a jej ciało pokrywa pomarańczowo-biały kombinezon. Zestaw zawiera również naszyjnik z Miraculum Lisa połączony z Kwami o imieniu Trixx – pomarańczową zawieszkę przypominającą lisi ogon. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-ruda-kitka-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Ruda Kitka, lalka', '', '', '', ''),
