(230, 1, 2, 'Lalka Natalia siusiający bobas Po napojeniu lalka siusia Smoczek posiada przycisk odpowiadający za dźwięki gaworzenia i płaczu Zamyka oczy Dodatkowe informacje:  Marka:  Natalia Seria:  Pozostałe Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Tak Zasilanie:  Bateria CR2032 Wysokość:  41 cm Akcesoria w zestawie: Nocnik Talerzyk Sztućce Smoczek Butelka  Pozostałe parametry: Wymiary opakowania:  26x44,5x14 cm', '', 'artyk-natalia-lalka-bobas-siusiajaca-41-cm', '', '', '', 'Artyk, Natalia, lalka bobas, siusiająca, 41 cm', '', '', '', ''),
(231, 1, 1, 'BABY born Kindergarten Ubranko do Zabawy na Dworzu 36cm Ubranko z ogrodniczkami, kurtką i butami idealne do zabawy w piaskownicy i w parku. Jak nazwać misia, który tarza się w błocie? Misiobrudasek, niedźwiadkomorusek? No, chyba nie o to chodzi            Nie ważne. Gdy Grupa Niedźwiadków idzie na spacer, siostrzyczka może bawić się na całego w piaskownicy i nad strumykiem. Błotkoodporne ubranko wytrzyma każdą zabawę. Ogrodniczki w kolorowe paski na końcu nogawek mają pętelki, które przytrzymują stopy w kaloszkach. Do kompletu kurtka z misiaczkowym nadrukiem. Gdy dziewczynka nałoży czerwony kaptur, nie wystraszą jej nawet  chłopcy polewający wodą z ogrodowego węża. Wysokiej jakości ubranka do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Pasuje na wszystkie lalki BABY born 36cm. BABY born Kindergarten Ubranko do Zabawy na Dworzu 36cm. Zestaw zawiera kurtkę, spodnie i buty. Dodatkowe informacje:  Nr katalogowy:  831618-116721 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Wielokolorowy', '', 'baby-born-ubranko-do-przedszkola', '', '', '', 'Baby Born, ubranko do przedszkola', '', '', '', ''),
(231, 1, 2, 'BABY born Kindergarten Ubranko do Zabawy na Dworzu 36cm Ubranko z ogrodniczkami, kurtką i butami idealne do zabawy w piaskownicy i w parku. Jak nazwać misia, który tarza się w błocie? Misiobrudasek, niedźwiadkomorusek? No, chyba nie o to chodzi            Nie ważne. Gdy Grupa Niedźwiadków idzie na spacer, siostrzyczka może bawić się na całego w piaskownicy i nad strumykiem. Błotkoodporne ubranko wytrzyma każdą zabawę. Ogrodniczki w kolorowe paski na końcu nogawek mają pętelki, które przytrzymują stopy w kaloszkach. Do kompletu kurtka z misiaczkowym nadrukiem. Gdy dziewczynka nałoży czerwony kaptur, nie wystraszą jej nawet  chłopcy polewający wodą z ogrodowego węża. Wysokiej jakości ubranka do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Pasuje na wszystkie lalki BABY born 36cm. BABY born Kindergarten Ubranko do Zabawy na Dworzu 36cm. Zestaw zawiera kurtkę, spodnie i buty. Dodatkowe informacje:  Nr katalogowy:  831618-116721 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Wielokolorowy', '', 'baby-born-ubranko-do-przedszkola', '', '', '', 'Baby Born, ubranko do przedszkola', '', '', '', ''),
(232, 1, 1, 'Pod postacią Czarnego Kota kryje się jeden z głównych bohaterów serialu animowanego Miraculous – Adrien Agreste. Zielonooki blondyn posiada Miraculum w postaci pierścienia, które jest połączone z kwami o imieniu Plagg. Ten przedmiot umożliwia mu przemianę w super bohatera posiadającego moc niszczenia. Po transformacji w Czarnego Kota Adrien jest pewny siebie, towarzyski i otwarty. Nie boi się wyrażać swoich poglądów i zawsze chętnie wyrusza na pomoc osobom w potrzebie. Figurka przedstawiająca postać Czarnego Kota przeniesie twoją pociechę do świata Miraculous w którym przeżyje niezapomniane przygody. Zabawka wiernie odwzorowuje serialowego bohatera. Adrien ma na sobie czarny kombinezon, jego szyję zdobi złoty dzwonek, a jego twarz czarna maska z parą kocich uszu. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-czarny-kot-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Czarny Kot, lalka', '', '', '', ''),
(232, 1, 2, 'Pod postacią Czarnego Kota kryje się jeden z głównych bohaterów serialu animowanego Miraculous – Adrien Agreste. Zielonooki blondyn posiada Miraculum w postaci pierścienia, które jest połączone z kwami o imieniu Plagg. Ten przedmiot umożliwia mu przemianę w super bohatera posiadającego moc niszczenia. Po transformacji w Czarnego Kota Adrien jest pewny siebie, towarzyski i otwarty. Nie boi się wyrażać swoich poglądów i zawsze chętnie wyrusza na pomoc osobom w potrzebie. Figurka przedstawiająca postać Czarnego Kota przeniesie twoją pociechę do świata Miraculous w którym przeżyje niezapomniane przygody. Zabawka wiernie odwzorowuje serialowego bohatera. Adrien ma na sobie czarny kombinezon, jego szyję zdobi złoty dzwonek, a jego twarz czarna maska z parą kocich uszu. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-czarny-kot-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Czarny Kot, lalka', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(233, 1, 1, 'Lalka - bobas w nosidełku. Laleczka jest ubrana w kolorową piżamkę. Na głowę ma założone okrycie głowy. Bobas jest wykonany dość realistycznie. Dotyczy to zarówno główki (np. wyżłobienia odwzorowujące małe włoski), ale również rączek i stóp. Zabawkę umieszczono w nosidełku z regulowaną rączką. Jest to produkt, który pozwala wyrabiać opiekuńczość. Wymiary: 24x17x15 cm. Wiek:  3+. Produkt występuje w różnych wariantach. Uwaga! Produkt wysyłany losowo.', '', 'dromader-lalka-bobas-w-nosidelku', '', '', '', 'Dromader, lalka bobas w nosidełku', '', '', '', ''),
(233, 1, 2, 'Lalka - bobas w nosidełku. Laleczka jest ubrana w kolorową piżamkę. Na głowę ma założone okrycie głowy. Bobas jest wykonany dość realistycznie. Dotyczy to zarówno główki (np. wyżłobienia odwzorowujące małe włoski), ale również rączek i stóp. Zabawkę umieszczono w nosidełku z regulowaną rączką. Jest to produkt, który pozwala wyrabiać opiekuńczość. Wymiary: 24x17x15 cm. Wiek:  3+. Produkt występuje w różnych wariantach. Uwaga! Produkt wysyłany losowo.', '', 'dromader-lalka-bobas-w-nosidelku', '', '', '', 'Dromader, lalka bobas w nosidełku', '', '', '', ''),
(234, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Poznaj młodsze wersje swoich sześciu ulubionych oryginalnych lalek Rainbow High Fashion! Ruby, Poppy, Sunny, Jade, Skyler i Violet. Każda z nich ma swoją własną historię o tym, jak odnalazły swoją twórczą pasję, zanim stały się uczennicami Rainbow High. Każda jest tak samo piękna, stylowa i kolorowa. Rainbow High Junior High to urocze laleczki, które mają piękne, młode rysy twarzy. Ich kolorowe i długie włosy nadają każdej z nich unikatowego charakteru, ale także są idealne do układania fantazyjnych fryzur. W zestawie znajdziesz akcesoria do włosów oraz grzebień. Dzięki kilku punktom artykulacji mogą z łatwością zmieniać pozy i dostosowywać się do Twojej wizji. Bardzo łatwo można je przebrać więc możesz dopasować każdą laleczkę do Twojej stylizacji. Laleczki Junior High nie mogą obejść się bez plecaka, który pomieści wszystkie potrzebne w szkole modowej artykuły. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High Junior High:  Ruby Anderson, Poppy Rowan, Sunny Madison, Jade Hunter, Skyler Bradshaw, Violet Willow (sprzedawane oddzielnie)! Wysokość lalki:  ok. 22 cm.', '', 'rainbow-high-junior-high-violet-willow-lalka-modowa', '', '', '', 'Rainbow High, Junior High, Violet Willow, lalka modowa', '', '', '', ''),
