(236, 1, 1, 'Harry Potter Wizarding World to luksusowa lalka jest idealna do opowiadania historii. Jest obowiązkową pozycją dla fanów Harry\'ego Pottera. Piękne detale twarzy, jego blizna po błyskawicy, okrągłe okulary i pięć punktów artykulacji ożywiają tę ukochaną postać z Harry\'ego Pottera. Poruszaj rękami i udawaj, że Harry rzuca kultowe zaklęcia, takie jak Expelliarmus! Zbuduj swój własny czarodziejski świat! Lalka Harry Potter ubrana w sweter Gryffindor, czarne spodnie i buty Akcesoria:  okulary i różdżka Do ustawienia w różnych pozycjach', '', 'wizarding-world-harry-potter-figurka-18-cm', '', '', '', 'Wizarding World, Harry Potter, figurka, 18 cm', '', '', '', ''),
