(238, 1, 1, 'Jeśli zdmuchniesz wszystkie świeczki naraz, to czeka cię szczęście! Mała księżniczka świętuje swoje urodziny. Ma już, jak twierdzi, 30 lat! Oczywiście mamy tu torcik urodzinowy ze świeczkami. Jest pokrojony na sześć porcji, każda oblana różowym lukrem. W tym wyjątkowym dniu jubilatka jest ubrana w różową sukienkę z asymetrycznymitiulowymi falbankami. Sukienka ma nadruki z motywami kosmicznymi. Na brzuszku widnieje aplikacja z emblematem planety. Całości dopełniają złote sandałki. Urodzinowa korona na głowie BABY born skrzy się niczym rozgwieżdżone niebo. Przyjęcie nie z tej ziemi! Wysokiej jakości akcesoria do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Zestaw urodzinowy BABY born Deluxe Happy Birthday 43cm z sukienką i bucikami. Urodzinowy tort i korona w zestawie. Dodatkowe informacje:  Nr katalogowy:  830789-116721   Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Fioletowy, Różowy', '', 'baby-born-zestaw-urodzinowy-sukienka-buciki-korona-tort', '', '', '', 'Baby Born, zestaw urodzinowy, sukienka, buciki, korona, tort', '', '', '', ''),
