(239, 1, 1, 'Leżenie w wózku podczas wycieczki jest zbyt nudne dla Baby Annabell. W końcu chce odkryć cały szeroki świat. I właśnie to może zrobić w swoim nosidełku. Można ją nosić na plecach jak plecak lub na klatce piersiowej, w dwóch możliwych pozycjach do siedzenia. Może albo patrzeć na zewnątrz i obserwować, co się przed nią dzieje, albo być zwrócona w stronę mamy i tatusia i może się do nich przytulać. Urocze nadruki pokazują ulubione miejsce Baby Annabell w parku. Uwielbia obserwować ważki i lilie wodne przy stawie. System pasków można dopasować do wzrostu dziecka. Oryginalne akcesoria do lalki Baby Annabell. Najwyższej jakości akcesoria pobudzają wyobraźnię i oferują nowe możliwości i bodźce do zabawy. Baby Annabell Active Cocoon Carrier z regulowanym systemem pasków Dodatkowe informacje:  Nr katalogowy:  704226-116721   Marka:  Baby Annabell Rodzaj:  Foteliki/Nosidełka Wymagania wiekowe:  od 3 lat Kolor:  Różowy Wymiary opakowania:  30 x 7.4 x 23.2 cm', '', 'zapf-creation-baby-annabell-nosidelko-kokon', '', '', '', 'Zapf Creation, Baby Annabell, nosidełko kokon', '', '', '', ''),
