(240, 1, 1, 'Zabierz lalkę Barbie Malibu na niesamowitą wyprawę kempingową ze szczeniaczkiem i ponad 10 akcesoriami biwakowymi, które inspirują do wymyślania różnorodnych opowieści. Chcesz odkrywać leśne ostępy? Przypnij śpiwór Barbie i zapakuj do plecaka niezbędne akcesoria do pieszych wędrówek, takie jak latarenka, mapa, lornetka, smartfon i nie tylko. Po całym dniu przygód okryj lalkę Barbie i jej szczeniaczka przytulnym śpiworem do snu pod gwiazdami. Dzięki tak wielu akcesoriom biwakowym dzieci w wieku od 3 do 7 lat mogą zabrać lalkę Barbie na niezliczone przygody na świeżym powietrzu. Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-kemping-malibu-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kemping Malibu, zestaw z lalką i akcesoriami', '', '', '', ''),
(240, 1, 2, 'Zabierz lalkę Barbie Malibu na niesamowitą wyprawę kempingową ze szczeniaczkiem i ponad 10 akcesoriami biwakowymi, które inspirują do wymyślania różnorodnych opowieści. Chcesz odkrywać leśne ostępy? Przypnij śpiwór Barbie i zapakuj do plecaka niezbędne akcesoria do pieszych wędrówek, takie jak latarenka, mapa, lornetka, smartfon i nie tylko. Po całym dniu przygód okryj lalkę Barbie i jej szczeniaczka przytulnym śpiworem do snu pod gwiazdami. Dzięki tak wielu akcesoriom biwakowym dzieci w wieku od 3 do 7 lat mogą zabrać lalkę Barbie na niezliczone przygody na świeżym powietrzu. Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-kemping-malibu-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Kemping Malibu, zestaw z lalką i akcesoriami', '', '', '', ''),
(241, 1, 1, 'To czas wakacji! BABY born uwielbia oglądać podwodny świat i nurkować w poszukiwaniu małży. Jej bikini w stylu dżungli amazońskiej jest połączone z dopasowaną maską do nurkowania niedźwiedzia. Bikini ma asymetryczny top i jest ozdobione zabawnymi marszczeniami i kwiecistym pnączem. Wysokiej jakości akcesoria do markowych lalek BABY born. Dla lepszej, różnorodnej i niekończącej się zabawy BABY born  Bikini Set 43 z bikini, sandałami i maską do nurkowania. Dodatkowe informacje:  Nr katalogowy:  829240-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Mix Wielkość lalki:  43cm', '', 'baby-born-bikini-dla-lalki', '', '', '', 'Baby Born, bikini dla lalki', '', '', '', ''),
(241, 1, 2, 'To czas wakacji! BABY born uwielbia oglądać podwodny świat i nurkować w poszukiwaniu małży. Jej bikini w stylu dżungli amazońskiej jest połączone z dopasowaną maską do nurkowania niedźwiedzia. Bikini ma asymetryczny top i jest ozdobione zabawnymi marszczeniami i kwiecistym pnączem. Wysokiej jakości akcesoria do markowych lalek BABY born. Dla lepszej, różnorodnej i niekończącej się zabawy BABY born  Bikini Set 43 z bikini, sandałami i maską do nurkowania. Dodatkowe informacje:  Nr katalogowy:  829240-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Mix Wielkość lalki:  43cm', '', 'baby-born-bikini-dla-lalki', '', '', '', 'Baby Born, bikini dla lalki', '', '', '', ''),
(242, 1, 1, 'Lalka Laura to idealna pierwsza córeczka Twojej pociechy. Miękki brzuszek laleczki idealnie nadaje się do przytulania. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ubrana jest w śpiochy i opaskę. Lalka zamyka oczy i zasypia. Lalkę można przytulać, kołysać i śmiać się razem z nią. Zabawka może stać się przyjacielem dziecka na długie lata, kształtując długotrwałe więzi. Informacje podstawowe:  Wymiary:  ok. 39 cm. Wiek:  od 2 lat. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-laura-lalka-39-cm', '', '', '', 'Smiki, Laura, lalka, 39 cm', '', '', '', ''),
(242, 1, 2, 'Lalka Laura to idealna pierwsza córeczka Twojej pociechy. Miękki brzuszek laleczki idealnie nadaje się do przytulania. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ubrana jest w śpiochy i opaskę. Lalka zamyka oczy i zasypia. Lalkę można przytulać, kołysać i śmiać się razem z nią. Zabawka może stać się przyjacielem dziecka na długie lata, kształtując długotrwałe więzi. Informacje podstawowe:  Wymiary:  ok. 39 cm. Wiek:  od 2 lat. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-laura-lalka-39-cm', '', '', '', 'Smiki, Laura, lalka, 39 cm', '', '', '', ''),
(243, 1, 1, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka. Bobas posiada efekty dźwiękowe:  po naciśnięciu brzuszka lalka płacze, śmieje się i mówi Tata. Lalka Bobas od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zawartość zestawu:  lalka Bobas, wanna, ręcznik, myjka, buteleczka z płynem do kąpieli, mydełko. Całość wykonana z plastiku oraz materiału. Wymiary produktu dł. (cm):  lalka - 35 cm, wanna:  32 x 12 x 19. Wymiary opakowania (cm):  33 x 31 x 19. Waga produktu bez opakowania (kg):  0,34 kg. Waga produktu w opakowaniu (kg):  0,62 kg. Wymaga zasilania bateriami 2 x LR44 - załączono do zestawu. Produkt przeznaczony dla dzieci w wieku:  3+.', '', 'mega-creative-lalka-bobas-z-akcesoriami', '', '', '', 'Mega Creative, lalka bobas z akcesoriami', '', '', '', ''),
