(244, 1, 1, 'Odkryj zupełnie nowy świat Cry Babies Magic Tears Storyland! Zainspirowanych kultowymi baśniowymi historiami do zebrania jest ponad 6 unikalnych postaci! Każda kapsuła pasuje do osobowości każdej postaci, każda jest dostarczana z pasującym zwierzakiem i zabawnym dodatkiem do ubrania! Otwórz go za pomocą tęczowego klucza i odkryj wszystkie 10 niespodzianek w zestawie:  magiczna butelka dla niemowląt, smoczek, para butów, ubranie, spersonalizowana książka, dwa spersonalizowane akcesoria i arkusz naklejek. Ponadto niektóre kapsułki zawierają opalizujący dodatek, kokardę lub smoczek! Nakarm lalkę magiczną butelką, ściśnij jej brzuch, a zapłacze prawdziwymi łzami! Ich łzy są magiczne; gdy ich łzy spadną na książkę, obraz tej historii zostanie ujawniony! Zawartość:   1xlalka, 1xzwierzak, 1xbutelka dla niemowląt, 1xsmoczek, 1xpara butów, 1xczęść garderoby, 1xspersonalizowana książka, 2xunikalne akcesoria, 1xarkusz naklejek.', '', 'cry-babies-storyhouse-dress-me-up-kapsula-z-lalka', '', '', '', 'Cry Babies, Storyhouse Dress Me Up, kapsuła z lalką', '', '', '', ''),
(244, 1, 2, 'Odkryj zupełnie nowy świat Cry Babies Magic Tears Storyland! Zainspirowanych kultowymi baśniowymi historiami do zebrania jest ponad 6 unikalnych postaci! Każda kapsuła pasuje do osobowości każdej postaci, każda jest dostarczana z pasującym zwierzakiem i zabawnym dodatkiem do ubrania! Otwórz go za pomocą tęczowego klucza i odkryj wszystkie 10 niespodzianek w zestawie:  magiczna butelka dla niemowląt, smoczek, para butów, ubranie, spersonalizowana książka, dwa spersonalizowane akcesoria i arkusz naklejek. Ponadto niektóre kapsułki zawierają opalizujący dodatek, kokardę lub smoczek! Nakarm lalkę magiczną butelką, ściśnij jej brzuch, a zapłacze prawdziwymi łzami! Ich łzy są magiczne; gdy ich łzy spadną na książkę, obraz tej historii zostanie ujawniony! Zawartość:   1xlalka, 1xzwierzak, 1xbutelka dla niemowląt, 1xsmoczek, 1xpara butów, 1xczęść garderoby, 1xspersonalizowana książka, 2xunikalne akcesoria, 1xarkusz naklejek.', '', 'cry-babies-storyhouse-dress-me-up-kapsula-z-lalka', '', '', '', 'Cry Babies, Storyhouse Dress Me Up, kapsuła z lalką', '', '', '', ''),
(245, 1, 1, 'Baby Born Szlafrok kąpielowy 43 cm Szlafrok kąpielowy z motywami z parku wodnego. W parku wodnym można znaleźć wszystko:  statki, kotwice, wodne zjeżdżalnie, gumowe kaczuszki, hydranty, małże, ryby, fale i wiatr. Dokładnie to, co widnieje na szlafroku Baby Born. Po kąpieli w wanience, albo po lekcji pływania w basenie, Maleństwo otula się mięciutkim szlafrokiem, nakłada kaptur i zasypia śniąc o syrenkach i rozgwiazdach. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Baby Born Szlafok kąpielowy 43 cm. Wieszak na ubrania w zestawie.', '', 'baby-born-szlafrok-kapielowy-dla-lalki-43-cm', '', '', '', 'Baby Born, szlafrok kąpielowy dla lalki 43 cm', '', '', '', ''),
(245, 1, 2, 'Baby Born Szlafrok kąpielowy 43 cm Szlafrok kąpielowy z motywami z parku wodnego. W parku wodnym można znaleźć wszystko:  statki, kotwice, wodne zjeżdżalnie, gumowe kaczuszki, hydranty, małże, ryby, fale i wiatr. Dokładnie to, co widnieje na szlafroku Baby Born. Po kąpieli w wanience, albo po lekcji pływania w basenie, Maleństwo otula się mięciutkim szlafrokiem, nakłada kaptur i zasypia śniąc o syrenkach i rozgwiazdach. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Baby Born Szlafok kąpielowy 43 cm. Wieszak na ubrania w zestawie.', '', 'baby-born-szlafrok-kapielowy-dla-lalki-43-cm', '', '', '', 'Baby Born, szlafrok kąpielowy dla lalki 43 cm', '', '', '', ''),
(246, 1, 1, 'Siostrzyczka blondynka posiada 6 funkcji działających bez konieczności użycia baterii. W zestawie 10 akcesoriów. Siostrzyczka uwielbia stylizować włosy. Codziennie ma nowy fryz. Koczki i warkocze za każdym razem są w inny sposób upięte i przyozdobione różnymi akcesoriami do włosów. Spinki, gumki i kolorowe pasemka idealnie pasują do kolorów jej ubranka. Baby Born lubi zwłaszcza pasemka różowe i fioletowe. W chwili nieuwagi wypina je z głowy siostry. Oczywiście siostra reaguje płaczem. Pewnie nie miałaby takich niesfornych pomysłów, gdyby wcześniej ostudziła emocje pijąc wodę z butelki. Dziewczynka ma na sobie sukienkę z dżinsową spódnicą i asymetrycznym topem z dekoltem Carmen. Szare legginsy z różowymi lampasami i pomarańczowo-czerwone trampki idealnie komponują z sukienką. Siostrzyczka jest bardzo wysportowana. Dzięki elastycznym kolanom może samodzielnie stać. Uwielbia też kąpać się w wanience Baby Born. Baby Born Siostrzyczka. Naśladuje 6 funkcji życiowych dostarczając mnóstwo zabawy. Pasują na nią wszystkie ubranka Baby Born. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Zabawka nie wymaga baterii. BABY born Siostrzyczka 43cm z sukienką, legginsami i butami. Akcesoria w zestawie:  Butelka Szczotka do włosów 2 spiralki do włosów 2 spinki do włosów 2 pasemka włosów z klipsami 1 bransoletka przyjaźni dla dziecka i dla lalki', '', 'baby-born-lalka-siostrzyczka-blondynka-43-cm', '', '', '', 'Baby Born, lalka siostrzyczka, blondynka, 43 cm', '', '', '', ''),
(246, 1, 2, 'Siostrzyczka blondynka posiada 6 funkcji działających bez konieczności użycia baterii. W zestawie 10 akcesoriów. Siostrzyczka uwielbia stylizować włosy. Codziennie ma nowy fryz. Koczki i warkocze za każdym razem są w inny sposób upięte i przyozdobione różnymi akcesoriami do włosów. Spinki, gumki i kolorowe pasemka idealnie pasują do kolorów jej ubranka. Baby Born lubi zwłaszcza pasemka różowe i fioletowe. W chwili nieuwagi wypina je z głowy siostry. Oczywiście siostra reaguje płaczem. Pewnie nie miałaby takich niesfornych pomysłów, gdyby wcześniej ostudziła emocje pijąc wodę z butelki. Dziewczynka ma na sobie sukienkę z dżinsową spódnicą i asymetrycznym topem z dekoltem Carmen. Szare legginsy z różowymi lampasami i pomarańczowo-czerwone trampki idealnie komponują z sukienką. Siostrzyczka jest bardzo wysportowana. Dzięki elastycznym kolanom może samodzielnie stać. Uwielbia też kąpać się w wanience Baby Born. Baby Born Siostrzyczka. Naśladuje 6 funkcji życiowych dostarczając mnóstwo zabawy. Pasują na nią wszystkie ubranka Baby Born. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Zabawka nie wymaga baterii. BABY born Siostrzyczka 43cm z sukienką, legginsami i butami. Akcesoria w zestawie:  Butelka Szczotka do włosów 2 spiralki do włosów 2 spinki do włosów 2 pasemka włosów z klipsami 1 bransoletka przyjaźni dla dziecka i dla lalki', '', 'baby-born-lalka-siostrzyczka-blondynka-43-cm', '', '', '', 'Baby Born, lalka siostrzyczka, blondynka, 43 cm', '', '', '', ''),
(247, 1, 1, 'Twórz niekończące się przygody z czarodziejskiego świata z 8-calową lalką Harry\'ego Pottera! Śliczne detale twarzy, blizna w kształcie błyskawicy i pięć punktów zgięcia ożywiają tę ukochaną postać. Harry ma na sobie mundurek Howartu, sweter Gryffindoru, a także zdejmowalne buty, okulary oraz różdżkę, które wzbogacą tworzone przez Ciebie historie. Ustaw Harry\'ego w dowolny sposób, odtwarzając ulubione sceny albo wymyślając całkowicie nowe! Poruszaj jego ramionami i udawaj, że rzuca kultowe zaklęcia takie jak Expelliarmus! 8-calowe lalki ze świata Harry\'ego Pottera to doskonały sposób, aby zainspirować czarodziejską wyobraźnię poprzez zabawę. Dodaj wszystkie 8-calowe lalki do kolekcji (każda sprzedawana osobno) i stwórz własny magiczny świat. Te zabawki to doskonały prezent dla dziewczynek w wieku 5 lat i starszych. Obowiązkowy element kolekcji każdego fana. Weź do domu 8-calową lalkę Harry\'ego Pottera i szykuj się na czarodziejskie przygody!', '', 'wizarding-world-harry-potter-harry-lalka-8', '', '', '', 'Wizarding World, Harry Potter, Harry, lalka 8\"', '', '', '', ''),
(247, 1, 2, 'Twórz niekończące się przygody z czarodziejskiego świata z 8-calową lalką Harry\'ego Pottera! Śliczne detale twarzy, blizna w kształcie błyskawicy i pięć punktów zgięcia ożywiają tę ukochaną postać. Harry ma na sobie mundurek Howartu, sweter Gryffindoru, a także zdejmowalne buty, okulary oraz różdżkę, które wzbogacą tworzone przez Ciebie historie. Ustaw Harry\'ego w dowolny sposób, odtwarzając ulubione sceny albo wymyślając całkowicie nowe! Poruszaj jego ramionami i udawaj, że rzuca kultowe zaklęcia takie jak Expelliarmus! 8-calowe lalki ze świata Harry\'ego Pottera to doskonały sposób, aby zainspirować czarodziejską wyobraźnię poprzez zabawę. Dodaj wszystkie 8-calowe lalki do kolekcji (każda sprzedawana osobno) i stwórz własny magiczny świat. Te zabawki to doskonały prezent dla dziewczynek w wieku 5 lat i starszych. Obowiązkowy element kolekcji każdego fana. Weź do domu 8-calową lalkę Harry\'ego Pottera i szykuj się na czarodziejskie przygody!', '', 'wizarding-world-harry-potter-harry-lalka-8', '', '', '', 'Wizarding World, Harry Potter, Harry, lalka 8\"', '', '', '', ''),
(248, 1, 1, 'Expecto Patronum! Ożyw Patronusa Hermiony i udawaj, że rzucasz zaklęcia z 8-calową lalką Hermiony z Patronusem od Wizarding World! Dzięki siedmiu akcesoriom, w tym dołączonej tarczy przeciwko zaklęciom i Patronusowi pod postacią wydry, ta 8-calowa lalka Hermiony to idealna zabawka dla fanów Harry\'ego Pottera, która pozwala rzucać zaklęcia swoją ulubioną postacią. Śliczne detale twarzy, miękkie, długie kręcone włosy oraz pięć punktów zgięcia ożywiają postać Hermiony. Zarzuć szatę Hogwartu na ramiona Hermiony i umieść różdżkę w jej dłoni. Kiedy podnosisz jej ramię lub naciskach przycisk na brzuchu, z rękawa jej szaty wystaje dioda LED. Przypnij magiczną tarczę do nadgarstka Hermiony i odkryj holograficznej efekty świetlne! Wymień tarczę na Patronusa pod postacią wydry i wezwij na pomoc jej uroczego strażnika! Aby bawić się na jeszcze więcej sposobów Hermiona ma też dodatkowe akcesoria:  dwie księgi zaklęć, piórko i butelkę z eliksirem, którą może trzymać w dłoni. Ta 8-calowa lalka Hermiony Granger inspiruje wyobraźnie poprzez zabawę. Aby uzyskać jeszcze więcej sposobów na rozbudowanie swojego czarodziejskiego świata, zbierz wszystkie pozostałe 8-calowe zabawki Harry\'ego Pottera do swojej kolekcji (sprzedawane osobno)! Lalka Hermiony z Patronusem i inne 8-calowe lalki ze świata Harry\'ego Pottera to świetne prezenty dla dziewczynek. Zawiera 3 baterie LR44. Poczuj magię świata Harry\'ego Pottera dzięki lalce Hermiony z Patronusem od Wizarding World! Dodatkowe informacje:  Licencja:  Harry Potter Wymagania wiekowe:  od 5 lat Płeć:  Dziewczynki Wysokość:  8 \'\'', '', 'wizarding-world-hermonia-z-patronusem-lalka-8-cali', '', '', '', 'Wizarding World, Hermonia z Patronusem, lalka, 8 cali', '', '', '', ''),
(248, 1, 2, 'Expecto Patronum! Ożyw Patronusa Hermiony i udawaj, że rzucasz zaklęcia z 8-calową lalką Hermiony z Patronusem od Wizarding World! Dzięki siedmiu akcesoriom, w tym dołączonej tarczy przeciwko zaklęciom i Patronusowi pod postacią wydry, ta 8-calowa lalka Hermiony to idealna zabawka dla fanów Harry\'ego Pottera, która pozwala rzucać zaklęcia swoją ulubioną postacią. Śliczne detale twarzy, miękkie, długie kręcone włosy oraz pięć punktów zgięcia ożywiają postać Hermiony. Zarzuć szatę Hogwartu na ramiona Hermiony i umieść różdżkę w jej dłoni. Kiedy podnosisz jej ramię lub naciskach przycisk na brzuchu, z rękawa jej szaty wystaje dioda LED. Przypnij magiczną tarczę do nadgarstka Hermiony i odkryj holograficznej efekty świetlne! Wymień tarczę na Patronusa pod postacią wydry i wezwij na pomoc jej uroczego strażnika! Aby bawić się na jeszcze więcej sposobów Hermiona ma też dodatkowe akcesoria:  dwie księgi zaklęć, piórko i butelkę z eliksirem, którą może trzymać w dłoni. Ta 8-calowa lalka Hermiony Granger inspiruje wyobraźnie poprzez zabawę. Aby uzyskać jeszcze więcej sposobów na rozbudowanie swojego czarodziejskiego świata, zbierz wszystkie pozostałe 8-calowe zabawki Harry\'ego Pottera do swojej kolekcji (sprzedawane osobno)! Lalka Hermiony z Patronusem i inne 8-calowe lalki ze świata Harry\'ego Pottera to świetne prezenty dla dziewczynek. Zawiera 3 baterie LR44. Poczuj magię świata Harry\'ego Pottera dzięki lalce Hermiony z Patronusem od Wizarding World! Dodatkowe informacje:  Licencja:  Harry Potter Wymagania wiekowe:  od 5 lat Płeć:  Dziewczynki Wysokość:  8 \'\'', '', 'wizarding-world-hermonia-z-patronusem-lalka-8-cali', '', '', '', 'Wizarding World, Hermonia z Patronusem, lalka, 8 cali', '', '', '', ''),
(249, 1, 1, 'Lalka Barbie i jej ukochany koń - nowy zestaw do zabawy W zestawie:  lalka Barbie w modnym ubranku i butach koń z siodłem na grzbiecie czapka dżokejka Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Zabawka dla dzieci w wieku od 3 lat.', '', 'barbie-lalka-i-kon-zestaw', '', '', '', 'Barbie, Lalka i koń, zestaw', '', '', '', ''),
(249, 1, 2, 'Lalka Barbie i jej ukochany koń - nowy zestaw do zabawy W zestawie:  lalka Barbie w modnym ubranku i butach koń z siodłem na grzbiecie czapka dżokejka Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Zabawka dla dzieci w wieku od 3 lat.', '', 'barbie-lalka-i-kon-zestaw', '', '', '', 'Barbie, Lalka i koń, zestaw', '', '', '', ''),
(250, 1, 1, 'Lalka Steffi w bliźniaczej ciąży została stworzona przez bardzo cenioną i popularną markę Simba, która od lat projektuje zabawki dla dzieci, dbając o ich wysoką jakość. Pochodzi ona z serii lalek Steffi Love uwielbianej przez dziewczynki. Steffi jest w zaawansowanej ciąży, będzie miała dwójkę dzieci. Ubrana jest w kolorową ciążową sukienkę na ramiączkach i białe buciki, ma piękne długie blond włosy. Jej brzuch jest otwierany, więc można wyjąć bobasy i włożyć z powrotem do brzuszka lalki. Lalka jest przygotowana do opieki nad dwójką dzieci, w zestawie znajduje się komoda oraz wiele akcesoriów. Komoda posiada jedną wysuwaną szufladę, w której można przechowywać drobne akcesoria. Poniżej szuflady znajduje się przestronna półeczka, która pomieści rzeczy większych rozmiarów np. wanienkę. Na blacie komody zamontowana jest karuzela, która ma możliwość ręcznego obracania czterech wiszących mini-zabaweczek. Blat komody jest na tyle obszerny, że może służyć do przewijania maluszków. W zestawie znajdują się akcesoria niezbędne do opieki nad maluszkami. Są to:  2 rożki do zawinięcia niemowląt, jeden różowy, drugi błękitny wanienka, w której bliźnięta mogą się naprawdę wykąpać kaczuszka do kąpieli podkładka do przewijania z miejscem na dwoje dzieci butelka z mlekiem butelka z uchwytami na herbatkę miseczka + 2 łyżeczki smoczek gryzak, grzechotka i inne małe zabawki Lalka Steffi w ciąży bliźniaczej z pewnością przypadnie do gustu każdej dziewczynce uwielbiającej lalki. Dzięki załączonym akcesoriom zabawa nigdy się nie znudzi! lalka Steffi w ciąży bliźniaczej, Steffi Love, Welcome Twins zabawka przeznaczona dla dzieci od 3. roku życia w zestawie:  lalka, 2 bobasy, komoda i zestaw akcesoriów wysokość lalki:  29 cm wymiary opakowania:  32,8x20x6,5 cm', '', 'steffi-lalka-w-blizniaczej-ciazy-2-bobasy-komoda-i-akcesoria-zestaw', '', '', '', 'Steffi, lalka w bliźniaczej ciąży, 2 bobasy, komoda i akcesoria, zestaw', '', '', '', ''),
(250, 1, 2, 'Lalka Steffi w bliźniaczej ciąży została stworzona przez bardzo cenioną i popularną markę Simba, która od lat projektuje zabawki dla dzieci, dbając o ich wysoką jakość. Pochodzi ona z serii lalek Steffi Love uwielbianej przez dziewczynki. Steffi jest w zaawansowanej ciąży, będzie miała dwójkę dzieci. Ubrana jest w kolorową ciążową sukienkę na ramiączkach i białe buciki, ma piękne długie blond włosy. Jej brzuch jest otwierany, więc można wyjąć bobasy i włożyć z powrotem do brzuszka lalki. Lalka jest przygotowana do opieki nad dwójką dzieci, w zestawie znajduje się komoda oraz wiele akcesoriów. Komoda posiada jedną wysuwaną szufladę, w której można przechowywać drobne akcesoria. Poniżej szuflady znajduje się przestronna półeczka, która pomieści rzeczy większych rozmiarów np. wanienkę. Na blacie komody zamontowana jest karuzela, która ma możliwość ręcznego obracania czterech wiszących mini-zabaweczek. Blat komody jest na tyle obszerny, że może służyć do przewijania maluszków. W zestawie znajdują się akcesoria niezbędne do opieki nad maluszkami. Są to:  2 rożki do zawinięcia niemowląt, jeden różowy, drugi błękitny wanienka, w której bliźnięta mogą się naprawdę wykąpać kaczuszka do kąpieli podkładka do przewijania z miejscem na dwoje dzieci butelka z mlekiem butelka z uchwytami na herbatkę miseczka + 2 łyżeczki smoczek gryzak, grzechotka i inne małe zabawki Lalka Steffi w ciąży bliźniaczej z pewnością przypadnie do gustu każdej dziewczynce uwielbiającej lalki. Dzięki załączonym akcesoriom zabawa nigdy się nie znudzi! lalka Steffi w ciąży bliźniaczej, Steffi Love, Welcome Twins zabawka przeznaczona dla dzieci od 3. roku życia w zestawie:  lalka, 2 bobasy, komoda i zestaw akcesoriów wysokość lalki:  29 cm wymiary opakowania:  32,8x20x6,5 cm', '', 'steffi-lalka-w-blizniaczej-ciazy-2-bobasy-komoda-i-akcesoria-zestaw', '', '', '', 'Steffi, lalka w bliźniaczej ciąży, 2 bobasy, komoda i akcesoria, zestaw', '', '', '', ''),
(251, 1, 1, 'Wyobraź sobie opiekę nad stworzeniami z czarodziejskiego świata z Luną Lovegood i zestawem Magical Minis magiczne zwierzęta. Dzięki wyjątkowej 3-calowej lalce Luny Lovegood i trzem tematycznym akcesoriom (w tym mały, latający Testral) młode czarownice, czarodzieje i mugole mogą odtwarzać ulubione sceny z Harry\'ego Pottera. Przymocuj małego Testrala do drzewa i pozwól mu latać dookoła! Następnie zdejmij wiadro z haczyka i nakarm magiczne zwierzę jabłkami Luna może je brać do ręki. Następnie znajdź stworzenie ukrywające się pomiędzy liśćmi. Przesuń lunę nad miejscem aktywacji, żeby na drzewie pojawiły się Nieśmiałki. Ten zestaw to doskonały sposób pobudzenia wyobraźni poprzez ekscytującą zabawę. Połącz go z zamkiem Hogwart Magical Minis (sprzedawany oddzielnie) i rozszerz o klasę zaklęć oraz eliksirów (zestawy z lalkami są sprzedawane osobno). Zbierz wszystkie Małe Lalki Magical Minis i zestawy do zabawy, aby stworzyć swój własny świat czarodziejów (każdy sprzedawany osobno). Zabawki Magical Minis to idealne prezenty dla dzieci i fanów Harry\'ego Pottera. Poczuj magię dzięki klasie zaklęć!', '', 'wizarding-world-harry-potter-opieka-nad-magicznymi-zwierzetami-zestaw-z-laleczka', '', '', '', 'Wizarding World, Harry Potter, Opieka nad magicznymi zwierzętami, zestaw z laleczką', '', '', '', ''),
(251, 1, 2, 'Wyobraź sobie opiekę nad stworzeniami z czarodziejskiego świata z Luną Lovegood i zestawem Magical Minis magiczne zwierzęta. Dzięki wyjątkowej 3-calowej lalce Luny Lovegood i trzem tematycznym akcesoriom (w tym mały, latający Testral) młode czarownice, czarodzieje i mugole mogą odtwarzać ulubione sceny z Harry\'ego Pottera. Przymocuj małego Testrala do drzewa i pozwól mu latać dookoła! Następnie zdejmij wiadro z haczyka i nakarm magiczne zwierzę jabłkami Luna może je brać do ręki. Następnie znajdź stworzenie ukrywające się pomiędzy liśćmi. Przesuń lunę nad miejscem aktywacji, żeby na drzewie pojawiły się Nieśmiałki. Ten zestaw to doskonały sposób pobudzenia wyobraźni poprzez ekscytującą zabawę. Połącz go z zamkiem Hogwart Magical Minis (sprzedawany oddzielnie) i rozszerz o klasę zaklęć oraz eliksirów (zestawy z lalkami są sprzedawane osobno). Zbierz wszystkie Małe Lalki Magical Minis i zestawy do zabawy, aby stworzyć swój własny świat czarodziejów (każdy sprzedawany osobno). Zabawki Magical Minis to idealne prezenty dla dzieci i fanów Harry\'ego Pottera. Poczuj magię dzięki klasie zaklęć!', '', 'wizarding-world-harry-potter-opieka-nad-magicznymi-zwierzetami-zestaw-z-laleczka', '', '', '', 'Wizarding World, Harry Potter, Opieka nad magicznymi zwierzętami, zestaw z laleczką', '', '', '', ''),
(252, 1, 1, 'Lalka Księżniczka Jasmina z serii Disney Princess Księżniczka Jasmina błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty! W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-jasmina-lalka', '', '', '', 'Disney Princess, Księżniczka Jaśmina, lalka', '', '', '', ''),
(252, 1, 2, 'Lalka Księżniczka Jasmina z serii Disney Princess Księżniczka Jasmina błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty! W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-jasmina-lalka', '', '', '', 'Disney Princess, Księżniczka Jaśmina, lalka', '', '', '', ''),
(253, 1, 1, 'Każdy, kto wije swoje wielkanocne gniazdko, powinien być czujny! W różowym jajku wielkanocnym Baby Born ono się kryje. Na kombinezonie widać króliczka Benno i wiosenne tulipany. Do kaptura przyszyte są zabawne zajęcze uszy. Połączone z kombinezonem czerwone stopy fantastycznie wyglądają podczas kicania. Dzięki arkuszowi naklejek można tworzyć wielkanocne dekoracje. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Baby Born Jajko wielkanocne z arkuszem naklejek.', '', 'baby-born-jajko-wielkanocne-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, Jajko wielkanocne, ubranko dla lalki 43 cm', '', '', '', ''),
(253, 1, 2, 'Każdy, kto wije swoje wielkanocne gniazdko, powinien być czujny! W różowym jajku wielkanocnym Baby Born ono się kryje. Na kombinezonie widać króliczka Benno i wiosenne tulipany. Do kaptura przyszyte są zabawne zajęcze uszy. Połączone z kombinezonem czerwone stopy fantastycznie wyglądają podczas kicania. Dzięki arkuszowi naklejek można tworzyć wielkanocne dekoracje. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Baby Born Jajko wielkanocne z arkuszem naklejek.', '', 'baby-born-jajko-wielkanocne-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, Jajko wielkanocne, ubranko dla lalki 43 cm', '', '', '', ''),
(254, 1, 1, 'Dzieci od najmłodszych lat powinny się uczyć odpowiedzialności i troski o drugą osobę. Lalka MEGA CREATIVE sprawi, że Twoja pociecha zaopiekuje się nią w najlepszy możliwy sposób. Zalety produktu:  możliwość nauki przez dziecko troskliwość oraz opiekuńczości. Lalka w ubranku, z butelką, grzechotką i becikiem. Zawartość zestawu:  lalka Bobas, pluszowa butelka, pluszowa grzechotka, ręcznik z kapturkiem. Wielkość lalki:  40 cm Zestaw przeznaczony dla dzieci w wieku:  3+', '', 'mega-creative-lalka-bobas-z-akcesoriami-40-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 40 cm', '', '', '', ''),
(254, 1, 2, 'Dzieci od najmłodszych lat powinny się uczyć odpowiedzialności i troski o drugą osobę. Lalka MEGA CREATIVE sprawi, że Twoja pociecha zaopiekuje się nią w najlepszy możliwy sposób. Zalety produktu:  możliwość nauki przez dziecko troskliwość oraz opiekuńczości. Lalka w ubranku, z butelką, grzechotką i becikiem. Zawartość zestawu:  lalka Bobas, pluszowa butelka, pluszowa grzechotka, ręcznik z kapturkiem. Wielkość lalki:  40 cm Zestaw przeznaczony dla dzieci w wieku:  3+', '', 'mega-creative-lalka-bobas-z-akcesoriami-40-cm', '', '', '', 'Mega Creative, lalka bobas z akcesoriami, 40 cm', '', '', '', ''),
(255, 1, 1, 'Evi w letnim stroju pięć dziewczynek i jeden chłopiec Uwaga! Produkt występuje w dwóch wersjach kolorystycznych. Wysyłka losowa, bez możliwości wyboru koloru.', '', 'evi-love-letnia-przyjaciolka-lalka', '', '', '', 'Evi Love, Letnia przyjaciółka, lalka', '', '', '', ''),
(255, 1, 2, 'Evi w letnim stroju pięć dziewczynek i jeden chłopiec Uwaga! Produkt występuje w dwóch wersjach kolorystycznych. Wysyłka losowa, bez możliwości wyboru koloru.', '', 'evi-love-letnia-przyjaciolka-lalka', '', '', '', 'Evi Love, Letnia przyjaciółka, lalka', '', '', '', ''),
(256, 1, 1, 'Bella błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty! W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-bella-lalka', '', '', '', 'Disney Princess, Księżniczka Bella, lalka', '', '', '', ''),
(256, 1, 2, 'Bella błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty! W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-bella-lalka', '', '', '', 'Disney Princess, Księżniczka Bella, lalka', '', '', '', ''),
(257, 1, 1, 'Smoby - Maxi-Cosi Quinny. Wysokie krzesełko ze stolikiem, huśtawką oraz fotelikiem. Dla lalek do 42 cm (brak lalki w zestawie).', '', 'smoby-maxi-cosi-quinny-krzeselko-do-karmienia-fotelik-i-hustawka', '', '', '', 'Smoby, Maxi-Cosi Quinny, krzesełko do karmienia, fotelik i huśtawka', '', '', '', ''),
(257, 1, 2, 'Smoby - Maxi-Cosi Quinny. Wysokie krzesełko ze stolikiem, huśtawką oraz fotelikiem. Dla lalek do 42 cm (brak lalki w zestawie).', '', 'smoby-maxi-cosi-quinny-krzeselko-do-karmienia-fotelik-i-hustawka', '', '', '', 'Smoby, Maxi-Cosi Quinny, krzesełko do karmienia, fotelik i huśtawka', '', '', '', ''),
(258, 1, 1, 'Ten wyjątkowy, lśniący, 40-centymetrowy kabriolet Barbie w kolorze białym z kolorowymi pasami ma dwa siedzenia i logo Barbie na masce oraz drzwiach. Sportowe koła, wysoka jakość i starannie wykonane detale wnętrza dodają mu realizmu, przenosząc dziecko do świata zabawy i fantazji.  Stylowy pilot zdalnego sterowania o częstotliwości 2,4 GHz gwarantuje bezawaryjne użytkowanie samochodu, a w dodatku ma kształt kierownicy, co zapewnia lepszą kontrolę i zabawę. Ten zdalnie sterowany samochód Barbie osiąga prędkość nawet 8 km/h! Zapewnia nieskończone możliwości świetnej zabawy i doskonale pasuje do innych zestawów z lalką Barbie, Kenem i akcesoriami. Można łączyć go z innymi zabawkami z tej kolekcji, aby wymyślać niesamowite, nowe historie. To idealny prezent dla każdej małej księżniczki! Zdalne sterowanie - pilot zdalnego sterowania ma kształt kierownicy, co zapewnia lepszą kontrolę i zabawę.  Prędkość - do 8 km/h.  Doskonały styl i świetna zabawa - wysoka jakość wykonania, dbałość o każdy detal, olśniewający różowy kolor i logo Barbie na masce oraz drzwiach zachwycą każdą małą księżniczkę! Autentyczny design Mattel.  Idealny prezent dla dziewczynki na każdą okazję.', '', 'barbie-kabriolet-pojazd-zdalnie-sterowany-bialy', '', '', '', 'Barbie, kabriolet, pojazd zdalnie sterowany, biały', '', '', '', ''),
(258, 1, 2, 'Ten wyjątkowy, lśniący, 40-centymetrowy kabriolet Barbie w kolorze białym z kolorowymi pasami ma dwa siedzenia i logo Barbie na masce oraz drzwiach. Sportowe koła, wysoka jakość i starannie wykonane detale wnętrza dodają mu realizmu, przenosząc dziecko do świata zabawy i fantazji.  Stylowy pilot zdalnego sterowania o częstotliwości 2,4 GHz gwarantuje bezawaryjne użytkowanie samochodu, a w dodatku ma kształt kierownicy, co zapewnia lepszą kontrolę i zabawę. Ten zdalnie sterowany samochód Barbie osiąga prędkość nawet 8 km/h! Zapewnia nieskończone możliwości świetnej zabawy i doskonale pasuje do innych zestawów z lalką Barbie, Kenem i akcesoriami. Można łączyć go z innymi zabawkami z tej kolekcji, aby wymyślać niesamowite, nowe historie. To idealny prezent dla każdej małej księżniczki! Zdalne sterowanie - pilot zdalnego sterowania ma kształt kierownicy, co zapewnia lepszą kontrolę i zabawę.  Prędkość - do 8 km/h.  Doskonały styl i świetna zabawa - wysoka jakość wykonania, dbałość o każdy detal, olśniewający różowy kolor i logo Barbie na masce oraz drzwiach zachwycą każdą małą księżniczkę! Autentyczny design Mattel.  Idealny prezent dla dziewczynki na każdą okazję.', '', 'barbie-kabriolet-pojazd-zdalnie-sterowany-bialy', '', '', '', 'Barbie, kabriolet, pojazd zdalnie sterowany, biały', '', '', '', ''),
(259, 1, 1, 'Lalka - bobas w nosidełku. Laleczka jest ubrana w kolorową piżamkę. Na głowę ma założone okrycie głowy. Bobas jest wykonany dość realistycznie. Dotyczy to zarówno główki (np. wyżłobienia odwzorowujące małe włoski), ale również rączek i stóp. Zabawkę umieszczono w nosidełku z regulowaną rączką. Jest to produkt, który pozwala wyrabiać opiekuńczość. Wymiary: 24x17x15 cm Wiek:  3+ Produkt występuje w różnych wariantach. Uwaga! Produkt wysyłany losowo.', '', 'dromader-lalka-w-nosidelku', '', '', '', 'Dromader, lalka w nosidełku', '', '', '', ''),
(259, 1, 2, 'Lalka - bobas w nosidełku. Laleczka jest ubrana w kolorową piżamkę. Na głowę ma założone okrycie głowy. Bobas jest wykonany dość realistycznie. Dotyczy to zarówno główki (np. wyżłobienia odwzorowujące małe włoski), ale również rączek i stóp. Zabawkę umieszczono w nosidełku z regulowaną rączką. Jest to produkt, który pozwala wyrabiać opiekuńczość. Wymiary: 24x17x15 cm Wiek:  3+ Produkt występuje w różnych wariantach. Uwaga! Produkt wysyłany losowo.', '', 'dromader-lalka-w-nosidelku', '', '', '', 'Dromader, lalka w nosidełku', '', '', '', ''),
(260, 1, 1, 'Bluzy z kapturem są bardzo wygodne i chronią główkę Baby Born przed wiatrem. Spodnie do biegania w kolorze różowym i niebieskim mają kolorowe obszycia wyglądające jak kieszonki - do tego jeszcze te białe zygzaki! Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. W zestawie wieszak na ubrania. Wymiary opakowania:  39 x 19 x 1 cm. Wiek:  3+. Uwaga! Produkt wysyłany losowo.', '', 'baby-born-zestaw-do-joggingu-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, zestaw do joggingu, ubranko dla lalki, 43 cm', '', '', '', ''),
(260, 1, 2, 'Bluzy z kapturem są bardzo wygodne i chronią główkę Baby Born przed wiatrem. Spodnie do biegania w kolorze różowym i niebieskim mają kolorowe obszycia wyglądające jak kieszonki - do tego jeszcze te białe zygzaki! Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. W zestawie wieszak na ubrania. Wymiary opakowania:  39 x 19 x 1 cm. Wiek:  3+. Uwaga! Produkt wysyłany losowo.', '', 'baby-born-zestaw-do-joggingu-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, zestaw do joggingu, ubranko dla lalki, 43 cm', '', '', '', '');
