(261, 1, 1, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Royal Bee uwielbia pomagać swoim przyjaciołom i wie, że można osiągnąć wszystko, jeśli tylko uwierzysz w siebie. Jest starszą siostrą L.O.L. Surprise Queen Bee. Ulubiony styl Royal Bee to glam! Jak wszystkie laleczki, L.O.L. Surprise O.M.G mają oszałamiające rysy twarzy, piękne włosy. Mają kilka punktów artykulacji co pozwala na ustawianie laleczek w przeróżnych pozach, a także ułatwiają przebieranie lalek. W opakowaniu czeka aż 12 niespodzianek do odkrycia! Sprawdź sama co kryje Twoja Royal Bee! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Royal Bee,  ubrania,  buty,  akcesoria,  szczotka do włosów,  stojak na lalkę Zbierz całą kolekcję Series 1:  Swag, Royal B, Lady Diva oraz Neonlicious.', '', 'lol-surprise-omg-royal-bee-laleczka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Royal Bee, laleczka modowa', '', '', '', ''),
(261, 1, 2, 'Laleczki L.O.L. Surprise O.M.G. powracają! Jak zawsze w pięknym i modnym stylu! Royal Bee uwielbia pomagać swoim przyjaciołom i wie, że można osiągnąć wszystko, jeśli tylko uwierzysz w siebie. Jest starszą siostrą L.O.L. Surprise Queen Bee. Ulubiony styl Royal Bee to glam! Jak wszystkie laleczki, L.O.L. Surprise O.M.G mają oszałamiające rysy twarzy, piękne włosy. Mają kilka punktów artykulacji co pozwala na ustawianie laleczek w przeróżnych pozach, a także ułatwiają przebieranie lalek. W opakowaniu czeka aż 12 niespodzianek do odkrycia! Sprawdź sama co kryje Twoja Royal Bee! W zestawie:   modna lalka L.O.L. Surprise O.M.G. Royal Bee,  ubrania,  buty,  akcesoria,  szczotka do włosów,  stojak na lalkę Zbierz całą kolekcję Series 1:  Swag, Royal B, Lady Diva oraz Neonlicious.', '', 'lol-surprise-omg-royal-bee-laleczka-modowa', '', '', '', 'L.O.L. Surprise, O.M.G., Royal Bee, laleczka modowa', '', '', '', ''),
(262, 1, 1, 'Lalka - mały bobas, który ma 24  cm.    Ubrana jest w kombinezon i czapeczkę.   Całe ubranko jest dwukolorowe i ma nadruk tygrysa na bluzce.   Czapka ma doszyte uszy i nosek zwierzątka.   Lalka posiada wyszczególnione źrenice oraz piegi.   Bobas ma bardzo dobrze odwzorowane buzie i ciało do rzeczywistego wyglądu.   Trzyma w ręce butelkę.  Wymiary opakowania:  13x18,5x11,5 cm.  Wiek:  3+.', '', 'hh-poland-lalka-bobas', '', '', '', 'HH Poland, lalka bobas', '', '', '', ''),
(262, 1, 2, 'Lalka - mały bobas, który ma 24  cm.    Ubrana jest w kombinezon i czapeczkę.   Całe ubranko jest dwukolorowe i ma nadruk tygrysa na bluzce.   Czapka ma doszyte uszy i nosek zwierzątka.   Lalka posiada wyszczególnione źrenice oraz piegi.   Bobas ma bardzo dobrze odwzorowane buzie i ciało do rzeczywistego wyglądu.   Trzyma w ręce butelkę.  Wymiary opakowania:  13x18,5x11,5 cm.  Wiek:  3+.', '', 'hh-poland-lalka-bobas', '', '', '', 'HH Poland, lalka bobas', '', '', '', ''),
(263, 1, 1, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-piesek-husky-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka piesek husky, 1 szt.', '', '', '', ''),
(263, 1, 2, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-piesek-husky-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka piesek husky, 1 szt.', '', '', '', ''),
(264, 1, 1, 'Ubierz swoją lalkę z zestawem akcesoriów. Zawartość zestawu:  sukienka 3 pary pantofli 2 torebki okulary szczotka opaska naszyjnik aparat Wymiary opakowania:  25x27x3 cm<br />Wiek:  3+', '', 'bigtoys-ubranie-dla-lalki-zestaw-z-akcesoriami', '', '', '', 'Bigtoys, ubranie dla lalki, zestaw z akcesoriami', '', '', '', ''),
(264, 1, 2, 'Ubierz swoją lalkę z zestawem akcesoriów. Zawartość zestawu:  sukienka 3 pary pantofli 2 torebki okulary szczotka opaska naszyjnik aparat Wymiary opakowania:  25x27x3 cm<br />Wiek:  3+', '', 'bigtoys-ubranie-dla-lalki-zestaw-z-akcesoriami', '', '', '', 'Bigtoys, ubranie dla lalki, zestaw z akcesoriami', '', '', '', ''),
(265, 1, 1, 'Zbierz całą kolekcję laleczek w modnych stylizacjach. Aż 6 modeli lalek to sposób na doskonałą zabawę, odgrywanie scenek. Lalki mają 13 cm wysokości. Każda lalka ma inne ubranie i fryzurę.  Mix wzorów, towar wysyłany losowo.', '', 'pro-kids-lalka-13-cm', '', '', '', 'Pro Kids, lalka, 13 cm', '', '', '', ''),
(265, 1, 2, 'Zbierz całą kolekcję laleczek w modnych stylizacjach. Aż 6 modeli lalek to sposób na doskonałą zabawę, odgrywanie scenek. Lalki mają 13 cm wysokości. Każda lalka ma inne ubranie i fryzurę.  Mix wzorów, towar wysyłany losowo.', '', 'pro-kids-lalka-13-cm', '', '', '', 'Pro Kids, lalka, 13 cm', '', '', '', ''),
(266, 1, 1, 'L.O.L. Surprise O.M.G. Queens Splash Beauty to królowa stylu i szyku! Zawsze wspiera wszystkich dookoła i jest najlepszymi przyjaciółką każdej z nas. Splash Beauty to największa artystka świata L.O.L. Surprise! Uwielbia być na scenie i stać w świetle reflektorów. Królowa ma kilka punktów artykulacji, więc jest gotowa, by wejść na scenę i dumnie prezentować swoje rzeczy. Ubierz Splash Beauty w jej najwspanialsze stroje z olśniewającymi dodatkami. Rada:  ręce można zdejmować, co ułatwia ubieranie. Oprócz modnych strojów i akcesoriów, Miss Divine ma również zaproszenie na najgorętszą imprezę roku! Rozpakuj olśniewające ubrania i zdobione klejnotami akcesoria i nie zapomnij poprosić o jej autograf! Splash Beauty ma jeszcze jedną niespodzianek dla swoich przyjaciół. Jej włosy zmieniają kolor! Kosmyki białych włosów zmieniają kolor na różowy w świetle dziennym, nawet jeśli jest pochmurny! Zestaw zawiera:   1 modną lalkę L.O.L. Surprise O.M.G. Queens,  srebrny podkoszulek,  spódnicę o kroju syreny,  długi różowy płaszcz,  kurtkę,  mini spódniczkę,  dwuczęściowy strój kąpielowy,  skarpetki,  okulary przeciwsłoneczne,  naszyjnik,  pasek,  opaskę,  wieszak,  stojak na lalkę,  torebka,  buty,  szczotka do włosów,  zaproszenie,  plakat,  torba na ubrania. Zbierz także inne laleczki z serii L.O.L. Surprise O.M.G. Queens:  Runway Diva, Miss Divine, Sways i Prism. Zbierz wszystkie królowe!', '', 'lol-surprise-queens-splash-beauty-laleczka-modowa', '', '', '', 'L.O.L. Surprise, Queens, Splash Beauty, laleczka modowa', '', '', '', ''),
(266, 1, 2, 'L.O.L. Surprise O.M.G. Queens Splash Beauty to królowa stylu i szyku! Zawsze wspiera wszystkich dookoła i jest najlepszymi przyjaciółką każdej z nas. Splash Beauty to największa artystka świata L.O.L. Surprise! Uwielbia być na scenie i stać w świetle reflektorów. Królowa ma kilka punktów artykulacji, więc jest gotowa, by wejść na scenę i dumnie prezentować swoje rzeczy. Ubierz Splash Beauty w jej najwspanialsze stroje z olśniewającymi dodatkami. Rada:  ręce można zdejmować, co ułatwia ubieranie. Oprócz modnych strojów i akcesoriów, Miss Divine ma również zaproszenie na najgorętszą imprezę roku! Rozpakuj olśniewające ubrania i zdobione klejnotami akcesoria i nie zapomnij poprosić o jej autograf! Splash Beauty ma jeszcze jedną niespodzianek dla swoich przyjaciół. Jej włosy zmieniają kolor! Kosmyki białych włosów zmieniają kolor na różowy w świetle dziennym, nawet jeśli jest pochmurny! Zestaw zawiera:   1 modną lalkę L.O.L. Surprise O.M.G. Queens,  srebrny podkoszulek,  spódnicę o kroju syreny,  długi różowy płaszcz,  kurtkę,  mini spódniczkę,  dwuczęściowy strój kąpielowy,  skarpetki,  okulary przeciwsłoneczne,  naszyjnik,  pasek,  opaskę,  wieszak,  stojak na lalkę,  torebka,  buty,  szczotka do włosów,  zaproszenie,  plakat,  torba na ubrania. Zbierz także inne laleczki z serii L.O.L. Surprise O.M.G. Queens:  Runway Diva, Miss Divine, Sways i Prism. Zbierz wszystkie królowe!', '', 'lol-surprise-queens-splash-beauty-laleczka-modowa', '', '', '', 'L.O.L. Surprise, Queens, Splash Beauty, laleczka modowa', '', '', '', ''),
(267, 1, 1, 'Zalety produktu:  Lalka Mega Creative to niezbędna zabawka w kolekcji każdej młodej damy. Bez wątpienia czas spędzony z nią będzie czystą przyjemnością. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Produkt przeznaczony dla dzieci w wieku:  3. Wymiary lalki:  29cm.Wymiary opakowania (cm):  8 x 32 x 4,5. Waga opakowania kg. 0,13 kg.', '', 'mega-creative-lalka-29-cm', '', '', '', 'Mega Creative, lalka, 29 cm', '', '', '', ''),
(267, 1, 2, 'Zalety produktu:  Lalka Mega Creative to niezbędna zabawka w kolekcji każdej młodej damy. Bez wątpienia czas spędzony z nią będzie czystą przyjemnością. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Produkt przeznaczony dla dzieci w wieku:  3. Wymiary lalki:  29cm.Wymiary opakowania (cm):  8 x 32 x 4,5. Waga opakowania kg. 0,13 kg.', '', 'mega-creative-lalka-29-cm', '', '', '', 'Mega Creative, lalka, 29 cm', '', '', '', ''),
(268, 1, 1, 'Lalka wróżka ze świecącymi skrzydłami. W kolorowym opakowaniu, które przyciągnie uwagę dziewczynek, umieszczono lalkę ubraną w modną stylizację suknia z elementami tiulu i koronki. Na twarzy bajkowej postaci znajduje się delikatny makijaż. Jej blond włosy są upięte. Obecna jest również kokardka. Po naciśnięciu na serduszko umieszczone na zabawce skrzydełka zaczynają świecić. Do zestawu dołączono akcesoria. Są to buty baleriny. Baterie w zestawie. Zabawka działa po wyjęciu zabezpieczenia baterii. Wymiary opakowania:  24x8x32 cm. Wiek:  3+. Uwaga:  produkt wysyłany losowo.', '', 'ciuciubabka-lalka-wrozka-ze-swiecacymi-skrzydlami', '', '', '', 'Ciuciubabka, lalka, wróżka ze świecącymi skrzydłami', '', '', '', ''),
(268, 1, 2, 'Lalka wróżka ze świecącymi skrzydłami. W kolorowym opakowaniu, które przyciągnie uwagę dziewczynek, umieszczono lalkę ubraną w modną stylizację suknia z elementami tiulu i koronki. Na twarzy bajkowej postaci znajduje się delikatny makijaż. Jej blond włosy są upięte. Obecna jest również kokardka. Po naciśnięciu na serduszko umieszczone na zabawce skrzydełka zaczynają świecić. Do zestawu dołączono akcesoria. Są to buty baleriny. Baterie w zestawie. Zabawka działa po wyjęciu zabezpieczenia baterii. Wymiary opakowania:  24x8x32 cm. Wiek:  3+. Uwaga:  produkt wysyłany losowo.', '', 'ciuciubabka-lalka-wrozka-ze-swiecacymi-skrzydlami', '', '', '', 'Ciuciubabka, lalka, wróżka ze świecącymi skrzydłami', '', '', '', ''),
(269, 1, 1, 'Zestaw składa się z łóżka piętrowego, 2 poduszek i 2 kocyków i jest przeznaczony dla 30-centymetrowych lalek, wymiary:  39 x 28 x 38 cm', '', 'simba-baby-born-lozko-pietrowe', '', '', '', 'Simba, Baby Born, łóżko pietrowe', '', '', '', ''),
(269, 1, 2, 'Zestaw składa się z łóżka piętrowego, 2 poduszek i 2 kocyków i jest przeznaczony dla 30-centymetrowych lalek, wymiary:  39 x 28 x 38 cm', '', 'simba-baby-born-lozko-pietrowe', '', '', '', 'Simba, Baby Born, łóżko pietrowe', '', '', '', ''),
(270, 1, 1, 'Lalka od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka, lalka w sukience z dwoma kucykami, koczkami lub warkoczami, chłopiec w ubranku, zestawy występują w trzech wzorach i kolorach włosów. Zawartość zestawu:  lalka w sukience, lalka chłopiec w ubranku - wysyłka losowa. Wymiary produktu dł. cm:  15 cm. Wymiary opakowania dł. x wys. x gł. cm:  12x20x5. Waga produktu bez opakowania kg:  0,06 kg. Waga produktu w opakowaniu kg:  0,08 kg. Nie wymaga zasilania bateriami. Przeznaczona dla dzieci w wieku:  3+. Pakowana w kartonik z okienkiem.', '', 'mega-creative-lalka-z-akcesoriami-15-cm', '', '', '', 'Mega Creative, lalka z akcesoriami, 15 cm', '', '', '', ''),
(270, 1, 2, 'Lalka od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka, lalka w sukience z dwoma kucykami, koczkami lub warkoczami, chłopiec w ubranku, zestawy występują w trzech wzorach i kolorach włosów. Zawartość zestawu:  lalka w sukience, lalka chłopiec w ubranku - wysyłka losowa. Wymiary produktu dł. cm:  15 cm. Wymiary opakowania dł. x wys. x gł. cm:  12x20x5. Waga produktu bez opakowania kg:  0,06 kg. Waga produktu w opakowaniu kg:  0,08 kg. Nie wymaga zasilania bateriami. Przeznaczona dla dzieci w wieku:  3+. Pakowana w kartonik z okienkiem.', '', 'mega-creative-lalka-z-akcesoriami-15-cm', '', '', '', 'Mega Creative, lalka z akcesoriami, 15 cm', '', '', '', ''),
(271, 1, 1, 'Zabawa z tą słodką lalką sprawi, że wieczory będą o wiele przyjemniejsze. Uwielbia bawić się swoim doudou i spać na miękkiej poduszce. Jest to niemowlę o miękkim ciele i winylowych kończynach, które są miękkie w dotyku. Dodatkowo wydziela przyjemny aromat wanilii. Jej ubrania i gondola w odcieniach różu i bieli wykonane są z wysokiej jakości materiałów. Poza tym będzie potrzebowała dużo przytulania, bo jak ściskasz go za brzuszek, zaczyna płakać. Zawiera smoczek, poduszkę i doudou jako akcesoria.', '', 'munecas-arias-natal-placzaca-lalka-33-cm', '', '', '', 'Munecas Arias, Natal, płacząca lalka, 33 cm', '', '', '', ''),
(271, 1, 2, 'Zabawa z tą słodką lalką sprawi, że wieczory będą o wiele przyjemniejsze. Uwielbia bawić się swoim doudou i spać na miękkiej poduszce. Jest to niemowlę o miękkim ciele i winylowych kończynach, które są miękkie w dotyku. Dodatkowo wydziela przyjemny aromat wanilii. Jej ubrania i gondola w odcieniach różu i bieli wykonane są z wysokiej jakości materiałów. Poza tym będzie potrzebowała dużo przytulania, bo jak ściskasz go za brzuszek, zaczyna płakać. Zawiera smoczek, poduszkę i doudou jako akcesoria.', '', 'munecas-arias-natal-placzaca-lalka-33-cm', '', '', '', 'Munecas Arias, Natal, płacząca lalka, 33 cm', '', '', '', ''),
(272, 1, 1, 'Zanurz się w świecie przygód z lalką Barbie \"Brooklyn\" Roberts inspirowaną bajką \"Barbie Mermaid Power Moc syrenek\"! Na magiczny wygląd syrenki lalki Barbie składają się bardzo długie fioletowe włosy i piękny ogon z efektem ombre, wspaniałymi akcentami i łuskami. Lalka ma także wymieniane płetwy, 2 tiary wysadzane \"klejnotami\", 2 naszyjniki i szczotkę do włosów, dlatego dzieci mogą tworzyć niesamowite stylizacje na każdą przygodę. Uroczy mały feniks inspiruje do wspaniałych opowieści o przyjaźni. Lalki nie stoją i nie pływają samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.  Lalki Barbie Mermaid Power Moc syrenek dla dzieci od 3 roku życia inspirują do odtwarzania ulubionych filmowych momentów lub tworzenia własnych opowieści!', '', 'barbie-syrenka-brooklyn-lalka-filmowa', '', '', '', 'Barbie, Syrenka Brooklyn, lalka filmowa', '', '', '', ''),
(272, 1, 2, 'Zanurz się w świecie przygód z lalką Barbie \"Brooklyn\" Roberts inspirowaną bajką \"Barbie Mermaid Power Moc syrenek\"! Na magiczny wygląd syrenki lalki Barbie składają się bardzo długie fioletowe włosy i piękny ogon z efektem ombre, wspaniałymi akcentami i łuskami. Lalka ma także wymieniane płetwy, 2 tiary wysadzane \"klejnotami\", 2 naszyjniki i szczotkę do włosów, dlatego dzieci mogą tworzyć niesamowite stylizacje na każdą przygodę. Uroczy mały feniks inspiruje do wspaniałych opowieści o przyjaźni. Lalki nie stoją i nie pływają samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.  Lalki Barbie Mermaid Power Moc syrenek dla dzieci od 3 roku życia inspirują do odtwarzania ulubionych filmowych momentów lub tworzenia własnych opowieści!', '', 'barbie-syrenka-brooklyn-lalka-filmowa', '', '', '', 'Barbie, Syrenka Brooklyn, lalka filmowa', '', '', '', ''),
(273, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. W zestawie:  lalka Meena Fleur z długimi włosami do czesania akcesoria do włosów i grzebień dodatkowa odzież dla lalek (2 komplety) + wieszaki akcesoria modowe (kolczyki, torebka, buty...) stojak na lalkę Lalka zgina się w przegubach. Rozmiar:  30,48x 8,13x30,48 cm Zbierz kolekcję pięknych lalek z Rainbow High!', '', 'rainbow-high-fashion-doll-meena-fleur-lalka-modowa', '', '', '', 'Rainbow High, Fashion Doll, Meena Fleur, lalka modowa', '', '', '', ''),
(273, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. W zestawie:  lalka Meena Fleur z długimi włosami do czesania akcesoria do włosów i grzebień dodatkowa odzież dla lalek (2 komplety) + wieszaki akcesoria modowe (kolczyki, torebka, buty...) stojak na lalkę Lalka zgina się w przegubach. Rozmiar:  30,48x 8,13x30,48 cm Zbierz kolekcję pięknych lalek z Rainbow High!', '', 'rainbow-high-fashion-doll-meena-fleur-lalka-modowa', '', '', '', 'Rainbow High, Fashion Doll, Meena Fleur, lalka modowa', '', '', '', ''),
(274, 1, 1, 'Piękna lalka w balowej,różowej sukience, w zestawie z koniem i karocą w kształcie dyni.KARETA z chodzącym konikiem, który wydaje odgłosy rżenia i lalką. Całość wykonana jest bardzo starannie i estetycznie, zapewne sprawi wiele wspaniałej zabawy każdej małej dziewczynce. KONIK- chodzi do przodu- wydaje odgłos rżenia- ma piękną długą grzywę i ogon, która można zaplatać w warkocze- piękna różowa uprząż imitująca pędy kwiatów KAROCA- posiada kolorowe światełka, które migają po włączeniu- całość pięknie ozdobiona - drzwi karocy są otwierane. Zabawka wymaga użycia baterii 5xAA(brak w zestawie).', '', 'kareta-z-lalka-i-koniem-rozowa', '', '', '', 'Kareta z lalką i koniem, różowa', '', '', '', ''),
(274, 1, 2, 'Piękna lalka w balowej,różowej sukience, w zestawie z koniem i karocą w kształcie dyni.KARETA z chodzącym konikiem, który wydaje odgłosy rżenia i lalką. Całość wykonana jest bardzo starannie i estetycznie, zapewne sprawi wiele wspaniałej zabawy każdej małej dziewczynce. KONIK- chodzi do przodu- wydaje odgłos rżenia- ma piękną długą grzywę i ogon, która można zaplatać w warkocze- piękna różowa uprząż imitująca pędy kwiatów KAROCA- posiada kolorowe światełka, które migają po włączeniu- całość pięknie ozdobiona - drzwi karocy są otwierane. Zabawka wymaga użycia baterii 5xAA(brak w zestawie).', '', 'kareta-z-lalka-i-koniem-rozowa', '', '', '', 'Kareta z lalką i koniem, różowa', '', '', '', ''),
(275, 1, 1, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę nauka samodzielności rozwijanie wyobraźni dziecka lalka 25 cm w sukience i z czapką na głowie, na stopach ma skarpetki lalka w całości wykonana z gumy Lalka Bobas od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zawartość zestawu:  lalka bobas 25 cm w ubranku spódniczka na zamianę spodenki kokarda Wymiary/waga/baterie:  wymiary produktu dł. cm: 25 cm wymiary opakowania dł.xwys.xgł. cm: 25x21x14 waga produktu bez opakowania kg: 0,24 kg waga produktu w opakowaniu kg: 0,48 kg nie wymaga zasilania bateriami Zabawka wykonana z gumy oraz tkaniny. Przeznaczona dla dzieci w wieku:  18m.', '', 'mega-creative-lalka-bobas-z-akcesoriami-25-cm', '', '', '', 'Mega Creative, Lalka Bobas z akcesoriami, 25 cm', '', '', '', ''),
