(276, 1, 1, 'Cry Babies Magic Tears to laleczki do kolekcjonowania, które potrzebują troskliwej opieki i miłości każdej dziewczynki! Cry Babies Magic Tears płaczą prawdziwymi łzami. Smoczek jest lekarstwem na ich łzy. Każda postać występuje w wyjątkowym zwierzęcym ubranku. Laleczki w opakowaniu występują z wieloma akcesoriami. Wymiary ok.:  11 cm. Uwaga! Produkt wysyłany losowo.', '', 'cry-babies-magic-tears-laleczka-niespodzianka-placzaca-zlota-edycja', '', '', '', 'Cry Babies, Magic Tears, laleczka niespodzianka, płacząca, złota edycja', '', '', '', ''),
(276, 1, 2, 'Cry Babies Magic Tears to laleczki do kolekcjonowania, które potrzebują troskliwej opieki i miłości każdej dziewczynki! Cry Babies Magic Tears płaczą prawdziwymi łzami. Smoczek jest lekarstwem na ich łzy. Każda postać występuje w wyjątkowym zwierzęcym ubranku. Laleczki w opakowaniu występują z wieloma akcesoriami. Wymiary ok.:  11 cm. Uwaga! Produkt wysyłany losowo.', '', 'cry-babies-magic-tears-laleczka-niespodzianka-placzaca-zlota-edycja', '', '', '', 'Cry Babies, Magic Tears, laleczka niespodzianka, płacząca, złota edycja', '', '', '', ''),
(277, 1, 1, 'Steffi na spacerze z psami, suczką i szczeniaczkiem to zestaw dla każdej wielbicielki zwierząt. Steffi ma niebieskie oczy i długie blond włosy do czesania. Na głowie ma stylowe, różowe okulary, a na nogach modne i wygodne białe buty. Ubrana jest w koszulkę z wzorem psich łapek i niebieską spódniczkę, co tworzy piękny dziewczęcy zestaw idealny na spacer. Steffi jest w towarzystwie dwóch słodkich psiaków, które są wierną kopią rasy Golden Retriever (malutki szczeniaczek w różowym koszyczku i drugi, większy na różowej smyczy). Dodatkowo zestaw zawiera komplet akcesoriów dla psiaków, takich jak miseczka czy zabawki.  Wysokość lalki:  29 cm. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'steffi-na-spacerze-z-psami-lalka-29-cm', '', '', '', 'Steffi na spacerze z psami, lalka, 29 cm', '', '', '', ''),
(277, 1, 2, 'Steffi na spacerze z psami, suczką i szczeniaczkiem to zestaw dla każdej wielbicielki zwierząt. Steffi ma niebieskie oczy i długie blond włosy do czesania. Na głowie ma stylowe, różowe okulary, a na nogach modne i wygodne białe buty. Ubrana jest w koszulkę z wzorem psich łapek i niebieską spódniczkę, co tworzy piękny dziewczęcy zestaw idealny na spacer. Steffi jest w towarzystwie dwóch słodkich psiaków, które są wierną kopią rasy Golden Retriever (malutki szczeniaczek w różowym koszyczku i drugi, większy na różowej smyczy). Dodatkowo zestaw zawiera komplet akcesoriów dla psiaków, takich jak miseczka czy zabawki.  Wysokość lalki:  29 cm. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'steffi-na-spacerze-z-psami-lalka-29-cm', '', '', '', 'Steffi na spacerze z psami, lalka, 29 cm', '', '', '', ''),
(278, 1, 1, 'Kiedy mama i tata wychodzą z Baby Annabell, lubią zajmować wygodne miejsca.   Uchwyt w kształcie litery Z sprawia, że fotelik jest szczególnie łatwy do przenoszenia.   Kiedy nadszedł czas na małą przerwę nad stawem w parku, uchwyt można łatwo złożyć, aby zamienić wygodne siedzenie w zwykłe siedzenie.   Materiał pokryty jest motywami stawowymi, takimi jak ważki i lilie wodne. Jeśli maluch zmęczy się, gdy jest poza domem, jest to super wygodne miejsce do drzemki.   Podczas podróży samochodem pas bezpieczeństwa jest po prostu przeciągany przez wgłębienia po bokach, aby zapewnić bezpieczeństwo Baby Annabell.  Dodatkowe informacje:  Nr katalogowy:  703120-116720', '', 'zapf-baby-annabell-fotelik', '', '', '', 'Zapf, Baby Annabell, fotelik', '', '', '', ''),
