(279, 1, 1, 'Przedstawiamy L.O.L. Surprise! Tweens! Te charakterne Be Tweens są dostępne z niespodziankami i wyjątkowym opakowaniem. 4 nowe postaci do zebrania:  Chloe Pepper, Marilyn Star, Emma Emo i Nia Regal W opakowaniu 15 niespodzianek Opakowaniem można się bawić Pudełko z okienkiem', '', 'lol-surprise-tweens-chloe-pepper-lalka-modowa', '', '', '', 'L.O.L. Surprise, Tweens, Chloe Pepper, lalka modowa', '', '', '', ''),
