(280, 1, 1, 'Zestaw akcesoriów dla lalek, zawiera niezbędne przybory dla niemowlaka. W komplecie znajduje się 1 pieluszka, miękkie i chłonna wyglądem przypominają prawdziwego pampersa. Nocnik i butelka z magicznym jedzeniem dla lalki zawsze będzie w pogotowiu – podczas przechylania, płyn wewnątrz butelki znika. Po ustawieniu jej w pozycji pionowej, w magiczny sposób pojawia się z powrotem. Wymiary opakowania:  25x18x13 cm. Wiek:  3+.', '', 'hipo-zestaw-dla-lalek-nocnik-pielucha-butelka', '', '', '', 'Hipo, zestaw dla lalek, nocnik, pielucha, butelka', '', '', '', ''),
