(281, 1, 1, 'Gaworząca lala Laura ma ok. 38 cm wysokości. Lalka z miękkim ciałem, ze śpiącymi oczami, ubrana jest w słodki kombinezon. Wydaje 24 dziecięce dźwięki.', '', 'simba-laura-gaworzaca-lalka-z-dzwiekiem-38-cm', '', '', '', 'Simba, Laura gaworząca, lalka z dźwiękiem, 38 cm', '', '', '', ''),
(281, 1, 2, 'Gaworząca lala Laura ma ok. 38 cm wysokości. Lalka z miękkim ciałem, ze śpiącymi oczami, ubrana jest w słodki kombinezon. Wydaje 24 dziecięce dźwięki.', '', 'simba-laura-gaworzaca-lalka-z-dzwiekiem-38-cm', '', '', '', 'Simba, Laura gaworząca, lalka z dźwiękiem, 38 cm', '', '', '', ''),
(282, 1, 1, 'Lalka Barbie Totally Hair z motywem kwiatów ma swój własny przebojowy styl i fryzurę, inspirowane niezwykle popularnym modelem Barbie sprzed 30 lat. Barbie ma bardzo długie włosy (21,5 cm) i ponad 15 dodatkowych elementów:  8 zmieniających kolor spinek do włosów, grzebień, 1 zestaw gumek do włosów, 2 frotki, krótki sweterek, torebkę, okulary przeciwsłoneczne i naszyjnik. Spinki ze zmianą koloru są dostępne w 4 różnych kolorach i zmieniają barwę w zależności od temperatury palców - odkryj nieskończone możliwości stylizacji. Lalka o krągłych kształtach ma różowe i fioletowe pasemka oraz kucyk zebrany z falowanych włosów. Ma na sobie sukienkę z nadrukiem w stokrotki oraz wycięciem. Dzieci pokochają tworzenie różnych fryzur i nieskończone możliwości stylizacji. To doskonały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają odkrywanie różnych stylów oraz stylizację fryzur i strojów.', '', 'barbie-totally-hair-kwiaty-lalka-z-akcesoriami', '', '', '', 'Barbie, Totally Hair, Kwiaty, lalka z akcesoriami', '', '', '', ''),
