(283, 1, 2, 'Evi Idzie spać.  Evi ubrana w uroczą piżamkę z nadrukowanymi barankami, trzyma w rączce swoją zabawkę - owieczkę.  Dołączone pasta, szczoteczka do mycia zębów oraz kubeczek.  Wysokość laleczki:  12 cm.  Wiek:  3+.', '', 'evi-love-evi-idzie-spac', '', '', '', 'Evi Love, Evi Idzie spać', '', '', '', ''),
