(284, 1, 2, 'Piękna lalka w balowej,różowej sukience, w zestawie z koniem i karocą w kształcie dyni.KARETA z chodzącym konikiem, który wydaje odgłosy rżenia i lalką. Całość wykonana jest bardzo starannie i estetycznie, zapewne sprawi wiele wspaniałej zabawy każdej małej dziewczynce. KONIK- chodzi do przodu- wydaje odgłos rżenia- ma piękną długą grzywę i ogon, która można zaplatać w warkocze- piękna różowa uprząż imitująca pędy kwiatów KAROCA- posiada kolorowe światełka, które migają po włączeniu- całość pięknie ozdobiona - drzwi karocy są otwierane. Zabawka wymaga użycia baterii 5xAA(brak w zestawie).', '', 'kareta-z-lalka-i-koniem-niebieska', '', '', '', 'Kareta z lalką i koniem, niebieska', '', '', '', ''),
(285, 1, 1, 'Bąbelkowa syrenka Enchantimals uwielbia robić bańki. Wystarczy zanurzyć buzię wielorybka w płynie do baniek wylanym na tackę w kształcie muszelki. Potem ściśnij łatwy do utrzymania w rączce ogonek syrenki, aby wypuścić w powietrze piękne mydlane bańki. W zestawie jest też jej ukochany delfinek Spray. Dzieci pokochają wyjątkową więź łączącą tych niezwykłych przyjaciół Enchantimals. Zestaw zawiera:  lalkę syrenkę 17,5 cm w zdejmowanej koronie, figurkę zwierzątka, płyn do baniek, tackę. Kolory i elementy dekoracyjne mogą się różnić. Wiek:  od 4 lat.', '', 'enchantimals-babelkowa-syrenka-atlantia-mermaid-lalka-z-akcesoriami', '', '', '', 'Enchantimals, Bąbelkowa syrenka Atlantia Mermaid, lalka z akcesoriami', '', '', '', ''),
(285, 1, 2, 'Bąbelkowa syrenka Enchantimals uwielbia robić bańki. Wystarczy zanurzyć buzię wielorybka w płynie do baniek wylanym na tackę w kształcie muszelki. Potem ściśnij łatwy do utrzymania w rączce ogonek syrenki, aby wypuścić w powietrze piękne mydlane bańki. W zestawie jest też jej ukochany delfinek Spray. Dzieci pokochają wyjątkową więź łączącą tych niezwykłych przyjaciół Enchantimals. Zestaw zawiera:  lalkę syrenkę 17,5 cm w zdejmowanej koronie, figurkę zwierzątka, płyn do baniek, tackę. Kolory i elementy dekoracyjne mogą się różnić. Wiek:  od 4 lat.', '', 'enchantimals-babelkowa-syrenka-atlantia-mermaid-lalka-z-akcesoriami', '', '', '', 'Enchantimals, Bąbelkowa syrenka Atlantia Mermaid, lalka z akcesoriami', '', '', '', ''),
(286, 1, 1, 'Ubranko dla lalek 45 cm.  Zestaw zawiera:    spodenki,   bluzę zapinaną na zamek,   czapeczkę,   buciki.     Kolor ubranka biało-różowym.  Wymiary opakowania:  39x27,5x1 cm.  Wiek:  3+.', '', 'adar-ubranko-dla-lalki-45-cm', '', '', '', 'Adar, ubranko dla lalki, 45 cm', '', '', '', ''),
(286, 1, 2, 'Ubranko dla lalek 45 cm.  Zestaw zawiera:    spodenki,   bluzę zapinaną na zamek,   czapeczkę,   buciki.     Kolor ubranka biało-różowym.  Wymiary opakowania:  39x27,5x1 cm.  Wiek:  3+.', '', 'adar-ubranko-dla-lalki-45-cm', '', '', '', 'Adar, ubranko dla lalki, 45 cm', '', '', '', ''),
(287, 1, 1, 'Lalka natalia na spacerze - naciśnij na brzuszek, by usłyszeć, jakie zna piosenki Funkcje:  Śpiewa 2 piosenki Kosi, kosi łapki Misia a, misia b Mówi 4 frazy Kocham cię mamusiu Przytul mnie bardzo mocno Pójdziemy na spacer Bardzo lubię śpiewać, to świetna zabawa Dodatkowe informacje:  Marka:  Natalia Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Tak Zasilanie:  Bateria CR2032 Wysokość:  35 cm Wymiary opakowania :  32 x 38 x 11 cm', '', 'artyk-natalia-na-spacerze-lalka-35-cm', '', '', '', 'Artyk, Natalia na spacerze, lalka, 35 cm', '', '', '', ''),
(287, 1, 2, 'Lalka natalia na spacerze - naciśnij na brzuszek, by usłyszeć, jakie zna piosenki Funkcje:  Śpiewa 2 piosenki Kosi, kosi łapki Misia a, misia b Mówi 4 frazy Kocham cię mamusiu Przytul mnie bardzo mocno Pójdziemy na spacer Bardzo lubię śpiewać, to świetna zabawa Dodatkowe informacje:  Marka:  Natalia Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Tak Zasilanie:  Bateria CR2032 Wysokość:  35 cm Wymiary opakowania :  32 x 38 x 11 cm', '', 'artyk-natalia-na-spacerze-lalka-35-cm', '', '', '', 'Artyk, Natalia na spacerze, lalka, 35 cm', '', '', '', ''),
(288, 1, 1, 'Evi zabrała kotka i pieska na przejażdżkę skuterem, zwierzęta siedzą w koszu. Evi ma kask i okulary przeciwsłoneczne. Wysokość lalki:  12 cm.', '', 'simba-evi-lalka-przyjaciele-na-skuterze', '', '', '', 'Simba, Evi, lalka, przyjaciele na skuterze', '', '', '', ''),
(288, 1, 2, 'Evi zabrała kotka i pieska na przejażdżkę skuterem, zwierzęta siedzą w koszu. Evi ma kask i okulary przeciwsłoneczne. Wysokość lalki:  12 cm.', '', 'simba-evi-lalka-przyjaciele-na-skuterze', '', '', '', 'Simba, Evi, lalka, przyjaciele na skuterze', '', '', '', ''),
(289, 1, 1, 'Wow! Jakaś strzała przemknęła tuż obok. To, zdaje się, BABY born w swoim szałowym kasku rowerowym. Srebrne okrycie głowy zapewnia bezpieczeństwo i pięknie mieni się w słońcu. Wystarczy zapiąć pasek pod brodą - kask wówczas nie będzie się zsuwał - i ruszamy w drogę! Jej Braciszek i Siostrzyczka także wkładają kaski na głowę - właśnie wybierają się na wrotki. Wysokiej jakości akcesoria do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosta konstrukcja sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Kask rowerowy BABY born 43 cm. Dodatkowe informacje:  Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Kolor:  Szary Kolor:  Żółty Wymiary opakowania:  15 x 9.5 x 19 cm', '', 'baby-born-kask-rowerowy-dla-lalki-43-cm', '', '', '', 'Baby Born, kask rowerowy dla lalki, 43 cm', '', '', '', ''),
(289, 1, 2, 'Wow! Jakaś strzała przemknęła tuż obok. To, zdaje się, BABY born w swoim szałowym kasku rowerowym. Srebrne okrycie głowy zapewnia bezpieczeństwo i pięknie mieni się w słońcu. Wystarczy zapiąć pasek pod brodą - kask wówczas nie będzie się zsuwał - i ruszamy w drogę! Jej Braciszek i Siostrzyczka także wkładają kaski na głowę - właśnie wybierają się na wrotki. Wysokiej jakości akcesoria do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosta konstrukcja sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Kask rowerowy BABY born 43 cm. Dodatkowe informacje:  Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Kolor:  Szary Kolor:  Żółty Wymiary opakowania:  15 x 9.5 x 19 cm', '', 'baby-born-kask-rowerowy-dla-lalki-43-cm', '', '', '', 'Baby Born, kask rowerowy dla lalki, 43 cm', '', '', '', ''),
(290, 1, 1, 'Anna Prima Balerina to urocza lalka o wysokości 33 cm.  Jeśli dotkniesz brzucha lalki, możesz usłyszeć dwie klasyczne piosenki baletowe.  Ze swoją śliczną buzią i lśniącymi blond włosami, Anna jest prawdziwą pięknością.  Kiedy kładziesz ją spać, zamyka oczy.  Ubrana jest w strój baletnicy.  Wymiary opakowania:  9x19,5x35 cm.', '', 'bayer-design-anna-prima-ballerina-lalka-33-cm', '', '', '', 'Bayer Design, Anna, Prima Ballerina, lalka, 33 cm', '', '', '', ''),
(290, 1, 2, 'Anna Prima Balerina to urocza lalka o wysokości 33 cm.  Jeśli dotkniesz brzucha lalki, możesz usłyszeć dwie klasyczne piosenki baletowe.  Ze swoją śliczną buzią i lśniącymi blond włosami, Anna jest prawdziwą pięknością.  Kiedy kładziesz ją spać, zamyka oczy.  Ubrana jest w strój baletnicy.  Wymiary opakowania:  9x19,5x35 cm.', '', 'bayer-design-anna-prima-ballerina-lalka-33-cm', '', '', '', 'Bayer Design, Anna, Prima Ballerina, lalka, 33 cm', '', '', '', ''),
(291, 1, 1, 'Każda dziewczynka lubi bawić się lalkami. Stylową Lalkę MEGA CREATIVE można do woli stroić i przebierać w inne stylizacje. Lalka w pięknej balowej sukni w 3 różnych stylizacjach. Zabawka wykonana z plastiku oraz sztucznego włosia i materiału. Produkt przeznaczony dla dzieci w wieku:  3+ Wielkość lalki 29 cm Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-lalka-29-cm', '', '', '', 'Mega Creative, lalka, 29 cm', '', '', '', ''),
(291, 1, 2, 'Każda dziewczynka lubi bawić się lalkami. Stylową Lalkę MEGA CREATIVE można do woli stroić i przebierać w inne stylizacje. Lalka w pięknej balowej sukni w 3 różnych stylizacjach. Zabawka wykonana z plastiku oraz sztucznego włosia i materiału. Produkt przeznaczony dla dzieci w wieku:  3+ Wielkość lalki 29 cm Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-lalka-29-cm', '', '', '', 'Mega Creative, lalka, 29 cm', '', '', '', ''),
(292, 1, 1, 'Zestaw przedstawiający szafę w komplecie z lalką i akcesoriami do niej. Lalka ma długie, lśniące włosy, a na buzi widnieje piękny makijaż. Ubrana jest w długą suknię balową i buciki. Idealny zestaw dla każdej dziewczynki interesującej się modą. W zestawie:  9 x sukienka, 8 x wieszak, grzebień, lalka, 4 x talerz, 2 x miska, 2 x owoc, 2 x butelka napoju, i inne. Informacje dodatkowe:  Produkt występuje w różnych wariantach. Wymiary opakowania:  38x32,5x5,5 cm. Wiek:  3+. Uwaga:  produkt wysyłany losowo.', '', 'bigtoys-lalka-ksiezniczka-zestaw-z-akcesoriami', '', '', '', 'BigToys, lalka księżniczka, zestaw z akcesoriami', '', '', '', ''),
(292, 1, 2, 'Zestaw przedstawiający szafę w komplecie z lalką i akcesoriami do niej. Lalka ma długie, lśniące włosy, a na buzi widnieje piękny makijaż. Ubrana jest w długą suknię balową i buciki. Idealny zestaw dla każdej dziewczynki interesującej się modą. W zestawie:  9 x sukienka, 8 x wieszak, grzebień, lalka, 4 x talerz, 2 x miska, 2 x owoc, 2 x butelka napoju, i inne. Informacje dodatkowe:  Produkt występuje w różnych wariantach. Wymiary opakowania:  38x32,5x5,5 cm. Wiek:  3+. Uwaga:  produkt wysyłany losowo.', '', 'bigtoys-lalka-ksiezniczka-zestaw-z-akcesoriami', '', '', '', 'BigToys, lalka księżniczka, zestaw z akcesoriami', '', '', '', ''),
(293, 1, 1, 'Barbie Cutie Reveal - oto Twoja ulubiona lalka w uroczym zwierzęcym przebraniu! Odkrywaj niespodzianki i baw się w najlepsze! Zabawa rozpoczyna się od rozpakowania. W środku znajdziesz lalkę, mięciutkie pluszowe zwierzątko oraz 10 niespodzianek. Lalka posiada punkty artykulacji dla jeszcze lepszej zabawy. Ubrana jest uroczy kostium. Kolorowe włosy oraz ładne detale urozmaicają zabawę. Wśród niespodzianek znajdziesz:  spódniczkę, buciki, grzebień, opaskę i zwierzątko! Kostium lalki jest dwustronny. Głowa kostiumu zamienia się w miejsce do spania dla zwierzątka. Funkcja zmiany koloru - użyj zimnej wody, by dokonać zmiany wyglądu Barbie i jej przyjaciela! Ciepła woda odwraca ten efekt. Można powtarzać w nieskończoność! Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i zdobienia mogą się różnić. Niespodzianki w tubie są losowe. Wiek dziecka:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-kotek-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka kotek z akcesoriami', '', '', '', ''),
(293, 1, 2, 'Barbie Cutie Reveal - oto Twoja ulubiona lalka w uroczym zwierzęcym przebraniu! Odkrywaj niespodzianki i baw się w najlepsze! Zabawa rozpoczyna się od rozpakowania. W środku znajdziesz lalkę, mięciutkie pluszowe zwierzątko oraz 10 niespodzianek. Lalka posiada punkty artykulacji dla jeszcze lepszej zabawy. Ubrana jest uroczy kostium. Kolorowe włosy oraz ładne detale urozmaicają zabawę. Wśród niespodzianek znajdziesz:  spódniczkę, buciki, grzebień, opaskę i zwierzątko! Kostium lalki jest dwustronny. Głowa kostiumu zamienia się w miejsce do spania dla zwierzątka. Funkcja zmiany koloru - użyj zimnej wody, by dokonać zmiany wyglądu Barbie i jej przyjaciela! Ciepła woda odwraca ten efekt. Można powtarzać w nieskończoność! Informacje dodatkowe:  Lalka nie stoi samodzielnie. Kolory i zdobienia mogą się różnić. Niespodzianki w tubie są losowe. Wiek dziecka:  od 3 lat.', '', 'barbie-cutie-reveal-lalka-kotek-z-akcesoriami', '', '', '', 'Barbie, Cutie Reveal, lalka kotek z akcesoriami', '', '', '', ''),
(294, 1, 1, 'Mały chłopiec Baby Born wciąż nie chce spać. Przecież na dworzu jest jeszcze tak widno. Mamusia i tatuś znają pewną sztuczkę:  wystarczy obrócić smoczek w buzi lali, żeby zamknęły się jej śliczne oczęta – i już jest ciemno. Gdy przekręcasz smoczek, oczka lalki zamykają się lub otwierają, bez względu na to w jakiej jest pozycji. Jego oczka są takie śpiące:  jeśli położysz ją na plecach bez smoczka, oczka zamkną się same. Niektóre czynności tak bardzo go bawią. Uwielbia spać, kocha jeść i oczywiście nie może doczekać się kąpieli. Chętnie pije wodę z butelki. Siusia w pieluchę albo do nocnika. Płacze prawdziwymi łzami. Nie tylko pije wodę. Baby Born potrafi jeść owsiankę. A potem to już tylko czas na kupkę. Ma ruchome rączki, nóżki i główkę. Łatwo jest go rozebrać, a potem ubrać w te wszystkie modne ciuszki. Ciało bobaska jest takie miękkie i przyjemne w dotyku.  Podstawowy zestaw zawiera 10 dodatków współgrających z funkcjami zabawki, do kompletu niebieskie body i czapeczka. Baby Born Magiczny chłopiec:  10 funkcji - niekończąca się zabawa. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Smoczek pasuje do wszystkich lalek Baby Born w rozmiarze 43 cm. Funkcja śpiących oczek sterowanych obrotem smoczka działa tylko w serii Baby Born Magic. Zabawka nie wymaga baterii. Zawartość:  1 nocnik, 1 pieluszka, 1 talerzyk z łyżką, 1 porcja owsianki, 1 butelka, 1 magiczny smoczek, 1 akt urodzenia, 1 bransoletka przyjaźni dla dziecka i dla lalki.', '', 'baby-born-magiczny-chlopiec-lalka-interaktywna-43-cm', '', '', '', 'Baby Born, Magiczny chłopiec, lalka interaktywna, 43 cm', '', '', '', ''),
(294, 1, 2, 'Mały chłopiec Baby Born wciąż nie chce spać. Przecież na dworzu jest jeszcze tak widno. Mamusia i tatuś znają pewną sztuczkę:  wystarczy obrócić smoczek w buzi lali, żeby zamknęły się jej śliczne oczęta – i już jest ciemno. Gdy przekręcasz smoczek, oczka lalki zamykają się lub otwierają, bez względu na to w jakiej jest pozycji. Jego oczka są takie śpiące:  jeśli położysz ją na plecach bez smoczka, oczka zamkną się same. Niektóre czynności tak bardzo go bawią. Uwielbia spać, kocha jeść i oczywiście nie może doczekać się kąpieli. Chętnie pije wodę z butelki. Siusia w pieluchę albo do nocnika. Płacze prawdziwymi łzami. Nie tylko pije wodę. Baby Born potrafi jeść owsiankę. A potem to już tylko czas na kupkę. Ma ruchome rączki, nóżki i główkę. Łatwo jest go rozebrać, a potem ubrać w te wszystkie modne ciuszki. Ciało bobaska jest takie miękkie i przyjemne w dotyku.  Podstawowy zestaw zawiera 10 dodatków współgrających z funkcjami zabawki, do kompletu niebieskie body i czapeczka. Baby Born Magiczny chłopiec:  10 funkcji - niekończąca się zabawa. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Smoczek pasuje do wszystkich lalek Baby Born w rozmiarze 43 cm. Funkcja śpiących oczek sterowanych obrotem smoczka działa tylko w serii Baby Born Magic. Zabawka nie wymaga baterii. Zawartość:  1 nocnik, 1 pieluszka, 1 talerzyk z łyżką, 1 porcja owsianki, 1 butelka, 1 magiczny smoczek, 1 akt urodzenia, 1 bransoletka przyjaźni dla dziecka i dla lalki.', '', 'baby-born-magiczny-chlopiec-lalka-interaktywna-43-cm', '', '', '', 'Baby Born, Magiczny chłopiec, lalka interaktywna, 43 cm', '', '', '', ''),
(295, 1, 1, 'Lalki, to najstarsze znane światu zabawki. Niewątpliwą ich zaletą jest to, że można bawić się nimi wszędzie – zarówno w podróży, w domu, czy wszędzie tam, gdzie dziecko postanowi zabrać swoją lalę. Lalka ubrana jest w piękną suknię ślubną z welonem. Wysokość lalki to 80 cm. Podczas zabawy można ją prowadzić za rączkę. Lalka należy do serii Lalek Chodzących przedstawiających wizerunki bohaterek, uroczo przebranych w charakterystyczne stroje:  Kopciuszka Roszpunki Królewny Śnieżki Księżniczki Śniegu Baleriny Suknię ślubną Zabawa lalkami nauczy dziecko troskliwości względem innych. Pomoże poznać miłe emocje, takie jak przyjaźń, szczęście, troska. Dzieci mogą przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lala, kształtując długotrwałe więzi. Specyfikacja:  Wiek:  3l+ Wysokość lalki 80 cm. Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3', '', 'smily-play-lalka-slubna', '', '', '', 'Smily Play, lalka ślubna', '', '', '', '');
