(295, 1, 2, 'Lalki, to najstarsze znane światu zabawki. Niewątpliwą ich zaletą jest to, że można bawić się nimi wszędzie – zarówno w podróży, w domu, czy wszędzie tam, gdzie dziecko postanowi zabrać swoją lalę. Lalka ubrana jest w piękną suknię ślubną z welonem. Wysokość lalki to 80 cm. Podczas zabawy można ją prowadzić za rączkę. Lalka należy do serii Lalek Chodzących przedstawiających wizerunki bohaterek, uroczo przebranych w charakterystyczne stroje:  Kopciuszka Roszpunki Królewny Śnieżki Księżniczki Śniegu Baleriny Suknię ślubną Zabawa lalkami nauczy dziecko troskliwości względem innych. Pomoże poznać miłe emocje, takie jak przyjaźń, szczęście, troska. Dzieci mogą przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lala, kształtując długotrwałe więzi. Specyfikacja:  Wiek:  3l+ Wysokość lalki 80 cm. Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3', '', 'smily-play-lalka-slubna', '', '', '', 'Smily Play, lalka ślubna', '', '', '', ''),
(296, 1, 1, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-niedzwiadek-polarny-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka niedźwiadek polarny, 1 szt.', '', '', '', ''),
(296, 1, 2, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-niedzwiadek-polarny-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka niedźwiadek polarny, 1 szt.', '', '', '', ''),
(297, 1, 1, 'Przedstawiamy L.O.L. Surprise! Tweens! Te charakterne Be Tweens są dostępne z niespodziankami i wyjątkowym opakowaniem. 4 nowe postaci do zebrania:  Chloe Pepper, Marilyn Star, Emma Emo i Nia Regal W opakowaniu 15 niespodzianek Opakowaniem można się bawić Pudełko z okienkiem', '', 'lol-surprise-tweens-marilyn-star-lalka-modowa', '', '', '', 'L.O.L. Surprise, Tweens, Marilyn Star, lalka modowa', '', '', '', ''),
(297, 1, 2, 'Przedstawiamy L.O.L. Surprise! Tweens! Te charakterne Be Tweens są dostępne z niespodziankami i wyjątkowym opakowaniem. 4 nowe postaci do zebrania:  Chloe Pepper, Marilyn Star, Emma Emo i Nia Regal W opakowaniu 15 niespodzianek Opakowaniem można się bawić Pudełko z okienkiem', '', 'lol-surprise-tweens-marilyn-star-lalka-modowa', '', '', '', 'L.O.L. Surprise, Tweens, Marilyn Star, lalka modowa', '', '', '', ''),
(298, 1, 1, 'Ten zestaw Barbie Dreamtopia inspiruje do baśniowej zabawy w opiekę i naukę toalety z lalką księżniczką Barbie, jednorożcem i magiczną funkcją zmiany koloru. Fantazyjna stajnia inspirowana chmurkami i tęczą to doskonałe miejsce do troszczenia się o ukochanego jednorożca. Napełnij butelkę wodą, umieść małego jednorożca na specjalnej macie i pomóż Barbie go napoić w ramach treningu czystości. W miarę jak jednorożec „siusia”, kolor maty zmieni się z białego na tęczowy. Poczekaj, aż mata wyschnie, a potem powtarzaj tę zabawę ze zmianą koloru, ile razy chcesz. Wśród dodatkowych elementów do zabawy są korytko, „przekąski”, szczotka do włosów dla Barbie, szczotka dla jednorożca i 10 akcesoriów do włosów, które poszerzają możliwości zabawy w stylizację. Dzięki funkcji magicznej zmiany koloru i tak wielu akcesoriom ten zestaw z lalką księżniczką Barbie i jednorożcem to idealny prezent dla dzieci w wieku od 3 do 7 lat. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-dreamtopia-ksiezniczka-i-jednorozec-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Barbie, Dreamtopia, Księżniczka i jednorożec, zestaw z lalką i akcesoriami', '', '', '', ''),
