(299, 1, 1, 'Zalety produktu:  nauka odpowiedzialności za drugą osobę, nauka samodzielności, rozwijanie wyobraźni dziecka, bobas posiada efekty dźwiękowe:  po naciśnięciu brzuszka lalka płacze, śmieje się, mówi Mama, Tata. Lalka Bobas od Mega Creative to bez wątpienia świetna propozycja zabawy dla Twojej pociechy. Oprócz radości wynikającej z możliwości zajmowania się swoją Lalką jak prawdziwym dzieckiem, to także dobry pomysł na naukę samodzielności oraz odpowiedzialności za drugą osobę. Zawartość zestawu:  lalka Bobas, stetoskop, okulary, chusteczki higieniczne, termometr, strzykawka, lampka czołówka, lusterko, skalpel. Całość wykonana z plastiku oraz materiału. Wymiary produktu dł. (cm):  lalka - 35 cm. Wymiary opakowania (cm):  31 x 36 x 11. Waga produktu bez opakowania (kg):  0,32 kg. Waga produktu w opakowaniu (kg):  0,51 kg. Wymaga zasilania bateriami 2 x LR44 - załączono do zestawu. Produkt przeznaczony dla dzieci w wieku:  3+.', '', 'mega-creative-lalka-bobas-z-akcesoriami', '', '', '', 'Mega Creative, lalka bobas z akcesoriami', '', '', '', ''),
