(300, 1, 1, 'Witamy w tym baśniowym pałacu Royal Enchantimals stworzonym z myślą o przeżywaniu magicznych chwil! W środku wysokiego budynku (66 cm) znajdziesz 5 królewskich pomieszczeń i 15 elementów do zabawy, aby niezwykłe opowieści mogły trwać w nieskończoność. W zestawie są lalka Felicity Fox i lisek Flick z królewskimi strojami i akcesoriami. Zasiądź na podwójnym tronie, zorganizuj podwieczorek w wystawnej jadalni lub wejdź po okazałych schodach do łazienki, kuchni i komnat królewskich, gdzie znajdziesz huśtawkę dla liska Flick i łóżeczko dla Felicity Fox! Daj się zachwycić baśniowym detalom, takim jak lisie uszka na dachu oraz małe drzwi i okienko w wieży - specjalnie dla liska Flick. Wiek dziecka:  od 4 lat.', '', 'enchantimals-krolewski-palac-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Królewski pałac, zestaw z lalką i akcesoriami', '', '', '', ''),
(300, 1, 2, 'Witamy w tym baśniowym pałacu Royal Enchantimals stworzonym z myślą o przeżywaniu magicznych chwil! W środku wysokiego budynku (66 cm) znajdziesz 5 królewskich pomieszczeń i 15 elementów do zabawy, aby niezwykłe opowieści mogły trwać w nieskończoność. W zestawie są lalka Felicity Fox i lisek Flick z królewskimi strojami i akcesoriami. Zasiądź na podwójnym tronie, zorganizuj podwieczorek w wystawnej jadalni lub wejdź po okazałych schodach do łazienki, kuchni i komnat królewskich, gdzie znajdziesz huśtawkę dla liska Flick i łóżeczko dla Felicity Fox! Daj się zachwycić baśniowym detalom, takim jak lisie uszka na dachu oraz małe drzwi i okienko w wieży - specjalnie dla liska Flick. Wiek dziecka:  od 4 lat.', '', 'enchantimals-krolewski-palac-zestaw-z-lalka-i-akcesoriami', '', '', '', 'Enchantimals, Królewski pałac, zestaw z lalką i akcesoriami', '', '', '', ''),
