(302, 1, 2, 'Zestaw zawiera:   wannę z korkiem  3 buteleczki  kaczkę do kąpieli  myjkę', '', 'dolls-world-zestaw-akcesoriow-bath-set', '', '', '', 'Dolls World, Zestaw akcesoriów, Bath Set', '', '', '', ''),
(303, 1, 1, '<b>Kraina Lodu Toaletka 2 w 1</b>  Toaletka z lustrem z wizerunkiem Elsy i stołeczkiem. W zestawie z  10 akcesoriami, w tym pojemniczki, grzebyk, opaski do włosów.   <b>ORYGINALNA, LICENCJONOWNA ZABAWKA</b>:  Toaletka wywoła radość  u każdej miłośniczki bohaterów Krainy Lodu i nie tylko. Zabawka na licencji popularnego filmu dla dzieci Kraina Lodu produkcji Disneya, daje możliwości odgrywania ekscytujących historii i przygód dotyczących Elsy, Anny i Olafa.   <b>TRWAŁOŚĆ I WIELOFUNKCUYJNOŚĆ</b>:  Dla małych królowych piękności - solidny stolik do makijażu z dużym, obrotowym lustrem spełni oczekiwania najbardziej wymagających księżniczek.   <b>RÓŻNORODNOŚĆ ZABAWY</b>:  Stolik do makijażu to wspaniały prezent dla każdej małej modelki. Uwiedzie wieloma akcesoriami i ładnym designem, jest bogato wyposażony, zawiera flakoniki perfum, naszyjnik dla dziewczynki, opaskę na włosy, stołek, grzebienie, bransoletkę i pierścionki, ponadto dzięki 3 szufladom można przechowywać swoje cenne drobiazgi.   K<b>OMPAKTOWA  I PRAKTYCZNA W USTAWIENIU</b>:  Toaletka dla dziewczynek Kraina Lodu od Smoby zajmuje niewiele miejsca - stanowi estetyczne wyposażenie każdego pokoju dziecięcego, można jej górną część odłączyć od nóżek i postawić na stole lub biurku. Pozwoli to na spędzanie czasu przed lustrem naśladując mamę. Dodatkowo regulowane lusterko to duży plus, ponieważ można je pochylić w zależności od potrzeb.  <b>WYPRODUKOWANA WE FRANCJI</b>:  Jakość Smoby od 1924 roku:  Zapewniamy bezpieczne zabawki poprzez stałą kontrolę jakości, wieloletnie doświadczenie, stosowanie wysokiej jakości materiałów oraz najnowocześniejsze zaplecze produkcyjne. Dodatkowe informacje:  Nr katalogowy:  7600320244  Marka:  Frozen Rodzaj:  Toaletki Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Nie Baterie w zestawie:  Nie Zasilanie:  Nie dotyczy Kolor:  Biały Kolor:  Błękitny Kolor:  Niebieski Wymiary:  49 x 36 x 87 cm  Akcesoria w zestawie:   Pozostałe parametry:  Wymiary opakowania:  49 x 19,2 x 64 cm', '', 'smoby-kraina-lodu-toaletka-2w1', '', '', '', 'Smoby, Kraina Lodu, toaletka, 2w1', '', '', '', ''),
