(308, 1, 1, '<b>Steffi Love Steffi tańcząca baletnica</b>  Steffi baletnica z kręcącą się spódnicą. W zestawie króliczek.  LALKA Z TRADYCJĄ:  Steffi Love ma ponad 30-letnią historię i oferuje pierwszorzędną estetykę wykonania. Ubrana w strój baleriny. Ma obracaną spódnicę i zachwycający top ozdobiony brokatowymi akcentami.   DLA PASJONATKI TAŃCA:  lalka baletnica, tiulowa spódniczka obraca się po naciśnięciu na guzik w kształcie roży na brzuchu lalki, w zestawie jest też króliczek ze spódniczką, który urozmaici zabawę w balet.  RUCHOME ELEMENTY:  lalka na zginane w łokciach i nadgarstkach ręce, dzięki czemu można ją układać w fantazyjnie, taneczne pozycje.   RÓŻNORODNOŚĆ ZESTAWÓW TEMATYCZNYCH:  w asortymencie Steffi LOVE znajdziesz zestawy, które pozwolą wcielić się w codzienne role:  zakupy, taniec, księżniczki, syreny, konie, zestawy lekarskie, wycieczki.   ROZWIJAJĄ UMIEJĘTNOŚCI SPOŁECZNE:  dziewczynki mają nieograniczone możliwości zanurzania się w nowych rolach i odgrywania ich, dzięki czemu rozwijają umiejętności społeczne oraz wzbogacają zabawę.   WIELKOŚĆ I PRZEZNACZENIE:  lalka Steffi ma wysokość 29 cm, królik ok 7 cm, zabawka przeznaczona dla dzieci powyżej 3 roku życia.   Dodatkowe informacje:  Nr katalogowy:  105733603  Marka:  Steffi Love Seria:  Pozostałe Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Nie Baterie w zestawie:  Nie Zasilanie:  Nie dotyczy Wysokość:  29 cm Akcesoria w zestawie:   Pozostałe parametry:  Wymiary opakowania:  5,5 x 14 x 33 cm', '', 'steffi-love-lalka-tanczaca-baletnica', '', '', '', 'Steffi Love, lalka tańcząca baletnica', '', '', '', ''),
