(309, 1, 1, 'Przygody z czarodziejskiego świata czekają na Ciebie razem z zestawem małych laleczek Harry\'ego Pottera i Cho Chang Magical Minis. Ten zestaw zabawek ze świata Harry\'ego Pottera zawiera dwie 3-calowe lalki bohaterów oraz sowę Hedwigę i niezbędnik do wysyłania listów. Wszystkie są ruchome i posiadają szczegółowe detale, które ożywiają ukochane postaci. Posiadają strój z Hogwartu i trzymają różdżki. Możesz ruszać ich rękoma i udawać, że rzucają zaklęcia. Dzięki kopercie możesz pomóc Hedwidze dostarczyć list! Zestaw Przyjaźni Magical Minis to doskonały sposób, aby pobudzić wyobraźnię i chęć do zabawy. Przemierzaj sale zamku Hogwart (sprzedawanego osobno) z Harry\'m i Cho. Zbierz wszystkie zestawy, lalki i lokacje (sprzedawane osobno), aby stworzyć własny czarodziejski świat. Przedmioty kolekcjonerskie Magical Minis ze świata Harry\'ego Pottera i Zestawy Przyjaźni to wspaniałe podarunku dla dzieci od 5. roku życia. Twórz własne, magiczne historie, dzięki zestawowi Małych Lalek z Harrym Potterem i Cho Chang.', '', 'wizarding-world-harry-potter-harry-i-cho-zestaw-dwoch-lalek-3', '', '', '', 'Wizarding World, Harry Potter, Harry i Cho, zestaw dwóch lalek 3\"', '', '', '', ''),
(309, 1, 2, 'Przygody z czarodziejskiego świata czekają na Ciebie razem z zestawem małych laleczek Harry\'ego Pottera i Cho Chang Magical Minis. Ten zestaw zabawek ze świata Harry\'ego Pottera zawiera dwie 3-calowe lalki bohaterów oraz sowę Hedwigę i niezbędnik do wysyłania listów. Wszystkie są ruchome i posiadają szczegółowe detale, które ożywiają ukochane postaci. Posiadają strój z Hogwartu i trzymają różdżki. Możesz ruszać ich rękoma i udawać, że rzucają zaklęcia. Dzięki kopercie możesz pomóc Hedwidze dostarczyć list! Zestaw Przyjaźni Magical Minis to doskonały sposób, aby pobudzić wyobraźnię i chęć do zabawy. Przemierzaj sale zamku Hogwart (sprzedawanego osobno) z Harry\'m i Cho. Zbierz wszystkie zestawy, lalki i lokacje (sprzedawane osobno), aby stworzyć własny czarodziejski świat. Przedmioty kolekcjonerskie Magical Minis ze świata Harry\'ego Pottera i Zestawy Przyjaźni to wspaniałe podarunku dla dzieci od 5. roku życia. Twórz własne, magiczne historie, dzięki zestawowi Małych Lalek z Harrym Potterem i Cho Chang.', '', 'wizarding-world-harry-potter-harry-i-cho-zestaw-dwoch-lalek-3', '', '', '', 'Wizarding World, Harry Potter, Harry i Cho, zestaw dwóch lalek 3\"', '', '', '', ''),
(310, 1, 1, 'Lalki, to najstarsze znane światu zabawki. Niewątpliwą ich zaletą jest to, że można bawić się nimi wszędzie – zarówno w podróży, w domu, czy wszędzie tam, gdzie dziecko postanowi zabrać swoją lalę. Lalka wyglądem przypomina bohaterkę ponadczasowej bajki o Królewnie Śnieżce. Dzieci mogą przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lala, kształtując długotrwałe więzi. Wiek:  3l+ Wysokość lalki 80 cm. Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3', '', 'smily-play-bambolina-ksiezniczka-sniegu-lalka-80-cm', '', '', '', 'Smily Play, Bambolina Księżniczka Śniegu, lalka, 80 cm', '', '', '', ''),
(310, 1, 2, 'Lalki, to najstarsze znane światu zabawki. Niewątpliwą ich zaletą jest to, że można bawić się nimi wszędzie – zarówno w podróży, w domu, czy wszędzie tam, gdzie dziecko postanowi zabrać swoją lalę. Lalka wyglądem przypomina bohaterkę ponadczasowej bajki o Królewnie Śnieżce. Dzieci mogą przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lala, kształtując długotrwałe więzi. Wiek:  3l+ Wysokość lalki 80 cm. Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3', '', 'smily-play-bambolina-ksiezniczka-sniegu-lalka-80-cm', '', '', '', 'Smily Play, Bambolina Księżniczka Śniegu, lalka, 80 cm', '', '', '', ''),
(311, 1, 1, 'Przedstawiamy Rainbow High CORE Fashion Doll! Tęcza to nieograniczone możliwości kolorystyczne! Wśród nowych uczniów jest 5 fantastycznych dziewczyn i 1 łamacz serc. Wszystkie lalki mają unikalny styl, który widać w dwóch różnych<br />strojach i wielu modnych akcesoriach! A kiedy ustawi się je razem, tworzą oszałamiającą tęczę. Zbierz je wszystkie, żeby zobaczyć te niesamowite kolory tęczy! Cechy produktów:  6 nowych lalek w odcieniach tęczy Lalki zginają się w przegubach Długie włosy do czesania plus akcesoria do włosów i grzebień Dodatkowa odzież dla lalek (2 komplety) + wieszaki Akcesoria modowe (kolczyki, torebka, buty…) Stojak na lalkę Dostępne w 6 nowych kolorach Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-core-fashion-doll-jewel-richie-lalka-modowa', '', '', '', 'Rainbow High, Core Fashion Doll, Jewel Richie, lalka modowa', '', '', '', ''),
