(312, 1, 1, 'Nowoczesne nosidełko jest idealne dla pluszowych zabawek lub lalek do 46 cm.  Lalkę można nosić zarówno z przodu, jak i z tyłu.  Dzięki miękkim, szerokim pasom naramiennym oraz szerokiemu pasowi biodrowemu, który można indywidualnie regulować, ukochanego maluszka można nosić długo i wygodnie.  Zintegrowane siedzisko po wewnętrznej stronie nosidełka zapewnia dodatkowe podparcie dla lalki.  Wymiary zabawki:  31 x 1 x 32,5 cm.  Wiek:  3+.', '', 'bayer-design-nosidelko-dla-lalki-jednorozec', '', '', '', 'Bayer Design, nosidełko dla lalki, Jednorożec', '', '', '', ''),
(312, 1, 2, 'Nowoczesne nosidełko jest idealne dla pluszowych zabawek lub lalek do 46 cm.  Lalkę można nosić zarówno z przodu, jak i z tyłu.  Dzięki miękkim, szerokim pasom naramiennym oraz szerokiemu pasowi biodrowemu, który można indywidualnie regulować, ukochanego maluszka można nosić długo i wygodnie.  Zintegrowane siedzisko po wewnętrznej stronie nosidełka zapewnia dodatkowe podparcie dla lalki.  Wymiary zabawki:  31 x 1 x 32,5 cm.  Wiek:  3+.', '', 'bayer-design-nosidelko-dla-lalki-jednorozec', '', '', '', 'Bayer Design, nosidełko dla lalki, Jednorożec', '', '', '', ''),
(313, 1, 1, 'Tańcząca wróżka, która posiada światełka i muzykę.  Włącz na niej przełącznik, a lalka zaświeci się i zagra muzykę.  Jej spódnica obraca się w tym samym czasie.  Lalka posiada długie, lśniące włosy, które można czesać, a na jej buzi widnieje piękny makijaż.  Na plecach ma duże, białe skrzydła.  Zabawka wymaga baterii 3xAA 1,5V (brak w zestawie). Wymiary opakowania:  14,5x15,5x14,5 cm. Wiek:  3+.', '', 'norimpex-tanczaca-wrozka-swiatlo-i-dzwiek', '', '', '', 'Norimpex, tańcząca wróżka, światło i dźwięk', '', '', '', ''),
(313, 1, 2, 'Tańcząca wróżka, która posiada światełka i muzykę.  Włącz na niej przełącznik, a lalka zaświeci się i zagra muzykę.  Jej spódnica obraca się w tym samym czasie.  Lalka posiada długie, lśniące włosy, które można czesać, a na jej buzi widnieje piękny makijaż.  Na plecach ma duże, białe skrzydła.  Zabawka wymaga baterii 3xAA 1,5V (brak w zestawie). Wymiary opakowania:  14,5x15,5x14,5 cm. Wiek:  3+.', '', 'norimpex-tanczaca-wrozka-swiatlo-i-dzwiek', '', '', '', 'Norimpex, tańcząca wróżka, światło i dźwięk', '', '', '', ''),
(314, 1, 1, 'Witamy w Domku jelonków Enchantimals! Odtwarzaj chwile pełne przyjaźni w stylu Enchantimals z lalką Danessa Deer i jelonkiem Sprint w ich przytulnym domku.  Domek ma 53 cm wysokości, 4 obszary zabawy i ponad 15 akcesoriów, dzięki czemu zabawa w snucie słodkich opowieści może trwać bez końca. Lalka Danessa Deer i jelonek Sprint uwielbiają spędzać razem czas w swoim domku. Posmakuj przekąsek w kuchni na świeżym powietrzu, odpręż się na kanapie w salonie, przygotuj się w łazience na dzień pełen wrażeń i ułóż się do snu w sypialni na piętrze. Zaproś innych przyjaciół Enchantimals, by zabawa była jeszcze lepsza (inne lalki sprzedawane osobno). Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 4 lat.', '', 'enchantimals-maly-domek-jelonkow-zestaw-do-zabawy', '', '', '', 'Enchantimals, Mały domek jelonków, zestaw do zabawy', '', '', '', ''),
