(315, 1, 1, 'Interaktywna lalka z serii Natalia. Bobas zachowuje się jak prawdziwe niemowlę:  porusza ustami płacze śpiewa gaworzy wypowiada słowa:  „Mama” i „Dziadzia” W zestawie znajduje się smoczek. Wysokość lalki:  41 cm.', '', 'natalia-bobas-interaktywny-41-cm', '', '', '', 'Natalia, bobas interaktywny, 41 cm', '', '', '', ''),
(315, 1, 2, 'Interaktywna lalka z serii Natalia. Bobas zachowuje się jak prawdziwe niemowlę:  porusza ustami płacze śpiewa gaworzy wypowiada słowa:  „Mama” i „Dziadzia” W zestawie znajduje się smoczek. Wysokość lalki:  41 cm.', '', 'natalia-bobas-interaktywny-41-cm', '', '', '', 'Natalia, bobas interaktywny, 41 cm', '', '', '', ''),
(316, 1, 1, 'Lalka Steffi z niemowlakiem, wózkiem, kołyską, wagą wanienką i wieloma akcesoriami, w sumie 18 elementów. Zawartość zestawu:  <!--endif-->jasnowłosa lalka Steffi ubrana w śliczną bluzkę w serca i niebieską spódniczkę; bobas w różowy stroju; łóżeczko z baldachimem; wózek z koszem na drobiazgi; <!--endif-->waga; wanienka; drobne akcesoria: talerzyk ze sztućcami, zabawki, butelka, smoczek.  Wysokość lalki:  29 cm. Wiek:  od 3 lat.', '', 'steffi-mama-z-niemowlakiem-lalka', '', '', '', 'Steffi mama z niemowlakiem, lalka', '', '', '', ''),
(316, 1, 2, 'Lalka Steffi z niemowlakiem, wózkiem, kołyską, wagą wanienką i wieloma akcesoriami, w sumie 18 elementów. Zawartość zestawu:  <!--endif-->jasnowłosa lalka Steffi ubrana w śliczną bluzkę w serca i niebieską spódniczkę; bobas w różowy stroju; łóżeczko z baldachimem; wózek z koszem na drobiazgi; <!--endif-->waga; wanienka; drobne akcesoria: talerzyk ze sztućcami, zabawki, butelka, smoczek.  Wysokość lalki:  29 cm. Wiek:  od 3 lat.', '', 'steffi-mama-z-niemowlakiem-lalka', '', '', '', 'Steffi mama z niemowlakiem, lalka', '', '', '', ''),
(317, 1, 1, 'Evi w roli farmerki, która przemieszcza się na traktorze z przyczepką, laleczka przewodzi baranka oraz belki siana, dołączone widły i łopata, laleczka ubrana w strój tematyczny i kalosze. Wysokość lalki:  12 cm Wiek:  3l+', '', 'simba-evi-lalka-farmerka-z-traktorem', '', '', '', 'Simba, Evi, lalka farmerka z traktorem', '', '', '', ''),
(317, 1, 2, 'Evi w roli farmerki, która przemieszcza się na traktorze z przyczepką, laleczka przewodzi baranka oraz belki siana, dołączone widły i łopata, laleczka ubrana w strój tematyczny i kalosze. Wysokość lalki:  12 cm Wiek:  3l+', '', 'simba-evi-lalka-farmerka-z-traktorem', '', '', '', 'Simba, Evi, lalka farmerka z traktorem', '', '', '', ''),
(318, 1, 1, 'Lalka Laura to idealna pierwsza lalka Twojej pociechy. Miękki brzuszek laleczki idealnie nadaje się do przytulania. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ubrana jest w body i opaskę. Lalka zamyka oczy i kładzie się do snu. Lalkę można przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lata, kształtując długotrwałe więzi. Informacje podstawowe:  Wymiary:  ok. 34 cm Wiek:  od 2 lat Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-laura-lalka-34-cm', '', '', '', 'Smiki, Laura, lalka, 34 cm', '', '', '', ''),
(318, 1, 2, 'Lalka Laura to idealna pierwsza lalka Twojej pociechy. Miękki brzuszek laleczki idealnie nadaje się do przytulania. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ubrana jest w body i opaskę. Lalka zamyka oczy i kładzie się do snu. Lalkę można przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lata, kształtując długotrwałe więzi. Informacje podstawowe:  Wymiary:  ok. 34 cm Wiek:  od 2 lat Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-laura-lalka-34-cm', '', '', '', 'Smiki, Laura, lalka, 34 cm', '', '', '', ''),
(319, 1, 1, 'Przedstawiamy Rainbow High CORE Fashion Doll! Tęcza to nieograniczone możliwości kolorystyczne! Wśród nowych uczniów jest 5 fantastycznych dziewczyn i 1 łamacz serc. Wszystkie lalki mają unikalny styl, który widać w dwóch różnych<br />strojach i wielu modnych akcesoriach! A kiedy ustawi się je razem, tworzą oszałamiającą tęczę. Zbierz je wszystkie, żeby zobaczyć te niesamowite kolory tęczy! Cechy produktów:  6 nowych lalek w odcieniach tęczy Lalki zginają się w przegubach Długie włosy do czesania plus akcesoria do włosów i grzebień Dodatkowa odzież dla lalek (2 komplety) + wieszaki Akcesoria modowe (kolczyki, torebka, buty…) Stojak na lalkę Dostępne w 6 nowych kolorach Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-core-fashion-doll-lila-tamamoto-lalka-modowa', '', '', '', 'Rainbow High, Core Fashion Doll, Lila Tamamoto, lalka modowa', '', '', '', ''),
(319, 1, 2, 'Przedstawiamy Rainbow High CORE Fashion Doll! Tęcza to nieograniczone możliwości kolorystyczne! Wśród nowych uczniów jest 5 fantastycznych dziewczyn i 1 łamacz serc. Wszystkie lalki mają unikalny styl, który widać w dwóch różnych<br />strojach i wielu modnych akcesoriach! A kiedy ustawi się je razem, tworzą oszałamiającą tęczę. Zbierz je wszystkie, żeby zobaczyć te niesamowite kolory tęczy! Cechy produktów:  6 nowych lalek w odcieniach tęczy Lalki zginają się w przegubach Długie włosy do czesania plus akcesoria do włosów i grzebień Dodatkowa odzież dla lalek (2 komplety) + wieszaki Akcesoria modowe (kolczyki, torebka, buty…) Stojak na lalkę Dostępne w 6 nowych kolorach Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-core-fashion-doll-lila-tamamoto-lalka-modowa', '', '', '', 'Rainbow High, Core Fashion Doll, Lila Tamamoto, lalka modowa', '', '', '', ''),
(320, 1, 1, 'Rainbow High, Rainbow Vision, Minnie Choi, lalka modowa Epicka bitwa muzyczna - Najlepsze Szkoły Artystyczne z całego świata zmierzą się w konkursie muzycznym - Rainbow Vision. Zawodnicy z całego świata zabłysną swoimi prawdziwymi kolorami w epickiej bitwie, aby wyłonić JEDNEGO ZWYCIĘZCĘ! Jeden zwycięzca - Shadow High chce powstrzymać Rainbow High przed kolejną wygraną. Nie są to jednak jedyne szkoły biorące udział w konkursie. Do walki staje również znany na całym świecie K-popowy zespół, Royal Three, który przyjechał tu, aby wygrać! Minnie Choi ma unikalny design i jest ubrana od stóp do głów w różowe odcienie lawendy. Ma wspaniałe, szczegółowe rysy w swojej modzie, piękne długie falujące różowe lawendowe włosy z 2 uroczymi małymi warkoczami odciągającymi włosy z twarzy, długie prawdziwe rzęsy i szklane oczy. Zbierz tęczę wszystkich lalek Rainbow Vision- Royal Three K-pop. 2 stroje Mix &amp; Match:  Minnie Choi przychodzi ubrana we wspaniały k-popowy strój sceniczny. Jej kurtka ze sztucznego zamszu jest obszyta ponad 200 perłowymi koralikami, haftowanymi filigranowymi i metalicznym srebrem, opalizującymi nićmi lureksowymi, frędzlami na przednim brzegu oraz zawieszką z koralików i metalicznego srebra. Pod żakietem ma na sobie taftowy top bez ramiączek obszyty perłami. Śliczna czarna spódniczka. I miękkie, wysokie do kolan kozaki z metalicznymi srebrnymi detalami. I ma urocze pierścionki na palcach. Jest również wyposażona w drugi komplet w kolorze różowej lawendy i pokryty perłowymi koralikami do mieszania i dopasowywania. Strój zawiera bluzkę z długim rękawem, spódnicę, skarpetki, rękawiczki, szpilki z paskami. Mikrofon - Posiada ona wszystkie niezbędne dla zespołu akcesoria oraz merch zespołu. Ma swój własny mikrofon, dzięki czemu może występować i śpiewać bez statyw Band Merch - W zestawie znajduje się oficjalny merch zespołu, w tym t-shirt, książeczka z tekstami piosenek i mini plakat zespołu. Zestaw zapewni dzieciom niekończącą się radość i pomysłową zabawę oraz będą mogły same walczyć na Rainbow Vision', '', 'rainbow-high-rainbow-vision-minnie-choi-lalka-modowa', '', '', '', 'Rainbow High, Rainbow Vision, Minnie Choi, lalka modowa', '', '', '', ''),
