ową zabawę oraz będą mogły same walczyć na Rainbow Vision', '', 'rainbow-high-rainbow-vision-minnie-choi-lalka-modowa', '', '', '', 'Rainbow High, Rainbow Vision, Minnie Choi, lalka modowa', '', '', '', ''),
(321, 1, 1, 'Zalety produktu:  rozwijanie wyobraźni dziecka. Każda dziewczynka lubi bawić się lalkami. Lalka Syrenka od Mega Creative to fantastyczna zabawka, którą pokocha każda dziewczynka. Zabawka wykonana z plastiku, gumy i materiału, ogon Syrenki występuje w trzech wersjach kolorystycznych:  złoto różowy, niebiesko różowy, fioletowo biały. lalka w komplecie ma dodatkowe 2 warkoczyki, którymi można przyozdobić jej piękne długie blond lub brązowe włosy.. Zawartość zestawu:  lalka Syrenka 30 cm, 2 x warkocz ze spinką do włosów. Wymiary produktu (cm) 8 x 30 x 4. Waga produktu bez opakowania (kg):  0,11 kg. Wymiary opakowania (cm):  14 x 33 x 5. Waga produktu kg. 0,16 kg. Produkt przeznaczony dla dzieci w wieku:  3+.', '', 'mega-creative-syrenka-lalka-30-cm', '', '', '', 'Mega Creative, Syrenka, lalka, 30 cm', '', '', '', ''),
(321, 1, 2, 'Zalety produktu:  rozwijanie wyobraźni dziecka. Każda dziewczynka lubi bawić się lalkami. Lalka Syrenka od Mega Creative to fantastyczna zabawka, którą pokocha każda dziewczynka. Zabawka wykonana z plastiku, gumy i materiału, ogon Syrenki występuje w trzech wersjach kolorystycznych:  złoto różowy, niebiesko różowy, fioletowo biały. lalka w komplecie ma dodatkowe 2 warkoczyki, którymi można przyozdobić jej piękne długie blond lub brązowe włosy.. Zawartość zestawu:  lalka Syrenka 30 cm, 2 x warkocz ze spinką do włosów. Wymiary produktu (cm) 8 x 30 x 4. Waga produktu bez opakowania (kg):  0,11 kg. Wymiary opakowania (cm):  14 x 33 x 5. Waga produktu kg. 0,16 kg. Produkt przeznaczony dla dzieci w wieku:  3+.', '', 'mega-creative-syrenka-lalka-30-cm', '', '', '', 'Mega Creative, Syrenka, lalka, 30 cm', '', '', '', ''),
(322, 1, 1, 'Ruszaj w drogę pełną przygód z lalką Barbie i jej fioletowym kabrioletem! Posadź lalkę Barbie na siedzeniu, zapnij pasy i popchnij pojazd z obracającymi się kółkami oraz realistycznymi detalami, takimi jak srebrzyste akcenty oraz matowe czarne okratowanie i koła. Modny sportowy kabriolet ma dwa siedzenia, spersonalizowaną tablicę rejestracyjną i ozdobę na maskę z logo Barbie! Lalka Barbie jest gotowa na każdą przygodę ubrana w sukienkę w liście palmowe i stylowe białe sandałki. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Ten zestaw z lalką Barbie i pojazdem to doskonały prezent dla dzieci w wieku od 3 do 7 lat. Zbierz też inne lalki i zestawy Barbie, aby odkryć nieskończone możliwości oraz poszerzyć świat zabawy. Sprzedawane oddzielnie w zależności od dostępności.', '', 'barbie-kabriolet-zestaw-do-zabawy-z-lalka-i-samochodem', '', '', '', 'Barbie, Kabriolet, zestaw do zabawy z lalką i samochodem', '', '', '', ''),
(322, 1, 2, 'Ruszaj w drogę pełną przygód z lalką Barbie i jej fioletowym kabrioletem! Posadź lalkę Barbie na siedzeniu, zapnij pasy i popchnij pojazd z obracającymi się kółkami oraz realistycznymi detalami, takimi jak srebrzyste akcenty oraz matowe czarne okratowanie i koła. Modny sportowy kabriolet ma dwa siedzenia, spersonalizowaną tablicę rejestracyjną i ozdobę na maskę z logo Barbie! Lalka Barbie jest gotowa na każdą przygodę ubrana w sukienkę w liście palmowe i stylowe białe sandałki. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Ten zestaw z lalką Barbie i pojazdem to doskonały prezent dla dzieci w wieku od 3 do 7 lat. Zbierz też inne lalki i zestawy Barbie, aby odkryć nieskończone możliwości oraz poszerzyć świat zabawy. Sprzedawane oddzielnie w zależności od dostępności.', '', 'barbie-kabriolet-zestaw-do-zabawy-z-lalka-i-samochodem', '', '', '', 'Barbie, Kabriolet, zestaw do zabawy z lalką i samochodem', '', '', '', ''),
(323, 1, 1, 'Ubranko dla lalki Natalia. W zestawie:  spodenki, sukienka, sweterek. Pasuje na lalkę do 40 cm.', '', 'artyk-natalia-ubranko-dla-lalki', '', '', '', 'Artyk, Natalia, ubranko dla lalki', '', '', '', ''),
(323, 1, 2, 'Ubranko dla lalki Natalia. W zestawie:  spodenki, sukienka, sweterek. Pasuje na lalkę do 40 cm.', '', 'artyk-natalia-ubranko-dla-lalki', '', '', '', 'Artyk, Natalia, ubranko dla lalki', '', '', '', ''),
(324, 1, 1, 'Smile Play, Julka, sensoryczna lalka z akcesoriami do karmienia w pudełku prezentowym odgrywanie ról Lalka Julka lubi, kiedy się nią opiekujesz i karmisz. Lalka jest ubrana w różowy pajacyk, ma finezyjny talerz z podziałką, sztućce i butelkę. Lalka po naciśnięciu na brzuszek:  Mówi po polsku pełnymi zdaniami Śpiewa piosenkę Opowiada bajkę o Złotowłosej i 3 misiach Zabawa w karmienie, to znakomita okazja do nauki zasad zdrowego odżywiania, a używanie akcesoriów rozwija małą motorykę oraz usprawnia precyzję ruchów. Podczas zabawy zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Podczas zabawy lalką dziecko rozwija w sobie opiekuńczość i wrażliwość. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 35 cm Skład zestawu:  Miękka lalka Butelka Widelec Łyżka Talerzyk Specyfikacja:  Wiek:  36m+ Wymiary produktu:  szer. 28 cm., wys. 14,5 cm., gł. 24 cm. Baterie:  3 x AG13 dołączone Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-sensoryczna-lalka-z-akcesoriami-do-karmienia-35-cm', '', '', '', 'Smily Play, sensoryczna lalka z akcesoriami do karmienia, 35 cm', '', '', '', ''),
(324, 1, 2, 'Smile Play, Julka, sensoryczna lalka z akcesoriami do karmienia w pudełku prezentowym odgrywanie ról Lalka Julka lubi, kiedy się nią opiekujesz i karmisz. Lalka jest ubrana w różowy pajacyk, ma finezyjny talerz z podziałką, sztućce i butelkę. Lalka po naciśnięciu na brzuszek:  Mówi po polsku pełnymi zdaniami Śpiewa piosenkę Opowiada bajkę o Złotowłosej i 3 misiach Zabawa w karmienie, to znakomita okazja do nauki zasad zdrowego odżywiania, a używanie akcesoriów rozwija małą motorykę oraz usprawnia precyzję ruchów. Podczas zabawy zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Podczas zabawy lalką dziecko rozwija w sobie opiekuńczość i wrażliwość. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 35 cm Skład zestawu:  Miękka lalka Butelka Widelec Łyżka Talerzyk Specyfikacja:  Wiek:  36m+ Wymiary produktu:  szer. 28 cm., wys. 14,5 cm., gł. 24 cm. Baterie:  3 x AG13 dołączone Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-sensoryczna-lalka-z-akcesoriami-do-karmienia-35-cm', '', '', '', 'Smily Play, sensoryczna lalka z akcesoriami do karmienia, 35 cm', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(325, 1, 1, 'Lalka Julia to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Interaktywną lalę marki Smiki można przebierać, karmić i przytulać. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ma 3 akcesoria:  butelkę, poduszkę i 2 grzechotki. Lalka ubrana jest w różowe body i czapkę (czapka połączona z body). Lalka płacze gdy jest głodna. Po położeniu lalka zamyka oczy i kładzie się do snu. Informacje podstawowe:  Wymiary:  ok. 30 cm. Wiek:  od 2 lat. Lalka działa na baterie. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-julia-lalka-interaktywna-z-akcesoriami-30-cm', '', '', '', 'Smiki, Julia, lalka interaktywna z akcesoriami, 30 cm', '', '', '', ''),
(325, 1, 2, 'Lalka Julia to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Interaktywną lalę marki Smiki można przebierać, karmić i przytulać. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ma 3 akcesoria:  butelkę, poduszkę i 2 grzechotki. Lalka ubrana jest w różowe body i czapkę (czapka połączona z body). Lalka płacze gdy jest głodna. Po położeniu lalka zamyka oczy i kładzie się do snu. Informacje podstawowe:  Wymiary:  ok. 30 cm. Wiek:  od 2 lat. Lalka działa na baterie. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-julia-lalka-interaktywna-z-akcesoriami-30-cm', '', '', '', 'Smiki, Julia, lalka interaktywna z akcesoriami, 30 cm', '', '', '', ''),
(326, 1, 1, 'Laleczka Evi księżniczka w lodowej karecie to zdumiewająca postać w zestawie z powozem i koniem. Laleczka ubrana w subtelną, błękitną suknię, która zachwyci wszystkich na lalkowym balu. Przy jej boku jest również wierny rumak, który ma piękną grzywę w dopasowanym do sukni kolorze, ze spinkami. Wysokość lalki wynosi:  12 cm. Wymiary opakowania:  28x16x9 cm. Wiek:  3+.', '', 'evi-love-ksiezniczka-w-lodowej-karecie-lalka', '', '', '', 'Evi Love, księżniczka w lodowej karecie, lalka', '', '', '', ''),
(326, 1, 2, 'Laleczka Evi księżniczka w lodowej karecie to zdumiewająca postać w zestawie z powozem i koniem. Laleczka ubrana w subtelną, błękitną suknię, która zachwyci wszystkich na lalkowym balu. Przy jej boku jest również wierny rumak, który ma piękną grzywę w dopasowanym do sukni kolorze, ze spinkami. Wysokość lalki wynosi:  12 cm. Wymiary opakowania:  28x16x9 cm. Wiek:  3+.', '', 'evi-love-ksiezniczka-w-lodowej-karecie-lalka', '', '', '', 'Evi Love, księżniczka w lodowej karecie, lalka', '', '', '', ''),
(327, 1, 1, 'Lalka syrenka z kolekcji Barbie Dreamtopia  niezwykły wygląd i migoczące światełka zanurz syrenkę w wodzie i zachwyć się podświetlanym ogonem naciśnij gorset lalki, aby zobaczyć światełka również bez zanurzania w wodzie lalka ma tęczową płetwę, gorset z perełkami, różowe pasemka we włosach i tiarę księżniczki baterie AG13 w zestawie Wiek:  od 3 lat', '', 'barbie-dreamtopia-syrenka-ze-swiatelkami-lalka', '', '', '', 'Barbie, Dreamtopia, syrenka ze światełkami, lalka', '', '', '', ''),
(327, 1, 2, 'Lalka syrenka z kolekcji Barbie Dreamtopia  niezwykły wygląd i migoczące światełka zanurz syrenkę w wodzie i zachwyć się podświetlanym ogonem naciśnij gorset lalki, aby zobaczyć światełka również bez zanurzania w wodzie lalka ma tęczową płetwę, gorset z perełkami, różowe pasemka we włosach i tiarę księżniczki baterie AG13 w zestawie Wiek:  od 3 lat', '', 'barbie-dreamtopia-syrenka-ze-swiatelkami-lalka', '', '', '', 'Barbie, Dreamtopia, syrenka ze światełkami, lalka', '', '', '', ''),
(328, 1, 1, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  body/śpiochy, śliniaczek, wieszak. Wymiary produktu dł. x wys. cm:  22 x 21. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,03 kg. Waga produktu w opakowaniu (kg):  0,10 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-spiochy-ubranko-dla-lalek', '', '', '', 'Mega Creative, Śpiochy, ubranko dla lalek', '', '', '', ''),
(328, 1, 2, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  body/śpiochy, śliniaczek, wieszak. Wymiary produktu dł. x wys. cm:  22 x 21. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,03 kg. Waga produktu w opakowaniu (kg):  0,10 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-spiochy-ubranko-dla-lalek', '', '', '', 'Mega Creative, Śpiochy, ubranko dla lalek', '', '', '', ''),
(329, 1, 1, 'Evi w sukience, z figurką kotka i butelką do karmienia. Miks wzorów, towar wysyłany losowo. Laleczka występuje w dwóch wersjach kolorystycznych:  żółto-różowa sukienka z kotkiem i seledynowo-fioletowa sukienka z kotkiem. Wysokość:  12 cm', '', 'simba-evi-z-kotkami-lalka', '', '', '', 'Simba, Evi z kotkami, lalka', '', '', '', ''),
(329, 1, 2, 'Evi w sukience, z figurką kotka i butelką do karmienia. Miks wzorów, towar wysyłany losowo. Laleczka występuje w dwóch wersjach kolorystycznych:  żółto-różowa sukienka z kotkiem i seledynowo-fioletowa sukienka z kotkiem. Wysokość:  12 cm', '', 'simba-evi-z-kotkami-lalka', '', '', '', 'Simba, Evi z kotkami, lalka', '', '', '', ''),
(330, 1, 1, 'Lalka Mega Creative to niezbędna zabawka w kolekcji każdej młodej damy. Występuje w trzech różnych sukienkach. Bez wątpienia czas spędzony z nią będzie czystą przyjemnością Baw się ze mną, będziesz szczęśliwsza piękna. Zawartość zestawu:  Lalka w ubranku. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Wymiary produktu dł. x wys. x gł. cm:  11x25x6. Wymiar opakowania dł. x wys. x gł. cm:  12x28x7. Waga produktu bez opakowania kg:  0,15 kg. Waga produktu w opakowaniu kg:  0,20 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+. Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-lalka-25-cm', '', '', '', 'Mega Creative, lalka, 25 cm', '', '', '', ''),
(330, 1, 2, 'Lalka Mega Creative to niezbędna zabawka w kolekcji każdej młodej damy. Występuje w trzech różnych sukienkach. Bez wątpienia czas spędzony z nią będzie czystą przyjemnością Baw się ze mną, będziesz szczęśliwsza piękna. Zawartość zestawu:  Lalka w ubranku. Zabawka wykonana z plastiku, sztucznego włosia oraz materiału. Wymiary produktu dł. x wys. x gł. cm:  11x25x6. Wymiar opakowania dł. x wys. x gł. cm:  12x28x7. Waga produktu bez opakowania kg:  0,15 kg. Waga produktu w opakowaniu kg:  0,20 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+. Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-lalka-25-cm', '', '', '', 'Mega Creative, lalka, 25 cm', '', '', '', ''),
(331, 1, 1, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-180', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 180', '', '', '', ''),
(331, 1, 2, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-180', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 180', '', '', '', ''),
(332, 1, 1, 'Baby Nurse Elektroniczny Kącik opiekunki Elektroniczny kącik opiekunki z 20 akcesoriami w tym lalką. Zestaw składa się z  trzech różnych obszarów:  kuchni z krzesełkiem, strefy pielęgnacji lalki oraz  sypialni z karuzelką. W zestawie atrapa kamery i elektronicznej niani z dźwiękiem dla zwiększenia realizmu opieki nad lalką. Zestaw nie zawiera lalki. Dodatkowe informacje:  Marka:  Baby Nurse Rodzaj:  Kącik do pielęgnacji Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Nie Kolor:  Beżowy Kolor:  Biały Kolor:  Różowy Wymiary:  43 x 59 x 48 cm Wymiary opakowania:  18,4 x 39,9 x 51,7 cm', '', 'smoby-baby-nurse-elektroniczny-kacik-opiekunki', '', '', '', 'Smoby, Baby Nurse, elektroniczny kącik opiekunki', '', '', '', ''),
(332, 1, 2, 'Baby Nurse Elektroniczny Kącik opiekunki Elektroniczny kącik opiekunki z 20 akcesoriami w tym lalką. Zestaw składa się z  trzech różnych obszarów:  kuchni z krzesełkiem, strefy pielęgnacji lalki oraz  sypialni z karuzelką. W zestawie atrapa kamery i elektronicznej niani z dźwiękiem dla zwiększenia realizmu opieki nad lalką. Zestaw nie zawiera lalki. Dodatkowe informacje:  Marka:  Baby Nurse Rodzaj:  Kącik do pielęgnacji Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Nie Kolor:  Beżowy Kolor:  Biały Kolor:  Różowy Wymiary:  43 x 59 x 48 cm Wymiary opakowania:  18,4 x 39,9 x 51,7 cm', '', 'smoby-baby-nurse-elektroniczny-kacik-opiekunki', '', '', '', 'Smoby, Baby Nurse, elektroniczny kącik opiekunki', '', '', '', ''),
(333, 1, 1, 'Przedstawiamy L.O.L. Surprise! Tweens! Te charakterne be tweens są dostępne z niespodziankami i wyjątkowym opakowaniem. 4 nowe postaci do zebrania:  Chloe Pepper, Marilyn Star, Emma Emo i Nia Regal W opakowaniu 15 niespodzianek Opakowaniem można się bawić Pudełko z okienkiem', '', 'lol-surprise-tweens-emma-emo-lalka-modowa', '', '', '', 'L.O.L. Surprise, Tweens, Emma Emo, lalka modowa', '', '', '', ''),
