(334, 1, 2, 'Każda mała dziewczynka w swojej kolekcji zabawek musi posiadać lalkę. Lalka Nella Mega Creative to idealne rozwiązanie na spędzenie wspólnego czasu ze swoją pociechą Zabawka wykonana z plastiku, materiału, sztucznego włosia oraz tworzywa sztucznego. Przeznaczona dla dzieci w wieku 3. Nie wymaga zasilania bateriami. Wymiary produktu 12 cm. Dostępne różne rodzaje. Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-ksiezniczka-nella-lalka-12-cm', '', '', '', 'Mega Creative, księżniczka Nella, lalka, 12 cm', '', '', '', ''),
(335, 1, 1, 'Lalka Meghan to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Interaktywną lalę marki Smiki można przebierać, karmić i przytulać. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Meghan wesoło rusza główką i nuci melodie, kiedy jest noszona na rękach i przytulana. Gdy naciśnie się brzuch bobasa zacznie śpiewać i gaworzyć. Po położeniu lalka Meghan zamyka oczy i zasypia. Lalka ubrana jest w czapeczkę, różowe body i sukienkę w gwiazdki.(ubranko można zdejmować). Zestaw zawiera lalkę przytulankę, butelkę do picia, poduszkę i kocyk. Informacje podstawowe:  Wymiary:  ok. 43 cm. Wiek:  od 2 lat. baterie:  2x AA (w zestawie). Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-meghan-lalka-interaktywna-z-akcesoriami-43-cm', '', '', '', 'Smiki, Meghan, lalka interaktywna z akcesoriami, 43 cm', '', '', '', ''),
