(336, 1, 1, 'Lalka Mój pierwszy bobas to idealna pierwsza lalka Twojej pociechy. Miękki brzuszek laleczki idealnie nadaje się do przytulania. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ubrana jest w czapeczkę i śpioszki. Lalka zamyka oczy i kładzie się do snu. Lalkę można przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lata, kształtując długotrwałe więzi. Informacje podstawowe:  Wymiary:  ok. 28 cm. Wiek:  od 10 miesiąca życia. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-moj-pierwszy-bobas-lalka-28-cm', '', '', '', 'Smiki, Mój pierwszy bobas, lalka, 28 cm', '', '', '', ''),
(336, 1, 2, 'Lalka Mój pierwszy bobas to idealna pierwsza lalka Twojej pociechy. Miękki brzuszek laleczki idealnie nadaje się do przytulania. Zabawa gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze. Lalka ubrana jest w czapeczkę i śpioszki. Lalka zamyka oczy i kładzie się do snu. Lalkę można przytulać, kołysać i śmiać się razem z lalką. Zabawka może stać się przyjacielem dziecka na długie lata, kształtując długotrwałe więzi. Informacje podstawowe:  Wymiary:  ok. 28 cm. Wiek:  od 10 miesiąca życia. Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-moj-pierwszy-bobas-lalka-28-cm', '', '', '', 'Smiki, Mój pierwszy bobas, lalka, 28 cm', '', '', '', ''),
(337, 1, 1, 'Lalka bobas to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Lalę marki Smiki można przebierać, karmić i przytulać i sadzać na nocniku. Zabawa nią gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze, zachęci także do samodzielnego korzystania z nocniczka. Szczegóły:  Lalka ubrana w śliczne, różowe ubranko i czapeczkę. Dzięki dołączonej butelce dziecko można napoić wodą, a po chwili postawić na nocniczku do którego \"nasiusia\". Nocnik po naciśnięciu znajdującego się na nim guzika, wydaje dźwięk spłukiwanej wody i podświetla się czerwonymi światłami. W zestawie znajdują się akcesoria:  pieluszka, miseczka ze sztućcami, butelka, miękki ręczniczek, który może także pełnić funkcję kocyka. W zestawie 3 baterie AA. Wysokość zabawki:  ok. 40 cm Produkt spełnia wymogi bezpieczeństwa - norma europejska EN71.', '', 'smiki-love-baby-melanie-bobas-z-nocnikiem-lalka-40-cm', '', '', '', 'Smiki, Love Baby, Melanie, bobas z nocnikiem, lalka, 40 cm', '', '', '', ''),
(337, 1, 2, 'Lalka bobas to spełnienie marzeń każdej dziewczynki, która chce poczuć się jak mama. Lalę marki Smiki można przebierać, karmić i przytulać i sadzać na nocniku. Zabawa nią gwarantuje dziecku kreatywny czas i rozwija zdolności opiekuńcze, zachęci także do samodzielnego korzystania z nocniczka. Szczegóły:  Lalka ubrana w śliczne, różowe ubranko i czapeczkę. Dzięki dołączonej butelce dziecko można napoić wodą, a po chwili postawić na nocniczku do którego \"nasiusia\". Nocnik po naciśnięciu znajdującego się na nim guzika, wydaje dźwięk spłukiwanej wody i podświetla się czerwonymi światłami. W zestawie znajdują się akcesoria:  pieluszka, miseczka ze sztućcami, butelka, miękki ręczniczek, który może także pełnić funkcję kocyka. W zestawie 3 baterie AA. Wysokość zabawki:  ok. 40 cm Produkt spełnia wymogi bezpieczeństwa - norma europejska EN71.', '', 'smiki-love-baby-melanie-bobas-z-nocnikiem-lalka-40-cm', '', '', '', 'Smiki, Love Baby, Melanie, bobas z nocnikiem, lalka, 40 cm', '', '', '', ''),
(338, 1, 1, 'Evi w stroju dżokejskim, z kucykiem. Wysokość lalki:  12 cm. Dla dzieci w wieku 3+. Uwaga! Produkt wysyłany losowo.', '', 'evi-love-lalka-z-kucykiem', '', '', '', 'Evi Love, lalka z kucykiem', '', '', '', ''),
(338, 1, 2, 'Evi w stroju dżokejskim, z kucykiem. Wysokość lalki:  12 cm. Dla dzieci w wieku 3+. Uwaga! Produkt wysyłany losowo.', '', 'evi-love-lalka-z-kucykiem', '', '', '', 'Evi Love, lalka z kucykiem', '', '', '', ''),
(339, 1, 1, 'Niedźwiadek Bruno jest kapitanem wanienki, więc rozchlapuje wodę gdzie popadnie. Na różowym ręczniku białe kreski wyglądają jak fale. Zanim owinie się ręcznikiem i założy kaptur, Baby Born dokładnie wyszoruje się flanelową myjką i żółtym mydełkiem. Wysokiej jakości akcesoria do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Odpowiednie dla mniejszych lalek. Ręcznik z kapturem, flanelową myjką i zabawkowym mydłem. Wymiary opakowania:  36 x 19 x 2 cm. Wiek:  3+.', '', 'baby-born-zestaw-recznikow-z-kapturem', '', '', '', 'Baby Born, zestaw ręczników z kapturem', '', '', '', ''),
(339, 1, 2, 'Niedźwiadek Bruno jest kapitanem wanienki, więc rozchlapuje wodę gdzie popadnie. Na różowym ręczniku białe kreski wyglądają jak fale. Zanim owinie się ręcznikiem i założy kaptur, Baby Born dokładnie wyszoruje się flanelową myjką i żółtym mydełkiem. Wysokiej jakości akcesoria do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Odpowiednie dla mniejszych lalek. Ręcznik z kapturem, flanelową myjką i zabawkowym mydłem. Wymiary opakowania:  36 x 19 x 2 cm. Wiek:  3+.', '', 'baby-born-zestaw-recznikow-z-kapturem', '', '', '', 'Baby Born, zestaw ręczników z kapturem', '', '', '', ''),
(340, 1, 1, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-178', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 178', '', '', '', ''),
(340, 1, 2, 'Barbie i Ken celebrują różnorodność z lalkami Fashionistas, które zachęcają dzieci do tworzenia opowieści osadzonych w prawdziwym świecie oraz podążania za marzeniami.  Niezwykła linia lalek Barbie Fashionistas prezentuje różne typy sylwetki oraz zróżnicowane połączenia odcieni skóry, fryzur, kolorów oczu i włosów, a także mnóstwo ubranek inspirowanych najnowszymi trendami! Każda lalka Barbie ma na sobie wyjątkowy strój, który pasuje do jej stylu. Stylizację dopełniają modne akcesoria, takie jak para bucików czy bransoletka. Różnorodność lalek wyraża się też poprzez ich fryzury o rożnych kolorach, typach włosów i stylach. Winylowe opakowanie wielokrotnego użytku z suwakiem może posłużyć do przechowywania lalki lub ubranek i akcesoriów Barbie. Można je też dowolnie ozdobić, np. za pomocą naklejek. Opakowanie możesz wykorzystać na wiele sposobów - spakuj w nie zabawki, noś ze sobą i personalizuj. To doskonały prezent dla dzieci od 3 roku życia, który pozwoli im opowiadać własne historyjki i odkrywać niezwykły świat Barbie. Większa różnorodność sprawia, że kolekcjonowanie lalek Barbie Fashionistas daje jeszcze więcej radości. Zbierz je wszystkie, aby poszerzyć możliwości zabawy (sprzedawane oddzielnie, zależnie od dostępności). Informacje dodatkowe:  Lalki są sprzedawane oddzielnie i w zależności od dostępności. Lalki nie stoją samodzielnie. Płaskie buciki pasują na lalki z ruchomymi kostkami lub płaskimi stopami. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 3 lat', '', 'barbie-fashionistas-modna-przyjaciolka-lalka-nr-178', '', '', '', 'Barbie Fashionistas, Modna przyjaciółka, lalka nr 178', '', '', '', ''),
(341, 1, 1, 'Przedstawiamy ultramodne lalki Barbie Extra Fancy gotowe na WIELKIE wyjście w olśniewających kreacjach! Lalki Barbie Extra Fancy wyglądają olśniewająco dzięki pięknym strojom z luksusowymi detalami i akcesoriami oraz uroczym zwierzęcym towarzyszom. Ta lalka Barbie ma niezwykłą oryginalną fryzurę - bardzo długie pomarańczowe włosy z błyszczącymi pasemkami i warkoczykami. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się dwuczęściowa kwiecista suknia z legginsami. Pomarańczowe buciki na obcasie z paskami, duże złociste okulary przeciwsłoneczne, kwiatowa torebka i mnóstwo biżuterii inspirują do wyrażania swojego stylu i kreatywnej zabawy. Jej kotek też jest niezwykle modny - ma wesoły wygląd i uroczą minkę. Lalki Barbie Extra Fancy to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-fancy-lalka-w-stroju-w-kwiaty', '', '', '', 'Barbie, Extra Fancy, lalka w stroju w kwiaty', '', '', '', ''),
(341, 1, 2, 'Przedstawiamy ultramodne lalki Barbie Extra Fancy gotowe na WIELKIE wyjście w olśniewających kreacjach! Lalki Barbie Extra Fancy wyglądają olśniewająco dzięki pięknym strojom z luksusowymi detalami i akcesoriami oraz uroczym zwierzęcym towarzyszom. Ta lalka Barbie ma niezwykłą oryginalną fryzurę - bardzo długie pomarańczowe włosy z błyszczącymi pasemkami i warkoczykami. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się dwuczęściowa kwiecista suknia z legginsami. Pomarańczowe buciki na obcasie z paskami, duże złociste okulary przeciwsłoneczne, kwiatowa torebka i mnóstwo biżuterii inspirują do wyrażania swojego stylu i kreatywnej zabawy. Jej kotek też jest niezwykle modny - ma wesoły wygląd i uroczą minkę. Lalki Barbie Extra Fancy to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-fancy-lalka-w-stroju-w-kwiaty', '', '', '', 'Barbie, Extra Fancy, lalka w stroju w kwiaty', '', '', '', ''),
(342, 1, 1, 'Witaj w uniwersum Miraculum, w którym dwoje licealistów - Marinette i Adrien zostali wybrani na super bohaterów. Każde z nich posiada biżuterię połączoną z magicznymi stworzeniami, które dają im ogromną moc. Marinette po przemianie w Biedronkę staje się bardziej pewna siebie, jest zwinniejsza i silniejsza. Jej ciało pokrywa czerwony kombinezon w czarne kropki. Na twarzy nosi maskę, a jej nieodłącznymi atrybutami są kolczyki z pięcioma kropkami oraz jo-jo. Jeżeli twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego kota i z utęsknieniem wyczekuje emisji kolejnego odcinka animowanej bajki podaruj mu wyjątkowy prezent w postaci figurki przedstawiającej ulubioną super bohaterkę! Od teraz będzie mogło się bawić w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-biedronka-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Biedronka, lalka', '', '', '', ''),
(342, 1, 2, 'Witaj w uniwersum Miraculum, w którym dwoje licealistów - Marinette i Adrien zostali wybrani na super bohaterów. Każde z nich posiada biżuterię połączoną z magicznymi stworzeniami, które dają im ogromną moc. Marinette po przemianie w Biedronkę staje się bardziej pewna siebie, jest zwinniejsza i silniejsza. Jej ciało pokrywa czerwony kombinezon w czarne kropki. Na twarzy nosi maskę, a jej nieodłącznymi atrybutami są kolczyki z pięcioma kropkami oraz jo-jo. Jeżeli twoje dziecko ze szczególną uwagą śledzi losy Biedronki i Czarnego kota i z utęsknieniem wyczekuje emisji kolejnego odcinka animowanej bajki podaruj mu wyjątkowy prezent w postaci figurki przedstawiającej ulubioną super bohaterkę! Od teraz będzie mogło się bawić w odgrywanie scenek z serialu, a także rozwijać swoją wyobraźnię tworząc zupełnie nowe historie. Zabawka dedykowana jest dla dzieci powyżej 4 roku życia.', '', 'miraculous-biedronka-i-czarny-kot-biedronka-lalka', '', '', '', 'Miraculous:  Biedronka i Czarny Kot, Biedronka, lalka', '', '', '', ''),
(343, 1, 1, 'Akcesoria, które potrzebne są każdej mamie by móc w pełni opiekować się swoim dzieckiem. Ta interaktywna butelka, wydająca dźwięk jedzenia, jest idealnie dopasowana do małych rączek. Zawartość i cechy zestawu:  butelka dla lalki interaktywna funkcja dźwiękowa - po naciśnięciu guziczka, emituje dźwięki picia i przełykania nakładka do pojenia wodą nakładka z końcówką w formie specjalnej łyżeczki do podawania pokarmu dla lalki nakrętka tradycyjna łyżeczka Wymagana bateria:  2 x LR44 (baterie testowe w zestawie). Przeznaczone dla dzieci w wieku:  3+.', '', 'baby-born-butelka-z-lyzeczka-dla-lalki', '', '', '', 'Baby Born, butelka z łyżeczką dla lalki', '', '', '', ''),
(343, 1, 2, 'Akcesoria, które potrzebne są każdej mamie by móc w pełni opiekować się swoim dzieckiem. Ta interaktywna butelka, wydająca dźwięk jedzenia, jest idealnie dopasowana do małych rączek. Zawartość i cechy zestawu:  butelka dla lalki interaktywna funkcja dźwiękowa - po naciśnięciu guziczka, emituje dźwięki picia i przełykania nakładka do pojenia wodą nakładka z końcówką w formie specjalnej łyżeczki do podawania pokarmu dla lalki nakrętka tradycyjna łyżeczka Wymagana bateria:  2 x LR44 (baterie testowe w zestawie). Przeznaczone dla dzieci w wieku:  3+.', '', 'baby-born-butelka-z-lyzeczka-dla-lalki', '', '', '', 'Baby Born, butelka z łyżeczką dla lalki', '', '', '', ''),
(344, 1, 1, 'Lalka 29 cm w modnej stylizacji (tiulowa suknia z koronką).   Dziewczyna ma na twarzy wyraźnie zaznaczony makijaż.   Dostępne są również kolczyki.   Włosy zostały upięte w długi, kolorowy warkocz.   Laleczka jest przegubowa.   Zabawkę zapakowano w pudełko, które automatycznie przyciąga uwagę dziewczynek.  Produkt występuje w różnych wariantach.  Wymiary opakowania:  14x5x31,5 cm.  Wiek:  3+. Uwaga:  produkt wysyłany losowo!', '', 'bigtoys-lalka-w-sukni-balowej-ksiezniczka-dlugi-warkocz', '', '', '', 'BigToys, lalka w sukni balowej, księżniczka, długi warkocz', '', '', '', ''),
(344, 1, 2, 'Lalka 29 cm w modnej stylizacji (tiulowa suknia z koronką).   Dziewczyna ma na twarzy wyraźnie zaznaczony makijaż.   Dostępne są również kolczyki.   Włosy zostały upięte w długi, kolorowy warkocz.   Laleczka jest przegubowa.   Zabawkę zapakowano w pudełko, które automatycznie przyciąga uwagę dziewczynek.  Produkt występuje w różnych wariantach.  Wymiary opakowania:  14x5x31,5 cm.  Wiek:  3+. Uwaga:  produkt wysyłany losowo!', '', 'bigtoys-lalka-w-sukni-balowej-ksiezniczka-dlugi-warkocz', '', '', '', 'BigToys, lalka w sukni balowej, księżniczka, długi warkocz', '', '', '', ''),
(345, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. W zestawie:  lalka Mila z długimi włosami do czesania akcesoria do włosów i grzebień dodatkowa odzież dla lalek (2 komplety) + wieszaki akcesoria modowe (kolczyki, torebka, buty...) stojak na lalkę Lalka zgina się w przegubach. Rozmiar:  30,48x 8,13x30,48 cm Zbierz kolekcję pięknych lalek z Rainbow High!', '', 'rainbow-high-fashion-doll-mila-berrymore-lalka-modowa', '', '', '', 'Rainbow High, Fashion Doll, Mila Berrymore, lalka modowa', '', '', '', ''),
(345, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. W zestawie:  lalka Mila z długimi włosami do czesania akcesoria do włosów i grzebień dodatkowa odzież dla lalek (2 komplety) + wieszaki akcesoria modowe (kolczyki, torebka, buty...) stojak na lalkę Lalka zgina się w przegubach. Rozmiar:  30,48x 8,13x30,48 cm Zbierz kolekcję pięknych lalek z Rainbow High!', '', 'rainbow-high-fashion-doll-mila-berrymore-lalka-modowa', '', '', '', 'Rainbow High, Fashion Doll, Mila Berrymore, lalka modowa', '', '', '', ''),
(346, 1, 1, 'Wyrusz na biwak z Kamperem Marzeń Barbie DreamCamper   Ten pojazd Barbie z siedmioma obszarami zabawy do utworzenia, epicką zjeżdżalnią i mnóstwem akcesoriów inspiruje do niekończących się przygód na świeżym powietrzu.  Dzięki obracającym się kółkom i szoferce dla dwóch osób (lalki sprzedawane oddzielnie) możesz dojechać do każdego wymarzonego miejsca.  Gdy dotrzesz do celu, zaparkuj kamper i rozłóż go, odsłaniając kuchnię, łazienkę, basen, zjeżdżalnię i miejsce wypoczynkowe z telewizorem oraz tworząc jadalnię i sypialnię na świeżym powietrzu.  Pomóż lalce Barbie i jej przyjaciołom lalki nie znajdują się w zestawie wspiąć się na drabinkę, a potem zjechać po zjeżdżalni do basenu z wielkim pluśnięciem.  Spersonalizuj pojazd Barbie za pomocą arkusza naklejek na zderzak z motywami biwakowymi i odkryj nieograniczone możliwości zabawy dzięki ponad 60 elementom, w tym dwóm figurkom szczeniaczków.  Gdy lalki będą gotowe na kolejną wyprawę, spakuj wszystko do środka kampera i zamknij go, aby wyruszyć w dalszą drogę.  Lalki nie znajdują się w zestawie.  Kolory i elementy dekoracyjne mogą się różnić.   Wiek od 3 lat.', '', 'barbie-kamper-marzen-auto-bez-lalek', '', '', '', 'Barbie, Kamper Marzeń, auto bez lalek', '', '', '', ''),
(346, 1, 2, 'Wyrusz na biwak z Kamperem Marzeń Barbie DreamCamper   Ten pojazd Barbie z siedmioma obszarami zabawy do utworzenia, epicką zjeżdżalnią i mnóstwem akcesoriów inspiruje do niekończących się przygód na świeżym powietrzu.  Dzięki obracającym się kółkom i szoferce dla dwóch osób (lalki sprzedawane oddzielnie) możesz dojechać do każdego wymarzonego miejsca.  Gdy dotrzesz do celu, zaparkuj kamper i rozłóż go, odsłaniając kuchnię, łazienkę, basen, zjeżdżalnię i miejsce wypoczynkowe z telewizorem oraz tworząc jadalnię i sypialnię na świeżym powietrzu.  Pomóż lalce Barbie i jej przyjaciołom lalki nie znajdują się w zestawie wspiąć się na drabinkę, a potem zjechać po zjeżdżalni do basenu z wielkim pluśnięciem.  Spersonalizuj pojazd Barbie za pomocą arkusza naklejek na zderzak z motywami biwakowymi i odkryj nieograniczone możliwości zabawy dzięki ponad 60 elementom, w tym dwóm figurkom szczeniaczków.  Gdy lalki będą gotowe na kolejną wyprawę, spakuj wszystko do środka kampera i zamknij go, aby wyruszyć w dalszą drogę.  Lalki nie znajdują się w zestawie.  Kolory i elementy dekoracyjne mogą się różnić.   Wiek od 3 lat.', '', 'barbie-kamper-marzen-auto-bez-lalek', '', '', '', 'Barbie, Kamper Marzeń, auto bez lalek', '', '', '', ''),
(347, 1, 1, 'Wizarding World Różdżka Harrego z figurką Patronusa Opanuj zaklęcie Expecto Patronum z pomocą różdżki Wizarding World Harry Potter zaklęcie Patronus! Ta 13-calowa różdżka Harry\'ego Pottera zawiera 6-calową figurkę Patronusa - jelenia, która reaguje na ruchy różdżki za pomocą świateł i dźwięków! Aby rozpocząć ćwiczenia rzucania zaklęć, naciśnij przycisk zasilania, aby aktywować różdżkę. Następnie przytrzymaj ją pionowo, aby zwiększyć jej moc. Po osiągnięciu pożądanego poziomu, opuść różdżkę, skieruj ją na Patronusa, zwolnij przycisk i rzuć zaklęcie. Expecto Patronum! Jeśli wykonasz zaklęcie poprawnie, Patronus - pod postacią jelenia - będzie świecił i wydawał czarujące dźwięki! Aby Patronus dłużej pilnował Twojego pokoju, włącz tryb oświetlenia nocnego. Po prostu przesuń różdżkę trzy razy w dół i w górę, zanim rzucisz pełne mocy zaklęcie. Różdżka Patronus to niezbędny gadżet dla fanów Harry\'ego Pottera i doskonały sposób na pobudzenie wyobraźni przez ekscytującą zabawę. Aby jeszcze urozmaicić sobie doświadczenie w czarodziejskim świecie, poszukaj różdżki Patronus Hermiony Granger (sprzedawanej osobno)! Ta czarująca kolekcja zabawek ze świata Harry\'ego Pottera to świetny prezent dla dzieci w wieku od lat 6. Figurka Patronusa wymaga 3 baterii AAA (brak w zestawie). Różdżka zawiera 3 baterie LR44. Wyczaruj idealne zaklęcie Expecto Patronum dzięki różdżce Wizarding World Harry\'ego Pottera! Dodatkowe informacje:  Licencja:  Harry Potter Rodzaj:  Bajkowe Wymagania wiekowe:  od 6 lat Płeć:  chłopcy, dziewczynki Produkt na baterie:  Tak Zasilanie:  Baterie/akumulatory AAA Zasilanie:  Bateria LR44 Wymiary opakowania:  30.48 x 30.48 x 8.13 cm', '', 'wizarding-world-rozdzka-harrego-pottera-z-figurka-patronusa', '', '', '', 'Wizarding World, różdżka Harrego Pottera z figurką Patronusa', '', '', '', ''),
(347, 1, 2, 'Wizarding World Różdżka Harrego z figurką Patronusa Opanuj zaklęcie Expecto Patronum z pomocą różdżki Wizarding World Harry Potter zaklęcie Patronus! Ta 13-calowa różdżka Harry\'ego Pottera zawiera 6-calową figurkę Patronusa - jelenia, która reaguje na ruchy różdżki za pomocą świateł i dźwięków! Aby rozpocząć ćwiczenia rzucania zaklęć, naciśnij przycisk zasilania, aby aktywować różdżkę. Następnie przytrzymaj ją pionowo, aby zwiększyć jej moc. Po osiągnięciu pożądanego poziomu, opuść różdżkę, skieruj ją na Patronusa, zwolnij przycisk i rzuć zaklęcie. Expecto Patronum! Jeśli wykonasz zaklęcie poprawnie, Patronus - pod postacią jelenia - będzie świecił i wydawał czarujące dźwięki! Aby Patronus dłużej pilnował Twojego pokoju, włącz tryb oświetlenia nocnego. Po prostu przesuń różdżkę trzy razy w dół i w górę, zanim rzucisz pełne mocy zaklęcie. Różdżka Patronus to niezbędny gadżet dla fanów Harry\'ego Pottera i doskonały sposób na pobudzenie wyobraźni przez ekscytującą zabawę. Aby jeszcze urozmaicić sobie doświadczenie w czarodziejskim świecie, poszukaj różdżki Patronus Hermiony Granger (sprzedawanej osobno)! Ta czarująca kolekcja zabawek ze świata Harry\'ego Pottera to świetny prezent dla dzieci w wieku od lat 6. Figurka Patronusa wymaga 3 baterii AAA (brak w zestawie). Różdżka zawiera 3 baterie LR44. Wyczaruj idealne zaklęcie Expecto Patronum dzięki różdżce Wizarding World Harry\'ego Pottera! Dodatkowe informacje:  Licencja:  Harry Potter Rodzaj:  Bajkowe Wymagania wiekowe:  od 6 lat Płeć:  chłopcy, dziewczynki Produkt na baterie:  Tak Zasilanie:  Baterie/akumulatory AAA Zasilanie:  Bateria LR44 Wymiary opakowania:  30.48 x 30.48 x 8.13 cm', '', 'wizarding-world-rozdzka-harrego-pottera-z-figurka-patronusa', '', '', '', 'Wizarding World, różdżka Harrego Pottera z figurką Patronusa', '', '', '', ''),
(348, 1, 1, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-jelonek-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka jelonek, 1 szt.', '', '', '', ''),
(348, 1, 2, 'Rozpakowywanie lalek Barbie Cutie Reveal z serii Zimowa Kraina to świetna zabawa dzięki 10 niespodziankom, w tym lalce Barbie z punktami zgięcia! Odkrywaj miękkie zimowe zwierzątka i ubranka, niespodzianki oraz transformacje ze zmianą koloru. W opakowaniu znajdziesz lalkę Barbie w kostiumie mięciutkiego zwierzątka. Do wyboru masz jelonka, sowę śnieżną, pieska husky i niedźwiadka polarnego. Odkryj wygląd lalki! Zdejmij kostium, aby odkryć lalkę Barbie z punktami zgięcia, długimi kolorowymi włosami i lśniącymi detalami. Otwórz 4 torebki-niespodzianki, aby znaleźć ubranko i akcesoria:  uroczą spódniczkę, parę zimowych bucików, gąbkę-grzebień, opaskę na głowę inspirowaną zwierzątkiem i specjalnie dobrane minizwierzątko! Przebieraj lalkę Barbie i dobieraj akcesoria - po przekręceniu na drugą stronę góra kostiumu staje się kurtką z niezwykle miękkiego materiału z uroczym nadrukiem np. w kropki lub gwiazdki. Dodatkowo głowa kostiumu zmienia się w legowisko dla minizwierzątka! Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-cutie-reveal-zimowa-kraina-lalka-jelonek-1-szt', '', '', '', 'Barbie, Cutie Reveal, Zimowa kraina, lalka jelonek, 1 szt.', '', '', '', ''),
(349, 1, 1, '<b>Lalka siostrzyczka 36cm Baby Born</b>  Młodsza siostra uwielbia chodzić do przedszkola. Dziewczynka nie mogła się doczekać swojego pierwszego dnia w grupie Misów. W końcu jest dużą dziewczynką i potrafi sama wytrzymać. Poza tym, że ma ruchome kolana, maluch jest ogólnie dość elastyczny. To sprawia, że zakładanie i zdejmowanie jej uroczych ubrań jest dziecinnie proste. Jej sukienka ma plisowane rękawy i warstwową spódnicę. Ponieważ jest w grupie Misów, ma nadrukowane na ubranku niedźwiaki. Mała przedszkolanka nosi kolorowe legginsy w paski i różowe tenisówki. Zamiast używać butelki dla niemowląt, pije wodę z butelki sportowej. Kiedy trzeba iść spać, zawsze robi zamieszanie i płacze prawdziwymi lalkami. Nie jest już małą dziewczynką, więc dlaczego miałaby spać? Ale posłusznie zamyka śpiące oczy, kiedy kładziesz ją na plecach. Uwielbia też kąpać się i układać włosy, dlatego przychodzi z różnego rodzaju akcesoriami do włosów. 7 realistycznych funkcjami zapewniających mnóstwo zabawy. Dodatkowe informacje:  Nr katalogowy:  828533-116721 Marka:  Baby Born Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Nie Baterie w zestawie:  Nie Wysokość:  36 cm', '', 'baby-born-lalka-siostrzyczka-36-cm', '', '', '', 'Baby Born, lalka siostrzyczka, 36 cm', '', '', '', ''),
