(350, 1, 1, 'Każda mała dziewczynka w swojej kolekcji zabawek musi posiadać lalkę stworzoną na wzór lalek Barbie. Ten zestaw z lalką w sukience Mega Creative to idealne rozwiązanie na spędzenie wspólnego czasu ze swoją pociechą. Lalka 29 cm posiada długi warkocz, ubrana jest w biało-fioletową sukienkę w grochy. Dodatkowo do lalki dołączona jest kolejna sukienka oraz różowe buty na obcasach. Lalka wykonana z plastiku oraz materiału. Przeznaczona dla dzieci od lat:  3+ Wymiary opakowania dł. x wys. x gł. cm 13x33x4.', '', 'mega-creative-lalka-z-akcesoriami-29-cm', '', '', '', 'Mega Creative, lalka z akcesoriami, 29 cm', '', '', '', ''),
(350, 1, 2, 'Każda mała dziewczynka w swojej kolekcji zabawek musi posiadać lalkę stworzoną na wzór lalek Barbie. Ten zestaw z lalką w sukience Mega Creative to idealne rozwiązanie na spędzenie wspólnego czasu ze swoją pociechą. Lalka 29 cm posiada długi warkocz, ubrana jest w biało-fioletową sukienkę w grochy. Dodatkowo do lalki dołączona jest kolejna sukienka oraz różowe buty na obcasach. Lalka wykonana z plastiku oraz materiału. Przeznaczona dla dzieci od lat:  3+ Wymiary opakowania dł. x wys. x gł. cm 13x33x4.', '', 'mega-creative-lalka-z-akcesoriami-29-cm', '', '', '', 'Mega Creative, lalka z akcesoriami, 29 cm', '', '', '', ''),
(351, 1, 1, 'W zestawie:  butelka z mlekiem, smoczek, śliniak', '', 'artyk-natalia-magiczna-butelka-akcesoria', '', '', '', 'Artyk, Natalia, magiczna butelka, akcesoria', '', '', '', ''),
(351, 1, 2, 'W zestawie:  butelka z mlekiem, smoczek, śliniak', '', 'artyk-natalia-magiczna-butelka-akcesoria', '', '', '', 'Artyk, Natalia, magiczna butelka, akcesoria', '', '', '', ''),
(352, 1, 1, 'Przedstawiamy Rainbow High CORE Fashion Doll! Tęcza to nieograniczone możliwości kolorystyczne! Wśród nowych uczniów jest 5 fantastycznych dziewczyn i 1 łamacz serc. Wszystkie lalki mają unikalny styl, który widać w dwóch różnych<br />strojach i wielu modnych akcesoriach! A kiedy ustawi się je razem, tworzą oszałamiającą tęczę. Zbierz je wszystkie, żeby zobaczyć te niesamowite kolory tęczy! Cechy produktów:  6 nowych lalek w odcieniach tęczy Lalki zginają się w przegubach Długie włosy do czesania plus akcesoria do włosów i grzebień Dodatkowa odzież dla lalek (2 komplety) + wieszaki Akcesoria modowe (kolczyki, torebka, buty…) Stojak na lalkę Dostępne w 6 nowych kolorach Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-core-fashion-doll-coco-vanderbalt-lalka-modowa', '', '', '', 'Rainbow High, Core Fashion Doll, Coco Vanderbalt, lalka modowa', '', '', '', ''),
(352, 1, 2, 'Przedstawiamy Rainbow High CORE Fashion Doll! Tęcza to nieograniczone możliwości kolorystyczne! Wśród nowych uczniów jest 5 fantastycznych dziewczyn i 1 łamacz serc. Wszystkie lalki mają unikalny styl, który widać w dwóch różnych<br />strojach i wielu modnych akcesoriach! A kiedy ustawi się je razem, tworzą oszałamiającą tęczę. Zbierz je wszystkie, żeby zobaczyć te niesamowite kolory tęczy! Cechy produktów:  6 nowych lalek w odcieniach tęczy Lalki zginają się w przegubach Długie włosy do czesania plus akcesoria do włosów i grzebień Dodatkowa odzież dla lalek (2 komplety) + wieszaki Akcesoria modowe (kolczyki, torebka, buty…) Stojak na lalkę Dostępne w 6 nowych kolorach Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-core-fashion-doll-coco-vanderbalt-lalka-modowa', '', '', '', 'Rainbow High, Core Fashion Doll, Coco Vanderbalt, lalka modowa', '', '', '', ''),
(353, 1, 1, '\"Chodźmy i bawmy się!\" Owca na Annabell\'s pokaże jak to się robi. Koszulka w stylu easy fit może być łatwo zakładana i zdejmowana nawet przez najmniejsze rączki. Ciało małej 30 cm laleczki ma przytulne, miękkie wypełnienie. Mała po prostu uwielbia się przytulać i bawić godzinami, ale uwielbia też swoją butelkę. Ale zabawa i picie są bardzo męczące:  kiedy kładzie się Annabell na plecach, zamyka ona swoje niebieskie oczy.      Baby Annabell markowa lalka. Mała \"wersja dla początkujących\" (30 cm) W stylu easy fit Delikatnie zachęca dzieci od pierwszego roku życia do odgrywania ról i dostarcza wstępnych bodźców do rozwijania poczucia empatii i odpowiedzialności. Baby Annabell My First Annabell 30cm z pajacykiem i czapeczką. Dodatkowe informacje:  Nr katalogowy:  704073-116721 Marka:  Baby Annabell Wymagania wiekowe:  od 12 miesięcy Wysokość:  30 cm Wymiary opakowania:  18.3 x 16.3 x 27.2 cm', '', 'baby-born-moja-pierwsza-zawadiacka-annabell-lalka-30cm', '', '', '', 'Baby Born, Moja pierwsza zawadiacka Annabell, lalka, 30cm', '', '', '', ''),
(353, 1, 2, '\"Chodźmy i bawmy się!\" Owca na Annabell\'s pokaże jak to się robi. Koszulka w stylu easy fit może być łatwo zakładana i zdejmowana nawet przez najmniejsze rączki. Ciało małej 30 cm laleczki ma przytulne, miękkie wypełnienie. Mała po prostu uwielbia się przytulać i bawić godzinami, ale uwielbia też swoją butelkę. Ale zabawa i picie są bardzo męczące:  kiedy kładzie się Annabell na plecach, zamyka ona swoje niebieskie oczy.      Baby Annabell markowa lalka. Mała \"wersja dla początkujących\" (30 cm) W stylu easy fit Delikatnie zachęca dzieci od pierwszego roku życia do odgrywania ról i dostarcza wstępnych bodźców do rozwijania poczucia empatii i odpowiedzialności. Baby Annabell My First Annabell 30cm z pajacykiem i czapeczką. Dodatkowe informacje:  Nr katalogowy:  704073-116721 Marka:  Baby Annabell Wymagania wiekowe:  od 12 miesięcy Wysokość:  30 cm Wymiary opakowania:  18.3 x 16.3 x 27.2 cm', '', 'baby-born-moja-pierwsza-zawadiacka-annabell-lalka-30cm', '', '', '', 'Baby Born, Moja pierwsza zawadiacka Annabell, lalka, 30cm', '', '', '', '');
