(354, 1, 1, 'Cry Baby, Magic Tears Tutti Frutti to pachnące owocami lalki  wybrane akcesoria także są pachnące (buteleczka)  lalki płaczą kolorowymi łzami w postaci żelu  nowe, większe opakowanie w kształcie napoju owocowego ze słomką  przykrywka opakowania posiada żel z brokatem, co imituje prawdziwy napój  zestaw zawiera 8 akcesoriów  przykładowe akcesoria:    okulary   śliniak   miseczka   przykrywka ze smoczkiem   klapki/buty   łyżka   buteleczka   smoczek    Uwaga! Produkt występuje w wielu wariantach. Wysyłka losowa, bez możliwości wyboru wariantu.', '', 'cry-babies-magic-tears-tutti-frutti-laleczka-1-szt', '', '', '', 'Cry Babies, Magic Tears, Tutti Frutti, laleczka, 1 szt.', '', '', '', ''),
