(356, 1, 1, 'BABY born Wieszak na ubrania, 5-pak 43 cm Kolorowe wieszaki umożliwiające zaprowadzenie porządku w garderobie. Pora na zmiany w garderobie BABY born. Tylko jakie? Może przyszyć łaty i wzmocnić kolana na spodniach, a może przyczepić perełki do jeansowej bluzy? Albo wyprasować spódniczkę, żeby znowu nadawała się do noszenia? Chyba nie. Nadszedł czas, żeby powiesić ubrania na wieszaki - i to na pięć wieszaków w różnych kolorach. Wysokiej jakości akcesoria do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Wieszaki BABY born 5-pak 43 cm Dodatkowe informacje:  Nr katalogowy:  831144-116721 Marka:  Baby Born Rodzaj:  Pozostałe Wymagania wiekowe:  od 3 lat Kolor:  Wielokolorowy', '', 'baby-born-wieszak-na-ubrania-5-szt', '', '', '', 'Baby Born, wieszak na ubrania, 5 szt.', '', '', '', ''),
