(357, 1, 1, 'Lalki z serii Barbie Extra Moda - fascynujące kreacje, modne i zaskakujące dodatki oraz słodkie zwierzątka. W zestawie lalka z akcesoriami oraz modnymi ubraniami. Każdej lalce towarzyszy urocze zwierzątko. Zbierz wszystkie lalki z serii i baw się w najlepsze! Wiek dziecka:  powyżej 3 lat.', '', 'barbie-extra-moda-lalka-ze-zwierzatkiem-nr-9', '', '', '', 'Barbie, Extra Moda, lalka ze zwierzątkiem nr 9', '', '', '', ''),
(357, 1, 2, 'Lalki z serii Barbie Extra Moda - fascynujące kreacje, modne i zaskakujące dodatki oraz słodkie zwierzątka. W zestawie lalka z akcesoriami oraz modnymi ubraniami. Każdej lalce towarzyszy urocze zwierzątko. Zbierz wszystkie lalki z serii i baw się w najlepsze! Wiek dziecka:  powyżej 3 lat.', '', 'barbie-extra-moda-lalka-ze-zwierzatkiem-nr-9', '', '', '', 'Barbie, Extra Moda, lalka ze zwierzątkiem nr 9', '', '', '', ''),
(358, 1, 1, 'Dzieci uwielbiają kąpiel, a zabawa w wodzie z ulubioną laleczką Baby Born to wymarzone zajęcie. Taka malutka, a idealna do tulenia oraz kąpania! Niewielkich rozmiarów lalka ubrana jest w różowy strój kąpielowy z kolorowym motywem ozdobnym. W zestawie znajduje się także ręczniczek w formie rożka z kapturkiem, który przyda się po kąpieli, by osuszyć małą Baby Born. W zestawie znajduje się ręcznik rożek z kapturkiem różowy kostium różowa butelka smoczek Przeznaczona dla dzieci w wieku:  2+.', '', 'baby-born-mala-laleczka-kapielowa-30-cm', '', '', '', 'Baby Born, mała laleczka kąpielowa, 30 cm', '', '', '', ''),
(358, 1, 2, 'Dzieci uwielbiają kąpiel, a zabawa w wodzie z ulubioną laleczką Baby Born to wymarzone zajęcie. Taka malutka, a idealna do tulenia oraz kąpania! Niewielkich rozmiarów lalka ubrana jest w różowy strój kąpielowy z kolorowym motywem ozdobnym. W zestawie znajduje się także ręczniczek w formie rożka z kapturkiem, który przyda się po kąpieli, by osuszyć małą Baby Born. W zestawie znajduje się ręcznik rożek z kapturkiem różowy kostium różowa butelka smoczek Przeznaczona dla dzieci w wieku:  2+.', '', 'baby-born-mala-laleczka-kapielowa-30-cm', '', '', '', 'Baby Born, mała laleczka kąpielowa, 30 cm', '', '', '', ''),
(359, 1, 1, 'Przedstawiamy L.O.L. Surprise! Tweens! Te charakterne Be Tweens są dostępne z niespodziankami i wyjątkowym opakowaniem. 4 nowe postaci do zebrania:  Chloe Pepper, Marilyn Star, Emma Emo i Nia Regal W opakowaniu 15 niespodzianek Opakowaniem można się bawić Pudełko z okienkiem', '', 'lol-surprise-tweens-nia-regal-lalka-modowa', '', '', '', 'L.O.L. Surprise, Tweens, Nia Regal, lalka modowa', '', '', '', ''),
