(360, 1, 1, 'Lalka Królewna Śnieżka błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty. W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat', '', 'ksiezniczki-disneya-sniezka-lalka', '', '', '', 'Księżniczki Disneya, Śnieżka, lalka', '', '', '', ''),
(360, 1, 2, 'Lalka Królewna Śnieżka błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty. W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat', '', 'ksiezniczki-disneya-sniezka-lalka', '', '', '', 'Księżniczki Disneya, Śnieżka, lalka', '', '', '', ''),
(361, 1, 1, 'Zestaw Polly Pocket Pollyville Flamingowa myjnia ma mnóstwo fantastycznych niespodzianek. Odkryj radosną wodną zabawę w myjni, jeżdżąc flamingowym pojazdem przez różne poziomy i ciesząc się funkcją zmiany koloru. Wjedź na górę chmurkową windą, a potem użyj listkowego kubka do polewania dużej chmury wodą, która \"pada\" na samochodzik, zmieniając jego wygląd - fioletowe \"zabrudzenia\" znikają. Potem samochodzik przejeżdża przez obrotowe szczotki, które pucują go do czysta. Na przejażdżkę po myjni może się wybrać lalka oraz tukan lub leniwiec. Popchnij samochodzik w dół kwiatowej zjeżdżalni, aby zobaczyć zakręcony zjazd na niższy poziom. Gdy pojazd trafi na próg zwalniający, wyskoczy element na stacji benzynowej. W dystrybutorze \"paliwa\" jest flamingowy wąż, który można podłączyć do pojazdu. Zapraszamy do kasy i po przekąskę na drogę. W zestawie do zabawy Pollyville Flamingowa myjnia znajdziesz 2 lalki, 2 figurki zwierzątek, 3 akcesoria, 2 listkowe kubeczki i 1 inspirowany flamingiem pojazd z elementem ze zmianą koloru. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają motoryzację i wodną zabawę!', '', 'polly-pocket-flamingowa-myjnia-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Flamingowa myjnia, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(361, 1, 2, 'Zestaw Polly Pocket Pollyville Flamingowa myjnia ma mnóstwo fantastycznych niespodzianek. Odkryj radosną wodną zabawę w myjni, jeżdżąc flamingowym pojazdem przez różne poziomy i ciesząc się funkcją zmiany koloru. Wjedź na górę chmurkową windą, a potem użyj listkowego kubka do polewania dużej chmury wodą, która \"pada\" na samochodzik, zmieniając jego wygląd - fioletowe \"zabrudzenia\" znikają. Potem samochodzik przejeżdża przez obrotowe szczotki, które pucują go do czysta. Na przejażdżkę po myjni może się wybrać lalka oraz tukan lub leniwiec. Popchnij samochodzik w dół kwiatowej zjeżdżalni, aby zobaczyć zakręcony zjazd na niższy poziom. Gdy pojazd trafi na próg zwalniający, wyskoczy element na stacji benzynowej. W dystrybutorze \"paliwa\" jest flamingowy wąż, który można podłączyć do pojazdu. Zapraszamy do kasy i po przekąskę na drogę. W zestawie do zabawy Pollyville Flamingowa myjnia znajdziesz 2 lalki, 2 figurki zwierzątek, 3 akcesoria, 2 listkowe kubeczki i 1 inspirowany flamingiem pojazd z elementem ze zmianą koloru. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają motoryzację i wodną zabawę!', '', 'polly-pocket-flamingowa-myjnia-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Flamingowa myjnia, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(362, 1, 1, 'Zestaw ubranek na 4 pory roku BABY BORN. Śwetne uzupełnienie zabawy! Dodatkowe informacje:  Nr katalogowy:  829424-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Wielokolorowy Kolor:  Wielokolorowy', '', 'baby-born-ubranka-dla-lalki-na-4-pory-roku', '', '', '', 'Baby Born, ubranka dla lalki na 4 pory roku', '', '', '', ''),
