(363, 1, 1, 'Urocza lalka z serii Disney Princess - Kopciuszek! Kopciuszek błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty. W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-kopciuszek-lalka', '', '', '', 'Disney Princess, Księżniczka Kopciuszek, lalka', '', '', '', ''),
(363, 1, 2, 'Urocza lalka z serii Disney Princess - Kopciuszek! Kopciuszek błyszczy w swojej pięknej sukience w charakterystycznych dla niej kolorach oraz zupełnie nowym, odmienionym topie ze zdobieniami przypominającymi klejnoty. W zestawie znajduje się również opaska oraz buciki. Wiek dziecka:  od 3 lat.', '', 'disney-princess-ksiezniczka-kopciuszek-lalka', '', '', '', 'Disney Princess, Księżniczka Kopciuszek, lalka', '', '', '', ''),
(364, 1, 1, 'Evi kocha zwierzęta, więc postanowiła zostać weterynarzem, by im pomagać. Najważniejsze by jej podopieczni byli zdrowi i szczęśliwi. Tym razem dziewczyna zaopiekuje się klaczą i jej nowonarodzonym maleństwem. Źrebak jest w brzuchu mamy i zadaniem Evi jest pomoc w wyjściu maleńkiego konika na świat. Laleczka ma zginane w kolanach nóżki i ruchome nadgarstki. Ma na sobie kolorowe ubranko ze spodniami na szelkach i obrazkiem z podkową - idealne do pracy w stajni. Klacz ma piękną, długą grzywę i różowy kantar. Zabawka przeznaczona dla dziecka powyżej 3. roku życia. W zestawie:  lalka Evi klacz i źrebak kojec i legowisko buteleczka dla źrebaka, którą można precyzyjnie mocować w rączkach laleczki za pomocą wypustek jabłka do karmienia koni', '', 'evi-love-doktor-evi-i-klacz-w-ciazy', '', '', '', 'Evi Love, Doktor Evi i klacz w ciąży', '', '', '', ''),
(364, 1, 2, 'Evi kocha zwierzęta, więc postanowiła zostać weterynarzem, by im pomagać. Najważniejsze by jej podopieczni byli zdrowi i szczęśliwi. Tym razem dziewczyna zaopiekuje się klaczą i jej nowonarodzonym maleństwem. Źrebak jest w brzuchu mamy i zadaniem Evi jest pomoc w wyjściu maleńkiego konika na świat. Laleczka ma zginane w kolanach nóżki i ruchome nadgarstki. Ma na sobie kolorowe ubranko ze spodniami na szelkach i obrazkiem z podkową - idealne do pracy w stajni. Klacz ma piękną, długą grzywę i różowy kantar. Zabawka przeznaczona dla dziecka powyżej 3. roku życia. W zestawie:  lalka Evi klacz i źrebak kojec i legowisko buteleczka dla źrebaka, którą można precyzyjnie mocować w rączkach laleczki za pomocą wypustek jabłka do karmienia koni', '', 'evi-love-doktor-evi-i-klacz-w-ciazy', '', '', '', 'Evi Love, Doktor Evi i klacz w ciąży', '', '', '', ''),
(365, 1, 1, 'Smily Play, lalka julka 32 cm w pudełku prezentowym odgrywanie ról 2+ Lalka Julka lubi, kiedy się nią opiekujesz i zabierasz ze sobą na spacery. Miękka lalka jest ubrana w czapkę, kombinezon z prążkowanymi spodniami i pikowaną kurtkę z kapturem. Lalka, po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Podczas zabawy lalkami, zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju dziecka. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Lalki to nierozłączny element dzieciństwa. Zachęcają do aktywnej oraz kreatywnej zabawy, dają również możliwość stworzenia własnego świata. Dzięki nim uczymy się opiekuńczości oraz wrażliwości. Z lalką dziecku łatwiej jest wkroczyć w świat radości, strachu, euforii i smutku. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 32 cm Specyfikacja:   Wiek:  24m+  Wymiary produktu:  szer. 17 cm., wys. 33 cm., gł. 9,5 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-julka-lalka-32-cm', '', '', '', 'Smily Play, Julka, lalka, 32 cm', '', '', '', ''),
