(366, 1, 1, 'Mali styliści mogą tworzyć swoje wymarzone stylizacje dzięki lalce księżniczce Barbie Dreamtopia Zakręcone pasemka Lalka księżniczka Barbie ma bardzo długie włosy ok. 21 cm. Rozczesz włosy Barbie, a potem umieść dwa lub trzy zaczepy w specjalnym przyrządzie do stylizacji i twórz fantastyczne fryzury jednym naciśnięciem przycisku. Uzupełnij wygląd księżniczki Barbie kolorowymi spinkami i tiarą, a potem ruszaj ku magicznym przygodom. Lalka nie stoi samodzielnie. Kolory i elementy dekoracyjne mogą się różnić. Lalka księżniczka Barbie Dreamtopia Zakręcone pasemka daje tak wiele możliwości tworzenia opowieści i stylizacji, że stanowi wspaniały prezent dla miłośników baśni w wieku 3 lat i starszych.', '', 'barbie-dreamtopia-ksiezniczka-zakrecone-pasemka-lalka', '', '', '', 'Barbie Dreamtopia, Księżniczka, Zakręcone Pasemka, lalka', '', '', '', ''),
