(367, 1, 1, 'Jasnożółta kurtka z geometrycznymi łatami połączona jest z jeansami o stylowych czerwonych szwach. BABY born Little ma również na sobie szary kapelusz z kapitalnym nadrukiem i czerwone buty. Strój można łatwo założyć i zdjąć. Dodatkowe informacje:  Nr katalogowy:  827918-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 2 lat Kolor:  Czerwony Kolor:  Niebieski Kolor:  Szary Kolor:  Żółty Akcesoria w zestawie:  żółtka kurteczka niebieskie spodnie szara czapka czerwone buciki wieszaczek z kolekcji BABY Born', '', 'baby-born-little-cool-kids-ubranko-dla-lalki-36-cm', '', '', '', 'Baby Born, Little Cool Kids, ubranko dla lalki, 36 cm', '', '', '', ''),
(367, 1, 2, 'Jasnożółta kurtka z geometrycznymi łatami połączona jest z jeansami o stylowych czerwonych szwach. BABY born Little ma również na sobie szary kapelusz z kapitalnym nadrukiem i czerwone buty. Strój można łatwo założyć i zdjąć. Dodatkowe informacje:  Nr katalogowy:  827918-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 2 lat Kolor:  Czerwony Kolor:  Niebieski Kolor:  Szary Kolor:  Żółty Akcesoria w zestawie:  żółtka kurteczka niebieskie spodnie szara czapka czerwone buciki wieszaczek z kolekcji BABY Born', '', 'baby-born-little-cool-kids-ubranko-dla-lalki-36-cm', '', '', '', 'Baby Born, Little Cool Kids, ubranko dla lalki, 36 cm', '', '', '', ''),
(368, 1, 1, 'Te urocze lalki Braylee Bear i Bannon Bear z kolekcji Królewskie Enchantimals zachwycą wszystkich fanów magicznych opowieści. Ubrani w piękne królewskie stroje i dodatki takie jak korony i szarfy są gotowi przemierzać królestwo w poszukiwaniu przygód. Ich dwa misie, Honey i Bowey, także są niezwykle urocze. W zestawie są również dwa prezenty, dzięki czemu są przygotowani na każdą okazję:  bal, urodziny czy wesele. Ten zestaw Enchantimals zachęca do opowiadania historii pełnych królewskiego rozmachu. Aż cztery urocze postacie oznaczają wiele wspaniałej zabawy. Wiek dziecka:  od 4 lat.', '', 'enchantimals-royal-braylee-bannon-zestaw-2-figurek-z-akcesoriami', '', '', '', 'Enchantimals, Royal Braylee & Bannon, zestaw 2 figurek z akcesoriami', '', '', '', ''),
(368, 1, 2, 'Te urocze lalki Braylee Bear i Bannon Bear z kolekcji Królewskie Enchantimals zachwycą wszystkich fanów magicznych opowieści. Ubrani w piękne królewskie stroje i dodatki takie jak korony i szarfy są gotowi przemierzać królestwo w poszukiwaniu przygód. Ich dwa misie, Honey i Bowey, także są niezwykle urocze. W zestawie są również dwa prezenty, dzięki czemu są przygotowani na każdą okazję:  bal, urodziny czy wesele. Ten zestaw Enchantimals zachęca do opowiadania historii pełnych królewskiego rozmachu. Aż cztery urocze postacie oznaczają wiele wspaniałej zabawy. Wiek dziecka:  od 4 lat.', '', 'enchantimals-royal-braylee-bannon-zestaw-2-figurek-z-akcesoriami', '', '', '', 'Enchantimals, Royal Braylee & Bannon, zestaw 2 figurek z akcesoriami', '', '', '', ''),
(369, 1, 1, 'Nauka w szkole Polly Pocket Pollyville to świetna zabawa! Otwórz i rozłóż zestaw, aby zobaczyć 3 poziomy i 7 obszarów zabawy, mikrolalki Polly i Nicolas oraz 12 mikroakcesoriów, które można umieścić w dowolnym miejscu (takich jak torba, gitara, mikrofon, sztaluga, płótno, piłka do koszykówki, biurko, stolik do stołówki, 2 krzesła szkolne, siatka do siatkówki i siedzenia dla widowni). Zorganizuj spotkanie w szkolnej auli, podawaj jedzenie na stołówce i jedz lunch przy stoliku, graj w siatkówkę, koszykówkę lub wspinaj się po linie na sali gimnastycznej, ucz się w klasie (tablica przesuwa w górę i w dół), spędzaj czas na korytarzu z otwieranymi szafkami, graj na pianinie, perkusji czy gitarze w sali muzycznej, baw się na dworze i nie tylko! Powiększaj i zmieniaj swój świat zabawy dzięki pozostałym budynkom i pojazdom z linii Pollyville! Dzieci mogą zebrać wszystkie zestawy, które zapewnią im nieograniczone możliwości zabawy (sprzedawane oddzielnie w zależności od dostępności)! To wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają się uczyć i poznawać nowych przyjaciół w szkole! Wiek dziecka:  od 4 roku życia', '', 'polly-pocket-pollyville-szkola-zestaw-do-zabawy-z-mikrolalkami-i-akcesoriami', '', '', '', 'Polly Pocket, Pollyville, Szkoła, zestaw do zabawy z mikrolalkami i akcesoriami', '', '', '', ''),
