(370, 1, 1, 'Czerwony, biały i zielony to klasyczne kolory Świąt Bożego Narodzenia. Strój BABY born wpisuje się w ten wiecznie zielony trend. Ma na sobie sweterek z norweskimi wzorami i świątecznymi motywami. Na sweterku znajdują się płatki śniegu i choinki oraz kaczka Berta i niedźwiedź Bruno, oboje w świątecznych czapeczkach. Subtelne sztruksowe spodnie w kolorze jodłowej zieleni pasują idealnie. Klasyczna świąteczna czapka zdobi głowę.  Wysokiej jakości ubranka dla lalki marki BABY born. Dla urozmaiconej, różnorodnej i długotrwałej zabawy poprzez zabawę. Bardzo łatwe do zakładania i zdejmowania. Strój BABY born X-MAS 43 cm z sweterkiem, spodniami i czapką. W komplecie z wieszakiem na ubrania. Dodatkowe informacje:   Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Pozostałe parametry:  Sweterek Spodenki Czapeczka świąteczna', '', 'baby-born-x-mas-outfit-ubranka', '', '', '', 'Baby Born, X-Mas Outfit, ubranka', '', '', '', ''),
