(372, 1, 2, 'Smily Play, lalka julka 39 cm w pudełku prezentowym odgrywanie ról 2+ Lalka Julka lubi, kiedy się nią opiekujesz i zabierasz ze sobą na spacery. Miękka lalka jest ubrana w czapkę, szalik, kombinezon z prążkowanymi spodniami oraz różową pikowaną kurteczkę z kapturem, obszytą prążkowanym materiałem w kolorze spodni. Lalka, po naciśnięciu na brzuszek:   Mówi po polsku pełnymi zdaniami  Śpiewa piosenkę  Opowiada bajkę o Złotowłosej i 3 misiach Podczas zabawy lalkami, zachodzą silne procesy sensoryczne, które są niezbędne do prawidłowego rozwoju dziecka. Dziecko, podczas zabawy lalką odbiera w mózgu sygnały, które następnie przetwarza i odpowiada, odpowiednio reagując. Lalki to nierozłączny element dzieciństwa. Zachęcają do aktywnej oraz kreatywnej zabawy, dają również możliwość stworzenia własnego świata. Dzięki nim uczymy się opiekuńczości oraz wrażliwości. Z lalką dziecku łatwiej jest wkroczyć w świat radości, strachu, euforii i smutku. Noszenie, kołysanie, przytulanie lalki przynosi wiele pozytywnych emocji i pozwala na harmonijny rozwój. Poprzez zabawę pobudza rozwój systemów sensorycznych. Wysokość lalki 39 cm Specyfikacja:   Wiek:  24m+  Wymiary produktu:  szer. 20,5 cm., wys. 41 cm., gł. 11 cm.  Baterie:  3 x AG13 dołączone  Bezpieczeństwo:  EN71-1, EN71-2, ENT1-3, EN62115', '', 'smily-play-julka-lalka-39-cm', '', '', '', 'Smily Play, Julka, lalka, 39 cm', '', '', '', ''),
(373, 1, 1, 'Evi uwielbia zwierzęta, więc postanowiła zostać weterynarzem. Teraz uczy się profesjonalnej opieki nad zwierzątkami. Najważniejsze by jej podopieczni byli zdrowi i zadowoleni. Rozkładany ambulans ma otwieraną tylną część, która zamienia ambulans w klinikę weterynaryjną. Klinika zaopatrzona jest w składany stół, wysuwane szufladki, schowek z otwieranymi drzwiczkami oraz ruchomą słuchawkę prysznicową. Dołączone liczne akcesoria można precyzyjnie mocować w rączkach laleczki za pomocą wypustek. Laleczka ma zginane w kolanach nóżki i ruchome nadgarstki. Ubrana jest w turkusowe spodnie i kolorowy fartuch. Przeznaczona dla dziecka powyżej 3. roku życia. Wymiary pojazdu:  około 20x12x10 cm Długość kliniki po rozłożeniu:  ok. 28 cm W zestawie:  lalka Evi, rozkładany pojazd - vet mobile, kotek i piesek, wanienka do mycia zwierzątek, walizka doktora z przyrządami medycznymi:  kroplówką, kołnierzem, inhalatorem, mikroskopem, przenośnym aparatem USG i innymi.', '', 'evi-love-doktor-evi-ambulans-2w1', '', '', '', 'Evi Love, Doktor Evi, Ambulans 2w1', '', '', '', ''),
(373, 1, 2, 'Evi uwielbia zwierzęta, więc postanowiła zostać weterynarzem. Teraz uczy się profesjonalnej opieki nad zwierzątkami. Najważniejsze by jej podopieczni byli zdrowi i zadowoleni. Rozkładany ambulans ma otwieraną tylną część, która zamienia ambulans w klinikę weterynaryjną. Klinika zaopatrzona jest w składany stół, wysuwane szufladki, schowek z otwieranymi drzwiczkami oraz ruchomą słuchawkę prysznicową. Dołączone liczne akcesoria można precyzyjnie mocować w rączkach laleczki za pomocą wypustek. Laleczka ma zginane w kolanach nóżki i ruchome nadgarstki. Ubrana jest w turkusowe spodnie i kolorowy fartuch. Przeznaczona dla dziecka powyżej 3. roku życia. Wymiary pojazdu:  około 20x12x10 cm Długość kliniki po rozłożeniu:  ok. 28 cm W zestawie:  lalka Evi, rozkładany pojazd - vet mobile, kotek i piesek, wanienka do mycia zwierzątek, walizka doktora z przyrządami medycznymi:  kroplówką, kołnierzem, inhalatorem, mikroskopem, przenośnym aparatem USG i innymi.', '', 'evi-love-doktor-evi-ambulans-2w1', '', '', '', 'Evi Love, Doktor Evi, Ambulans 2w1', '', '', '', ''),
(374, 1, 1, 'Lalka Evi z trzema uroczymi szczeniaczkami w koszyczku. W zestawie akcesoria do opieki nad pieskami:  miseczka, butelka i kość. Wysokość lalki:  12 cm.', '', 'evi-love-lalka-ze-szczeniaczkami', '', '', '', 'Evi Love, lalka ze szczeniaczkami', '', '', '', ''),
(374, 1, 2, 'Lalka Evi z trzema uroczymi szczeniaczkami w koszyczku. W zestawie akcesoria do opieki nad pieskami:  miseczka, butelka i kość. Wysokość lalki:  12 cm.', '', 'evi-love-lalka-ze-szczeniaczkami', '', '', '', 'Evi Love, lalka ze szczeniaczkami', '', '', '', ''),
(375, 1, 1, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach. Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Ta lalka wyróżnia się lawendowymi ustami i superdługimi włosami ozdobionymi błyszczącymi spinkami. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się metaliczna srebrzysta kurtka z detalami z fioletowego futerka, dopasowana do kurtki spódniczka, bluzka w serduszka i fioletowe buciki ze sprzączkami. Torebka w kształcie kawałka pizzy, półprzezroczyste miniokulary przeciwsłoneczne i mnóstwo biżuterii zachęca do wyrażania swojego stylu i kreatywnej zabawy. Jej mały dalmatyńczyk też jest niezwykle modny - ma serduszkowe okulary przeciwsłoneczne, różową kokardkę i \"smartfon\". Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-15', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 15', '', '', '', ''),
(375, 1, 2, 'Lalki Barbie Extra prezentują unikalny i odważny EKSTRA styl w modnych strojach o wyrazistych kolorach. Lalki Barbie Extra uwielbiają zabawę z modą, mają więc dodatkowe akcesoria, w tym ubranka, dodatki, zwierzątko i akcesoria dla zwierzątka. Ta lalka wyróżnia się lawendowymi ustami i superdługimi włosami ozdobionymi błyszczącymi spinkami. Lalka wyraża swój odważny styl wyjątkowym strojem, na który składają się metaliczna srebrzysta kurtka z detalami z fioletowego futerka, dopasowana do kurtki spódniczka, bluzka w serduszka i fioletowe buciki ze sprzączkami. Torebka w kształcie kawałka pizzy, półprzezroczyste miniokulary przeciwsłoneczne i mnóstwo biżuterii zachęca do wyrażania swojego stylu i kreatywnej zabawy. Jej mały dalmatyńczyk też jest niezwykle modny - ma serduszkowe okulary przeciwsłoneczne, różową kokardkę i \"smartfon\". Kolory i elementy dekoracyjne mogą się różnić. Lalki Barbie Extra to świetny prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza tych, które uwielbiają zadawać szyku.', '', 'barbie-extra-moda-lalka-z-akcesoriami-nr-15', '', '', '', 'Barbie, Extra Moda, lalka z akcesoriami, nr 15', '', '', '', ''),
