(376, 1, 2, 'Lalka winylowa z funkcją picia i siusiania oraz akcesoriami. Akcesoria ilość:  4 szt. Wymiary:  30 cm Wiek:  od 3 lat', '', 'simba-new-born-baby-lalka-bobas-30-cm', '', '', '', 'Simba, New Born Baby, lalka bobas, 30 cm', '', '', '', ''),
(377, 1, 1, 'Wygląda na to, że Annabell jest bardzo spragniona. Jak tylko włożysz jej butelkę do ust i trzymasz ją pod kątem, mleko w środku zaczyna spływać w dół i w dół. Ale butelka również napełnia się nowym mlekiem jak za dotknięciem czarodziejskiej różdżki. Butelkę zdobi ulubiona owca Baby Annabell, która jest tak samo zachwycona mlekiem jak mały smakosz. Oryginalny dodatek do lalki z logo Baby Annabell. Wysokiej jakości akcesoria pobudzają wyobraźnię i oferują nowe możliwości oraz bodźce do zabawy. Dodatkowe informacje:  Nr katalogowy:  706404-116721 Marka:  Baby Annabell Rodzaj:  Butelki Wymagania wiekowe:  od 3 lat', '', 'baby-annabell-butelka', '', '', '', 'Baby Annabell, butelka', '', '', '', ''),
(377, 1, 2, 'Wygląda na to, że Annabell jest bardzo spragniona. Jak tylko włożysz jej butelkę do ust i trzymasz ją pod kątem, mleko w środku zaczyna spływać w dół i w dół. Ale butelka również napełnia się nowym mlekiem jak za dotknięciem czarodziejskiej różdżki. Butelkę zdobi ulubiona owca Baby Annabell, która jest tak samo zachwycona mlekiem jak mały smakosz. Oryginalny dodatek do lalki z logo Baby Annabell. Wysokiej jakości akcesoria pobudzają wyobraźnię i oferują nowe możliwości oraz bodźce do zabawy. Dodatkowe informacje:  Nr katalogowy:  706404-116721 Marka:  Baby Annabell Rodzaj:  Butelki Wymagania wiekowe:  od 3 lat', '', 'baby-annabell-butelka', '', '', '', 'Baby Annabell, butelka', '', '', '', ''),
(378, 1, 1, 'Odkryj magiczną moc przyjaźni i przyrody dzięki tym uroczym zestawom Enchantimals z rodzinką zwierzątek! W zestawie znajduje się jedna lalka Enchantimals (15 cm) oraz figurki zwierzątek. Lalki ubrane są w tematyczne stylizacje - modne, wygodne i praktyczne! Zwierzęcy przyjaciele mają urocze detale, które zachęcają do puszczenia wodzy fantazji. Zbierz wszystkie lalki, aby stworzyć swój własny świat Enchantimals!  Wiek dziecka:  powyżej 4 roku życia.', '', 'enchantimals-rodzina-pristina-polar-bear-zestaw-z-lalka-i-zwierzakami', '', '', '', 'Enchantimals, Rodzina Pristina Polar Bear, zestaw z lalką i zwierzakami', '', '', '', ''),
(378, 1, 2, 'Odkryj magiczną moc przyjaźni i przyrody dzięki tym uroczym zestawom Enchantimals z rodzinką zwierzątek! W zestawie znajduje się jedna lalka Enchantimals (15 cm) oraz figurki zwierzątek. Lalki ubrane są w tematyczne stylizacje - modne, wygodne i praktyczne! Zwierzęcy przyjaciele mają urocze detale, które zachęcają do puszczenia wodzy fantazji. Zbierz wszystkie lalki, aby stworzyć swój własny świat Enchantimals!  Wiek dziecka:  powyżej 4 roku życia.', '', 'enchantimals-rodzina-pristina-polar-bear-zestaw-z-lalka-i-zwierzakami', '', '', '', 'Enchantimals, Rodzina Pristina Polar Bear, zestaw z lalką i zwierzakami', '', '', '', ''),
(379, 1, 1, 'Zestaw do stylizacji lalki. Wybierz dodatki i zmień strój swojej lalce! W zestawie:  sukienka i 11 dodatków do stroju - buty, torebki, okulary, biżuteria. Wymiary opakowania:  25 x 3 x 26.5 cm Wiek:  3+', '', 'askato-sukienka-z-akcesoriami-dla-lalek', '', '', '', 'Askato, sukienka z akcesoriami dla lalek', '', '', '', ''),
(379, 1, 2, 'Zestaw do stylizacji lalki. Wybierz dodatki i zmień strój swojej lalce! W zestawie:  sukienka i 11 dodatków do stroju - buty, torebki, okulary, biżuteria. Wymiary opakowania:  25 x 3 x 26.5 cm Wiek:  3+', '', 'askato-sukienka-z-akcesoriami-dla-lalek', '', '', '', 'Askato, sukienka z akcesoriami dla lalek', '', '', '', ''),
(380, 1, 1, 'Mała dziewczynka Baby Born wciąż nie chce spać. Przecież jest jeszcze tak widno. Mamusia i tatuś znają pewną sztuczkę:  wystarczy obrócić smoczek w buzi lali, żeby zamknęły się jej śliczne oczęta – i już jest ciemno. Gdy przekręcasz smoczek, oczka lalki zamykają się lub otwierają, bez względu na to w jakiej jest pozycji. Jej oczka są takie śpiące:  jeśli położysz ją na plecach bez smoczka, oczka zamkną się same. Niektóre czynności tak bardzo ją bawią. Uwielbia spać, kocha jeść i oczywiście nie może doczekać się kąpieli. Chętnie pije wodę z butelki. Siusia w pieluchę albo do nocnika. Płacze prawdziwymi łzami. Nie tylko pije wodę. Baby Born potrafi jeść owsiankę. A potem to już tylko czas na kupkę. Ma ruchome rączki, nóżki i główkę. Łatwo jest ją rozebrać, a potem ubrać w te wszystkie modne ciuszki. Ciało bobaska jest takie miękkie i przyjemne w dotyku.  Podstawowy zestaw zawiera 10 dodatków współgrających z funkcjami zabawki, do kompletu różowe body i czapeczka. Baby Born Magic:  10 funkcji – niekończąca się zabawa. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Smoczek pasuje do wszystkich lalek Baby Born w rozmiarze 43 cm. Funkcja śpiących oczek sterowanych obrotem smoczka działa tylko w serii Baby Born Magic. Zabawka nie wymaga baterii. Zawartość zestawu:  lalka Baby Born Magic Girl 43 cm z body i czapeczką, 1 nocnik, 1 pieluszka, 1 talerzyk z łyżką, 1 porcja owsianki, 1 butelka, 1 magiczny smoczek, 1 akt urodzenia, 1 bransoletka przyjaźni dla dziecka i dla lalki.', '', 'baby-born-magiczna-dziewczyna-lalka-interaktywna-43-cm', '', '', '', 'Baby Born, Magiczna dziewczyna, lalka interaktywna, 43 cm', '', '', '', ''),
(380, 1, 2, 'Mała dziewczynka Baby Born wciąż nie chce spać. Przecież jest jeszcze tak widno. Mamusia i tatuś znają pewną sztuczkę:  wystarczy obrócić smoczek w buzi lali, żeby zamknęły się jej śliczne oczęta – i już jest ciemno. Gdy przekręcasz smoczek, oczka lalki zamykają się lub otwierają, bez względu na to w jakiej jest pozycji. Jej oczka są takie śpiące:  jeśli położysz ją na plecach bez smoczka, oczka zamkną się same. Niektóre czynności tak bardzo ją bawią. Uwielbia spać, kocha jeść i oczywiście nie może doczekać się kąpieli. Chętnie pije wodę z butelki. Siusia w pieluchę albo do nocnika. Płacze prawdziwymi łzami. Nie tylko pije wodę. Baby Born potrafi jeść owsiankę. A potem to już tylko czas na kupkę. Ma ruchome rączki, nóżki i główkę. Łatwo jest ją rozebrać, a potem ubrać w te wszystkie modne ciuszki. Ciało bobaska jest takie miękkie i przyjemne w dotyku.  Podstawowy zestaw zawiera 10 dodatków współgrających z funkcjami zabawki, do kompletu różowe body i czapeczka. Baby Born Magic:  10 funkcji – niekończąca się zabawa. Zabawa zestawami Baby Born z podziałem na role pobudza dziecięcą wyobraźnię. Dowiedziono, że ten rodzaj zabawy sprzyja rozwojowi kompetencji społecznych i wartości, takich jak odpowiedzialność, zdolność komunikacji i empatia. Smoczek pasuje do wszystkich lalek Baby Born w rozmiarze 43 cm. Funkcja śpiących oczek sterowanych obrotem smoczka działa tylko w serii Baby Born Magic. Zabawka nie wymaga baterii. Zawartość zestawu:  lalka Baby Born Magic Girl 43 cm z body i czapeczką, 1 nocnik, 1 pieluszka, 1 talerzyk z łyżką, 1 porcja owsianki, 1 butelka, 1 magiczny smoczek, 1 akt urodzenia, 1 bransoletka przyjaźni dla dziecka i dla lalki.', '', 'baby-born-magiczna-dziewczyna-lalka-interaktywna-43-cm', '', '', '', 'Baby Born, Magiczna dziewczyna, lalka interaktywna, 43 cm', '', '', '', ''),
(381, 1, 1, 'Baby Annabell uwielbia podróże, a dla ich ułatwienia posiada różne akcesoria. Lalka może teraz bezpiecznie podróżować razem ze swoją \"małą mamusią\" w swoim foteliku samochodowym.  Fotelik samochodowy pozwoli na bezpieczną podróż w dowolne miejsce. Wytrzymałe siedzisko z różowym pokrowcem, zdobionym motywem owieczki, ma własny system trzypunktowych pasów bezpieczeństwa. Siedzenie jest mocowane do samochodu za pomocą normalnego pasa bezpieczeństwa. Lalka nie jest dołączona do zestawu. Zabawka przeznaczona dla dzieci:  3+.', '', 'baby-annabell-fotelik-samochodowy', '', '', '', 'Baby Annabell, fotelik samochodowy', '', '', '', ''),
(381, 1, 2, 'Baby Annabell uwielbia podróże, a dla ich ułatwienia posiada różne akcesoria. Lalka może teraz bezpiecznie podróżować razem ze swoją \"małą mamusią\" w swoim foteliku samochodowym.  Fotelik samochodowy pozwoli na bezpieczną podróż w dowolne miejsce. Wytrzymałe siedzisko z różowym pokrowcem, zdobionym motywem owieczki, ma własny system trzypunktowych pasów bezpieczeństwa. Siedzenie jest mocowane do samochodu za pomocą normalnego pasa bezpieczeństwa. Lalka nie jest dołączona do zestawu. Zabawka przeznaczona dla dzieci:  3+.', '', 'baby-annabell-fotelik-samochodowy', '', '', '', 'Baby Annabell, fotelik samochodowy', '', '', '', ''),
