(384, 1, 1, 'Odkryj magiczną moc przyjaźni i przyrody dzięki tym uroczym zestawom Enchantimals z rodzinką zwierzątek! W zestawie znajduje się jedna lalka Enchantimals (15 cm) oraz figurki zwierzątek. Lalki ubrane są w tematyczne stylizacje - modne, wygodne i praktyczne! Zwierzęcy przyjaciele mają urocze detale, które zachęcają do puszczenia wodzy fantazji. Zbierz wszystkie lalki, aby stworzyć swój własny świat Enchantimals! Wiek dziecka:  powyżej 4 roku życia.', '', 'enchantimals-rodzina-ofelia-ostrich-zestaw-z-lalka-i-zwierzakami', '', '', '', 'Enchantimals, Rodzina Ofelia Ostrich, zestaw z lalką i zwierzakami', '', '', '', ''),
(384, 1, 2, 'Odkryj magiczną moc przyjaźni i przyrody dzięki tym uroczym zestawom Enchantimals z rodzinką zwierzątek! W zestawie znajduje się jedna lalka Enchantimals (15 cm) oraz figurki zwierzątek. Lalki ubrane są w tematyczne stylizacje - modne, wygodne i praktyczne! Zwierzęcy przyjaciele mają urocze detale, które zachęcają do puszczenia wodzy fantazji. Zbierz wszystkie lalki, aby stworzyć swój własny świat Enchantimals! Wiek dziecka:  powyżej 4 roku życia.', '', 'enchantimals-rodzina-ofelia-ostrich-zestaw-z-lalka-i-zwierzakami', '', '', '', 'Enchantimals, Rodzina Ofelia Ostrich, zestaw z lalką i zwierzakami', '', '', '', ''),
(385, 1, 1, 'Baby Born wyprawia przyjęcie na trzydziesty jubileusz. Goście mają stawić się w przebraniach. Chłopczyk uwielbia superbohaterów, nic więc dziwnego, że wystąpił jako batman, tyle że w psiej wersji, lepiej znanej jako batdog. Z początku nadal nosi maskę na nosie. Uuups! I tak każdy go w chwilę rozpoznał. Ściągnął więc maskę i udekorował nią portret pieska Bello na swojej niebieskiej bluzie z kapturem. Na nogawkach spodni widnieją błyskawice teraz wygląda jak prawdziwy superbohater. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Gość Baby Born Happy Birthday 43 cm. W zestawie koszula, spodnie i wieszak na ubrania.', '', 'baby-born-gosc-urodzinowy-ubranka-dla-lalki-43-cm', '', '', '', 'Baby Born, Gość urodzinowy, ubranka dla lalki 43 cm', '', '', '', ''),
(385, 1, 2, 'Baby Born wyprawia przyjęcie na trzydziesty jubileusz. Goście mają stawić się w przebraniach. Chłopczyk uwielbia superbohaterów, nic więc dziwnego, że wystąpił jako batman, tyle że w psiej wersji, lepiej znanej jako batdog. Z początku nadal nosi maskę na nosie. Uuups! I tak każdy go w chwilę rozpoznał. Ściągnął więc maskę i udekorował nią portret pieska Bello na swojej niebieskiej bluzie z kapturem. Na nogawkach spodni widnieją błyskawice teraz wygląda jak prawdziwy superbohater. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Gość Baby Born Happy Birthday 43 cm. W zestawie koszula, spodnie i wieszak na ubrania.', '', 'baby-born-gosc-urodzinowy-ubranka-dla-lalki-43-cm', '', '', '', 'Baby Born, Gość urodzinowy, ubranka dla lalki 43 cm', '', '', '', ''),
(386, 1, 1, 'Podczas każdego przyjęcia jest taki moment, kiedy robi się miła atmosfera. Jest to dobry moment, żeby założyć coś wygodniejszego. Podczas imprezy z okazji trzydziestolecia lalki Baby Born śpioszki mają kolor filetowo-niebieski. Pora się wyluzować. Tylko jak? Może film o astronautach, czy raczej wizyta w planetarium? W każdym razie musi być jakiś motyw kosmiczny - taki z gwiazdami. Przecież na śpioszkach widnieją galaktyczne wzory. Łaty na rękawach są nie z tej ziemi. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. W zestawie wieszak na ubrania. Wymiary opakowania:  46 x 18 x 1 cm Wiek:  3+. Uwaga! Produkt wysyłany losowo.', '', 'baby-born-spioszki-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, śpioszki, ubranko dla lalki, 43 cm', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(386, 1, 2, 'Podczas każdego przyjęcia jest taki moment, kiedy robi się miła atmosfera. Jest to dobry moment, żeby założyć coś wygodniejszego. Podczas imprezy z okazji trzydziestolecia lalki Baby Born śpioszki mają kolor filetowo-niebieski. Pora się wyluzować. Tylko jak? Może film o astronautach, czy raczej wizyta w planetarium? W każdym razie musi być jakiś motyw kosmiczny - taki z gwiazdami. Przecież na śpioszkach widnieją galaktyczne wzory. Łaty na rękawach są nie z tej ziemi. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. W zestawie wieszak na ubrania. Wymiary opakowania:  46 x 18 x 1 cm Wiek:  3+. Uwaga! Produkt wysyłany losowo.', '', 'baby-born-spioszki-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, śpioszki, ubranko dla lalki, 43 cm', '', '', '', ''),
(387, 1, 1, 'Poznaj siostrzyczki Enchantimals! Urocze i sympatyczne siostry Enchantimals - starsza (15 cm) i młodsza (10 cm) - uwielbiają robić wszystko razem! Do wyboru masz zestawy zawierające siostry króliczki, liski, jelonki, pawie lub skunksiki. Lalki można ustawić tak, aby trzymały się za rączki, co podkreśla ich wyjątkową siostrzaną więź. Każda lalka ma też do towarzystwa urocze zwierzątko. Zestaw z 2 lalkami i 2 figurkami zwierzątek zapewnia mnóstwo wesołej zabawy w stylu Enchantimals dla najmłodszych! Lalki są ubrane w pasujące do siebie stroje z wyjmowanymi akcesoriami, które umożliwiają zabawę modą. Doskonały prezent dla dzieci od 4 roku życia, który zachęca do zabawy z wyobraźnią.', '', 'enchantimals-sage-i-sabella-skunk-zestaw-z-2-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Sage i Sabella Skunk, zestaw z 2 lalkami i zwierzątkami', '', '', '', ''),
(387, 1, 2, 'Poznaj siostrzyczki Enchantimals! Urocze i sympatyczne siostry Enchantimals - starsza (15 cm) i młodsza (10 cm) - uwielbiają robić wszystko razem! Do wyboru masz zestawy zawierające siostry króliczki, liski, jelonki, pawie lub skunksiki. Lalki można ustawić tak, aby trzymały się za rączki, co podkreśla ich wyjątkową siostrzaną więź. Każda lalka ma też do towarzystwa urocze zwierzątko. Zestaw z 2 lalkami i 2 figurkami zwierzątek zapewnia mnóstwo wesołej zabawy w stylu Enchantimals dla najmłodszych! Lalki są ubrane w pasujące do siebie stroje z wyjmowanymi akcesoriami, które umożliwiają zabawę modą. Doskonały prezent dla dzieci od 4 roku życia, który zachęca do zabawy z wyobraźnią.', '', 'enchantimals-sage-i-sabella-skunk-zestaw-z-2-lalkami-i-zwierzatkami', '', '', '', 'Enchantimals, Sage i Sabella Skunk, zestaw z 2 lalkami i zwierzątkami', '', '', '', ''),
(388, 1, 1, 'To moooooja różdżka Nie, to moje berło! BABY born i jej siostrzyczka kłócą się o insygnia władzy królewskiej i magicznych mocy. Dla BABY born najważniejszy jest czarodziejski pył   i wiara w magiczną moc zaklęć. Jej Siostrzyczce głównie chodzi o wydawanie poleceń   i posłuszeństwo poddanych niech tańczą, jak im każę! No właśnie, tylko że obie kochają tańczyć. Suknia księżniczki w kolorach tęczy wspaniale wiruje podczas piruetów a jej tiulowy wierzch magicznie skrzy się brokatem. Asymetryczny krój sprawia wrażenie, jakby lalka miała na sobie szal. Złote sandałki doskonale komponują się z kokardą wokół talii. Całości dopełnia opaska na włosy z jednorożcem, koroną, uroczymi uszkami i przypinkami.  Wysokiej jakości ubranka do oryginalnych lalek BABY born.  Dla ciekawszej, różnorodnej i niekończącej się zabawy.  Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe.  BABY born Księżniczka Fantasy Deluxe 43 cm z suknią i bucikami. W zestawie opaska na włosy z przypinkami i berło. Dodatkowe informacje:  Nr katalogowy:  832028-116721', '', 'zapf-baby-born-sukienka-ksiezniczki', '', '', '', 'Zapf, Baby Born, sukienka księżniczki', '', '', '', ''),
