(389, 1, 1, 'W rajstopach BABY born musi czuć się jak w drugiej skórze! Wygodne rajstopy w dwupakach wykonane są z miękkiej wełny i zapewniają pełną swobodę ruchów. Zabawę w ubieranie się umilają najlepsi przyjaciele BABY born:  Pies Bello, Króliczek Benno, Kaczka Berta i Niedźwiadek Bruno. Różne wzory. Cena dotyczy jednego 2-paku. Produkt wysyłany losowo. Dodatkowe informacje:  Nr katalogowy:  828236-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat', '', 'baby-born-rajstopki-2-szt', '', '', '', 'Baby Born, rajstopki, 2 szt.', '', '', '', ''),
(389, 1, 2, 'W rajstopach BABY born musi czuć się jak w drugiej skórze! Wygodne rajstopy w dwupakach wykonane są z miękkiej wełny i zapewniają pełną swobodę ruchów. Zabawę w ubieranie się umilają najlepsi przyjaciele BABY born:  Pies Bello, Króliczek Benno, Kaczka Berta i Niedźwiadek Bruno. Różne wzory. Cena dotyczy jednego 2-paku. Produkt wysyłany losowo. Dodatkowe informacje:  Nr katalogowy:  828236-116720 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat', '', 'baby-born-rajstopki-2-szt', '', '', '', 'Baby Born, rajstopki, 2 szt.', '', '', '', ''),
(390, 1, 1, 'Zestaw do stylizacji lalek Wybierz strój i stwórz nowy look swojej lalki. W zestawie:  2 sukienki + 2 dodatki (torebka i naszyjnik). Wymiary opakowania:  23 x 2.5 x 23 cm Wiek:  3+', '', 'askato-sukienka-z-akcesoriami-dla-lalek-zestaw-2-szt', '', '', '', 'Askato, sukienka z akcesoriami dla lalek, zestaw, 2 szt.', '', '', '', ''),
(390, 1, 2, 'Zestaw do stylizacji lalek Wybierz strój i stwórz nowy look swojej lalki. W zestawie:  2 sukienki + 2 dodatki (torebka i naszyjnik). Wymiary opakowania:  23 x 2.5 x 23 cm Wiek:  3+', '', 'askato-sukienka-z-akcesoriami-dla-lalek-zestaw-2-szt', '', '', '', 'Askato, sukienka z akcesoriami dla lalek, zestaw, 2 szt.', '', '', '', ''),
(391, 1, 1, 'Przygotuj się na przyjęcie urodzinowe z zestawem do zabawy Tort urodzinowy Polly Pocket! Z tym uroczym zestawem w kształcie dwuwarstwowego tortu (z opakowaniem przypominającym pudełko na tort) czeka Cię aż 7 dni urodzinowych niespodzianek (i 25 elementów do zabawy). Przez cały tydzień przed urodzinami możesz otwierać po jednej przegródce, aby znajdować wyjątkowe niespodzianki. W przegródce 6 jest żółty przycisk serduszka. Gdy go naciśniesz, pokaże się druga warstwa \"tortu\", w której skrywa się ostatnia, najwspanialsza niespodzianka:  karuzela z jednorożcami. Tematyczne obszary zabawy to między innymi garderoba, sala imprezowa i stos prezentów. Wiek dziecka:  od 4 lat.', '', 'polly-pocket-tort-urodzinowy-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Tort urodzinowy, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(391, 1, 2, 'Przygotuj się na przyjęcie urodzinowe z zestawem do zabawy Tort urodzinowy Polly Pocket! Z tym uroczym zestawem w kształcie dwuwarstwowego tortu (z opakowaniem przypominającym pudełko na tort) czeka Cię aż 7 dni urodzinowych niespodzianek (i 25 elementów do zabawy). Przez cały tydzień przed urodzinami możesz otwierać po jednej przegródce, aby znajdować wyjątkowe niespodzianki. W przegródce 6 jest żółty przycisk serduszka. Gdy go naciśniesz, pokaże się druga warstwa \"tortu\", w której skrywa się ostatnia, najwspanialsza niespodzianka:  karuzela z jednorożcami. Tematyczne obszary zabawy to między innymi garderoba, sala imprezowa i stos prezentów. Wiek dziecka:  od 4 lat.', '', 'polly-pocket-tort-urodzinowy-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Tort urodzinowy, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(392, 1, 1, 'Zestaw kosemtyków 4 cz. Mini zestaw do makijażu w pudełku z motywem róży. Świetna zabawa dla każdej początkującej makijażystki! W środku znajdziesz 3 poziomy z różnymi kosmetykami. Złącz je razem, a stworzą urocze pudełko – kwiat. Zawartość:  cienie do powiek pomadka błyszczyki sztuczne paznokcie naklejki do paznokci Do użytku pod bezpośrednim nadzorem osoby dorosłej.<br />Zaleca się przetestowanie małej ilości produktu na skórze przed rozpoczęciem zabawy. W przypadku wystąpienia reakcji alergicznej należy bezzwłocznie zaprzestać używania. Specyfikacja:  Dystrybutor:  Anek Zabawki Kod produktu:  SP83795 Wymiary pudełka:  23x23,2x6,7 cm Przeznaczone dla dzieci od 3 lat', '', 'smily-play-zestaw-kosmetykow-kwiaty-4-cz', '', '', '', 'Smily Play, zestaw kosmetyków, kwiaty, 4 cz.', '', '', '', ''),
(392, 1, 2, 'Zestaw kosemtyków 4 cz. Mini zestaw do makijażu w pudełku z motywem róży. Świetna zabawa dla każdej początkującej makijażystki! W środku znajdziesz 3 poziomy z różnymi kosmetykami. Złącz je razem, a stworzą urocze pudełko – kwiat. Zawartość:  cienie do powiek pomadka błyszczyki sztuczne paznokcie naklejki do paznokci Do użytku pod bezpośrednim nadzorem osoby dorosłej.<br />Zaleca się przetestowanie małej ilości produktu na skórze przed rozpoczęciem zabawy. W przypadku wystąpienia reakcji alergicznej należy bezzwłocznie zaprzestać używania. Specyfikacja:  Dystrybutor:  Anek Zabawki Kod produktu:  SP83795 Wymiary pudełka:  23x23,2x6,7 cm Przeznaczone dla dzieci od 3 lat', '', 'smily-play-zestaw-kosmetykow-kwiaty-4-cz', '', '', '', 'Smily Play, zestaw kosmetyków, kwiaty, 4 cz.', '', '', '', ''),
(393, 1, 1, 'Cienie do powiek. Wiek:  3+ Wymiary opakowania:  25.5x6x27 cm', '', 'askato-kosmetyki-dla-lalek-babeczka-podwojna-cienie-do-powiek', '', '', '', 'Askato, kosmetyki dla lalek, babeczka, podwójna cienie do powiek', '', '', '', ''),
(393, 1, 2, 'Cienie do powiek. Wiek:  3+ Wymiary opakowania:  25.5x6x27 cm', '', 'askato-kosmetyki-dla-lalek-babeczka-podwojna-cienie-do-powiek', '', '', '', 'Askato, kosmetyki dla lalek, babeczka, podwójna cienie do powiek', '', '', '', ''),
(394, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Karma Nichols. Jej ulubionym kolorem jest neonowy zielony. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Karma zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ma elegancki, luksusowy styl, ponieważ zawsze jest w centrum uwagi. Wraz z laleczką znajdziesz dwa podkoszulki na ramiączkach, dwie spódnice, kurtkę z siateczki, 2 pary modnych szpilek i nie tylko. Zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-karma-nichols-lalka-modowa', '', '', '', 'Rainbow High, Karma Nichols, lalka modowa', '', '', '', ''),
(394, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Karma Nichols. Jej ulubionym kolorem jest neonowy zielony. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Karma zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ma elegancki, luksusowy styl, ponieważ zawsze jest w centrum uwagi. Wraz z laleczką znajdziesz dwa podkoszulki na ramiączkach, dwie spódnice, kurtkę z siateczki, 2 pary modnych szpilek i nie tylko. Zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-karma-nichols-lalka-modowa', '', '', '', 'Rainbow High, Karma Nichols, lalka modowa', '', '', '', ''),
(395, 1, 1, 'Odkryj magiczną moc przyjaźni i przyrody dzięki tym uroczym zestawom Enchantimals z rodzinką zwierzątek! W zestawie znajduje się jedna lalka Enchantimals (15 cm) oraz figurki zwierzątek. Lalki ubrane są w tematyczne stylizacje - modne, wygodne i praktyczne! Zwierzęcy przyjaciele mają urocze detale, które zachęcają do puszczenia wodzy fantazji. Zbierz wszystkie lalki, aby stworzyć swój własny świat Enchantimals! Wiek dziecka:  powyżej 4 roku życia.', '', 'enchantimals-rodzina-deanna-dragon-zestaw-z-lalka-i-zwierzakami', '', '', '', 'Enchantimals, Rodzina Deanna Dragon, zestaw z lalką i zwierzakami', '', '', '', ''),
(395, 1, 2, 'Odkryj magiczną moc przyjaźni i przyrody dzięki tym uroczym zestawom Enchantimals z rodzinką zwierzątek! W zestawie znajduje się jedna lalka Enchantimals (15 cm) oraz figurki zwierzątek. Lalki ubrane są w tematyczne stylizacje - modne, wygodne i praktyczne! Zwierzęcy przyjaciele mają urocze detale, które zachęcają do puszczenia wodzy fantazji. Zbierz wszystkie lalki, aby stworzyć swój własny świat Enchantimals! Wiek dziecka:  powyżej 4 roku życia.', '', 'enchantimals-rodzina-deanna-dragon-zestaw-z-lalka-i-zwierzakami', '', '', '', 'Enchantimals, Rodzina Deanna Dragon, zestaw z lalką i zwierzakami', '', '', '', ''),
(396, 1, 1, 'Baby Born Happy Birthday - magiczny smoczek interaktywny dla lalek 43 cm. Smoczek z dźwiękami ssania i świecącymi zawieszkami. Baby Born jeszcze nie ochłonęła po przyjęciu urodzinowym. Ostatecznie trzydziestolecie istnienia to wyjątkowa okazja. Żeby zasnąć, będzie potrzebować interaktywnego smoczka. Wystarczy obrócić smoczek i dzidzia zamknie oczka. Żeby to było takie proste z prawdziwymi dzidziusiami... Księżniczka jubilatka jest szczęśliwa, że tylu gości przybyło na przyjęcie. Na wstążeczce od smoczka również widnieje napis happy - szczęśliwa. Obrazek na smoczku można wymieniać, jest podświetlany. Jak tylko smoczek trafia do jej buzi, od razu słychać dźwięki ssania. Do smoczka za pomocą klipsa można doczepić kolorową kaczuszkę. Kolorowych snów! Wysokiej jakości akcesoria do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Smoczek pasuje do wszystkich lalek Baby Born w rozmiarze 43 cm. Funkcja śpiących oczek sterowanych obrotem smoczka działa tylko w serii Baby Born Magic. Zabawka wymaga baterii (w zestawie). Magiczny smoczek interaktywny BABY born Happy Birthday 43 cm z efektami dźwiękowymi  i świetlnymi. Marka:  Baby Born Rodzaj:  Smoczki Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Produkt na baterie:  Tak Baterie w zestawie:  Tak Zasilanie:  Bateria LR44', '', 'baby-born-zestaw-urodzinowy-smoczek-dla-lalki', '', '', '', 'Baby Born, Zestaw urodzinowy, smoczek dla lalki', '', '', '', ''),
