(397, 1, 1, 'Udekoruj pokój godny prawdziwej księżniczki z zabawką My Little Pony Przemiana Królewskiej Komnaty Księżniczki Pipp! Spójrz, jak specjalny marker odkrywa magiczne, królewskie wzory ukryte na akcesoriach. Zestaw zawiera figurkę Pipp Petals i inspirowane postaciami akcesoria do urządzenia wymarzonej komnaty. Niech pokój wygląda tak, aby Księżniczka Pipp już za chwilę mogła pozdrawiać z niego swoich fanów. Wiek dziecka:  od 5 lat', '', 'my-little-pony-przemiana-krolewskiej-komnaty-zestaw-z-kucykiem', '', '', '', 'My Little Pony, Przemiana królewskiej komnaty, zestaw z kucykiem', '', '', '', ''),
(397, 1, 2, 'Udekoruj pokój godny prawdziwej księżniczki z zabawką My Little Pony Przemiana Królewskiej Komnaty Księżniczki Pipp! Spójrz, jak specjalny marker odkrywa magiczne, królewskie wzory ukryte na akcesoriach. Zestaw zawiera figurkę Pipp Petals i inspirowane postaciami akcesoria do urządzenia wymarzonej komnaty. Niech pokój wygląda tak, aby Księżniczka Pipp już za chwilę mogła pozdrawiać z niego swoich fanów. Wiek dziecka:  od 5 lat', '', 'my-little-pony-przemiana-krolewskiej-komnaty-zestaw-z-kucykiem', '', '', '', 'My Little Pony, Przemiana królewskiej komnaty, zestaw z kucykiem', '', '', '', ''),
(398, 1, 1, 'Dwa urocze stroje dla małych letnich dzieci. Mała Annabell i Mały Aleksander nie mogą się doczekać wakacji. Czy to na wsi, w górach, czy nad morzem, te dwa zestawy ubrań są idealnymi towarzyszami wakacji. Koszulka ogrodniczki i zabawna koszula są idealne do uprawiania turystyki pieszej. 1, 2, 3 i poza nimi idą w dość szybkim tempie. Sukienka ze zintegrowaną koszulą z długimi rękawami jest idealna do zwiedzania nowego miasta, a urocze czapki chronią główki lalek przed słońcem. Różne wzory. Cena dotyczy jednego stroju. Produkt wysyłany losowo Dodatkowe informacje:  Nr katalogowy:  702994-116720 Marka:  Baby Annabell Rodzaj:  Ubranka Wymagania wiekowe:  od 1 lat Kolor:  Niebieski Kolor:  Różowy Akcesoria w zestawie:  Urocza, wygodna sukienka z bluzką z długim rękawem 2x czapeczka/kapelusz 2x wieszaczek z kolekcji Baby Annabell     Urocze, wygodne ogrodniczki z bluzką z długim rękawem', '', 'baby-annabell-wygodne-ubranko-dla-lalki-36-cm', '', '', '', 'Baby Annabell, wygodne ubranko dla lalki, 36 cm', '', '', '', ''),
