(399, 1, 1, 'Przedstawiamy L.O.L. Surprise Hair Hair Hair! Poznaj 6 laleczek z pięknymi włosami i odpakuj aż 10 ukrytych niespodzianek, w tym akcesoria modowe oraz fryzjerskie. Pudełko z okienkiem Lalka LOL Surprise z włosami Uwaga. Produkt wysyłany losowo.', '', 'lol-surprise-hair-hair-hair-tots-laleczka-niespodzianka', '', '', '', 'L.O.L. Surprise, Hair Hair Hair Tots, laleczka niespodzianka', '', '', '', ''),
(399, 1, 2, 'Przedstawiamy L.O.L. Surprise Hair Hair Hair! Poznaj 6 laleczek z pięknymi włosami i odpakuj aż 10 ukrytych niespodzianek, w tym akcesoria modowe oraz fryzjerskie. Pudełko z okienkiem Lalka LOL Surprise z włosami Uwaga. Produkt wysyłany losowo.', '', 'lol-surprise-hair-hair-hair-tots-laleczka-niespodzianka', '', '', '', 'L.O.L. Surprise, Hair Hair Hair Tots, laleczka niespodzianka', '', '', '', ''),
(400, 1, 1, 'Baw się z rodzinką świnek morskich Enchantimals z kolekcji Miejskie przygody. W zestawie są lalka Glee Guinea Pig (15 cm) i 4 figurki świnek morskich. Aby zabawa była jeszcze lepsza, lalka Glee Guinea Pig ma zdejmowaną spódniczkę, opaskę na głowę, okulary i buciki. Zawsze towarzyszą jej świnki morskie, a każda z nich jest równie urocza. Lalka oraz cztery figurki ze świata Enchantimals dostarczą mnóstwa inspiracji do wymyślania własnych przygód! Wspaniały prezent dla dzieci od 4 roku życia, zachęca do zabawy z wyobraźnią.', '', 'enchantimals-rodzina-swinki-morskie-glee-guinea-pig-lalka-i-figurki', '', '', '', 'Enchantimals, Rodzina Świnki morskie, Glee Guinea Pig, lalka i figurki', '', '', '', ''),
(400, 1, 2, 'Baw się z rodzinką świnek morskich Enchantimals z kolekcji Miejskie przygody. W zestawie są lalka Glee Guinea Pig (15 cm) i 4 figurki świnek morskich. Aby zabawa była jeszcze lepsza, lalka Glee Guinea Pig ma zdejmowaną spódniczkę, opaskę na głowę, okulary i buciki. Zawsze towarzyszą jej świnki morskie, a każda z nich jest równie urocza. Lalka oraz cztery figurki ze świata Enchantimals dostarczą mnóstwa inspiracji do wymyślania własnych przygód! Wspaniały prezent dla dzieci od 4 roku życia, zachęca do zabawy z wyobraźnią.', '', 'enchantimals-rodzina-swinki-morskie-glee-guinea-pig-lalka-i-figurki', '', '', '', 'Enchantimals, Rodzina Świnki morskie, Glee Guinea Pig, lalka i figurki', '', '', '', ''),
(401, 1, 1, 'Lalka Steffi i Evi z akcesoriami. W skład zestawu wchodzi:   lalka weterynarz,  lala Evi z króliczkiem,  buda dla psa,  warzywa dla zwierząt,  stół,  wanienka,  zwierzęta,  butelki,  apteczka,  miski,  zjeżdżalnia,  szczotki,  akcesoria lekarza.', '', 'steffi-weterynarz-lalka', '', '', '', 'Steffi weterynarz, lalka', '', '', '', ''),
(401, 1, 2, 'Lalka Steffi i Evi z akcesoriami. W skład zestawu wchodzi:   lalka weterynarz,  lala Evi z króliczkiem,  buda dla psa,  warzywa dla zwierząt,  stół,  wanienka,  zwierzęta,  butelki,  apteczka,  miski,  zjeżdżalnia,  szczotki,  akcesoria lekarza.', '', 'steffi-weterynarz-lalka', '', '', '', 'Steffi weterynarz, lalka', '', '', '', ''),
(402, 1, 1, 'Z zestawem Polly Pocket Słoneczny park wodny zabawa w słońcu nie ma końca. Pełna dynamicznych przygód opowieść zaczyna się od lalki Polly 7,5 cm oraz 15 akcesoriów związanych z wodą i sportem W zestawie znajdują się duża zjeżdżalnia wodna z tęczowym łukiem i wyścigami gokartowymi znajdziesz tu gokarty w kształcie jednorożca i flaminga, basen można go wypełnić wodą, siatka i piłka do siatkówki, huśtawka, figurka pieska oraz dodatkowe akcesoria Wspinaj się po ściance lub drabinie linowej, pędź po zjeżdżalni w gokarcie i przejedź tęczowym łukiem, pływaj w basenie, graj w siatkówkę, bujaj się na serduszkowej huśtawce i wesoło spędzaj czas Kolory i elementy dekoracyjne mogą się różnić Wiek dziecka:  od 4 lat.', '', 'polly-pocket-sloneczny-park-wodny-zestaw-z-figurka-i-akcesoriami', '', '', '', 'Polly Pocket, Słoneczny Park Wodny, zestaw z figurką i akcesoriami', '', '', '', ''),
(402, 1, 2, 'Z zestawem Polly Pocket Słoneczny park wodny zabawa w słońcu nie ma końca. Pełna dynamicznych przygód opowieść zaczyna się od lalki Polly 7,5 cm oraz 15 akcesoriów związanych z wodą i sportem W zestawie znajdują się duża zjeżdżalnia wodna z tęczowym łukiem i wyścigami gokartowymi znajdziesz tu gokarty w kształcie jednorożca i flaminga, basen można go wypełnić wodą, siatka i piłka do siatkówki, huśtawka, figurka pieska oraz dodatkowe akcesoria Wspinaj się po ściance lub drabinie linowej, pędź po zjeżdżalni w gokarcie i przejedź tęczowym łukiem, pływaj w basenie, graj w siatkówkę, bujaj się na serduszkowej huśtawce i wesoło spędzaj czas Kolory i elementy dekoracyjne mogą się różnić Wiek dziecka:  od 4 lat.', '', 'polly-pocket-sloneczny-park-wodny-zestaw-z-figurka-i-akcesoriami', '', '', '', 'Polly Pocket, Słoneczny Park Wodny, zestaw z figurką i akcesoriami', '', '', '', ''),
(403, 1, 1, 'Komplet pościeli do łóżeczka od polskiego producenta. Pościel wykonana z bardzo dobrej jakości materiałów, miła i przyjemna w dotyku, idealna do łóżeczka, kołyski i wózeczka. W skład zestawy wchodzi: materacyk 44x25 cm, kołderka 32x27 cm, poduszka 22x18cm.  Pościel można prać i prasować Uwaga! Produkt w kilku wariantach kolorystycznych - wysyłka losowa, bez możliwości wyboru koloru.', '', 'posciel-do-lozeczka-dla-lalek', '', '', '', 'Pościel do łóżeczka dla lalek', '', '', '', ''),
(403, 1, 2, 'Komplet pościeli do łóżeczka od polskiego producenta. Pościel wykonana z bardzo dobrej jakości materiałów, miła i przyjemna w dotyku, idealna do łóżeczka, kołyski i wózeczka. W skład zestawy wchodzi: materacyk 44x25 cm, kołderka 32x27 cm, poduszka 22x18cm.  Pościel można prać i prasować Uwaga! Produkt w kilku wariantach kolorystycznych - wysyłka losowa, bez możliwości wyboru koloru.', '', 'posciel-do-lozeczka-dla-lalek', '', '', '', 'Pościel do łóżeczka dla lalek', '', '', '', ''),
(404, 1, 1, 'Wygodny pajacyk dla Baby Annabell to ubranko idealne na przytulny dzień w domu. W tym wygodnym ubranku dziewczynki mogą zabrać laleczkę na spacer, w podróż lub po prostu bawić się w domu. Mięciutki pajacyk dla chłopca i dziewczynki (w dwóch kolorach). Ubranko zdobione wielobarwną aplikacją z owieczką chmurkami, tęczą i słoneczkiem. Oba produkty posiadają w komplecie pasujące kolorystycznie wieszaki Przeznaczone dla dzieci w wieku:  1+. Uwaga! Produkt w dwóch wariantach - wysyłka losowa, bez możliwości wyboru.', '', 'baby-annabell-pajacyk-dla-lalki-36-cm', '', '', '', 'Baby Annabell, pajacyk dla lalki, 36 cm', '', '', '', ''),
(404, 1, 2, 'Wygodny pajacyk dla Baby Annabell to ubranko idealne na przytulny dzień w domu. W tym wygodnym ubranku dziewczynki mogą zabrać laleczkę na spacer, w podróż lub po prostu bawić się w domu. Mięciutki pajacyk dla chłopca i dziewczynki (w dwóch kolorach). Ubranko zdobione wielobarwną aplikacją z owieczką chmurkami, tęczą i słoneczkiem. Oba produkty posiadają w komplecie pasujące kolorystycznie wieszaki Przeznaczone dla dzieci w wieku:  1+. Uwaga! Produkt w dwóch wariantach - wysyłka losowa, bez możliwości wyboru.', '', 'baby-annabell-pajacyk-dla-lalki-36-cm', '', '', '', 'Baby Annabell, pajacyk dla lalki, 36 cm', '', '', '', ''),
(405, 1, 1, 'Zestaw piękności z paletką cieni w kształcie babeczki. Paletka otwiera się i zamyka. Kosmetyki są przyjazne oraz nietoksyczne dla skóry i można je łatwo zmyć. Idealny zestaw do makijażu dla każdej dziewczynki. Zawartość:  12 cieni, aplikator, pomadka. Wymiary opakowania:  22,5x29x3,5 cm. Wiek:  3+.', '', 'gazelo-paletka-cieni-zestaw-do-makijazu-cupcake', '', '', '', 'Gazelo, paletka cieni, zestaw do makijażu, cupcake', '', '', '', ''),
(405, 1, 2, 'Zestaw piękności z paletką cieni w kształcie babeczki. Paletka otwiera się i zamyka. Kosmetyki są przyjazne oraz nietoksyczne dla skóry i można je łatwo zmyć. Idealny zestaw do makijażu dla każdej dziewczynki. Zawartość:  12 cieni, aplikator, pomadka. Wymiary opakowania:  22,5x29x3,5 cm. Wiek:  3+.', '', 'gazelo-paletka-cieni-zestaw-do-makijazu-cupcake', '', '', '', 'Gazelo, paletka cieni, zestaw do makijażu, cupcake', '', '', '', ''),
(406, 1, 1, 'Przygody z czarodziejskiego świata czekają na Ciebie razem z Zestawem Przyjaźni Hermiony Granger i Rubeusa Hagrida od Magical Minis. Ten zestaw podarunkowy ze świata Harry\'ego Pottera zawiera 3-calową lalkę Hermiony Granger i 4-calową lalkę Rubeusa Hagrida oraz Kła, psa Hagrida. Wszystkie są ruchome i posiadają szczegółowe detale, które ożywiają ukochane postaci. Hermiona nosi strój znany z Więźnia Azkabanu i trzyma w dłoni różdżkę. Ustaw lalkę Hermiony i ruszaj jej ręką, aby udawać, że rzuca zaklęcia. Dzięki dobrej jakości wykończenia Kieł może towarzyszyć Hagridowi i Hermionie podczas przygód! Zestaw Przyjaźni Magical Minis to doskonały sposób, aby pobudzić wyobraźnię i chęć do zabawy. Przemierzaj sale zamku Hogwart (sprzedawanego osobno) z Hermioną i Hagridem. Zbierz wszystkie zestawy, lalki i lokacje (sprzedawane osobno), aby stworzyć własny czarodziejski świat. Przedmioty kolekcjonerskie Magical Minis ze świata Harry\'ego Pottera i Zestawy Przyjaźni to wspaniałe podarunku dla dzieci od 5 roku życia. Twórz własne, magiczne historie, dzięki Zestawowi Przyjaźni Hermiony Granger i Rubeusa Hagrida od Magical Minis.', '', 'wizarding-world-harry-potter-hermiona-i-hagrid-zestaw-dwoch-lalek-3', '', '', '', 'Wizarding World, Harry Potter, Hermiona i Hagrid, zestaw dwóch lalek 3\"', '', '', '', ''),
