(407, 1, 1, 'Wkrocz prosto do świata mody! Zestaw do zabawy z szafą na ubranka Barbie to skarbnica stylu. Szafa jest fioletowa na zewnątrz i różowa w środku, a dzięki przezroczystym drzwiom można zerknąć do środka. Rozkładany duży wieszak służy do wieszania ubrań i pozwala szybko zmienić stylizację. W zestawie znajduje się również 6 wieszaków. Dzięki półkom można przechowywać i eksponować akcesoria (sprzedawane oddzielnie), a w szafie jest też miejsce na lalkę (sprzedawana oddzielnie). Wygodny uchwyt ułatwia przenoszenie modnej szafy i zabawę, gdziekolwiek chcesz. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 3 roku życia, zwłaszcza tych, które uwielbiają zabawę stylem i kreatywność', '', 'barbie-szafa-na-ubranka-zestaw-bez-lalki-i-ubranek', '', '', '', 'Barbie, Szafa na ubranka, zestaw bez lalki i ubranek', '', '', '', ''),
