(409, 1, 1, 'Króliczkowe śnieżne wdzianko dla miśków polarnych z kapturem i bucikami.<br /><br />Uwaga miśki polarne, nadchodzi śnieżny króliczek! Podczas lepienia śnieżnego bałwana w  przedszkolu siostrzyczka ma na sobie czerwone wdzianko. Na przodzie widnieje naszywka z bałwanem. Musi ulepić podobnego, tylko że ze śniegu.<br />Śliczne uszka wystają z króliczkowego kaptura. Pluszowe obrzeże i osłona na twarz chroni przed lodowatym wiatrem. Nadrukowany srebrny zamek i lśniąca klamra paska przykuwają wzrok. Na nóżkach siostrzyczka ma błękitne butki z bałwankiem. Wysokiej jakości ubranka do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Pasuje na wszystkie lalki BABY born 36cm.', '', 'baby-born-kombinezon-zimowy-dla-lalki', '', '', '', 'Baby Born, kombinezon zimowy dla lalki', '', '', '', ''),
