(411, 1, 1, 'Baby Born często udaje się na wyprawy z rodzicami. Bezpieczną podróż zagwarantuje jej wygodny fotelik samochodowy wyposażony w system pasów.  Teraz możesz zabrać swoją lalkę w najdalszą podróż - z Tobą będzie pod najlepszą opieką. Wycieczki umili jej Piesek Bello umieszczony na oparciu siedzenia, który także uwielbia jeździć i odkrywać nowe rzeczy. Aby zapewnić komfort i bezpieczeństwo Twojej Baby Born, posadź lalkę w foteliku i przypnij. Następnie przeciągnij pas samochodowy przez boczne otwory.', '', 'baby-born-fotelik-samochodowy-dla-lalki', '', '', '', 'Baby Born, fotelik samochodowy dla lalki', '', '', '', ''),
(411, 1, 2, 'Baby Born często udaje się na wyprawy z rodzicami. Bezpieczną podróż zagwarantuje jej wygodny fotelik samochodowy wyposażony w system pasów.  Teraz możesz zabrać swoją lalkę w najdalszą podróż - z Tobą będzie pod najlepszą opieką. Wycieczki umili jej Piesek Bello umieszczony na oparciu siedzenia, który także uwielbia jeździć i odkrywać nowe rzeczy. Aby zapewnić komfort i bezpieczeństwo Twojej Baby Born, posadź lalkę w foteliku i przypnij. Następnie przeciągnij pas samochodowy przez boczne otwory.', '', 'baby-born-fotelik-samochodowy-dla-lalki', '', '', '', 'Baby Born, fotelik samochodowy dla lalki', '', '', '', ''),
(412, 1, 1, 'Witamy w Domku jelonków Enchantimals! Domek ma ok 53 cm i jest doskonałym miejscem do opowiadania radosnych historii o przyjaźni. W środku znajdziesz 4 obszary do zabawy, 15 elementów oraz lalkę Danessa Deer (ok. 15 cm) i figurkę jelonka Sprint. Akcesoria zachęcają do zabawy w snucie niezliczonych opowieści:  kanapa dla dwóch osób, talerze, imbryk, podwójna toaleta, podwójna umywalka, łóżko i nie tylko. Odpręż się na kanapie w salonie, posmakuj przekąsek w kuchni na świeżym powietrzu, przygotuj się w łazience na dzień pełen wrażeń i ułóż się do snu w sypialni na piętrze. Zaproś innych przyjaciół Enchantimals, by zabawa była jeszcze lepsza (lalki sprzedawane oddzielnie)! Odtwarzaj chwile pełne przyjaźni z lalką Danessa Deer i jelonkiem Sprint w ich przytulnym domku. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 4 lat.', '', 'enchantimals-domek-jelonkow-zestaw-do-zabawy-z-lalka-i-figurka', '', '', '', 'Enchantimals, Domek Jelonków, zestaw do zabawy z lalką i figurką', '', '', '', ''),
(412, 1, 2, 'Witamy w Domku jelonków Enchantimals! Domek ma ok 53 cm i jest doskonałym miejscem do opowiadania radosnych historii o przyjaźni. W środku znajdziesz 4 obszary do zabawy, 15 elementów oraz lalkę Danessa Deer (ok. 15 cm) i figurkę jelonka Sprint. Akcesoria zachęcają do zabawy w snucie niezliczonych opowieści:  kanapa dla dwóch osób, talerze, imbryk, podwójna toaleta, podwójna umywalka, łóżko i nie tylko. Odpręż się na kanapie w salonie, posmakuj przekąsek w kuchni na świeżym powietrzu, przygotuj się w łazience na dzień pełen wrażeń i ułóż się do snu w sypialni na piętrze. Zaproś innych przyjaciół Enchantimals, by zabawa była jeszcze lepsza (lalki sprzedawane oddzielnie)! Odtwarzaj chwile pełne przyjaźni z lalką Danessa Deer i jelonkiem Sprint w ich przytulnym domku. Kolory i elementy dekoracyjne mogą się różnić. Wiek dziecka:  od 4 lat.', '', 'enchantimals-domek-jelonkow-zestaw-do-zabawy-z-lalka-i-figurka', '', '', '', 'Enchantimals, Domek Jelonków, zestaw do zabawy z lalką i figurką', '', '', '', ''),
(413, 1, 1, 'Daj się ponieść wyobraźni i ruszaj w drogę Wymarzonym kamperem! Przeżywaj niezwykłe przygody i baw się, konstruując różowy kamper pełen różnorodnych akcesoriów i niespodzianek. Odkrywaj dzikie krainy i znajdź idealne miejsce na piknik, w którego przygotowaniu pomogą Ci stolik, krzesła, \"rogaliki\" i inne akcesoria. Po dniu pełnym przygód czas na odpoczynek. Przygotuj przytulne miejsce do spania, zdejmując górę kampera i przekształcając go w obozowisko z łóżeczkiem dla 2 mikrolalek Barbie, które mogą drzemać pod gwiazdami. Ten zestaw konstrukcyjny jest łatwy do złożenia i zapewnia wyśmienitą zabawę na każdym etapie budowy. Idealny prezent dla dzieci od 5 roku życia. W skład zestawu wchodzą 2 mikrolalki Barbie, 4 zwierzątka, 123 klocki ze specjalnymi elementami i akcesoriami oraz 1 podstawa w kształcie serca, na której można budować. Kamper do zbudowania przekształca się w obozowisko z łóżeczkiem dla dwóch mikrolalek. Użyj 6 akcesoriów modowych, aby wzbogacić styl mikrolalek - możesz zamieniać je między postaciami! Klocki są kompatybilne ze wszystkimi zestawami konstrukcyjnymi Barbie i Mega Construx oraz z klockami innych wiodących marek. Dzięki możliwości samodzielnego konstruowania dzieci rozwijają kreatywność i umiejętność rozwiązywania problemów. Idealne dla dzieci od 5 roku życia.', '', 'mega-construx-barbie-wymarzony-kamper-klocki-123-elementy', '', '', '', 'Mega Construx, Barbie, Wymarzony kamper, klocki, 123 elementy', '', '', '', ''),
