(416, 1, 1, 'BABY born Kindergarten Zestaw z bejsbolową czapką 36cm Balet i hip hop urocza sukienka, buciki i czapka bejsbolowa. Palce, pięta, ugięcie nóg     Spróbuj utrzymać równowagę na palcach nie jest to takie łatwe. Dlatego właśnie dzieci z Grupy Niedźwiadków trochę się niecierpliwią. Tak właśnie wygląda pierwsza lekcja baletu w przedszkolu. Specjalnie na tą okazję Siostrzyczka założyła sukienkę z falbankowymi ramionkami. Pod spodem ma majteczki na wypadek, gdyby spódniczkę podwiało w tańcu. A jeśli się okaże, że balet nie daje pełni szczęścia, zawsze może spróbować sił w hip hopie. Pomoże w tym bejsbolowa czapka. Po lekcji baletu można jeszcze założyć trampki i poskakać na trampolinie. Miśki nadrukowane na bluzeczce pokażą, jak można się bawić. Wysokiej jakości ubranka do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Pasuje na wszystkie lalki BABY born 36cm. BABY born Kindergarten Zestaw z bejsbolową czapką 36cm. W komplecie sukienka, majtki, buty i czapka. Dodatkowe informacje:  Nr katalogowy:  831946-116721 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat', '', 'baby-born-zestaw-z-czapka', '', '', '', 'Baby Born, zestaw z czapką', '', '', '', ''),
