(417, 1, 1, 'Robin jest bardzo nowoczesna i odważna, zawsze podąża za najnowszą modą i nigdy nie pozostaje niezauważona. Te neonowe kolory są najfajniejsze! Gdy zgasisz światło... będą świecić w ciemności!  Który stój najlepiej pasuje do jej nastroju? Ty o tym decydujesz! A kiedy skończysz zabawę, schowaj wszystko do garderoby i zabierz ją ze sobą! Zawartość:  1 ekskluzywna KookyLoos Robin 2 stroje, akcesoria i buty wieszaki i szuflady 3 naklejki', '', 'kookyloos-robin-wardrobe-zestaw-z-laleczka', '', '', '', 'Kookyloos, Robin Wardrobe, zestaw z laleczką', '', '', '', ''),
(417, 1, 2, 'Robin jest bardzo nowoczesna i odważna, zawsze podąża za najnowszą modą i nigdy nie pozostaje niezauważona. Te neonowe kolory są najfajniejsze! Gdy zgasisz światło... będą świecić w ciemności!  Który stój najlepiej pasuje do jej nastroju? Ty o tym decydujesz! A kiedy skończysz zabawę, schowaj wszystko do garderoby i zabierz ją ze sobą! Zawartość:  1 ekskluzywna KookyLoos Robin 2 stroje, akcesoria i buty wieszaki i szuflady 3 naklejki', '', 'kookyloos-robin-wardrobe-zestaw-z-laleczka', '', '', '', 'Kookyloos, Robin Wardrobe, zestaw z laleczką', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(418, 1, 1, 'Stąpanie bosymi stopami po łące i taniec wśród motyli… Maleństwo uwielbia przechadzać się w białej zwiewnej sukience w wielobarwne wzory. Trójkątny dekolt ozdabiają neonowo-różowe wstążki. Do saszetki na pasku można schować zebrane podczas spaceru jagody i maliny. Błyszcząca saszetka przykuwa uwagę – wygląda, jakby była wykonana ze skóry krokodyla. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Wieszak na ubrania w zestawie. Wymiary opakowania:  36 x 17 x 1 cm. Wiek:  3+.', '', 'baby-born-modna-sukienka-boho-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, Modna sukienka Boho, ubranko dla lalki, 43 cm', '', '', '', ''),
(418, 1, 2, 'Stąpanie bosymi stopami po łące i taniec wśród motyli… Maleństwo uwielbia przechadzać się w białej zwiewnej sukience w wielobarwne wzory. Trójkątny dekolt ozdabiają neonowo-różowe wstążki. Do saszetki na pasku można schować zebrane podczas spaceru jagody i maliny. Błyszcząca saszetka przykuwa uwagę – wygląda, jakby była wykonana ze skóry krokodyla. Wysokiej jakości ubranka do oryginalnych lalek Baby Born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Wieszak na ubrania w zestawie. Wymiary opakowania:  36 x 17 x 1 cm. Wiek:  3+.', '', 'baby-born-modna-sukienka-boho-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, Modna sukienka Boho, ubranko dla lalki, 43 cm', '', '', '', ''),
(419, 1, 1, 'Poznaj młodsze wersje swoich ulubionych lalek Rainbow High Fashion Series 2! Bella, Stella, Karma, River, Krystal i Amaya mają swoje własne historie o tym, jak odnalazły swoją twórczą pasję, zanim stały się uczennicami Rainbow High. Każda z pełnowymiarowych lalek jest tak samo piękna, stylowa i kolorowa. Cechy produktów:  Młodsza wersja 6 oryginalnych lalek do przebierania 22 cm wysokości Młodo wyglądające rysy twarzy Urocze, piękne i w pełni przegubowe małe lalki do przebierania Unikalny pełny strój w charakterystycznym kolorze Podstawowe szkolne akcesoria i miękki materiałowy plecak Długie włosy do czesania plus akcesoria do włosów i grzebień Dostępne w 6 klasycznych kolorach:  Bella Harper (różowy), Stella Monroe (czerwony), Karma Nichols (neonowy), River Kendall (morski), Krystal Bailey (fioletowy), Amaya Raine (tęczowy) Stojak na lalkę Każda lalka jest sprzedawana oddzielnie', '', 'rainbow-high-junior-high-stella-monroe-lalka-modowa', '', '', '', 'Rainbow High, Junior High, Stella Monroe, lalka modowa', '', '', '', ''),
(419, 1, 2, 'Poznaj młodsze wersje swoich ulubionych lalek Rainbow High Fashion Series 2! Bella, Stella, Karma, River, Krystal i Amaya mają swoje własne historie o tym, jak odnalazły swoją twórczą pasję, zanim stały się uczennicami Rainbow High. Każda z pełnowymiarowych lalek jest tak samo piękna, stylowa i kolorowa. Cechy produktów:  Młodsza wersja 6 oryginalnych lalek do przebierania 22 cm wysokości Młodo wyglądające rysy twarzy Urocze, piękne i w pełni przegubowe małe lalki do przebierania Unikalny pełny strój w charakterystycznym kolorze Podstawowe szkolne akcesoria i miękki materiałowy plecak Długie włosy do czesania plus akcesoria do włosów i grzebień Dostępne w 6 klasycznych kolorach:  Bella Harper (różowy), Stella Monroe (czerwony), Karma Nichols (neonowy), River Kendall (morski), Krystal Bailey (fioletowy), Amaya Raine (tęczowy) Stojak na lalkę Każda lalka jest sprzedawana oddzielnie', '', 'rainbow-high-junior-high-stella-monroe-lalka-modowa', '', '', '', 'Rainbow High, Junior High, Stella Monroe, lalka modowa', '', '', '', ''),
(420, 1, 1, 'Ten zestaw Enchantimals z kolekcji Miejskie przygody zawierający rodzinkę zwierzątek zapewni wyjątkową zabawę w wymyślanie niezwykłych przygód. W zestawie są lalka Gerika Golden Retriever (15 cm), 2 figurki szczeniaczków i 1 figurka wiewiórki. Aby zabawa była bardziej różnorodna, Gerika Golden Retriever ma zdejmowaną spódniczkę i buciki. Zawsze towarzyszą jej zwierzęcy przyjaciele, a każdy z nich jest równie uroczy. Zestaw z lalką i 3 figurkami zapewnia mnóstwo wesołej zabawy. Wspaniały prezent dla dzieci od 4 roku życia, zachęca do zabawy z wyobraźnią.', '', 'enchantimals-rodzina-pieski-retrievery-gerika-golden-retriever-lalka-i-figurki', '', '', '', 'Enchantimals, Rodzina Pieski Retrievery, Gerika Golden Retriever, lalka i figurki', '', '', '', ''),
(420, 1, 2, 'Ten zestaw Enchantimals z kolekcji Miejskie przygody zawierający rodzinkę zwierzątek zapewni wyjątkową zabawę w wymyślanie niezwykłych przygód. W zestawie są lalka Gerika Golden Retriever (15 cm), 2 figurki szczeniaczków i 1 figurka wiewiórki. Aby zabawa była bardziej różnorodna, Gerika Golden Retriever ma zdejmowaną spódniczkę i buciki. Zawsze towarzyszą jej zwierzęcy przyjaciele, a każdy z nich jest równie uroczy. Zestaw z lalką i 3 figurkami zapewnia mnóstwo wesołej zabawy. Wspaniały prezent dla dzieci od 4 roku życia, zachęca do zabawy z wyobraźnią.', '', 'enchantimals-rodzina-pieski-retrievery-gerika-golden-retriever-lalka-i-figurki', '', '', '', 'Enchantimals, Rodzina Pieski Retrievery, Gerika Golden Retriever, lalka i figurki', '', '', '', ''),
(421, 1, 1, 'Zawsze jest dobry moment na coś słodkiego! Zakręć dużym kołem ruletki, a potem małym. Jaką kombinację udało Ci się wylosować? Z Mystery Menu odkryjesz, jakie smoothies lubi lub nie Blaire (ekskluzywna Kookyloos, którą możesz znaleźć tylko w tym zestawie), której jednym ruchem możesz zmienić wyraz twarzy! Skorzystaj z wózka i złóż wylosowany koktajl, a potem usiądź wygodnie przy stoliku na krzesełku by się zrelaksować! Jak pysznie! Wspaniała zabawa z Kookyloos i Mystery Menu!', '', 'kookyloos-mystery-menu-zestaw-z-laleczka', '', '', '', 'KookyLoos, Mystery Menu, zestaw z laleczką', '', '', '', ''),
(421, 1, 2, 'Zawsze jest dobry moment na coś słodkiego! Zakręć dużym kołem ruletki, a potem małym. Jaką kombinację udało Ci się wylosować? Z Mystery Menu odkryjesz, jakie smoothies lubi lub nie Blaire (ekskluzywna Kookyloos, którą możesz znaleźć tylko w tym zestawie), której jednym ruchem możesz zmienić wyraz twarzy! Skorzystaj z wózka i złóż wylosowany koktajl, a potem usiądź wygodnie przy stoliku na krzesełku by się zrelaksować! Jak pysznie! Wspaniała zabawa z Kookyloos i Mystery Menu!', '', 'kookyloos-mystery-menu-zestaw-z-laleczka', '', '', '', 'KookyLoos, Mystery Menu, zestaw z laleczką', '', '', '', ''),
(422, 1, 1, 'Mikser, waga i inne akcesoria kuchenne. Długość miksera:  4 cm', '', 'goki-akcesoria-kuchenne-22-elementy', '', '', '', 'Goki, akcesoria kuchenne, 22 elementy', '', '', '', ''),
(422, 1, 2, 'Mikser, waga i inne akcesoria kuchenne. Długość miksera:  4 cm', '', 'goki-akcesoria-kuchenne-22-elementy', '', '', '', 'Goki, akcesoria kuchenne, 22 elementy', '', '', '', ''),
(423, 1, 1, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  dres, wieszak. Wymiary produktu dł. x wys. cm:  30 x 30. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,07 kg. Waga produktu w opakowaniu (kg):  0,14 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-dres-ubranko-dla-lalek', '', '', '', 'Mega Creative, Dres, ubranko dla lalek', '', '', '', ''),
(423, 1, 2, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  dres, wieszak. Wymiary produktu dł. x wys. cm:  30 x 30. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,07 kg. Waga produktu w opakowaniu (kg):  0,14 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-dres-ubranko-dla-lalek', '', '', '', 'Mega Creative, Dres, ubranko dla lalek', '', '', '', ''),
(424, 1, 1, 'Ta butelka jest magiczna- gdy ją przechylisz mleko zniknie, a kiedy uniesiesz ją ponownie- sama się napełni. To niesamowite! Jakby Twoja lalka naprawdę umiała jeść! To idealna zabawka dla każdej małej mamusi, która uwielbia zajmować się swoim maleństwem. Wysokość butelki:  15 cm. Uwaga! Produkt wysyłany losowo.', '', 'artyk-natalia-butelka-z-mlekiem', '', '', '', 'Artyk Natalia, butelka z mlekiem', '', '', '', ''),
(424, 1, 2, 'Ta butelka jest magiczna- gdy ją przechylisz mleko zniknie, a kiedy uniesiesz ją ponownie- sama się napełni. To niesamowite! Jakby Twoja lalka naprawdę umiała jeść! To idealna zabawka dla każdej małej mamusi, która uwielbia zajmować się swoim maleństwem. Wysokość butelki:  15 cm. Uwaga! Produkt wysyłany losowo.', '', 'artyk-natalia-butelka-z-mlekiem', '', '', '', 'Artyk Natalia, butelka z mlekiem', '', '', '', ''),
(425, 1, 1, 'Zestaw dla dzidziusia - Magiczna Butelka, Natalia<br /> Droga Mała Mamusiu! W opiece nad Twoim maleństwem z pewnością przyda Ci się ten zestaw.<br />Podaj swojemu bobasowi butelkę z mleczkiem albo kubek uubionego soczku i zobacz, jak jego ulubione napoje znikają gdy przechylisz butekę! Niesamowite, prawda? Użyj smoczka, by pomóc swojemu maluszkowi wyciszyć sie i usnąć! Akcesoria w zestawie:  Butelka Kubeczek Smoczek', '', 'artyk-natalia-magiczna-butelka', '', '', '', 'Artyk, Natalia, magiczna butelka', '', '', '', ''),
(425, 1, 2, 'Zestaw dla dzidziusia - Magiczna Butelka, Natalia<br /> Droga Mała Mamusiu! W opiece nad Twoim maleństwem z pewnością przyda Ci się ten zestaw.<br />Podaj swojemu bobasowi butelkę z mleczkiem albo kubek uubionego soczku i zobacz, jak jego ulubione napoje znikają gdy przechylisz butekę! Niesamowite, prawda? Użyj smoczka, by pomóc swojemu maluszkowi wyciszyć sie i usnąć! Akcesoria w zestawie:  Butelka Kubeczek Smoczek', '', 'artyk-natalia-magiczna-butelka', '', '', '', 'Artyk, Natalia, magiczna butelka', '', '', '', ''),
(426, 1, 1, 'Wyrusz w podróż z Mią jej luksusową przyczepą kempingową! Przyczep ją do samochodu, załaduj walizki, posadź Mię za kierownicą, a jej pieska na tylnym siedzeniu i rozpocznij przygodę! Nie ma znaczenia, dokąd pojedziecie, bo Mia ma wszystko, czego KookyLoos może potrzebować w trakcie podróży. Po dniu pełnym zajęć może zrelaksować się w jacuzzi lub poczytać książkę siedząc na kanapie w towarzystwie swojego buldoga. A kiedy zapadnie noc, możesz ją posadzić koło ogniska, aby mogła cieszyć się marshmallows. Przygotuj też jej łóżko, by mogła odpocząć i wstać pełna energii następnego dnia! W przyczepie kempingowej Mia ma mnóstwo miejsca. Pod kuchenką znajduje się szafka do przechowywania rzeczy, a nad łóżkiem jest miejsce na przybory kuchenne. Kuchenkę możesz również zamienić w stół!<br />Postaw walizki na dachu przyczepy, dopóki Mia nie będzie ich potrzebować. Kiedy nadejdzie czas na kontynuowanie wyprawy, bagaże i pozostałe rzeczy włóż do środka i... w drogę! Zawartość:  przyczepa kempingowa, samochód, przyrządy kuchenne (kubek, szklanka, kawiarka...), siedzenia, 2 walizki, akcesoria (krzesło, świeczniki...), ekskluzywna lalka, ekskluzywne zwierzątko,', '', 'kookyloos-mia-s-kooky-caravan-przyczepa-kempingowa', '', '', '', 'KookyLoos, Mia\'s Kooky Caravan, przyczepa kempingowa', '', '', '', ''),
(426, 1, 2, 'Wyrusz w podróż z Mią jej luksusową przyczepą kempingową! Przyczep ją do samochodu, załaduj walizki, posadź Mię za kierownicą, a jej pieska na tylnym siedzeniu i rozpocznij przygodę! Nie ma znaczenia, dokąd pojedziecie, bo Mia ma wszystko, czego KookyLoos może potrzebować w trakcie podróży. Po dniu pełnym zajęć może zrelaksować się w jacuzzi lub poczytać książkę siedząc na kanapie w towarzystwie swojego buldoga. A kiedy zapadnie noc, możesz ją posadzić koło ogniska, aby mogła cieszyć się marshmallows. Przygotuj też jej łóżko, by mogła odpocząć i wstać pełna energii następnego dnia! W przyczepie kempingowej Mia ma mnóstwo miejsca. Pod kuchenką znajduje się szafka do przechowywania rzeczy, a nad łóżkiem jest miejsce na przybory kuchenne. Kuchenkę możesz również zamienić w stół!<br />Postaw walizki na dachu przyczepy, dopóki Mia nie będzie ich potrzebować. Kiedy nadejdzie czas na kontynuowanie wyprawy, bagaże i pozostałe rzeczy włóż do środka i... w drogę! Zawartość:  przyczepa kempingowa, samochód, przyrządy kuchenne (kubek, szklanka, kawiarka...), siedzenia, 2 walizki, akcesoria (krzesło, świeczniki...), ekskluzywna lalka, ekskluzywne zwierzątko,', '', 'kookyloos-mia-s-kooky-caravan-przyczepa-kempingowa', '', '', '', 'KookyLoos, Mia\'s Kooky Caravan, przyczepa kempingowa', '', '', '', ''),
(427, 1, 1, 'Zestaw 3 par butów materiałowych (1x kozaki, 2x baleriny) w modnych kolorach i tkaninach. Są łatwe w użytkowaniu i zakładaniu. Idealne dla lalek o wysokości 30-43 cm. Dodatkowe informacje:  Marka:  New Born Baby Rodzaj:  Buciki Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Akcesoria w zestawie: Kozaki 2 x baleriny  Wymiary opakowania:  2,5 x 12 x 15 cm', '', 'simba-new-born-baby-zestaw-bucikow-dla-lalki', '', '', '', 'Simba, New Born Baby, zestaw bucików dla lalki', '', '', '', ''),
(427, 1, 2, 'Zestaw 3 par butów materiałowych (1x kozaki, 2x baleriny) w modnych kolorach i tkaninach. Są łatwe w użytkowaniu i zakładaniu. Idealne dla lalek o wysokości 30-43 cm. Dodatkowe informacje:  Marka:  New Born Baby Rodzaj:  Buciki Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Akcesoria w zestawie: Kozaki 2 x baleriny  Wymiary opakowania:  2,5 x 12 x 15 cm', '', 'simba-new-born-baby-zestaw-bucikow-dla-lalki', '', '', '', 'Simba, New Born Baby, zestaw bucików dla lalki', '', '', '', ''),
(428, 1, 1, 'Wyjątkowe lalki z linii Królewskie Enchantimals! Królowa Paradise mierzy ok. 20 cm wysokości, ma zginane kolana oraz królewskie stroje i akcesoria, dzięki czemu zachęca do wymyślania własnych opowieści. Zawsze towarzyszy jej ukochane zwierzątko:  paw Rainbow, gotowy pomóc w pełnieniu królewskich obowiązków i wyruszyć ku przygodzie. Aby zabawa była jeszcze lepsza, wśród akcesoriów są ozdobne naszyjniki, które mogą nosić też ich zwierzęcy przyjaciele. Do wyboru masz takie urocze pary:  Daviana i Grassy, Unity i Stepper oraz Paradise i Rainbow. Zbierz je wszystkie, aby stworzyć własne królestwo Enchantimals! Królewskie Enchantimals przynoszą życzliwość i przygodę całej magicznej krainie! To idealny prezent dla dzieci od 4 roku życia, szczególnie tych, które kochają zwierzęta!', '', 'enchantimals-krolowa-paradise-i-paw-rainbow-lalka-krolewska-z-akcesoriami', '', '', '', 'Enchantimals, Królowa Paradise i paw Rainbow, lalka królewska z akcesoriami', '', '', '', ''),
(428, 1, 2, 'Wyjątkowe lalki z linii Królewskie Enchantimals! Królowa Paradise mierzy ok. 20 cm wysokości, ma zginane kolana oraz królewskie stroje i akcesoria, dzięki czemu zachęca do wymyślania własnych opowieści. Zawsze towarzyszy jej ukochane zwierzątko:  paw Rainbow, gotowy pomóc w pełnieniu królewskich obowiązków i wyruszyć ku przygodzie. Aby zabawa była jeszcze lepsza, wśród akcesoriów są ozdobne naszyjniki, które mogą nosić też ich zwierzęcy przyjaciele. Do wyboru masz takie urocze pary:  Daviana i Grassy, Unity i Stepper oraz Paradise i Rainbow. Zbierz je wszystkie, aby stworzyć własne królestwo Enchantimals! Królewskie Enchantimals przynoszą życzliwość i przygodę całej magicznej krainie! To idealny prezent dla dzieci od 4 roku życia, szczególnie tych, które kochają zwierzęta!', '', 'enchantimals-krolowa-paradise-i-paw-rainbow-lalka-krolewska-z-akcesoriami', '', '', '', 'Enchantimals, Królowa Paradise i paw Rainbow, lalka królewska z akcesoriami', '', '', '', ''),
(429, 1, 1, 'Ubranko dla lalki 45 cm.  Zestaw zawiera:    sweterek,   spódniczkę,   opaskę,   buciki.     Sweterek z tyłu zapinany na rzep.  Kolor:  szaro-różowy.', '', 'adar-ubranko-dla-lalki-45-cm', '', '', '', 'Adar, ubranko dla lalki, 45 cm', '', '', '', ''),
(429, 1, 2, 'Ubranko dla lalki 45 cm.  Zestaw zawiera:    sweterek,   spódniczkę,   opaskę,   buciki.     Sweterek z tyłu zapinany na rzep.  Kolor:  szaro-różowy.', '', 'adar-ubranko-dla-lalki-45-cm', '', '', '', 'Adar, ubranko dla lalki, 45 cm', '', '', '', ''),
(430, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy River Kendall, pierwszą lalkę chłopca w Rainbow High. Jest gwiazdą szkolnej drużyny piłkarskiej, co znajduje odzwierciedlenie w jego sportowym stylu. Ma wspaniałe rysy twarzy, długie rzęsy i piękne niebieskie włosy. Jest w pełni ruchomy, jego ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. River zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ma luksusowy styl, ponieważ zawsze jest w centrum uwagi. Wraz z laleczką znajdziesz dwie bluzki, dwie kurtki, dżinsy, szorty, 2 pary butów i nie tylko. Zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-kendall-teal-boy-lalka-modowa', '', '', '', 'Rainbow High, Kendall Teal, Boy, lalka modowa', '', '', '', ''),
