(431, 1, 1, 'Wyrusz w wspaniałą podróż razem z Mega Creative w różowym kabriolecie Zabawa lalkami od teraz będzie jeszcze bardziej fascynująca. Auta posiada otwierane drzwi i maska, efekty świetlne i dźwiękowe - warkot silnika oraz świecące lampy, pasy bezpieczeństwa, gumowe opony Zawartość zestawu:  Auto kabriolet, 2 x lalki. Wymiary/waga/baterie:  wymiary produktu dł. x wys. x gł. cm:  26x9x12,wymiar opakowania dł. x wys. x gł. cm:  28x12x18, waga produktu bez opakowania kg:  0,36kg, waga produktu w opakowaniu kg:  0,55kg, wymaga zasilania bateriami 3 x AG13 - załaczono do zestawu. Zestaw przeznaczony dla dzieci w wieku:  3. Zabawka pakowana w kartonik z okienkiem.', '', 'mega-creative-auto-lalki-swiatlo-dzwiek', '', '', '', 'Mega Creative, auto, lalki, światło, dźwięk', '', '', '', ''),
(431, 1, 2, 'Wyrusz w wspaniałą podróż razem z Mega Creative w różowym kabriolecie Zabawa lalkami od teraz będzie jeszcze bardziej fascynująca. Auta posiada otwierane drzwi i maska, efekty świetlne i dźwiękowe - warkot silnika oraz świecące lampy, pasy bezpieczeństwa, gumowe opony Zawartość zestawu:  Auto kabriolet, 2 x lalki. Wymiary/waga/baterie:  wymiary produktu dł. x wys. x gł. cm:  26x9x12,wymiar opakowania dł. x wys. x gł. cm:  28x12x18, waga produktu bez opakowania kg:  0,36kg, waga produktu w opakowaniu kg:  0,55kg, wymaga zasilania bateriami 3 x AG13 - załaczono do zestawu. Zestaw przeznaczony dla dzieci w wieku:  3. Zabawka pakowana w kartonik z okienkiem.', '', 'mega-creative-auto-lalki-swiatlo-dzwiek', '', '', '', 'Mega Creative, auto, lalki, światło, dźwięk', '', '', '', ''),
(432, 1, 1, 'I Love VIP Pets Mini Ten włos to sztos! Otwórz swój salon w magiczny sposób. Aby zobaczyć zawartość słodkiego serduszka wystarczy, że końcówkę pudełeczka umieścisz w wodzie, blokada zwolni się, dodatkowo na powierzchni pozostanie tęczowy ślad. W pudełki znajdziesz jednego z 12 nowych piesków (Bruna, Luna, Sarah, Lara, Emily, Lily, Chloe, Zoe, Lia, Sophia, Miranda, Amanda). Możesz też trafić na jednego wyjątkowego (Coco). Wszystkie postacie należą do fanklubu VIP Pets. Zabawę uzupełnią nowe, spersonalizowane akcesoria, które pozwolą stworzyć najbardziej wymyślne fryzury, wśród nich:  lokówka, grzebyk, opaska, gumki, spinki czy pasma włosów. Dodatkowo dzięki załączonym naklejkom przystroisz swój salon/pudełko. Każdy z piesków ma około 7 cm wysokości, a ich włosy są długie na 20 cm. Jakość - Każda figurka z serii, cechuje się starannym wykonaniem oraz precyzyjnie dopracowanymi szczegółami. VIP Pets Mini zachwycają jakością długich włosów, kolorami oraz fantazyjną formą opakowania. Bezpieczeństwo - Wszystkie akcesoria z zestawów VIP Pets Mini są całkowicie bezpieczne. Zabawki są przeznaczone dla dzieci powyżej 3 roku życia. Wygląd - Każdy z piesków posiada swoją psią idolkę VIP Pets, indywidualny styl oraz kolorystykę. Opakowanie w kształcie serca zawiera:  Jedną z 12 psich postaci (może się też trafić wyjątkowa:  Coco). Spersonalizowane akcesoria do tworzenia fryzur, dedykowane każdej figurce. Naklejki, którymi można upiększyć pudełeczko/salon. Wymiary opakowania:  10x14x5 cm. Uwaga:  produkt wysyłany losowo.', '', 'vip-pets-mini-fans-salon-pieknosci-zestaw-z-figurka-do-stylizacji-wlosow', '', '', '', 'Vip Pets, Mini Fans, Salon piękności, zestaw z figurką do stylizacji włosów', '', '', '', ''),
