(433, 1, 1, 'Te słodkie 15-centymetrowe lalki i ich zwierzątka inspirowane są światem Enchantimals - fantastycznym miejscem znajdującym się w samym sercu natury! Inspirowane zwierzęcymi kompanami uszka i ozdoby głowy wystają zadziornie z ich pięknych włosów. Każda lalka ma na sobie wyjątkowe kolorowe ubranko z wesołym wzorkiem oraz pasujące buciki. Urocze kolorowe fryzury, zwierzęce cechy urody i radosne, unikalne akcenty dodają każdej postaci elementu baśniowości. Ich pupili cechują słodkie akcenty, takie jak kwiatek przy czuprynce lub milutkie \"futerko\". Odgrywaj różnego rodzaju zaczarowane historyjki razem z tymi bajkowymi przyjaciółmi i zbierz wszystkie lalki, aby zbudować wspaniały świat Enchantimals. Informacje dodatkowe:  W zestawie:  Starla Starfish i Beamy Wysokość lalki:  15 cm Wiek dziecka:  od 4 lat', '', 'enchantimals-starla-starfish-i-beamy-lalka-i-zwierzatko', '', '', '', 'Enchantimals, Starla Starfish i Beamy, lalka i zwierzątko', '', '', '', ''),
(433, 1, 2, 'Te słodkie 15-centymetrowe lalki i ich zwierzątka inspirowane są światem Enchantimals - fantastycznym miejscem znajdującym się w samym sercu natury! Inspirowane zwierzęcymi kompanami uszka i ozdoby głowy wystają zadziornie z ich pięknych włosów. Każda lalka ma na sobie wyjątkowe kolorowe ubranko z wesołym wzorkiem oraz pasujące buciki. Urocze kolorowe fryzury, zwierzęce cechy urody i radosne, unikalne akcenty dodają każdej postaci elementu baśniowości. Ich pupili cechują słodkie akcenty, takie jak kwiatek przy czuprynce lub milutkie \"futerko\". Odgrywaj różnego rodzaju zaczarowane historyjki razem z tymi bajkowymi przyjaciółmi i zbierz wszystkie lalki, aby zbudować wspaniały świat Enchantimals. Informacje dodatkowe:  W zestawie:  Starla Starfish i Beamy Wysokość lalki:  15 cm Wiek dziecka:  od 4 lat', '', 'enchantimals-starla-starfish-i-beamy-lalka-i-zwierzatko', '', '', '', 'Enchantimals, Starla Starfish i Beamy, lalka i zwierzątko', '', '', '', ''),
(434, 1, 1, 'Centrum handlowe w Pollyville - zestaw do zabawy Polly Pocket. W zestawie:  6-poziomowy budynek akcesoria parking z zakręconą rampą samochód 2 laleczki:  Polly i Lila figurka pieska arkusz naklejek Cechy zabawki:  Laleczki Polly i Lila mogą wejść do lobby obrotowymi drzwiami i minąć piękną fontannę, potem przekąsić coś w strefie z jedzeniem, obejrzeć ubrania w butiku i przejść się po miniwybiegu. Do centrum sportowego warto się wybrać, by pojeździć na deskorolce, strzelić gola lub pograć w kosza. Potem można obejrzeć akwarium w sklepie zoologicznym ze specjalną przestrzenią dla pieska. Lalki mogą też odwiedzić sklep z elektroniką, a na koniec obejrzeć film i zjeść popcorn w kinie (kino rozkłada się, a maszyna do popcornu się obraca!). Polly (lub Lila) może wjechać windą na każde piętro! Odgrywane scenki będą jeszcze ciekawsze dzięki 2 dodatkowym stoiskom, kasie, stolikowi i 2 krzesełkom oraz torbom na zakupy. Czas wrócić do domu po długim dniu spędzonym na zabawie i zakupach! Polly i Lila mogą pojechać różowym sportowym autem Polly (obie lalki mieszczą się w fotelach), zjeżdżając po rampie i wyjeżdżając z parkingu centrum handlowego. Wiek dziecka:  od 4 lat. Kolory mogą się różnić.', '', 'polly-pocket-centrum-handlowe-w-pollyville-zestaw-z-figurka-i-akcesoriami', '', '', '', 'Polly Pocket, Centrum handlowe w Pollyville, zestaw z figurką i akcesoriami', '', '', '', ''),
