(435, 1, 1, 'Przedstawiamy nowe lalki L.O.L. Surprise!  Glitter Color Change Doll Collection. Odkryj ulubione postaci z błyszczącymi niespodziankami i zmianą koloru! Włosy, ozdoby twarzy i strój zmieniają kolor na nowy! Odpakuj 7 niespodzianek! Odkryj lalkę z wyjątkową niespodzianką ze zmianą koloru i brokatem.<br />12 ulubionych postaci. Zbierz całą rodzinę wraz ze zmieniającymi kolor siostrzyczkami i zwierzakami (sprzedawane oddzielnie). Dla dzieci w wieku 4+<br />', '', 'lol-surprise-glitter-color-change-doll-laleczka-niespodzianka', '', '', '', 'L.O.L. Surprise, Glitter Color Change Doll, laleczka niespodzianka', '', '', '', ''),
