(437, 1, 1, 'Już jest nowa seria KookyLoos Sunday Funday! W serii jest aż 12 super stylowych i zabawnych mini laleczek do kolekcjonowania, które mogą zmieniać wyraz twarzy za pomocą jednego kliknięcia! Każda KookyLoos jest inna, ma niepowtarzalną osobowość i hobby. Ava to wytworna dziewczyna, tak samo jak jest stroje! Uwielbia brokat, dlatego jej suknie są błyszczące i bardzo eleganckie.', '', 'magic-box-toys-polska-kookyloos-wardrobe-ava-s-zestaw-z-figurka', '', '', '', 'Magic Box Toys Polska, KookyLoos Wardrobe Ava\'s, zestaw z figurką', '', '', '', ''),
