(440, 1, 1, 'Te słodkie 15-centymetrowe lalki i ich zwierzątka inspirowane są światem Enchantimals - fantastycznym miejscem znajdującym się w samym sercu natury! Inspirowane zwierzęcymi kompanami uszka i ozdoby głowy wystają zadziornie z ich pięknych włosów. Każda lalka ma na sobie wyjątkowe kolorowe ubranko z wesołym wzorkiem oraz pasujące buciki. Urocze kolorowe fryzury, zwierzęce cechy urody i radosne, unikalne akcenty dodają każdej postaci elementu baśniowości. Ich pupili cechują słodkie akcenty, takie jak kwiatek przy czuprynce lub milutkie \"futerko\". Odgrywaj różnego rodzaju zaczarowane historyjki razem z tymi bajkowymi przyjaciółmi i zbierz wszystkie lalki, aby zbudować wspaniały świat Enchantimals. Informacje dodatkowe:  W zestawie:  Radia Rainbow Fish i Flo Wysokość lalki:  15 cm Wiek dziecka:  od 4 lat', '', 'enchantimals-radia-rainbow-fish-i-flo-lalka-i-zwierzatko', '', '', '', 'Enchantimals, Radia Rainbow Fish i Flo, lalka i zwierzątko', '', '', '', ''),
