(449, 1, 1, 'Kolorowa, urocza sukienka Baby Born wykonana z tęczowej tkaniny jest ozdobiona uroczymi jednorożcami tańczącymi na gwiaździstym niebie. Oczywiście, prawdziwa wróżka też potrzebuje skrzydeł. Delikatne skrzydła z błyszczącymi kwiatami są przyszyte do pleców i rozwijają się. Wysokiej jakości akcesoria do markowych lalek Baby Born (43 cm). Dla lepszej, różnorodnej i niekończącej się zabawy.', '', 'baby-born-jednorozec-sukienka-wrozki-dla-lalki', '', '', '', 'Baby Born, Jednorożec, sukienka wróżki dla lalki', '', '', '', ''),
