(450, 1, 1, 'Kucyk Sunny Starscout od My Little Pony promienieje dzięki swojej nowej tęczowej fryzurze! W zestawie mnóstwo dodatków i akcesoriów do stylizacji oraz odgrywania scen. Zapleć włosy kucykowi, by ujrzeć wszystkie kolory tęczy i dodaj ozdoby, by odtworzyć ulubione momenty z filmu. Akcesoriów można również użyć na własnych włosach, a także wykonać kolorowe zmywalne tatuaże Cutie Marks. Figurka ma również długie włosy idealne do stylizowania. Wiek dziecka:  od 5 lat.', '', 'my-little-pony-sunny-starscout-kucyk-z-akcesoriami', '', '', '', 'My Little Pony, Sunny Starscout, kucyk z akcesoriami', '', '', '', ''),
(450, 1, 2, 'Kucyk Sunny Starscout od My Little Pony promienieje dzięki swojej nowej tęczowej fryzurze! W zestawie mnóstwo dodatków i akcesoriów do stylizacji oraz odgrywania scen. Zapleć włosy kucykowi, by ujrzeć wszystkie kolory tęczy i dodaj ozdoby, by odtworzyć ulubione momenty z filmu. Akcesoriów można również użyć na własnych włosach, a także wykonać kolorowe zmywalne tatuaże Cutie Marks. Figurka ma również długie włosy idealne do stylizowania. Wiek dziecka:  od 5 lat.', '', 'my-little-pony-sunny-starscout-kucyk-z-akcesoriami', '', '', '', 'My Little Pony, Sunny Starscout, kucyk z akcesoriami', '', '', '', ''),
(451, 1, 1, 'Ogromny zestaw Polly Pocket Pollyville Przygody zwierzątek - Domek na drzewie jest pełen dynamicznej zabawy dla zwierzątek. Możesz bawić się ze zwierzątkami na aż 5 poziomach. Specjalna funkcja pozwala też powiększyć obszar zabawy - przejedź łabędziowym pojazdem po progu zwalniającym. Przejedź po drugim progu zwalniającym, aby rozłożyć wodospadową zjeżdżalnię. Na każdym poziomie znajdziesz świetne kryjówki i niezwykłe niespodzianki, a do tego 2 mikrolalki, 4 urocze figurki zwierzątek, 9 akcesoriów i 1 łabędziowy pojazd. Na 5 poziomach są:  platforma z tyrolką, tor przeszkód dla zwierzątek, obszar do karmienia i odpoczynku dla zwierzątek, sypialnia z łazienką i toaletą, liskowa altanka z miejscem do jedzenia oraz przekręcany punkt obserwacyjny na czubku drzewa. Odkrywaj niespodzianki i obszary zabawy, takie jak ukryta zjeżdżalnia w psiej budzie, ścianka wspinaczkowa, króliczkowy balon do \"latania\", rozsuwana wodospadowa zjeżdżalnia, huśtawka w kształcie koszyczka i sekretne miejsce do przechowywania na czubku drzewa. Dzieci pokochają dynamiczną zabawę ze zwierzątkami, niespodzianki i nieograniczone możliwości zabawy. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają przygody, zwierzęta i opiekę nad nimi!', '', 'polly-pocket-przygody-zwierzatek-domek-na-drzewie-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Przygody zwierzątek - Domek na drzewie, zestaw z laleczkami i akcesoriami', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(451, 1, 2, 'Ogromny zestaw Polly Pocket Pollyville Przygody zwierzątek - Domek na drzewie jest pełen dynamicznej zabawy dla zwierzątek. Możesz bawić się ze zwierzątkami na aż 5 poziomach. Specjalna funkcja pozwala też powiększyć obszar zabawy - przejedź łabędziowym pojazdem po progu zwalniającym. Przejedź po drugim progu zwalniającym, aby rozłożyć wodospadową zjeżdżalnię. Na każdym poziomie znajdziesz świetne kryjówki i niezwykłe niespodzianki, a do tego 2 mikrolalki, 4 urocze figurki zwierzątek, 9 akcesoriów i 1 łabędziowy pojazd. Na 5 poziomach są:  platforma z tyrolką, tor przeszkód dla zwierzątek, obszar do karmienia i odpoczynku dla zwierzątek, sypialnia z łazienką i toaletą, liskowa altanka z miejscem do jedzenia oraz przekręcany punkt obserwacyjny na czubku drzewa. Odkrywaj niespodzianki i obszary zabawy, takie jak ukryta zjeżdżalnia w psiej budzie, ścianka wspinaczkowa, króliczkowy balon do \"latania\", rozsuwana wodospadowa zjeżdżalnia, huśtawka w kształcie koszyczka i sekretne miejsce do przechowywania na czubku drzewa. Dzieci pokochają dynamiczną zabawę ze zwierzątkami, niespodzianki i nieograniczone możliwości zabawy. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają przygody, zwierzęta i opiekę nad nimi!', '', 'polly-pocket-przygody-zwierzatek-domek-na-drzewie-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Przygody zwierzątek - Domek na drzewie, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(452, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Poznaj młodsze wersje swoich sześciu ulubionych oryginalnych lalek Rainbow High Fashion! Ruby, Poppy, Sunny, Jade, Skyler i Violet. Każda z nich ma swoją własną historię o tym, jak odnalazły swoją twórczą pasję, zanim stały się uczennicami Rainbow High. Każda jest tak samo piękna, stylowa i kolorowa. Rainbow High Junior High to urocze laleczki, które mają piękne, młode rysy twarzy. Ich kolorowe i długie włosy nadają każdej z nich unikatowego charakteru, ale także są idealne do układania fantazyjnych fryzur. W zestawie znajdziesz akcesoria do włosów oraz grzebień. Dzięki kilku punktom artykulacji mogą z łatwością zmieniać pozy i dostosowywać się do Twojej wizji. Bardzo łatwo można je przebrać więc możesz dopasować każdą laleczkę do Twojej stylizacji. Laleczki Junior High nie mogą obejść się bez plecaka, który pomieści wszystkie potrzebne w szkole modowej artykuły. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High Junior High:  Ruby Anderson, Poppy Rowan, Sunny Madison, Jade Hunter, Skyler Bradshaw, Violet Willow (sprzedawane oddzielnie)! Wysokość lalki:  ok. 22 cm.', '', 'rainbow-high-junior-high-poppy-rowan-lalka-modowa', '', '', '', 'Rainbow High, Junior High, Poppy Rowan, lalka modowa', '', '', '', ''),
