(453, 1, 1, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  sukienka z tiulowym dołem, opaska do spania, wieszak. Wymiary produktu dł. x wys. cm:  18 x 21. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,03 kg. Waga produktu w opakowaniu (kg):  0,10 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-sukienka-ubranko-dla-lalek', '', '', '', 'Mega Creative, Sukienka, ubranko dla lalek', '', '', '', ''),
(453, 1, 2, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  sukienka z tiulowym dołem, opaska do spania, wieszak. Wymiary produktu dł. x wys. cm:  18 x 21. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,03 kg. Waga produktu w opakowaniu (kg):  0,10 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-sukienka-ubranko-dla-lalek', '', '', '', 'Mega Creative, Sukienka, ubranko dla lalek', '', '', '', ''),
(454, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Sheryl Meyer Marigold. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Pasją Sheryl jest projektowanie tekstyliów, które ożywają w jej stylowej modzie i stylu. Sheryl zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ubrana na żółto, ma skośną sukienkę w kratę ze sprzączką i marynarkę z guzikami, t-shirt, szyfonowe białe podkolanówki i parę szpilek Mary Jane. Jej drugi strój to przezroczysty szyfonowy top z długimi rękawami, żółty sweter bez rękawów, spódnica z nadrukiem i szpilki z paskami. Zestaw zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-sheryl-meyer-marigold-lalka-modowa', '', '', '', 'Rainbow High, Sheryl Meyer Marigold, lalka modowa', '', '', '', ''),
(454, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Sheryl Meyer Marigold. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Pasją Sheryl jest projektowanie tekstyliów, które ożywają w jej stylowej modzie i stylu. Sheryl zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ubrana na żółto, ma skośną sukienkę w kratę ze sprzączką i marynarkę z guzikami, t-shirt, szyfonowe białe podkolanówki i parę szpilek Mary Jane. Jej drugi strój to przezroczysty szyfonowy top z długimi rękawami, żółty sweter bez rękawów, spódnica z nadrukiem i szpilki z paskami. Zestaw zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-sheryl-meyer-marigold-lalka-modowa', '', '', '', 'Rainbow High, Sheryl Meyer Marigold, lalka modowa', '', '', '', ''),
(455, 1, 1, 'Kto pierwszy przekroczy linię mety? To nie ma znaczenia, ponieważ Królik Benno, Niedźwiedź Bruno i Kaczka Berta i tak zdobyli już nasze serca. Wysokiej jakości akcesoria do markowych lalek Baby Born. Łatwy krój sprawia, że ubieranie i rozbieranie jest dziecinnie proste. Uwaga! Produkt występuje w dwóch wzorach. Wzór wysyłany losowo, bez możliwości wyboru!', '', 'baby-born-ubranko-codzienne-dla-lalki', '', '', '', 'Baby Born, ubranko codzienne dla lalki', '', '', '', ''),
(455, 1, 2, 'Kto pierwszy przekroczy linię mety? To nie ma znaczenia, ponieważ Królik Benno, Niedźwiedź Bruno i Kaczka Berta i tak zdobyli już nasze serca. Wysokiej jakości akcesoria do markowych lalek Baby Born. Łatwy krój sprawia, że ubieranie i rozbieranie jest dziecinnie proste. Uwaga! Produkt występuje w dwóch wzorach. Wzór wysyłany losowo, bez możliwości wyboru!', '', 'baby-born-ubranko-codzienne-dla-lalki', '', '', '', 'Baby Born, ubranko codzienne dla lalki', '', '', '', ''),
(456, 1, 1, 'BABY born Little Sukienka 36 cm Urocza sukienka dla małych tancerek w rozmiarze 36 cm. Zdarza się, że czasami Maluszek BABY born Little nie wie jak zapanować nad nóżkami. No bo niby po co? Przecież taniec, to jak wyrażanie uczuć stopami. Mała tancerka wykonuje piruety wprawiając w ruch rękawy i różową tiulową spódniczkę. Ubranko jest luźno dopasowane, dzięki czemu nawet najmłodsze dzieci nie będą miały problemu ze zdjęciem  i ponownym założeniem ubranek na lalkę. Wysokiej jakości ubranka do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Sukienka BABY born Little 36 cm. Wieszak na ubrania w zestawie. Dodatkowe informacje:  Nr katalogowy:  830567-116721 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Różowy, Szary', '', 'baby-born-little-sukienka-36-cm', '', '', '', 'Baby Born, Little, sukienka, 36 cm', '', '', '', ''),
(456, 1, 2, 'BABY born Little Sukienka 36 cm Urocza sukienka dla małych tancerek w rozmiarze 36 cm. Zdarza się, że czasami Maluszek BABY born Little nie wie jak zapanować nad nóżkami. No bo niby po co? Przecież taniec, to jak wyrażanie uczuć stopami. Mała tancerka wykonuje piruety wprawiając w ruch rękawy i różową tiulową spódniczkę. Ubranko jest luźno dopasowane, dzięki czemu nawet najmłodsze dzieci nie będą miały problemu ze zdjęciem  i ponownym założeniem ubranek na lalkę. Wysokiej jakości ubranka do oryginalnych lalek BABY born. Dla ciekawszej, różnorodnej i niekończącej się zabawy. Prosty krój sprawia, że ubieranie i rozbieranie jest dziecinnie łatwe. Sukienka BABY born Little 36 cm. Wieszak na ubrania w zestawie. Dodatkowe informacje:  Nr katalogowy:  830567-116721 Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Kolor:  Różowy, Szary', '', 'baby-born-little-sukienka-36-cm', '', '', '', 'Baby Born, Little, sukienka, 36 cm', '', '', '', ''),
(457, 1, 1, 'Zestaw zawierający mnóstwo akcesoriów potrzebnych, aby zabawa z lalką była jeszcze lepsza! W praktycznej, zamykanej na suwak torebce znajduje się aż 30 przedmiotów, m.in:  pieluszki dla lalki, buteleczki, smoczek, śliniak, zabawki i wiele innych. Informacje podstawowe:  Wiek:  od 3 lat Wymiary:  25x15 cm Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-akcesoria-dla-lalek-w-torebce', '', '', '', 'Smiki, akcesoria dla lalek w torebce', '', '', '', ''),
(457, 1, 2, 'Zestaw zawierający mnóstwo akcesoriów potrzebnych, aby zabawa z lalką była jeszcze lepsza! W praktycznej, zamykanej na suwak torebce znajduje się aż 30 przedmiotów, m.in:  pieluszki dla lalki, buteleczki, smoczek, śliniak, zabawki i wiele innych. Informacje podstawowe:  Wiek:  od 3 lat Wymiary:  25x15 cm Produkt spełnia normy bezpieczeństwa EN 71.', '', 'smiki-akcesoria-dla-lalek-w-torebce', '', '', '', 'Smiki, akcesoria dla lalek w torebce', '', '', '', ''),
(458, 1, 1, 'Przedstawiamy drugą serię laleczek L.O.L. Surprise Tweens! Te laleczki są PO-MIĘ-DZY, dokładnie tam, gdzie chcą. Pełne niespodzianek i świetnego stylu. Uważaj świecie, bo nadchodzą! Tweens to laleczki o niestandardowym rozmiarze:  pomiędzy (Be-Tweens), standardowymi lalkami L.O.L, a lalkami modowymi O.M.G. Laleczka L.O.L. Surprise Tweens jest częścią wielkiej rodziny L.O.L., jest starszą siostrą L.O.L. i młodszą siostrą O.M.G. Aya Cherry to komiksy i gry wideo! Uwielbia spotykać się ze swoimi szkolnymi przyjaciółmi! Laleczka ma oszałamiające rysy twarzy i stylowo ułożone włosy, a także potrafi robić mnóstwo póz. Poza tym jest starszą siostrą L.O.L. Surprise Fanime. Poza wyjątkowym, uroczym stylem, modą i dodatkami, Aya Cherry ma również papierowy „dziennik”, który mówi trochę więcej o niej i jej osobowości. Opakowanie skrywa 15 niespodzianek, które tworzą unikatowy styl swojej laleczki, m.in. modne ubrania, pudełko na kapelusze, torebkę itp. Opakowania po niespodziankach są wielokrotnego użytku i dzięki nim stworzysz przytulną sypialnię dla swojej laleczki. W zestawie znajdziesz także pamiętnik laleczki, z którego dowiesz się więcej o jej charakterze i osobowości. Zestaw zawiera:   lalkę modową L.O.L. Surprise Tweens - Aya Cherry,  modne ciuchy,  buty,  akcesoria,  szczotkę do włosów,  torbę na ubrania,  wieszak,  stojak na lalkę,  pamiętnik. Serię 2 L.O.L. Surprise Tweens tworzą 4 niepowtarzalne postacie:  Goldie Twist, Aya Cherry, Gracie Skates oraz Lexi Gurl! Zbierz całą kolekcję L.O.L Surprise Tweens Series 1 i 2!', '', 'lol-surprise-tweens-doll-aya-cherry-laleczka-modowa', '', '', '', 'L.O.L. Surprise, Tweens Doll, Aya Cherry, laleczka modowa', '', '', '', ''),
