(459, 1, 1, 'Zestaw Modna mobilna lodziarnia Polly Pocket zawiera uroczą furgonetkę z lodami i ponad 18 elementów do zabawy, takich jak lalki Polly i Shani (7,5 cm), figurka pieska, \"przysmaki\", ubranka i akcesoria. Polly i Shani są gotowe na smakowitą zabawę modą w swojej ciężarówce z lodami, która ma obracające się kółka, otwierane boczne drzwi, a na dachu uroczy rożek lodowy - jest też zjeżdżalnią. Drzwi pojazdu się otwierają, aby można było bawić się z pieskiem, \"przysmakami\", ubrankami i akcesoriami. Serwuj pyszne słodkości w wielkim stylu dzięki ubrankom i akcesoriom, które można dowolnie łączyć, aby tworzyć wciąż nowe stylizacje. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają modę i spędzanie czasu z przyjaciółmi i lodowe przysmaki!', '', 'polly-pocket-modna-mobilna-lodziarnia-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Modna mobilna lodziarnia, zestaw z laleczkami i akcesoriami', '', '', '', ''),
