(460, 1, 1, 'Zalety produktu:  ubranko składa się z 2 części, zabawa staje się przyjemniejsza gdy dziecko ma możliwość przebierać swoją pociechę. Każda z Lalek znajdujących się w Twojej kolekcji oczekuje, by jej garderoba była gotowa na każdą okazję. Komplety ubranek dla lalek Mega Creative nadają najnowszym trendom unikalnego szyku. Zawartość zestawu:  śpiochy, czapeczka, wieszak. Wymiary produktu dł. x wys. cm:  33 x 28. Wymiary opakowania szer. x wys. x gł. cm:  26 x 35 x 2. Waga produktu bez opakowania (kg):  0,06 kg. Waga produktu w opakowaniu (kg):  0,13 kg. Nie wymaga zasilania bateriami. Zabawka przeznaczona dla dzieci w wieku:  3+.', '', 'mega-creative-spiochy-ubranko-dla-lalek', '', '', '', 'Mega Creative, Śpiochy, ubranko dla lalek', '', '', '', ''),
