(467, 1, 1, 'Spędź relaksujący dzień z Milą w jej Spa. Posadź swoją KookyLoos w foteliku i pozwól jej cieszyć się maseczką upiększającą. Możesz jej również umyć włosy! Użyj akcesoriów, aby to doświadczenie było naprawdę wyjątkowe! A kiedy skończy się wizyta w spa, spakuj wszystko i zabierz ze sobą dokąd chcesz!   Zawartość:  1 ekskluzywna KookyLoos Mila strój i buty akcesoria toaletka z lustrem fotelik', '', 'kookyloos-s-mila-popup-spa-zestaw-z-laleczka', '', '', '', 'Kookyloos S Mila Popup Spa, zestaw z laleczką', '', '', '', ''),
(467, 1, 2, 'Spędź relaksujący dzień z Milą w jej Spa. Posadź swoją KookyLoos w foteliku i pozwól jej cieszyć się maseczką upiększającą. Możesz jej również umyć włosy! Użyj akcesoriów, aby to doświadczenie było naprawdę wyjątkowe! A kiedy skończy się wizyta w spa, spakuj wszystko i zabierz ze sobą dokąd chcesz!   Zawartość:  1 ekskluzywna KookyLoos Mila strój i buty akcesoria toaletka z lustrem fotelik', '', 'kookyloos-s-mila-popup-spa-zestaw-z-laleczka', '', '', '', 'Kookyloos S Mila Popup Spa, zestaw z laleczką', '', '', '', ''),
(468, 1, 1, 'Ruszaj w świat wyobraźni w różowym kabriolecie Barbie i odkryj własną przygodę. Daj się ponieść wyobraźni, gdziekolwiek chcesz, w sportowym kabriolecie Barbie!  Posadź 2 lalki Barbie na siedzeniach i zapnij pasy, a potem wyruszaj w trasę dzięki obracającym się kółkom z oponami z realistycznie wyglądającym bieżnikiem. Pojazd wyróżnia się sportową linią, różową karoserią, czarnym wnętrzem i realistycznymi detalami, takimi jak pasy bezpieczeństwa, lusterko wsteczne i czarna maskownica. Kultowy styl Barbie jest widoczny w każdym szczególe, od spersonalizowanej tablicy rejestracyjnej po symbol na masce.  Lalki sprzedawane oddzielnie. Kolory i zdobienia mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-kabriolet-zestaw-bez-lalek', '', '', '', 'Barbie, Kabriolet, zestaw bez lalek', '', '', '', ''),
(468, 1, 2, 'Ruszaj w świat wyobraźni w różowym kabriolecie Barbie i odkryj własną przygodę. Daj się ponieść wyobraźni, gdziekolwiek chcesz, w sportowym kabriolecie Barbie!  Posadź 2 lalki Barbie na siedzeniach i zapnij pasy, a potem wyruszaj w trasę dzięki obracającym się kółkom z oponami z realistycznie wyglądającym bieżnikiem. Pojazd wyróżnia się sportową linią, różową karoserią, czarnym wnętrzem i realistycznymi detalami, takimi jak pasy bezpieczeństwa, lusterko wsteczne i czarna maskownica. Kultowy styl Barbie jest widoczny w każdym szczególe, od spersonalizowanej tablicy rejestracyjnej po symbol na masce.  Lalki sprzedawane oddzielnie. Kolory i zdobienia mogą się różnić. Wiek dziecka:  od 3 lat.', '', 'barbie-kabriolet-zestaw-bez-lalek', '', '', '', 'Barbie, Kabriolet, zestaw bez lalek', '', '', '', ''),
(469, 1, 1, 'Przedstawiamy drugą serię laleczek L.O.L. Surprise Tweens! Te laleczki są PO-MIĘ-DZY, dokładnie tam, gdzie chcą. Pełne niespodzianek i świetnego stylu. Uważaj świecie, bo nadchodzą! Tweens to laleczki o niestandardowym rozmiarze:  pomiędzy (Be-Tweens), standardowymi lalkami L.O.L, a lalkami modowymi O.M.G. Laleczka L.O.L. Surprise Tweens jest częścią wielkiej rodziny L.O.L., jest starszą siostrą L.O.L. i młodszą siostrą O.M.G. Lexi Gurl uwielbia być zabawna, ale ma też poważną stronę! Jest królową selfie, ale także mistrzynią fotobomb. Laleczka ma oszałamiające rysy twarzy i stylowo ułożone włosy, a także potrafi robić mnóstwo póz. Poza tym jest starszą siostrą LOL Surprise Pranksty. Poza wyjątkowym, uroczym stylem, modą i dodatkami, Lexi Gurl ma również papierowy „dziennik”, który mówi trochę więcej o niej i jej osobowości. Opakowanie skrywa 15 niespodzianek, które tworzą unikatowy styl swojej laleczki, m.in. modne ubrania, pudełko na kapelusze, torebkę itp. Opakowania po niespodziankach są wielokrotnego użytku i dzięki nim stworzysz przytulną sypialnię dla swojej laleczki. W zestawie znajdziesz także pamiętnik laleczki, z którego dowiesz się więcej o jej charakterze i osobowości. Zestaw zawiera:   lalkę modową L.O.L. Surprise Tweens - Lexi Gurl,  modne ciuchy,  buty,  akcesoria,  szczotkę do włosów,  torbę na ubrania,  wieszak,  stojak na lalkę,  pamiętnik. Serię 2 L.O.L. Surprise Tweens tworzą 4 niepowtarzalne postacie:  Goldie Twist, Aya Cherry, Gracie Skates oraz Lexi Gurl! Zbierz całą kolekcję L.O.L Surprise Tweens Series 1 i 2!', '', 'lol-surprise-tweens-doll-lexi-gurl-laleczka-modowa', '', '', '', 'L.O.L. Surprise, Tweens Doll, Lexi Gurl, laleczka modowa', '', '', '', ''),
