(470, 1, 1, 'Ubranko renifera z uroczymi detalami. Rudolf czy Rudolphina, to nie ma znaczenia, o ile mają czerwony nos. Więc oczywiście reniferowy kombinezon BABY born też musi go mieć. Przytulny romper ma też złote poroże, urocze małe jelenie uszy i malutki ogonek. Przytulne brązowe futerko ma biały pysk, biały brzuch i białe stopy. Rękawiczki w kształcie kopyt są przymocowane bezpośrednio do kombinezonu. Ten świąteczny renifer jest wystrojony i ma na sobie nawet muszkę. Dodatkowe informacje:  Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Wymiary:  43 cm', '', 'baby-born-ubranko-renifera', '', '', '', 'Baby Born, ubranko renifera', '', '', '', ''),
(470, 1, 2, 'Ubranko renifera z uroczymi detalami. Rudolf czy Rudolphina, to nie ma znaczenia, o ile mają czerwony nos. Więc oczywiście reniferowy kombinezon BABY born też musi go mieć. Przytulny romper ma też złote poroże, urocze małe jelenie uszy i malutki ogonek. Przytulne brązowe futerko ma biały pysk, biały brzuch i białe stopy. Rękawiczki w kształcie kopyt są przymocowane bezpośrednio do kombinezonu. Ten świąteczny renifer jest wystrojony i ma na sobie nawet muszkę. Dodatkowe informacje:  Marka:  Baby Born Rodzaj:  Ubranka Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Wymiary:  43 cm', '', 'baby-born-ubranko-renifera', '', '', '', 'Baby Born, ubranko renifera', '', '', '', ''),
(471, 1, 1, 'Dodatkowe informacje:  Marka:  Baby Born Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Kolor:  Mix Wymiary:  43 cm', '', 'baby-born-skarpetki-2-szt', '', '', '', 'Baby Born, skarpetki, 2 szt.', '', '', '', ''),
(471, 1, 2, 'Dodatkowe informacje:  Marka:  Baby Born Wymagania wiekowe:  od 3 lat Płeć:  Dziewczynki Kolor:  Mix Wymiary:  43 cm', '', 'baby-born-skarpetki-2-szt', '', '', '', 'Baby Born, skarpetki, 2 szt.', '', '', '', ''),
(472, 1, 1, 'Odkryj kolorowy świat zabawy z zestawem Polly Pocket Automacik Superniespodzianki! Zestaw Polly Pocket Automacik Superniespodzianki zawiera 4 obszary zabawy, 32 akcesoria (w tym mikrolalki Polly i Shani oraz 6 \"gum\") i mnóstwo słodkiej zabawy. Boki zestawu można rozłożyć, a czapka misia otwiera się, odsłaniając uroczą kawiarenkę. Zakręć krążkiem, aby odkryć panel frontowy, i kręć dalej, wypuszczając \"gumy\" (nie do jedzenia) z niespodziankami w środku. A to dopiero początek zabawy. Otwórz piernikowy domek, odkryj paragon wyskakujący z kasy, serwuj \"lody\", zjeżdżaj w dół lodowej góry, zakręć się na słodkiej karuzeli, podziwiaj obracające się słodycze i nie tylko! Niektóre akcesoria (np. lizakowa karuzela) mają specjalne zaczepy, więc możesz przyczepiać je w różnych miejscach zestawu, aby poszerzać możliwości zabawy. Wszystko mieści się w środku zestawu, który ma wygodny uchwyt do przenoszenia. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają słodkości, niespodzianki i zabawę.', '', 'polly-pocket-mis-automacik-superniespodzianki-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Miś Automacik Superniespodzianki, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(472, 1, 2, 'Odkryj kolorowy świat zabawy z zestawem Polly Pocket Automacik Superniespodzianki! Zestaw Polly Pocket Automacik Superniespodzianki zawiera 4 obszary zabawy, 32 akcesoria (w tym mikrolalki Polly i Shani oraz 6 \"gum\") i mnóstwo słodkiej zabawy. Boki zestawu można rozłożyć, a czapka misia otwiera się, odsłaniając uroczą kawiarenkę. Zakręć krążkiem, aby odkryć panel frontowy, i kręć dalej, wypuszczając \"gumy\" (nie do jedzenia) z niespodziankami w środku. A to dopiero początek zabawy. Otwórz piernikowy domek, odkryj paragon wyskakujący z kasy, serwuj \"lody\", zjeżdżaj w dół lodowej góry, zakręć się na słodkiej karuzeli, podziwiaj obracające się słodycze i nie tylko! Niektóre akcesoria (np. lizakowa karuzela) mają specjalne zaczepy, więc możesz przyczepiać je w różnych miejscach zestawu, aby poszerzać możliwości zabawy. Wszystko mieści się w środku zestawu, który ma wygodny uchwyt do przenoszenia. Kolory i elementy dekoracyjne mogą się różnić. Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają słodkości, niespodzianki i zabawę.', '', 'polly-pocket-mis-automacik-superniespodzianki-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, Miś Automacik Superniespodzianki, zestaw z laleczkami i akcesoriami', '', '', '', ''),
(473, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Jade Hunter. Ubrana jest na zielono od stóp do głów i ma wspaniałe rysy twarzy, długie rzęsy i piękne, nadające się do rozczesywania włosy. Jest w pełni ruchoma, jej ramiona i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Jade zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, efektowny wygląd. Ma ostry, oryginalny wygląd, który zawsze się wyróżnia. Jest wyposażona w bufiastą kurtkę, dwie koszulki, szorty w stylu graffiti, satynowy dres, tenisówki i nie tylko. Zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-jade-hunter-lalka-modowa', '', '', '', 'Rainbow High, Jade Hunter, lalka modowa', '', '', '', ''),
(473, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Jade Hunter. Ubrana jest na zielono od stóp do głów i ma wspaniałe rysy twarzy, długie rzęsy i piękne, nadające się do rozczesywania włosy. Jest w pełni ruchoma, jej ramiona i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Jade zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, efektowny wygląd. Ma ostry, oryginalny wygląd, który zawsze się wyróżnia. Jest wyposażona w bufiastą kurtkę, dwie koszulki, szorty w stylu graffiti, satynowy dres, tenisówki i nie tylko. Zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-jade-hunter-lalka-modowa', '', '', '', 'Rainbow High, Jade Hunter, lalka modowa', '', '', '', ''),
(474, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Stella Monroe. Jej ulubionym kolorem jest fuksja. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Stella zawiera 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ma elegancki, luksusowy styl, ponieważ zawsze jest w centrum uwagi. Wraz z laleczką znajdziesz dwa topy, dwie rozkloszowane spódnice, kurtkę ze sztucznego futra, 2 pary stylowych szpilek i nie tylko. Zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-stella-monroe-lalka-modowa', '', '', '', 'Rainbow High, Stella Monroe, lalka modowa', '', '', '', ''),
