(475, 1, 1, 'Kiedy Lalka Nella płacze trzeba sprawdzić czy nie jest głodna. W tym celu należy sięgnąć po butelkę z mlekiem Mega Creative. Butelka posiada płyn, przypominający mleko, który po przewróceniu w dół, kumuluje się w zakrętce, symulując wypicie mleka przez lalkę, natomiast przechylając butelkę w górę, wypełnia ścianki butelki, imitując pełną butelkę mleka. Butelka posiada odkręcaną nakrętkę. Wykonana z plastiku. Produkt przeznaczony dla dzieci w wieku:  3+. Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-nella-butelka-z-mlekiem-dla-lalek', '', '', '', 'Mega Creative, Nella, butelka z mlekiem dla lalek', '', '', '', ''),
(475, 1, 2, 'Kiedy Lalka Nella płacze trzeba sprawdzić czy nie jest głodna. W tym celu należy sięgnąć po butelkę z mlekiem Mega Creative. Butelka posiada płyn, przypominający mleko, który po przewróceniu w dół, kumuluje się w zakrętce, symulując wypicie mleka przez lalkę, natomiast przechylając butelkę w górę, wypełnia ścianki butelki, imitując pełną butelkę mleka. Butelka posiada odkręcaną nakrętkę. Wykonana z plastiku. Produkt przeznaczony dla dzieci w wieku:  3+. Uwaga! Produkt wysyłany losowo.', '', 'mega-creative-nella-butelka-z-mlekiem-dla-lalek', '', '', '', 'Mega Creative, Nella, butelka z mlekiem dla lalek', '', '', '', ''),
(476, 1, 1, '<b>Kojec dla lalek </b>  Kojec dla lalek Hot Hit to urozmaicenie dzieciecej zabawy z każdą lalką . Łózeczko pozwoli na dodatkową ozdobę każdego dziecięcego pokoju .Bardzo prosty system składania umożliwi zabranie łóżeczka w każdą podróż.', '', 'hot-hit-kojec-dla-lalek', '', '', '', 'Hot Hit, kojec dla lalek', '', '', '', '');
