(478, 1, 1, 'Komplety ubranek dla lalek nadają najnowszym trendom unikalnego szyku W każdym zestawie znajdują się dwa ubranka sukienki oraz 5 dodatkowych akcesoriów uzupełniających garderobę jak np buciki, torebka, szczotka/grzebień do włosów dla lalek, opaska do włosów dla lalek, flakonik na perfumy. Zestawy składają się z 6 elementów. Produkt wykonany z plastiku oraz materiału. Przeznaczony dla dzieci od lat:  3. Nie wymaga zasilania bateriami. Wymiary opakowania dł. x wys. x gł. cm:  25x33x3. Waga opakowania kg. 0,15kg. Produkt w kilku wariantach. Wysyłka losowa.', '', 'mega-creative-nella-ubrania-i-akcesoria-dla-lalki', '', '', '', 'Mega Creative, Nella, ubrania i akcesoria dla lalki', '', '', '', ''),
(478, 1, 2, 'Komplety ubranek dla lalek nadają najnowszym trendom unikalnego szyku W każdym zestawie znajdują się dwa ubranka sukienki oraz 5 dodatkowych akcesoriów uzupełniających garderobę jak np buciki, torebka, szczotka/grzebień do włosów dla lalek, opaska do włosów dla lalek, flakonik na perfumy. Zestawy składają się z 6 elementów. Produkt wykonany z plastiku oraz materiału. Przeznaczony dla dzieci od lat:  3. Nie wymaga zasilania bateriami. Wymiary opakowania dł. x wys. x gł. cm:  25x33x3. Waga opakowania kg. 0,15kg. Produkt w kilku wariantach. Wysyłka losowa.', '', 'mega-creative-nella-ubrania-i-akcesoria-dla-lalki', '', '', '', 'Mega Creative, Nella, ubrania i akcesoria dla lalki', '', '', '', ''),
(479, 1, 1, 'Przedstawiamy drugą serię laleczek L.O.L. Surprise Tweens! Te laleczki są PO-MIĘ-DZY, dokładnie tam, gdzie chcą. Pełne niespodzianek i świetnego stylu. Uważaj świecie, bo nadchodzą! Tweens to laleczki o niestandardowym rozmiarze:  pomiędzy (Be-Tweens), standardowymi lalkami L.O.L, a lalkami modowymi O.M.G. Laleczka L.O.L. Surprise Tweens jest częścią wielkiej rodziny L.O.L., jest starszą siostrą L.O.L. i młodszą siostrą O.M.G. Gracie Skates to sportowa laleczka, możesz ją znaleźć na wrotkach lub skateparku! Uwielbia szybować i kręcić się i wie, kiedy wykonywać krzykliwe ruchy, a kiedy odpuścić. Laleczka ma oszałamiające rysy twarzy i stylowo ułożone włosy, a także potrafi robić mnóstwo póz. Poza tym jest starszą siostrą LOL Surprise Baby Next Door. Poza wyjątkowym, uroczym stylem, modą i dodatkami, Aya Cherry ma również papierowy „dziennik”, który mówi trochę więcej o niej i jej osobowości.  Opakowanie skrywa 15 niespodzianek, które tworzą unikatowy styl swojej laleczki, m.in. modne ubrania, pudełko na kapelusze, torebkę itp. Opakowania po niespodziankach są wielokrotnego użytku i dzięki nim stworzysz przytulną sypialnię dla swojej laleczki. W zestawie znajdziesz także pamiętnik laleczki, z którego dowiesz się więcej o jej charakterze i osobowości. Zestaw zawiera:   lalkę modową L.O.L. Surprise Tweens - Gracie Skates,  modne ciuchy,  buty,  akcesoria,  szczotkę do włosów,  torbę na ubrania,  wieszak,  stojak na lalkę,  pamiętnik. Serię 2 L.O.L. Surprise Tweens tworzą 4 niepowtarzalne postacie:  Goldie Twist, Aya Cherry, Gracie Skates oraz Lexi Gurl! Zbierz całą kolekcję L.O.L Surprise Tweens Series 1 i 2!', '', 'lol-surprise-tweens-doll-gracie-skates-laleczka-modowa', '', '', '', 'L.O.L. Surprise, Tweens Doll, Gracie Skates, laleczka modowa', '', '', '', ''),
