(480, 1, 1, 'Kompaktowy zestaw do zabawy Park Rozrywki w formie plecaka przypadnie do gustu wielu fanom Polly Pocket.  Plecak ma kształt serca, jest w kolorze fioletowym z piękną kokardką.  Otwórz zestaw i sprawdź jak bawią się Polly i Lila.  W Parku Rozrywki masz sporo atrakcji do spróbowania.  Możesz jeździć na karuzeli z konikami czy bujać się w łódeczce.  Naciśnij fontannę i zobacz jak kręcą się filiżanki, samochodzki i statek UFO.  Zestaw po bokach ma rozsuwane dwie dodatkowe przestrzenie. Po jednej stronie możecie grać w mini golfa, a po drugiej usiąść w części restauracyjnej i zebrać siły na kolejne atrakcje. Plecak ma regulowane ramiączka (które można dowolnie zdejmować) oraz uchwyt do przenoszenia, co sprawi, że zawsze możesz mieć swój Park Rozrywki zawsze ze sobą. W zestawie:   plecak - Park Rozrywki;  dwie figurki - Polly i Lila,  budka z lodami. Dla dzieci od 3 lat.', '', 'polly-pocket-park-rozrywki-plecak-rozkladany-zestaw-z-figurkami', '', '', '', 'Polly Pocket, Park Rozrywki, plecak rozkładany, zestaw z figurkami', '', '', '', ''),
(480, 1, 2, 'Kompaktowy zestaw do zabawy Park Rozrywki w formie plecaka przypadnie do gustu wielu fanom Polly Pocket.  Plecak ma kształt serca, jest w kolorze fioletowym z piękną kokardką.  Otwórz zestaw i sprawdź jak bawią się Polly i Lila.  W Parku Rozrywki masz sporo atrakcji do spróbowania.  Możesz jeździć na karuzeli z konikami czy bujać się w łódeczce.  Naciśnij fontannę i zobacz jak kręcą się filiżanki, samochodzki i statek UFO.  Zestaw po bokach ma rozsuwane dwie dodatkowe przestrzenie. Po jednej stronie możecie grać w mini golfa, a po drugiej usiąść w części restauracyjnej i zebrać siły na kolejne atrakcje. Plecak ma regulowane ramiączka (które można dowolnie zdejmować) oraz uchwyt do przenoszenia, co sprawi, że zawsze możesz mieć swój Park Rozrywki zawsze ze sobą. W zestawie:   plecak - Park Rozrywki;  dwie figurki - Polly i Lila,  budka z lodami. Dla dzieci od 3 lat.', '', 'polly-pocket-park-rozrywki-plecak-rozkladany-zestaw-z-figurkami', '', '', '', 'Polly Pocket, Park Rozrywki, plecak rozkładany, zestaw z figurkami', '', '', '', ''),
(481, 1, 1, 'Wciel się w rolę mamusi i zaopiekuj się swoją laleczką najlepiej jak potrafisz! Pieluchy dla lalek Smiki pozwolą urozmaicić zabawę oraz opiekę nad bobasem. Produkt wykonany z wytrzymałego i bezpiecznego materiału.', '', 'smiki-pieluchy-dla-lalek-3-szt', '', '', '', 'Smiki, pieluchy dla lalek, 3 szt.', '', '', '', ''),
(481, 1, 2, 'Wciel się w rolę mamusi i zaopiekuj się swoją laleczką najlepiej jak potrafisz! Pieluchy dla lalek Smiki pozwolą urozmaicić zabawę oraz opiekę nad bobasem. Produkt wykonany z wytrzymałego i bezpiecznego materiału.', '', 'smiki-pieluchy-dla-lalek-3-szt', '', '', '', 'Smiki, pieluchy dla lalek, 3 szt.', '', '', '', ''),
(482, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Poznaj młodsze wersje swoich sześciu ulubionych oryginalnych lalek Rainbow High Fashion! Ruby, Poppy, Sunny, Jade, Skyler i Violet. Każda z nich ma swoją własną historię o tym, jak odnalazły swoją twórczą pasję, zanim stały się uczennicami Rainbow High. Każda jest tak samo piękna, stylowa i kolorowa. Rainbow High Junior High to urocze laleczki, które mają piękne, młode rysy twarzy. Ich kolorowe i długie włosy nadają każdej z nich unikatowego charakteru, ale także są idealne do układania fantazyjnych fryzur. W zestawie znajdziesz akcesoria do włosów oraz grzebień. Dzięki kilku punktom artykulacji mogą z łatwością zmieniać pozy i dostosowywać się do Twojej wizji. Bardzo łatwo można je przebrać więc możesz dopasować każdą laleczkę do Twojej stylizacji. Laleczki Junior High nie mogą obejść się bez plecaka, który pomieści wszystkie potrzebne w szkole modowej artykuły. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High Junior High:  Ruby Anderson, Poppy Rowan, Sunny Madison, Jade Hunter, Skyler Bradshaw, Violet Willow (sprzedawane oddzielnie)! Wysokość lalki:  ok. 22 cm.', '', 'rainbow-high-junior-high-ruby-anderson-lalka-modowa', '', '', '', 'Rainbow High, Junior High, Ruby Anderson, lalka modowa', '', '', '', ''),
