(483, 1, 1, 'Wybierz się z Polly Pocket do Tęczowego centrum handlowego! Zestaw Polly Pocket Tęczowe centrum handlowe ma 3 poziomy, 9 obszarów zabawy i ponad 35 elementów, w tym lalkę Polly 7,5 cm. Pierwszy poziom składa się ze sklepu z zabawkami, łazienki i kina. Na drugim poziomie są stylowy sklep z butami, sklep zoologiczny i butik. A na trzecim poziomie czeka strefa gastronomiczna. Niesamowita tęczowa winda zabierze lalkę Polly 7,5 cm na trzy różne poziomy, gdzie może robić zakupy i wesoło spędzać czas. W zestawie są literki i emotki, które można dowolnie układać, tworząc spersonalizowaną wiadomość. Drzwi kina można otworzyć, aby odsłonić fotele kinowe i ekran, a specjalna maszyna „robi popcorn”. W sklepie zoologicznym jest „trawnik” do zabawy ze zwierzątkami i miejsce do skakania na skakance. W butiku znajdziesz obrotowy wieszak na ubranka, a w sklepie obuwniczym zjeżdżalnię w kształcie buta. Użyj masy i foremek do przygotowywania przysmaków, takich jak „hot dogi” i „babeczki” do serwowania w budce z jedzeniem. Dzieci pokochają wymyślanie nieskończonych zakupowych przygód i nieograniczone możliwości zabawy Wspaniały prezent dla dzieci od 4 roku życia, zwłaszcza tych, które uwielbiają modę, zakupy i zabawę ze zwierzątkami', '', 'polly-pocket-teczowe-centrum-handlowe-zestaw-do-zabawy', '', '', '', 'Polly Pocket, Tęczowe Centrum Handlowe, zestaw do zabawy', '', '', '', ''),
