(488, 1, 1, 'Zestaw piękności z paletką cieni w kształcie truskawki. Paletka otwiera się i zamyka. Kosmetyki są przyjazne oraz nietoksyczne dla skóry i można je łatwo zmyć. Idealny zestaw do makijażu dla każdej dziewczynki. Zawartość:  6 cieni 6 błyszczyków 2 aplikatory Specyfikacja:  Wymiary opakowania:  22,5x29x4 cm Wiek:  3+', '', 'gazelo-paletka-cieni-i-blyszczykow-zestaw-do-makijazu-truskawka', '', '', '', 'Gazelo, paletka cieni i błyszczyków, zestaw do makijażu, truskawka', '', '', '', ''),
(488, 1, 2, 'Zestaw piękności z paletką cieni w kształcie truskawki. Paletka otwiera się i zamyka. Kosmetyki są przyjazne oraz nietoksyczne dla skóry i można je łatwo zmyć. Idealny zestaw do makijażu dla każdej dziewczynki. Zawartość:  6 cieni 6 błyszczyków 2 aplikatory Specyfikacja:  Wymiary opakowania:  22,5x29x4 cm Wiek:  3+', '', 'gazelo-paletka-cieni-i-blyszczykow-zestaw-do-makijazu-truskawka', '', '', '', 'Gazelo, paletka cieni i błyszczyków, zestaw do makijażu, truskawka', '', '', '', ''),
(489, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Poppy Rowan w zupełnie innym stylu! Jest teraz cheerleaderką i dopinguje drużynę swojej szkoły! Jej kolor to pomarańczowy! Laleczka ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ramiona i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Jej stylizację dopełnia kucyk z uroczą kokardką i spinką. Poppy ma również pompony, więc może stylowo dopingować drużynę Rainbow High! Zestaw zawiera:  modną lalkę Poppy Rowan w stroju cheerleaderk, 1 parę butów, skarpetki, pompony, grzebień do włosów. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-cheer-doll-poppy-rowan-lalka-modowa', '', '', '', 'Rainbow High, Cheer Doll, Poppy Rowan, lalka modowa', '', '', '', ''),
