(491, 1, 1, 'Idealny strój dla Baby Born. Idealny na wyjście, do parku, czy grania w gry w ogrodzie. Baby Born będzie niezwykle stylowa. Strój wykonany w stylu easy fit, dzięki czemu nawet najmniejsze dzieci mogą go bez wysiłku zakładać i zdejmować Odgrywanie ról z Baby Born pobudza wyobraźnię i jak udowodniono, wspiera rozwój umiejętności społecznych i wartości, takich jak odpowiedzialność, komunikacja i empatia. Pasuje do lalek BABY born do 43 cm. Uwaga! Zestaw występuje w dwóch wariantach. Wysyłka losowa, brak możliwości wyboru konkretnego modelu.', '', 'baby-born-plaszcz-i-spodnie-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, płaszcz i spodnie, ubranko dla lalki 43 cm', '', '', '', ''),
(491, 1, 2, 'Idealny strój dla Baby Born. Idealny na wyjście, do parku, czy grania w gry w ogrodzie. Baby Born będzie niezwykle stylowa. Strój wykonany w stylu easy fit, dzięki czemu nawet najmniejsze dzieci mogą go bez wysiłku zakładać i zdejmować Odgrywanie ról z Baby Born pobudza wyobraźnię i jak udowodniono, wspiera rozwój umiejętności społecznych i wartości, takich jak odpowiedzialność, komunikacja i empatia. Pasuje do lalek BABY born do 43 cm. Uwaga! Zestaw występuje w dwóch wariantach. Wysyłka losowa, brak możliwości wyboru konkretnego modelu.', '', 'baby-born-plaszcz-i-spodnie-ubranko-dla-lalki-43-cm', '', '', '', 'Baby Born, płaszcz i spodnie, ubranko dla lalki 43 cm', '', '', '', ''),
(492, 1, 1, 'Zalety produktu:  rozwijanie wyobraźni, nauka samodzielności i opieki nad drugą osobą, nauka dbania o higienę. Zestaw do kąpieli Mega Creative jest idealny dla każdej dziewczynki lubiącej wcielać się w rolę mamy, która opiekuje się swoim maleństwem. Występuje w dwóch kolorach niebieskim i różowym. Wysyłka losowa. Może wykąpać swojego dzidzusia lub misia, a po kąpieli obowiązkowo trzeba wyszczotkować ząbki. Zawartość zestawu:  wanienka, ręcznik, szczotka do zębów, pielucha, nocnik, pudełko z chusteczkami higienicznymi. Wymiary/waga/baterie:  wymiary produktu dł. x wys. x gł. cm:  27x5x15, wymiary produktu w opakowaniu dł. x wys. x gł. cm:  35x5x19 waga produktu bez opakowania kg:  0,11,waga produktu w opakowaniu kg:  0,13, nie wymaga zasilania bateriami. Pakowana w woreczek z eurozawieszką.', '', 'mega-creative-wanienka-recznik-szczotka-do-zebow-pielucha-nocnik-akcesoria', '', '', '', 'Mega Creative, wanienka, ręcznik, szczotka do zębów, pielucha, nocnik, akcesoria', '', '', '', ''),
(492, 1, 2, 'Zalety produktu:  rozwijanie wyobraźni, nauka samodzielności i opieki nad drugą osobą, nauka dbania o higienę. Zestaw do kąpieli Mega Creative jest idealny dla każdej dziewczynki lubiącej wcielać się w rolę mamy, która opiekuje się swoim maleństwem. Występuje w dwóch kolorach niebieskim i różowym. Wysyłka losowa. Może wykąpać swojego dzidzusia lub misia, a po kąpieli obowiązkowo trzeba wyszczotkować ząbki. Zawartość zestawu:  wanienka, ręcznik, szczotka do zębów, pielucha, nocnik, pudełko z chusteczkami higienicznymi. Wymiary/waga/baterie:  wymiary produktu dł. x wys. x gł. cm:  27x5x15, wymiary produktu w opakowaniu dł. x wys. x gł. cm:  35x5x19 waga produktu bez opakowania kg:  0,11,waga produktu w opakowaniu kg:  0,13, nie wymaga zasilania bateriami. Pakowana w woreczek z eurozawieszką.', '', 'mega-creative-wanienka-recznik-szczotka-do-zebow-pielucha-nocnik-akcesoria', '', '', '', 'Mega Creative, wanienka, ręcznik, szczotka do zębów, pielucha, nocnik, akcesoria', '', '', '', ''),
