(493, 1, 2, 'Magiczne butelki Zestaw 2 butelek ze znikającą zawartością - 1 z mlekiem i 1 z sokiem. Szczegóły:  wymiary butelki:  12 cm wymiary opakowania:  15x3,5x7,5 cm wiek:  3', '', 'simba-new-born-baby-magiczne-butelki', '', '', '', 'Simba, New Born Baby, magiczne butelki', '', '', '', ''),
(494, 1, 1, 'L.O.L. Surprise Color Change Me &amp; My Lil Sis to nowa wersja kolorowych kul skrywających słodkie laleczki. Są to dwie, połączone ze sobą kule, a każda z nich ma wiele niespodzianek. Zestaw Me &amp; My Lil SIs zawiera 2 unikalne laleczki - siostry:  starszą i młodszą. Wszystkie laleczki po zanurzeniu w wodzie zmieniają kolor! Do kąpieli laleczki możesz wykorzystać kulę, w której była schowana. Zimna zmiana koloru rozpocznie się od zanurzeniu laleczki w wodzie o temperaturze 15°C, ale najlepsze efekty będzie widać gdy woda będzie schłodzona do ok. 0°C. Ciepła zmiana rozpocznie się w wodzie o temperaturze od ok. 38°C, a najlepsze efekty osiągniesz w wodzie o temperaturze ok. 40°C. W zestawie znajdziesz 15 niespodzianek. Znajdź wszystkie w podwójnej kuli! Zestaw zawiera:  2 lalki LOL Surprise Me &amp; My Lil Sis Color Change Surprise, 2 sekretne wiadomości, 2 butelki, wiele akcesoriów, 2 modne stroje, 2 buty. Kolekcja Me &amp; My Lil Sis Color Change liczy aż 9 różnych par laleczek (sprzedawane oddzielnie). Zbierz całą kolekcję! Uwaga! Produkt występuje w kilku wariantach! Wysyłka losowa, bez możliwości wyboru laleczek.', '', 'lol-surprise-color-change-2-in-1-me-lil-sis-zestaw-dwoch-laleczek', '', '', '', 'L.O.L. Surprise, Color Change 2-in-1, Me & Lil Sis, zestaw dwóch laleczek', '', '', '', ''),
