(495, 1, 1, '<p>Przygotuj interaktywnego kucyka Sunny Starscout na wspaniałe, magiczne chwile! Nowość od My Little Pony! Duża figurka My Little Pony Śpiewająca Sunny na rolkach nuci piosenkę znaną z filmu oraz ma dołączony do zestawu mikrofon, więc dzieci mogą śpiewać razem z nią. Dzieci mogą także użyć mikrofonu jako kontrolera, by sterować ruchami tanecznymi Sunny! Dołączone akcesoria pomogą przygotować się do występu. Trenujcie śpiew i taniec, by stworzyć zgrany duet! Interaktywny kucyk to doskonała zabawka dla dzieci w wieku od 5 lat. Wymagane baterie AA (5 szt, brak w zestawie)</p>', '', 'my-little-pony-spiewajaca-sunny-starscout-kucyk-interaktywny-na-rolkach', '', '', '', 'My Little Pony, Śpiewająca Sunny Starscout, kucyk interaktywny na rolkach', '', '', '', ''),
