(496, 1, 1, 'Zestaw akceorisów dla lalki. W zestawie zajdziesz:  pieluchę, smoczek z łańcuszkiem, buteleczkę i sandałki Dla lalek 38 - 43 cm Wiek:  od 3 lat', '', 'simba-new-born-baby-zestaw-podrozny-bobas-akcesoria-dla-lalki', '', '', '', 'Simba, New Born Baby, zestaw podróżny bobas, akcesoria dla lalki', '', '', '', ''),
