(497, 1, 2, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Jade Hunter w zupełnie innym stylu! Jest teraz cheerleaderką i dopinguje drużynę swojej szkoły! Jej kolor to zielony! Laleczka ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ramiona i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Jej stylizację dopełnia kucyk z uroczą kokardką i spinką. Jade ma również pompony, więc może stylowo dopingować drużynę Rainbow High! Zestaw zawiera:  modną lalkę Jade Hunter w stroju cheerleaderk, 1 parę butów, skarpetki, pompony, grzebień do włosów. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-cheer-doll-jade-hunter-lalka-modowa', '', '', '', 'Rainbow High, Cheer Doll, Jade Hunter, lalka modowa', '', '', '', ''),
(498, 1, 1, 'Ogromny Kamper 3w1 dla Twoich lalek Barbie!  Wyrusz w drogę pełną przygód i odkrywaj niespodzianki, które kryje w sobie ten niesamowity pojazd. W kabinie kampera mogą siedzieć 2 duże lalki. Odłącz mini pojazd (dla 4 lalek!) i wybierz się na przejażdżkę po okolicy. Masz ochotę na wędkowanie? Czeka na Ciebie łódka i wędki! Rozbij obóz i spędzaj czas z przyjaciółmi - wystarczy rozłożyć boczne panele. Do dyspozycji masz basen, kuchnię polową oraz miejsce do relaksu. Posiłek można zjeść przy stoliku polowym z pełną zastawą. Otwórz tylny panel, by skorzystać z łazienki z prysznicem. Gdy nadejdzie wieczór, rozłóż łóżko na dachu. Teraz można podziwiać rozgwieżdżone niebo! W zestawie znajduje się łącznie ok 50 akcesoriów, które sprawią, że zabawa będzie niezwykle atrakcyjna i długo się nie znudzi. Wiek dziecka:  powyżej 3 lat. UWAGA:  lalki nie znajdują się w zestawie (sprzedawane oddzielnie).', '', 'barbie-kamper-3w1-zestaw-do-zabawy-bez-lalek', '', '', '', 'Barbie, Kamper 3w1, zestaw do zabawy bez lalek', '', '', '', ''),
(498, 1, 2, 'Ogromny Kamper 3w1 dla Twoich lalek Barbie!  Wyrusz w drogę pełną przygód i odkrywaj niespodzianki, które kryje w sobie ten niesamowity pojazd. W kabinie kampera mogą siedzieć 2 duże lalki. Odłącz mini pojazd (dla 4 lalek!) i wybierz się na przejażdżkę po okolicy. Masz ochotę na wędkowanie? Czeka na Ciebie łódka i wędki! Rozbij obóz i spędzaj czas z przyjaciółmi - wystarczy rozłożyć boczne panele. Do dyspozycji masz basen, kuchnię polową oraz miejsce do relaksu. Posiłek można zjeść przy stoliku polowym z pełną zastawą. Otwórz tylny panel, by skorzystać z łazienki z prysznicem. Gdy nadejdzie wieczór, rozłóż łóżko na dachu. Teraz można podziwiać rozgwieżdżone niebo! W zestawie znajduje się łącznie ok 50 akcesoriów, które sprawią, że zabawa będzie niezwykle atrakcyjna i długo się nie znudzi. Wiek dziecka:  powyżej 3 lat. UWAGA:  lalki nie znajdują się w zestawie (sprzedawane oddzielnie).', '', 'barbie-kamper-3w1-zestaw-do-zabawy-bez-lalek', '', '', '', 'Barbie, Kamper 3w1, zestaw do zabawy bez lalek', '', '', '', ''),
(499, 1, 1, 'Śpiewająca Princess Petals My Little Pony to istna popowa księżniczka - jej występy to prawdziwe show dla dziewczynek! W zestawie znajdziesz 3 akcesoria, dzięki którym można odgrywać różne sceny. Princess Petals nuci piosenkę znaną z filmu - naciśnij jej znaczek, by aktywować muzykę i dźwięki. Następnie ściśnij jej nogi, a bohaterka zatrzepocze skrzydełkami. Figurkę można ustawiać w różnych pozach, czesać jej włosy i podziwiać wspaniałe, miękkie skrzydła. Wiek dziecka:  od 5 lat.', '', 'my-little-pony-spiewajaca-gwiazda-princess-petals-zestaw-z-akcesoriami', '', '', '', 'My Little Pony, Śpiewająca Gwiazda Princess Petals, zestaw z akcesoriami', '', '', '', ''),
