(501, 1, 1, 'Przedstawiamy nowy domek L.O.L. Surprise! Zestaw do zabawy Fashion Show House, najlepsza miejscówka dla L.O.L. Surprise! Dolls. Rozpakuj dwa konternery transportowe, które można rozłożyć, ustawić jeden na drugim i zmienić w najlepszy trzypoziomowy domek. Zestaw obejmuje różne pokoje do relaksu, wyjątkowe meble i akcesoria, dzięki którym lalki mogą uprawiać sport i nie tylko! Zawiera ekskluzywne lalki:  1 chłopca i 1 dziewczynkę LOL Surprise! Charakterystyka produktów:  Zestaw do zabawy w postaci pojemnika transportowego, który można rozłożyć na różne sposoby 3 poziomy do zabawy z wieloma miejscami relaksu Meble obejmują podjazd na deskorolkę, hamak, zjeżdżalnię i nie tylko Zestaw można złożyć dla łatwego przechowywania Rozmiar:  57,79cm x 32,39cm x 38,74cm (Dł. x Szerokość x Wys.)', '', 'lol-surprise-fashion-show-house-domek-do-zabawy', '', '', '', 'L.O.L. Surprise, Fashion Show House, domek do zabawy', '', '', '', '');
