(501, 1, 2, 'Przedstawiamy nowy domek L.O.L. Surprise! Zestaw do zabawy Fashion Show House, najlepsza miejscówka dla L.O.L. Surprise! Dolls. Rozpakuj dwa konternery transportowe, które można rozłożyć, ustawić jeden na drugim i zmienić w najlepszy trzypoziomowy domek. Zestaw obejmuje różne pokoje do relaksu, wyjątkowe meble i akcesoria, dzięki którym lalki mogą uprawiać sport i nie tylko! Zawiera ekskluzywne lalki:  1 chłopca i 1 dziewczynkę LOL Surprise! Charakterystyka produktów:  Zestaw do zabawy w postaci pojemnika transportowego, który można rozłożyć na różne sposoby 3 poziomy do zabawy z wieloma miejscami relaksu Meble obejmują podjazd na deskorolkę, hamak, zjeżdżalnię i nie tylko Zestaw można złożyć dla łatwego przechowywania Rozmiar:  57,79cm x 32,39cm x 38,74cm (Dł. x Szerokość x Wys.)', '', 'lol-surprise-fashion-show-house-domek-do-zabawy', '', '', '', 'L.O.L. Surprise, Fashion Show House, domek do zabawy', '', '', '', ''),
(502, 1, 1, 'Już jest nowa seria KookyLoos Sunday Funday! W serii jest aż 12 superstylowych i zabawnych minilaleczek do kolekcjonowania, które mogą zmieniać wyraz twarzy za pomocą jednego kliknięcia! Każda KookyLoos jest inna, ma niepowtarzalną osobowość i hobby. Ale to nie przeszkadza im się przyjaźnić i świetnie się ze sobą dogadywać! Optymistyczne i pozytywnie nastawione do świata, uwielbiają się bawić i mieć wspólne tajemnice, odkrywać nowości i przeżywać wspólnie tysiące przygód. Każda z KookyLoos należy do jednej z \"ekip\", ale najlepiej bawią się, gdy są wszystkie razem! Otwórz tubę i sprawdź, która KookyLoos ukrywa się w środku. Poznaj jej styl, upodobania, dowiedz się, do której \"ekipy\" należy i wspólnie z nią zaplanuj najbliższy weekend dzięki nowej serii Sunday Funday! Na co masz ochotę? Plażę, sport, taniec... To nie ma znaczenia, bo z KookyLoos będziesz się świetnie bawić! Zawartość:  1 laleczka KookyLoos, 2 akcesoria, ubranko i buty, 1 karta osobowości. Wiek dziecka:  od 3 lat Uwaga! Produkt występuje w wielu wariantach. Wysyłka losowa, bez możliwości wyboru wariantu.', '', 'kookyloos-sunday-funday-mini-lalka-w-tubie-1-szt', '', '', '', 'KookyLoos, Sunday Funday, mini lalka w tubie, 1 szt.', '', '', '', ''),
