(503, 1, 1, 'Wprost idealne dla niemowląt będą świetnie pasować na stópki New Baby Born. W zestawie 1 para bucików i 1 para skarpetek. Zestaw przeznaczony dla lalek 38-43 cm. Uwaga! produkt wielowariantowy, wysyłka losowa.', '', 'simba-new-born-baby-buciki-i-skarpetki', '', '', '', 'Simba, New Born Baby, buciki i skarpetki', '', '', '', ''),
