(504, 1, 1, 'Przedstawiamy L.O.L. Surprise! Tweens + opiekunki dzieci. W zestawie 20 niespodzianek z nowymi elementami i zachwycającymi strojami takimi jak:  szlafroki piżamki opaski na oczy kilka par butów szczotka do włosów, miseczka z popcornem, butelka, pasta do zębów, 2 szczoteczki do zębów, ręcznik, kosmetyki, W zestawie dwie laleczki:  wysokość laleczki Ivy Winks:  ok. 17 cm wysokość laleczki Babydoll:  ok. 8 cm', '', 'lol-surprise-tweens-tots-baby-sitters-ivy-winks-babydoll-laleczka-modowa-i-laleczka-mala', '', '', '', 'L.O.L. Surprise, Tweens + Tots Baby Sitters, Ivy Winks + Babydoll, laleczka modowa i laleczka mała', '', '', '', ''),
(504, 1, 2, 'Przedstawiamy L.O.L. Surprise! Tweens + opiekunki dzieci. W zestawie 20 niespodzianek z nowymi elementami i zachwycającymi strojami takimi jak:  szlafroki piżamki opaski na oczy kilka par butów szczotka do włosów, miseczka z popcornem, butelka, pasta do zębów, 2 szczoteczki do zębów, ręcznik, kosmetyki, W zestawie dwie laleczki:  wysokość laleczki Ivy Winks:  ok. 17 cm wysokość laleczki Babydoll:  ok. 8 cm', '', 'lol-surprise-tweens-tots-baby-sitters-ivy-winks-babydoll-laleczka-modowa-i-laleczka-mala', '', '', '', 'L.O.L. Surprise, Tweens + Tots Baby Sitters, Ivy Winks + Babydoll, laleczka modowa i laleczka mała', '', '', '', ''),
(505, 1, 1, 'Odkryj mały świat wielkich przygód z Polly Pocket! Kompaktowe torebki otwierają się, by odsłonić zestaw do zabawy z motywem przygody, dwoma mikrolalkami, wesołymi funkcjami, akcesoriami i arkuszem naklejek. Zestaw ma też pasek, aby dzieci mogły nosić go ze sobą jako torebkę! Dzięki technologii Polly Stick mikrolalki można przyczepić w każdym miejscu zestawu. Umieść naklejkę z arkusza (w zestawie) w dowolnym miejscu zestawu i przyczep do niej lalkę. Kompaktowe rozmiary sprawiają, że możesz zabrać torebkę ze sobą, dokądkolwiek chcesz. Teraz każda – mała i duża – podróż będzie pełna niezapomnianych przygód z Polly Pocket. Kolory i elementy dekoracyjne mogą się różnić. Dla dzieci od 4 lat.', '', 'polly-pocket-kompaktowa-torebka-kangurek-zestaw-z-laleczkami-i-akcesoriami', '', '', '', 'Polly Pocket, kompaktowa torebka Kangurek, zestaw z laleczkami i akcesoriami', '', '', '', ''),
