(507, 1, 1, 'Przedstawiamy L.O.L. Surprise! Tweens + opiekunki dzieci. W zestawie 20 niespodzianek z nowymi elementami i zachwycającymi strojami takimi jak:  okulary przeciwsłoneczne akcesoria do włosów ubrania na plażę kostiumy kąpielowe ręczniki plażowe napoje lody W zestawie dwie laleczki:  wysokość laleczki Rae Sands:  ok. 17 cm wysokość laleczki SPF QT:  ok. 8 cm', '', 'lol-surprise-tweens-tots-baby-sitters-rae-sands-spf-qt-laleczka-modowa-i-laleczka-mala', '', '', '', 'L.O.L. Surprise, Tweens + Tots Baby Sitters, Rae Sands + SPF Q.T. laleczka modowa i laleczka mała', '', '', '', ''),
(507, 1, 2, 'Przedstawiamy L.O.L. Surprise! Tweens + opiekunki dzieci. W zestawie 20 niespodzianek z nowymi elementami i zachwycającymi strojami takimi jak:  okulary przeciwsłoneczne akcesoria do włosów ubrania na plażę kostiumy kąpielowe ręczniki plażowe napoje lody W zestawie dwie laleczki:  wysokość laleczki Rae Sands:  ok. 17 cm wysokość laleczki SPF QT:  ok. 8 cm', '', 'lol-surprise-tweens-tots-baby-sitters-rae-sands-spf-qt-laleczka-modowa-i-laleczka-mala', '', '', '', 'L.O.L. Surprise, Tweens + Tots Baby Sitters, Rae Sands + SPF Q.T. laleczka modowa i laleczka mała', '', '', '', ''),
(508, 1, 1, 'Legenda głosi, że na końcu tęczy znajduje się garnek złota. Ale prawda jest taka, że to coś jeszcze bardziej niesamowitego. Tylko nieliczni, którzy znają się na modzie, mogą podążać za tęczą do Rainbow High, kolorowej szkoły mody, w której każdy uczy się pokazywać swoje prawdziwe kolory. Przedstawiamy Emi Vanada. Jest ubrana na fioletowo od stóp do głów. Ma wspaniałe rysy twarzy, długie rzęsy i piękne włosy, które można rozczesać. Jest w pełni ruchoma, jej ręce i nogi zginają się, więc może przybrać mnóstwo efektownych poz. Emi koncentruje się na sztuce i uwielbia wyrażać siebie poprzez sztukę i modę, wyznacza trendy swoim ciemnym, ostrym wyglądem.  Emi ma 2 kompletne stroje, które można łączyć i dopasowywać, aby uzyskać odważny, oszałamiający wygląd. Ubrana jest w stylową bluzę z kapturem, plisowaną spódnicę i rockowe buty do kolan. Jej drugi strój to koszula z długimi rękawami z nadrukiem graficznym, przycięty sweter, spódnica i szpilki ze sznurowanymi wstążkami. Zestaw zawiera również grzebień do włosów, dwa wieszaki i stojak na lalki. Rada:  Podczas pierwszego rozpakowywania lalki dokładnie umyj jej włosy, aby usunąć żel do stylizacji i pozwól włosom całkowicie wyschnąć. Następnie jej włosy są gotowe do wyszczotkowania. Zbierz kolekcję pięknych lalek z Rainbow High! Wysokość lalki:  ok. 28 cm.', '', 'rainbow-high-emi-vanda-orchid-lalka-modowa', '', '', '', 'Rainbow High, Emi Vanda Orchid, lalka modowa', '', '', '', ''),
