(509, 1, 1, 'Lalka Chelsea i jej przyjaciele mają własny domek zabaw dzięki trzem poziomom, wielu obszarom zabawy i funkcji transformacji, która odblokowuje sekretne miejsca do zabawy, możesz otworzyć drzwi do świata niezliczonych opowieści Domek jest przystosowany do lalek Chelsea o wysokości ok 15 cm (sprzedawane oddzielnie) Na pierwszym poziomie znajdują się salon i kuchnia, a na drugim pokój zwierzątek i łazienka Na dachu jest sypialnia - Chelsea może wjechać na wszystkie poziomy windą Gdy najdzie Cię ochota na transformację, odkryj sekretny pokój dla zwierzątek, balkon dla dwóch osób i basen, który odwraca się, odsłaniając basen pełen piłeczek Wśród ponad 20 akcesoriów są piesek i kotek, oryginalne mebelki, akcesoria dla zwierzątek, akcesoria do podwieczorków i wiele innych Dzięki tak wielu elementom i obszarom zabawy możliwości opowiadania historii są nieograniczone Informacje dodatkowe:  Lalki nie znajdują się w zestawie Kolory i elementy dekoracyjne mogą się różnić Wiek dziecka:  od 3 lat', '', 'barbie-domek-zabaw-chelsea-zestaw-bez-lalki', '', '', '', 'Barbie, Domek Zabaw Chelsea, zestaw bez lalki', '', '', '', ''),
