(510, 1, 1, 'Wymarzony samolot Barbie inspirowany serialem Barbie Dreamhouse Adventures zachęca dzieci do odkrywania swoich marzeń i świata wokół. W zestawie:  lalka pilotka samolot wózek z przekąskami figurka szczeniaczka dodatkowe akcesoria Cechy zestawu:  samolot mieści lalkę pilotkę oraz 2 pasażerów fotele przesuwają się oraz odchylają do tyłu w siedzeniach znajdują się \"ekrany\" oraz schowki wózek ma miejsce na przekąski oraz tace do serwowania Informacje dodatkowe:  lalka nie stoi samodzielnie dodatkowe lalki sprzedawane oddzielnie kolory i elementy mogą się różnić wiek dziecka:  od 3 lat', '', 'barbie-dreamhouse-adventures-wymarzony-samolot-zestaw-z-lalka', '', '', '', 'Barbie, Dreamhouse Adventures, Wymarzony samolot, zestaw z lalką', '', '', '', ''),
(510, 1, 2, 'Wymarzony samolot Barbie inspirowany serialem Barbie Dreamhouse Adventures zachęca dzieci do odkrywania swoich marzeń i świata wokół. W zestawie:  lalka pilotka samolot wózek z przekąskami figurka szczeniaczka dodatkowe akcesoria Cechy zestawu:  samolot mieści lalkę pilotkę oraz 2 pasażerów fotele przesuwają się oraz odchylają do tyłu w siedzeniach znajdują się \"ekrany\" oraz schowki wózek ma miejsce na przekąski oraz tace do serwowania Informacje dodatkowe:  lalka nie stoi samodzielnie dodatkowe lalki sprzedawane oddzielnie kolory i elementy mogą się różnić wiek dziecka:  od 3 lat', '', 'barbie-dreamhouse-adventures-wymarzony-samolot-zestaw-z-lalka', '', '', '', 'Barbie, Dreamhouse Adventures, Wymarzony samolot, zestaw z lalką', '', '', '', ''),
(511, 1, 1, '2 seria L.O.L. Surprise Hair Hair Hair Dolls! Sprzedawane w nowym opakowaniu w pudełku z okienkiem. Rozpakuj lalkę LOL Surprise, która ma prawdziwe włosy. Każda lalka jest w zestawie 9 unikalnych akcesoriów do stylizacji włosów, które możesz kolekcjonować i które stworzą wspaniałe fryzury dla Twojej lalki! LOL Surprise Doll z prawdziwymi włosami. Dowolnie mieszaj akcesoria i dopasuj je tak, aby stworzyć wspaniałe style dla całej ekipy. W zestawie 9 wyjątkowych akcesoriów do stylizacji włosów do zabawy i czesania! NOWE pudełko z okienkiem Dla dzieci w wieku 4+ Uwaga! Jest to 1 szt. lalki. Produkt wysyłany losowo.', '', 'lol-surprise-hair-hair-hair-dolls-lalka-z-akcesoriami', '', '', '', 'L.O.L. Surprise, Hair Hair Hair Dolls, lalka z akcesoriami', '', '', '', ''),
(511, 1, 2, '2 seria L.O.L. Surprise Hair Hair Hair Dolls! Sprzedawane w nowym opakowaniu w pudełku z okienkiem. Rozpakuj lalkę LOL Surprise, która ma prawdziwe włosy. Każda lalka jest w zestawie 9 unikalnych akcesoriów do stylizacji włosów, które możesz kolekcjonować i które stworzą wspaniałe fryzury dla Twojej lalki! LOL Surprise Doll z prawdziwymi włosami. Dowolnie mieszaj akcesoria i dopasuj je tak, aby stworzyć wspaniałe style dla całej ekipy. W zestawie 9 wyjątkowych akcesoriów do stylizacji włosów do zabawy i czesania! NOWE pudełko z okienkiem Dla dzieci w wieku 4+ Uwaga! Jest to 1 szt. lalki. Produkt wysyłany losowo.', '', 'lol-surprise-hair-hair-hair-dolls-lalka-z-akcesoriami', '', '', '', 'L.O.L. Surprise, Hair Hair Hair Dolls, lalka z akcesoriami', '', '', '', ''),
(512, 1, 1, 'Pojazd Barbie Extra ma wszystko, czego lalki Barbie Extra potrzebują, aby podróżować w wielkim stylu. 2-osobowy samochód sportowy ma różową tapicerkę i błyszczącą srebrzystą karoserię z drzwiami w kształcie skrzydeł otwieranymi do góry oraz tęczowe felgi z logo Barbie Extra. Gdy nadejdzie czas na zmianę stroju, otwórz bagażnik i odkryj miejsce na przechowywanie ubranek i akcesoriów, takich jak tęczowa koszulka i para bucików. Z tyłu samochodu znajduje się basenik dla szczeniaczka w zestawie z zabawką do pływania i stylowymi okularami przeciwsłonecznymi. Dodatkowe wyjątkowe detale obejmują futerkowe zagłówki, skórzane fotele, podłogę z teksturą i tablicę rejestracyjną Barbie Extra. Dzięki licznym detalom i akcesoriom Kabriolet Barbie Extra to wspaniały prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza dla tych, które uwielbiają zadawać szyku. Informacje dodatkowe:  W zestawie NIE MA lalek - sprzedawane oddzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-extra-kabriolet-gwiazd-zestaw-bez-lalek', '', '', '', 'Barbie, Extra, Kabriolet gwiazd, zestaw bez lalek', '', '', '', ''),
(512, 1, 2, 'Pojazd Barbie Extra ma wszystko, czego lalki Barbie Extra potrzebują, aby podróżować w wielkim stylu. 2-osobowy samochód sportowy ma różową tapicerkę i błyszczącą srebrzystą karoserię z drzwiami w kształcie skrzydeł otwieranymi do góry oraz tęczowe felgi z logo Barbie Extra. Gdy nadejdzie czas na zmianę stroju, otwórz bagażnik i odkryj miejsce na przechowywanie ubranek i akcesoriów, takich jak tęczowa koszulka i para bucików. Z tyłu samochodu znajduje się basenik dla szczeniaczka w zestawie z zabawką do pływania i stylowymi okularami przeciwsłonecznymi. Dodatkowe wyjątkowe detale obejmują futerkowe zagłówki, skórzane fotele, podłogę z teksturą i tablicę rejestracyjną Barbie Extra. Dzięki licznym detalom i akcesoriom Kabriolet Barbie Extra to wspaniały prezent dla dzieci w wieku od 3 do 10 lat, zwłaszcza dla tych, które uwielbiają zadawać szyku. Informacje dodatkowe:  W zestawie NIE MA lalek - sprzedawane oddzielnie. Kolory i elementy dekoracyjne mogą się różnić.', '', 'barbie-extra-kabriolet-gwiazd-zestaw-bez-lalek', '', '', '', 'Barbie, Extra, Kabriolet gwiazd, zestaw bez lalek', '', '', '', ''),
(513, 1, 1, 'Magiczna butelka dla lalek Smiki to doskonały dodatek do zabawy z lalką-bobasem. Po przechyleniu butelki mleko \"znika\", dając wrażenie, że zostało wypite przez lalkę.', '', 'smiki-buteleczka-dla-lalki', '', '', '', 'Smiki, buteleczka dla lalki', '', '', '', ''),
